INSERT INTO `content` (`id`, `class_id`, `event_category_id`, `subjects_id`, `question`, `question_index`, `is_choosen`, `content_type_id`, `dificulty_id`, `description`, `tag`, `is_scrambled`, `is_audio_only`, `audio_url`, `is_video_only`, `is_picture`, `video_url`, `time_limit`, `score`, `created_at`, `updated_at`) VALUES
	(24, 1, 2, 3, 'Seorang perempuan berusia 39 tahun baru saja melahirkan secara spontan dan dirawat diruang nifas dengan riwayat plasenta letak rendah. TD: 100/80, N: 70x/menit, respiras1: 22x/menit, Suhu: 36,2 G, terdapat lochea rubra.\r\n\r\nManakah resiko yang muncul terkait riwayat plasenta letak rendah pada pasien post prtum tersebut?', 1, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-28 22:42:39', '2021-03-28 22:42:39'),
	(25, 1, 2, 3, 'Seorang perempuan usia 28 tahun kunjungan ke Poliklinik Kebidanan R.S.C dengan keluhan nyeri saat BAK, merasa panas dan gatal pada daerah kemaluan, pasien berkali-kali mengatakan cemas dan khawatir tentang janinnya akibat gejala yang dialami, pasien juga bertanya apakah penyakitnya bisa membahayakan janinnya.\r\nApakah masalah keperawatan yang tepat untuk kasus diatas?', 2, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-28 22:44:00', '2021-03-28 22:44:00'),
	(26, 1, 2, 3, 'Seorang perempuan usia 22 tahun, pertama kali hamil, diantar ke poli klinik oleh suaminya, pasien mengatakan sudah tidak mengalami haid beberapa minggu yang lalu. Hasil pemeriksaan fisik didapatkan, TD: 110/80, BB: 55kg, TB: 160cm, hasil pemeriksaan palpasi tinggi fundus satu sampe dua jari diatas sympisis.\r\nManakah metode yang digunakan untuk menentukan usia kehamilan?', 4, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-28 22:45:35', '2021-03-28 22:46:02'),
	(27, 1, 2, 3, 'Seorang perempuan usia 45 tahun kunjungan ke Poliklinik Kebidanan R.S.C dengan keluhan keluar darah dari vagina, darah berbau busuk, diagnose medis dikatakan kanker servik. \r\nApakah data yang perlu dikaji pada kasus diatas untuk memperkuat diagnose kanker serviks?', 332, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-28 22:51:27', '2021-03-29 22:52:10'),
	(28, 1, 2, 3, 'Seorang perempuan berusia 28 Tahun, P1A0 post SC atas indikasi plasenta previa. Hasil pemeriksaan fisik didapatkan: TD: 120/80, RR: 28x/menit, Nadi: 98x/menit, S: 37,5C. TFU setinggi pusat. \r\nManakah resiko yang mungkin muncul terkait plasenta previa yang perlu diperhatikan perawat ketika akan merencanakan asuhan keperawatan dan melakukan pengawasan pada pasien? ', 5, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-28 22:54:47', '2021-03-28 22:54:47'),
	(29, 1, 2, 3, 'Seorang perempuan berusia 23 tahun mengeluh perdarahan setelah 2 jam post partum, ketika dilakukan pemeriksaan TFU didapatkan TFU 1 jari diatas pusat, teraba kandung kemih penuh serta kontraksi uterus baik.\r\nSetelah dilakukan pemeriksaan pada pasien, intervensi apa yang harus dilakukan perawat?', 6, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-28 22:57:10', '2021-03-28 22:57:10'),
	(30, 1, 2, 1, '\r\n\r\nSeorang laki-laki berusia 30 tahun dirawat di RS dengan diagnosis apendiksitis. Tiga hari sebelumnya pasien mengeluh nyeri ulu hati yang kemudian menjalar ke daerah pusat dan perut kanan bawah, saat  saat dilakukan pemeriksaan fisik didapatkan adanya nyeri tekan dan nyeri lepas pada kuadran kanan bawah. \r\nBerikut adalaha pemeriksaan fisik yang dilakukan oleh perawat untuk mengetahui keluahan tersebut.\r\n\r\n', 7, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-28 23:18:21', '2021-03-28 23:18:21'),
	(31, 1, 2, 1, 'Seorang perempuan berusia 40 tahun dirawat di RS dengan diagnosis sirosis hepatis. Pada saat dilakukan pemeriksaan fisik tampak perut sudah mulai ascites. \r\nTindakan observasi apa yang bisa dilakukan perawat untuk memantau derajar perkembangan ascites ?', 8, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-28 23:21:50', '2021-03-28 23:21:50'),
	(32, 1, 2, 1, '\r\nSeorang perempuan berusia 25 tahun tersiram air panas di dada, perut, dan tangan. Dari hasil pengkajian pasien mengeluh nyeri skala 5 dari 10, pemeriksaan fisik didapatkan kulit tampak merah dan terdapat bullae, TD = 90/60 mmHg, frekuensi nadi 120 x/menit, frekuensi pernafasan 28 x/menit, BB = 60 kg, mukosa bibir terlihat kering dengan produksi urin 100 cc/6 jam.\r\nApakah prioritas masalah keperawatan pada kasus tersebut ?\r\n', 9, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-28 23:26:37', '2021-03-28 23:26:37'),
	(33, 1, 2, 1, '\r\nSeorang perempuan berusia 31 tahun datang ke polikliki RS dengan keluhan diare dan sakit perut sejak satu hari yang lalu. Hasil pemeriksaan fisik menunjukkan perut teraba tegang, bising usus 24x/menit dan diare 5-9 x/hari, turgor tidak eastis, frekuensi nadi 105 x/menit dan tekanan darah 110/80 mmHg\r\nApakah intervensi keperawatan yang paling tepatpada kasus tersebut ?\r\n', 10, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-28 23:29:46', '2021-03-28 23:29:46'),
	(34, 1, 2, 1, '\r\nSeorang laki-laki berusia 22 tahun dirawat di ruang penyakit dalam dengan diagnosis typhoid dengan hari rawat kedua. Dari hasil pengkajisn didapatkan pasien terlihat lemah, suhu 39 derajat celsius dan kadang meningkat sampai 40 derajat celsius, Td 100/70 mmHg, frekuensi nadi 110 x/menit, frekuensi pernafasan 19 x/menit. \r\nApakah kriteria hasil dalam intervensi keperawatan utama pada kasus tersebut ?\r\n', 11, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-28 23:32:27', '2021-03-28 23:32:27'),
	(35, 1, 2, 1, '\r\nSeorang laki-laki berusia 24 tahun dirawat di ruang bedah dengan diagnosis Ca Colon.                   Dari pemeriksaan penunjang pasien diharuskan untuk dilakukan tindakan colostomy. Pasien merasa malu dan sedih dengan kondisi yang menimpa dirinya. Tenaga kesehatan memberikan kebebasan kepada pasien untuk keberlangsungan tindakan selanjutnya\r\nAspek legal etik pada kasus tersebut ?\r\n', 12, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-28 23:35:02', '2021-03-28 23:35:02'),
	(36, 1, 2, 1, '\r\nSeorang perempuan berusia 40 tahun dirawat di RS dengan keluhan hipertermi lebih dari 10 tahun, masih terdapat nafsu makan tetapi badan dirasakan lemah. Dari hasil pemeriksaan fisik didapatkan lidah, kulit, dan rambut kotor. Pemeriksaan tanda-tanda vital menunjukkan tekanan darah 110/70 mmHg, frekuensi nadi 110 x/menit, frekuensi pernafasan 19 x/menit dan suhu          39 derajat celsius. Hasil lab test widal positif (+).\r\nApakah prioritas intervensi pada kasus tersebut ?\r\n', 13, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-28 23:50:00', '2021-03-28 23:50:00'),
	(37, 1, 2, 1, '\r\nSeorang perempuan berusia 20 tahun dirawat selama 3 hari di RS dengan post operasi appendictomy. Pasien masih mengeuh nyeri dengan skala 3 dari 10 sehingga takut untuk melakukan pergerakan. Pada saat pemeriksaan fisik terdapat luka operasi pada kuadaran kanan bawah yang masih tampak basah.\r\nApakah prioritas tindakan keperawatan yang harus dilakukan pada kasus tersebut ?\r\n', 14, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-28 23:53:00', '2021-03-28 23:53:00'),
	(38, 1, 2, 1, '\r\nSeorang perempuan berusia 25 tahun dirawat di RS karena menglami mual dan badan lemas. Hasil pemeriksaan fisik didapatkan data : warna kulit dan sklera ikterik, dan berat badan turun drastis. Pemeriksaan tanda-tanda vital didapatkan tekanan darah 110/60 mmHg, frekuensi nadi 76 x/menit, frekuensi pernafasan 21 x/menit, dan suhu 38,7 derajat celsius. Hasil pemeriksaan laboratorium yaitu darah HBSAg (+).\r\nApakah indikator utama keberhasilan pada kasus tersebut ?\r\n', 15, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-28 23:55:22', '2021-03-28 23:55:22'),
	(39, 1, 2, 1, '\r\nSeorang perempuan berusia 25 tahun dirawat di ruang bedah dengan post op appendiktomi. Pasien dipasang kateter sudah 6 hari dan direncanakan untuk di cabut kateternya.\r\nApakah tindakan prioritas pada kasus tersebut ?\r\n', 16, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-28 23:57:27', '2021-03-28 23:57:27'),
	(40, 1, 2, 1, '\r\nSeorang perempuan berusia 30 tahun, dirawat diruang isolasi dengan keluhan sesak nafas, RR: 27 dengan terpasang oksigen 2 ml melalui nasal canule, TD: 88/67 mmHg, Nadi: 72 kali/menit, Suhu=38.5 °C. Reflek Brudzinski (+), Kernig sign (+). Pasien didiagnosa meningitis TB dan suspect TB paru. \r\nApa pengkajian fokus yang diperlukan berdasarkan kasus tersebut?\r\n', 17, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 00:00:45', '2021-03-29 00:00:45'),
	(41, 1, 2, 1, '\r\nSeorang laki-laki berusia 30 tahun, dirawat diruang isolasi dengan keluhan sesak nafas, batuk berdahak. Tanda-tanda vital: TD=120/80 mmHg, N=110x/mnt, P=33x/mnt, S=38.70C, suara nafas Ronchi (+), konjungtiva tampak anemis, turgor kulit menurun. Diagnosa medis TBC positif\r\nApa diagnosa keperawatan prioritas yang tepat untuk kasus diatas?\r\n', 18, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 00:23:15', '2021-03-29 00:23:15'),
	(42, 1, 2, 1, '\r\nSeorang perawat pelaksana di Ruang Penyakit Dalam mengambil beberapa sampel darah untuk keperluan diagnostik pada penyakit HIV/AIDS. Secara tidak sengaja jarinya tertusuk jarum bekas pakai dari pasien tersebut.\r\nApakah tindakan yang harus segera dilakukan perawat tersebut ?\r\n', 19, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 00:27:08', '2021-03-29 00:27:08'),
	(43, 1, 2, 1, '\r\nSeorang perempuan usia 21 tahun dirawat di rumah sakit karena keputihan yang tidak sembuh selama 3 bulan. Warna keputihan hijau kekuningan, bau busuk. Klien juga mengeluh nyeri pada daerah supra publis. TD=120/80mmHg, P=24x/menit, N=98x/mnt, S=38.50C. Dia didiagnosis HIV oleh dokter. Pasien mengatakan cemas dan takut akan penyakitnya terlebih 6 bulan lagi pasien akan menikah, dia sering melamun dan pandangannya kosong.\r\nApa masalah keperawatan prioritas pada pasien tersebut?\r\n', 20, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 00:29:30', '2021-03-29 00:29:30'),
	(44, 1, 2, 1, '\r\nSeorang pasien datang ke rumah sakit dengan keluhan demam, flu selama satu bulan tidak sembuh-sembuh, pusing, sakit, kepala, nyeri dada, berkeringat pada malam hari. TD= 140/80 mmHg, N=92 x / menit, S= 39° C, P= 28 x/menit. Teraba benjolan di leher pasien, nyeri panggul, nyeri abdomen, dipsnea, takikardi. Diagnosa HIV oleh dokter.\r\nApa diagnosa keperawatan yang dapat ditegakkan dari data di atas?\r\n', 21, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 00:31:46', '2021-03-29 00:31:46'),
	(45, 1, 2, 1, '\r\nSeorang pasien datang ke rumah sakit denan keluhan mudah lelah, pusing, dan mengalami kelemahan otot. Pasien tampak lesu dan tidak segar. TD: 110/70 mmHg, Suhu : 350 C, HR : 89x/mnt, P : 25x/mnt. Hb didapat ; Hb 9 g/dl, kadar zat besi 3mg,TB 158 cm, BB : 45 Kg.\r\nApa masalah keperawatan prioritas pada pasien tersebut?\r\n', 22, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 00:34:22', '2021-03-29 00:34:22'),
	(46, 1, 2, 1, 'Seorang wanita berusia 45 tahun mengalami perdarahan haid yang banyak selama	3 minggu. Klien mengeluh lemas, letih, lesu dan keringat dimalam hari. TD=90/70 mmHg, N=80 x/mnt, P=28x/mnt, S=37.50 C. Hasil laboratorium didapatkan Hb 10 g/dl.\r\nApa intervensi yang dilakukan untuk mengatasi masalah keperawatan yang muncul?\r\n', 23, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 00:36:48', '2021-03-29 00:36:48'),
	(47, 1, 2, 1, '\r\nSeorang Laki-laki usia 45 tahun dirawat di ruang penyakit dalam dengan diagnosa SLE dengan komplikasi kerusakan ginjal stadium akhir. Hasil pemeriksaan fisik didapatkan bengkak (odem anasarka) dan anuria. Hasil pemeriksaan laboratorium : BUN 90 mg/dl, kreatinin 7,2 mg/dl. \r\nApakah tidakan kolaborasi yang tepat terhadap kasus diatas?\r\n', 24, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 00:40:20', '2021-03-29 00:40:20'),
	(48, 1, 2, 1, '\r\nSeorang berusia 20 tahun, dirawat dengan diagnose medis BDB. Berdasarkan hasil pengakajian: klien tampak menggigil, pusing disertai mual. Tekanan darah 100/70 mmHg, nadi 100 kali per menit, nafas 21 kali per menit dan suhu tubuh 29 derajat celcius, kulit tampak kemerahan dan CRT kurang dari 3 detik.\r\nBerdasarkan kasus diatas, apakah masalah keperawatan yang tepat?\r\n', 25, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 00:42:41', '2021-03-29 00:42:41'),
	(49, 1, 2, 1, '\r\nSeorang laki-laki berusia 28 tahun, dirawat diruang penyakit dalam dengan keluahan diare yang sudah sebulan tidak sembuh meskpun sudah berobat ke dokter. Pekerjaannya adalah seorang bartender di sebuah club malam. Tanda-tanda vital: TD=120/80 mmHg, N=110x/mnt, P=28x/mnt, S=38.70C, konnung tiva tampak anemis, turgor kulit menurun. Diagnosa medis HIV positif.\r\nApa penyebab diare yang tidak kunjung sembuh pada kasus tersebut?\r\n', 26, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 00:44:57', '2021-03-29 00:44:57'),
	(50, 1, 2, 1, '	\r\nSeorang perempuan 74 tahun dirawat di ruang penyakit dalam dengan perdarahan intra serebral mengalami kelemahan di sisi tubuh bagian kanan. Hasil pengkajian: TD 150/90 mm/Hg, frekuensi nadi 92 x/menit, frekuensi napas 18 x/menit. Perawat akan membantu mengganti pakaian klien.\r\nApakah yang dilakukan perawat pertama kali?\r\n', 27, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 00:47:36', '2021-03-29 00:59:07'),
	(51, 1, 2, 1, '\r\nSeorang perempuan 54 tahun dirawat di ruang penyakit dalam dengan perdarahan intra serebral mengalami kelemahan di sisi tubuh bagian kiri serta kelumpuhan nervus fasialis. Klien berbicara tidak jelas dan cenderung bergumam. Hasil pengkajian: TD 130/90 mm/Hg, frekuensi nadi 80 x/menit, frekuensi napas 16 x/menit. \r\nApakah yang dilakukan perawat dalam membangun komunikasi dengan klien?\r\n', 28, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 00:50:44', '2021-03-29 00:50:44'),
	(52, 1, 2, 1, '\r\nSeorang laki-laki 28 tahun dirawat di ruang bedah saraf dengan penurunan kesadaran akibat cedera kepala post kecelakaan lalu linas. Hasil pengkajian ditemukan GCS E2V2M3, terdapat vulnus laserasi (VL) di area wajah, tangan kanan, dan kaki kanan, TD: 90/60 mmHg, frekuenai nadi 110 x/menit, frekuensi napas 35x/menit. \r\nApakah tindakan utama yang harus dilakukan oleh perawat?\r\n', 29, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 00:53:01', '2021-03-29 00:53:01'),
	(53, 1, 2, 3, 'Seorang pasien perempuan usia 35 tahun datang ke Puskesmas untuk melakukan pemeriksaan ulang kehamilannya yang ke-5. Pasien mengatakan belakangan ini sering merasakan pusing, pengelihatan kadang-kadang kabur, disertai nyeri pada ulu hati. Hasil pemeriksaan fisik tekanan darah 140/90 mmHg, kedua kaki edema, BB bertambah drastis dalam dua minggu belakangan ini.Usia kehamilan 34 minggu, DJJ dalam batas normal, hasil pemeriksaan urun didapatkan protein urine (+).\r\nApakah komplikasi yang dapat terjadi pada pesien tersebut?', 30, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 00:54:05', '2021-03-29 00:54:05'),
	(54, 1, 2, 1, '\r\nSeorang laki-laki usia 31 tahun dirawat diruang bedah saraf dengan cedera kepala akibat kecelakaan lalu lintas. Hasil pemeriksaan fisik ditemukan: tingkat kesadaran GCS: E3V2M4, tampak sesak, sputum produktif, saliva produktif, gargling, TD 110/70 mm/Hg, frekuensi nadi  100 x/menit, frekuensi napas 24x/menit.  saturasi oksigen 90%. \r\nApakah tindakan yang dilakukan perawat?\r\n', 31, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 00:55:42', '2021-03-29 00:55:42'),
	(55, 1, 2, 1, '\r\nSeorang perempuan umur 35 tahun dirawat di ruang dewasa dengan meningitis. Hasil pengkajian ditemukan penurunan kesadaran, snoring, napas cepat dan dangkal, TD 130/80 mm/Hg, frekuensi nadi  100 x/menit, frekuensi napas 28x/menit.  saturasi oksigen 92%. Ketika perawat melakukan prosedur suction klien nampak gelisah dan terbatuk.\r\nApakah tindakan yang dilakukan perawat selanjutnya?\r\n', 32, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 00:58:08', '2021-03-29 00:58:08'),
	(56, 1, 2, 1, '\r\nSeorang laki-laki 40 tahun dengan meningitis datang ke RS dengan penurunan kesadaran GCS E3M5V4. TD: 130/70 mmHg, frekuensi napas: 22 x/menit, frekuensi nadi 90 x/menit, suhu: 38.2 0C. Berdasarkan informasi keluarga, pasien mengeluh nyeri kepala berat tidak tertahankan sejak 3 hari sebelum masuk RS, pasien bed rest total.\r\nApakah masalah keperawatan utama pada klien tersebut?\r\n', 33, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:00:27', '2021-03-29 01:00:27'),
	(57, 1, 2, 1, '\r\nSeorang laki-laki 35 tahun dirawat di ruang saraf dengan SOL disertai riwayat penurunan kesadaran. Hasil pengkajian TD: 140/100 mmHg, frekuensi napas: 24 x/menit, frekuensi nadi 100 x/menit, suhu: 37.2 0C, GDS: 200mg/dL, klien tirah baring. Hasil CT scan kepala menunjukan adanya herniasi serebri disertai edema perifokal. \r\nApakah yang harus dilakukan perawat untuk mengevaluasi tindakan keperawatan pada klien?\r\n', 34, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:03:33', '2021-03-29 01:03:33'),
	(58, 1, 2, 1, '\r\nSeorang perempuan 55 tahun dirawat di ruang bedah saraf dengan SOL akan menjalani prosedur operasi pengangkatan tumor. Hasil pengkajian TD: 140/100 mmHg, frekuensi napas: 16 x/menit, frekuensi nadi 104x/menit, suhu: 37.2 0C. Perawat melakukan persiapan pra operasi.\r\nApakah yang harus dilakukan perawat untuk mencegah infeksi di lokasi operasi?\r\n', 35, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:09:03', '2021-03-29 01:09:03'),
	(59, 1, 2, 1, '\r\nSeorang laki-laki berusia 67 tahun dirawat dengan stroke infark mengeluh nyeri kepala dengan skala 6 (1-10) yang tidak berkurang dengan istirahat, kelemahan ekstremitas dextra, kesulitan menelan, dan bicara tidak jelas. Nilai  GCS E4V5 M6 TD: 150/90 mmHg, frekuensi napas: 16 x/menit, frekuensi nadi 88x/menit, suhu: 37.2 0C.\r\nApakah masalah keperawatan  utama pada klien?\r\n', 36, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:11:30', '2021-03-29 01:11:30'),
	(60, 1, 2, 1, '\r\nSeorang laki-laki berusia 37 tahun dirawat dengan otitis media akut mengeluh telinga berdengung sejak 2 hari yang lalu, terdapat discharge dari telinga klien yang berbau busuk serta terdapat penurunan kemampuan mendengar. Perawat hendak memberikan pendidikan kesehatan terkait kebersihan diri kepada klien.\r\nApakah yang harus diperhatikan perawat ketika memberikan edukasi terkait kondisi klien?\r\n', 37, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:16:26', '2021-03-29 01:16:26'),
	(61, 1, 2, 1, 'Seorang perempuan usia 28 tahun dirawat dengan diagnosis medis asma. Hasil pengkajian kecepatan pernapasan 22 x/menit, pasien tampak lemah. Saat ini perawat sedang melakukan persiapan alat pada pasien yang akan dilakukan pemasangan oksigen dengan fraksi oksigen 5 liter per menit.  \r\nApakah jenis alat selang oksigen yang digunakan?\r\n', 38, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:18:37', '2021-03-29 01:18:37'),
	(62, 1, 2, 1, 'Seorang laki laki usia 38 tahun dirawat dengan diagnosis medis bronchitis kronis. Hasil pengkajian tampak pasien lemas dan sesak. Kecepatan pernapsan 23 x/menit, Nadi 90 x/menit, tekanan darah 120/90 mmHg. Saat ini perawat mengajar kepada pasien tentang latihan pernapasan. \r\nManakah dari berikut ini yang harus dimasukkan perawat dalam pengajaran?\r\n', 39, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:20:45', '2021-03-29 01:20:45'),
	(63, 1, 2, 1, 'Seorang perawat sedang mengajarkan tehnik batuk efektif kepada pasien. Perawat meminta pasien untuk meletakkan satu tangan di dada dan satu tangan di abdomen. \r\nApakah tindakan selanjutnya ?\r\n', 40, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:22:54', '2021-03-29 01:22:54'),
	(64, 1, 2, 1, 'Seorang perawat akan memasangkan alat oksigen dengan menggunakan tabung oksigen, perawat melihat tabung humidifire kosong.\r\nApakah tindakan selanjutnya yang harus dilakukan perawat ?\r\n', 41, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:25:27', '2021-03-29 01:25:27'),
	(65, 1, 2, 1, 'Seorang perawat akan memasangkan jenis alat oksigenisasi bentuk masker yang memiliki kantong reservoir dengan katup di dalamnya di tutup dan oksigen terisi oksigen terus menerus.\r\nApakah jenis alat tersebut ?', 42, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:27:39', '2021-03-29 01:27:39'),
	(66, 1, 2, 1, 'Seorang laki laki usia 22 tahun dirawat dengan keluhan sesak napas. Hasil pemeriksaan pernafasan yang sangat cepat yang memiliki frekuensi melebihi 24 kali per menit.\r\nApakah jenis gangguan pernapasan yang dialami pasien?\r\n', 43, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:29:43', '2021-03-29 01:29:43'),
	(67, 1, 2, 1, 'Seorang laki laki usia 65 tahun, dirawat di ruang merpati, dengan keluhan sesak napas. Dilakukan pemeriksaan fisik tekanan darah: 135/90 mmHg, nadi 112x/menit, pernapasan 32x/menit, auskultasi paru : wheezing, sputum +, sianosis pada ujung tangan dan bibir.Hasil pemeriksaan AGD : asidosis respiratorik. Pasien tampak kelelahan. Keluarga pasien mengatakan kalau pasien tidak pernah merokok, dan tinggal di daerah yang bersih udaranya.\r\nManakah yang merupakan faktor resiko terjadinya COPD pada pasien ?\r\n', 44, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:33:06', '2021-03-29 01:33:06'),
	(68, 1, 2, 1, '\r\nSeorang laki laki usia 60 tahun dirawat diruang ICU dan terpasang ventilator melalui selang ETT. Hasil pemeriksaan terdapat banyak sputum di daerah trakeabronkus dan perawat saat ini melakukan tindakan penghisapan lendir dengan menghidupkan mesin dan membilas kateter penghisap dengan aquabidest didalam kom. \r\nApakah tindakan selanjutnya?\r\n', 45, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:35:34', '2021-03-29 01:35:34'),
	(69, 1, 2, 1, 'Seorang laki-laki berusia 43 tahun di dirawat di ruang penyakit dalam . Hasil pengkajian pasien mengeluhan sesak nafas , suara nafas whezing, TD : 120/70 mmHg, N: 74x/menit, pernafasan 28x/menit, suhu : 36°C. Riwayat penyakit dahulu Asma Bronkhiale. \r\nApakah tindakan keperawatan yang pertama harus segera dilakukan untuk mengatasi masalah di atas?\r\n', 47, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:37:56', '2021-03-29 01:41:26'),
	(70, 1, 2, 1, 'Seorang perawat menyedot cairan dari klien wanita melalui tabung endotrakeal. Selama prosedur pengisapan, perawat mencatat pada monitor bahwa detak jantung menurun. \r\nManakah intervensi keperawatan yang sesuai?\r\n', 47, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:41:32', '2021-03-29 01:41:32'),
	(71, 1, 2, 1, 'Tn. LK 23 tahun di rawat di unit orthopedi dengan keluhan pada otot dan tulang. Klien mengeluh kadang linu dan nyeri pada kedua kaki dan lengannya. Skala nyeri 4 dari 1 sampai 5.  Terlihat kemerahan pada kedua kaki dan lengannya.\r\nIntervensi yang bisa dilakukan perawat adalah.....\r\n\r\n', 48, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:43:33', '2021-03-29 01:43:33'),
	(72, 1, 2, 1, '\r\nSeorang laki-laki berumur 25 tahun, dirawat dengan fraktur pada 1/3 humerus distal. Pasien akan dilakukan tindakan operasi pemasangan ORIF. \r\nTindakan persiapan 6 jam sebelum operasi adalah....\r\n', 49, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:45:47', '2021-03-29 01:45:47'),
	(73, 1, 2, 1, '\r\nTn. A berumur 35 tahun dirawat di ruang orthopedi. Klien mengeluh nyeri dan bengkak di daerah tibia dextra. Klien mempunyai riwayat patah tulang didaerah tersebut dan dibawa ke bengkel tulang. Pada saat pengkajian terdapat kemerahan dan bengkak. Klien direncanakan operasi debridement. Hasil kultur darah menunjukkan adanya bakteri staphylococcus aureus.\r\nIntervensi yang bisa dilakukan perawat untuk mengatasi masalah mobilisasi klien adalah ...\r\n\r\n', 50, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:48:10', '2021-03-29 01:48:10'),
	(74, 1, 2, 1, '\r\nTn. A berumur 35 tahun dirawat di ruang orthopedi. Klien mengeluh nyeri dan bengkak di daerah tibia dextra. Klien mempunyai riwayat patah tulang didaerah tersebut dan dibawa ke bengkel tulang. Pada saat pengkajian terdapat kemerahan dan bengkak. Klien direncanakan operasi debridement. Hasil kultur darah menunjukkan adanya bakteri staphylococcus aureus.\r\nIntervensi keperawatan untuk mengatasi nyeri klien ...\r\n\r\n', 51, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:50:01', '2021-03-29 01:50:01'),
	(75, 1, 2, 1, '\r\nTn. Y, umur 50 tahun, dirawat di ruang orthopedi dengan diagnosa osteorthritis. Klien mengeluh sakit pada lutut sinistra, terlihat bengkak dan kemerahan pada lutut dan sekitarnya. Klien pernah mengalami dislokasi pada lututnya 10 tahun yang lalu. \r\nKlien rencana akan dilakukan artroplasti.\r\nPersiapan operasi yang bisa dilakukan di ruang rawat untuk mencegah infeksi di daerah operasi\r\n\r\n', 52, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:51:49', '2021-03-29 01:51:49'),
	(76, 1, 2, 1, 'Tn. Y, umur 50 tahun, dirawat di ruang orthopedi dengan diagnosa osteorthritis. Klien mengeluh sakit pada sendi lututnya, terlihat bengkak dan kemerahan pada lutut dan sekitarnya. Klien pernah mengalami dislokasi pada lututnya 10 tahun yang lalu. \r\nKlien rencana akan dilakukan artroplasti. \r\nIntervensi keperawatan untuk mengatasi nyeri...\r\n\r\n', 53, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:54:07', '2021-03-29 01:54:07'),
	(77, 1, 2, 3, 'Seorang pasien perempuan usia 35 tahun datang ke Puskesmas untuk melakukan pemeriksaan ulang kehamilannya yang ke-5. Pasien mengatakan belakangan ini sering merasakan pusing, pengelihatan kadang-kadang kabur, disertai nyeri pada ulu hati. Hasil pemeriksaan fisik tekanan darah 140/90 mmHg, kedua kaki edema, BB bertambah drastis dalam dua minggu belakangan ini.Usia kehamilan 34 minggu, DJJ dalam batas normal, hasil pemeriksaan urun didapatkan protein urine (+).\r\nApakah komplikasi yang dapat terjadi pada pesien tersebut?', 54, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:55:40', '2021-03-29 01:55:40'),
	(78, 1, 2, 1, 'Ny A dengan usia 58 th memiliki riwayat DM tipe 2 sejak 5 th yang lalu, saat dikaji klien mengeluh mempunyai luka di kaki, ada riwayat polidipsi, polipaghi, poliuri yang. Hari ini hasil GD sewaktu 75 mg/dl, klien mengeluh keluar keringat dingin, kepala pusing. Klien mendapat therapy insulin 10-10-10 makan 1 porsi tidak habis.\r\nIntervensi yang harus dilakukan perawat adalah...\r\n', 55, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:56:04', '2021-03-29 01:56:04'),
	(79, 1, 2, 3, 'Seorang perempuan usia 40 tahun datang ke poli ginekologi dengan keluhan keluar cairan dari alat kelaminnya sejak 4 hari yang lalu disertai rasa sakit pada waktu BAK. Dari hasil pemeriksaan didapatkan pus yang keluar jumlahnya banyak hingga membasahi celana dalam pasien. Pus berwarna hijau kemerahan yang kental. Pasien mengatakan ia bekerja sebagai PSK.\r\nMasalah apa yang dialami oleh pasien?', 57, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:57:16', '2021-03-29 01:57:48'),
	(80, 1, 2, 1, '\r\nNy A dengan usia 58 th memiliki riwayat DM tipe 2 sejak 5 th yang lalu, saat dikaji klien mengeluh mempunyai luka di kaki, ada riwayat polidipsi, polipaghi, poliuri yang. Hari ini hasil GD sewaktu 75 mg/dl, klien mengeluh keluar keringat dingin, kepala pusing. Klien mendapat therapy insulin 10-10-10 makan 1 porsi tidak habis. \r\nIntervensi yang bisa dilakukan untuk masalah gangguan integritas kulit adanya luka di kaki adalah .....\r\n', 57, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:58:12', '2021-03-29 01:58:12'),
	(81, 1, 2, 3, 'Seorang perempuan berusia 50 tahun, datang ke poli ginekologi dengan keluhan nyeri perut bagian bawah sejak 2 minggu yang lalu. Pasienmerasakan keluhan nyeri di perut bagian bawah bertambah berat dari hari ke hari. Sebelumnya pasien mengalami perdarahan dari liang vagina sudah sejak 1 tahun. Darah keluar dari liang vagina terus-menerus setiap hari, darah yang keluar berwarna merah segar, kadang-kadang disertai dengan lendir, dan tidak berbau. Selama mengalami perdarahan pasien tidak mau berobat karena pasien merasa takut. Pasien merasa sakit di perut bagian bawah yang semakin lama semakin bertambah berat, nyeri dirasakan muncul tiba-tiba saja dan dirasakan terus menerus.\r\nMasalah apa yang dialami oleh pasien?', 58, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 01:59:46', '2021-03-29 01:59:46'),
	(82, 1, 2, 1, 'Ny A menderita DM tp 2 sejak 5 bulan yang lalu, pagi ini pasien mengeluh pusing, badan lemas, keluar keringat dingin. Sebelum makan pagi pasien disuntik insulin dengan dosis 20 unit, ketika ditanyakan kepada keluarga, pasien makan hanya 5 sendok dengan alasan ada rasa mual\r\nKeadaan Ny. A saat ini bisa dicegah dengan intervensi keperawatan....\r\n', 59, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 02:01:12', '2021-03-29 02:01:12'),
	(83, 1, 2, 1, '\r\nNy A menderita DM tp 2 sejak 5 bulan yang lalu, pagi ini pasien mengeluh pusing, badan lemas, keluar keringat dingin. Sebelum makan pagi pasien disuntik insulin dengan dosis 20 unit, ketika ditanyakan kepada keluarga, pasien makan hanya 5 sendok dengan alasan ada rasa mual\r\nDiagnosa keperawatan yang tepat untuk kasus diatas adalah...\r\n', 60, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 02:03:07', '2021-03-29 02:03:07'),
	(84, 1, 2, 5, 'Seorang kakek berusia 66 tahun mengalami masalah pendengaran, klien tidak menggunakan alat bantu pendengaran. Kakek sering jalan-jalan di jalan raya sambil berolah raga.\r\nApakah upaya perawat saat memberikan intervensi kepada klien tersebut ?', 61, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 02:39:31', '2021-03-29 02:39:31'),
	(85, 1, 2, 5, 'Seorang nenek berusia 59 tahun mengalami penurunan daya ingat, tidak dapat menyebutkan siapa saja nama-nama cucunya. Untuk melakukan aktivitas sehari-hari seperti makan dan minum klien di bantu oleh keluarganya.\r\nPenurunan  apakah yang di alami klien berdasarkan kasus di atas ?', 62, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 02:42:56', '2021-03-29 02:42:56'),
	(86, 1, 2, 5, 'Seorang laki-laki berusia 62 tahun mengeluh penglihatannya menurun, melihat orang menjadi agak buran, keluhan lain yang di rasakan adalah klien merasa tidak napsu makan karena merasa makanan yang di sediakan tampak tidak menarik sehingga membuat sang kakek turun BB sedikit.\r\nApakah tindakan mandi yang bisa dilakukan oleh perawat ?', 63, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 02:47:39', '2021-03-29 02:47:39'),
	(87, 1, 2, 5, 'Seorang nenek 67th dibawa ke puskemas dengan keluhan kaki terasa sakit teutama di bagian persendian, nyeri di rasakan semakin bertambah jika di gunakan untuk berjalan Hasil pengkajian TD:130/89 mmHg, N: 67x/mnt, RR: 22 x/mnt.\r\nApakah jenis perubahan fisiologis yang terjadi pada kasus di atas?', 64, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 02:55:25', '2021-03-29 02:55:25'),
	(88, 1, 2, 6, 'Seorang perempuan usia 25 tahun datang ke IGD dengan cedera kepala akibat kecelakaan lalu lintas. Hasil pemeriksaan tingkat kesadaran dengan rangsangan nyeri di supra orbita, klien berespon dengan membuka mata, mengerang, dan lengan kanan mencoba untuk mendekati sumber rangsangan.\r\nBerapakah nilai GCS pada pasien?', 65, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 02:56:58', '2021-03-29 02:56:58'),
	(89, NULL, NULL, 0, NULL, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 02:57:00', '2021-03-29 02:57:00'),
	(90, 1, 2, 5, 'Seorang nenek berusia  65 tahun dirawat di Rumah Sakit karena masalah pencernaan. Dari hasil pengkajian klien terlihat lemah, klien mengatakan tidak ada keinginan untuk BAB sejak 3 hari yang lalu, perut kembung (+), peristaltik usus 6x/mnt\r\nApakah rencana keperawatan mandiri yang bisa perawat lakukan pada kasus diatas?', 66, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 02:58:39', '2021-03-29 02:58:39'),
	(91, 1, 2, 5, 'Seorang nenek usia 60 tahun tinggal di Panti Tresna Wreda sejak 1 tahun yang lalu. Klien menggunakan kaca mata dan alat bantu pendengaran. Berdasarkan hasil screening, klien tidak memerlukan bantuan dalam merawat dirinya sendiri.\r\nBerdasarkan pengkajian fungsional Katz Indeks, apakah kategori lansia di atas', 67, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:00:31', '2021-03-29 03:00:31'),
	(92, 1, 2, 6, 'Seorang laki-laki 28 tahun datang ke IGD dengan penurunan kesadaran akibat cedera kepala post kecelakaan lalu linas. Hasil pengkajian ditemukan GCS E2V2M3, terdapat vulnus laserasi (VL) di area wajah, tangan kanan, dan kaki kanan, TD: 90/60 mmHg, frekuenai nadi 76 x/menit, frekuensi napas 35x/menit. \r\nApakah masalah keperawatan utama pada klien tersebut?', 68, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:02:12', '2021-03-29 03:02:12'),
	(93, 1, 2, 5, 'Seorang laki-laki 85 tahun mengalami masalah psikososial, klien sering merasa khawatir apakah klien akan berumur panjang, mengingat begitu banyak penyakit yang diseritanya, seperti hipertensi dan asam urat, klien sering merasa tidak bisa tidur memikirkan hal yang di alaminya saat ini.\r\nDiagnosa apakah yang paling tepat pada kasus diatas ?', 69, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:04:19', '2021-03-29 03:04:19'),
	(94, 1, 2, 6, 'Seorang laki-laki 40 tahun Tn.M 40 tahun datang ke IGD dengan cedera kepala ringan disertai keluhan nyeri kepala setelah terjatuh di depan rumahnya. Hasil pengkajian ditemukan GCS E4V5M6, mual, luka terbuka di area dahi,TD: 130/70, frekuensi nadi 90x/menit, frekuensi nafas 20 x/menit. Apakah data yang dibutuhkan perawat untuk mengangkat masalah ketidakefektifan perfusi jaringan serebral?', 70, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:05:37', '2021-03-29 03:05:37'),
	(95, 1, 2, 6, 'Seorang laki-laki 35 tahun datang ke IGD dengan penurunan kesadaran setelah kecelakaan lalu lintas. Hasil pengkajian diketahui terdapat luka terbuka disertai dengan fraktur tengkorak dan terjadi perdarahan hebat.\r\nApakah yang perlu diperhatikan oleh perawat ketika melakukan perawatan luka?', 71, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:09:54', '2021-03-29 03:09:54'),
	(96, 1, 2, 6, 'Seorang laki-laki 35 tahun datang ke IGD dengan penurunan kesadaran setelah mengalami kecelakaan lalu lintas. Hasil pengkajian TD: 150/90 x/menit, frekuensi nadi: 50 x/menit, frekuensi napas: 24 x/menit. Perawat akan mengukur tekanan perfusi serebral klien.\r\nBerapakan tekanan perfusi serebral Tn.F dengan anggapan tekanan intra kranial sebesar 15mmHg?', 72, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:16:36', '2021-03-29 03:16:36'),
	(97, 1, 2, 6, 'Seorang laki-laki 25 tahun datang ke IGD dengan penurunan kesadaran setelah kecelakaan lalu lintas. Hasil pengkajian diketahui klien nampak gelisah, terdapat darah di lubang hidung dan telinga, jejas di area belakang telinga kanan, serta nampak kehitaman di area mata.\r\nApakah bagian otak klien yang mengalami gangguan?', 73, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:20:27', '2021-03-29 03:20:27'),
	(98, 1, 2, 6, 'Seorang laki-laki 30 tahun datang ke IGD nampak gelisah setelah mengalami kecelakaan lalu lintas. Hasil pengkajian: klien mengalami penurunan TD hingga 90/60 mmHg, frekuensi nadi: 40 x/menit, frekuensi napas: 14 x/menit, GCS E2V2M3, pupil non reaktif.\r\nApakah yang harus dilakukan perawat untuk mengatasi perburukan kondisi klien?', 74, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:24:07', '2021-03-29 03:24:07'),
	(99, 1, 2, 5, 'Seorang laki-laki berusia 53 tahun mengalami hipertensi sejak 5 tahun yang lalu. Saat di kaji TD 150/92 mmHg. Klien sudah mendapatkan terapi obat anti hipertensi namun klien sering lupa untuk meminumnya. Klien sering bertanya kepada perawat tentang penyakit dan klien tampak murung dan sering melamun, namun jika ada teman nya yang datang, klien masih bisa bercanda dan melakukan aktifitas seperti biasanya.\r\nApakah diagnosa yang tepat pada kasus di atas?', 75, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:24:55', '2021-03-29 03:24:55'),
	(100, 1, 2, 5, 'Seorang laki-laki usia 60 tahun tinggal di Panti Werdha, klien merupakan seorang pensiunan TNI AD yang klien selalu berpakaian rapi dan sering memerintah sesama penghuni panti. Klien sulit diatur dan maunya menang sendiri.\r\nMasalah apakah yang di alami klien di atas?', 76, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:26:39', '2021-03-29 03:26:39'),
	(101, 1, 2, 6, 'Seorang perempuan 28 tahun datang ke IGD dengan penurunan kesadaran akibat kecelakaan sepeda motor, klien tidak menggunakan pelindung kepala. Hasil pengkajian, TD: 100/70 mmHg, frekuensi nadi: 72 x/menit, frekuensi napas: 28 x/menit, terdapat jejas di area leher disertai luka terbuka di bahu hingga lengan bawah klien.\r\nApakah yang harus dilakukan perawat pertama kali?', 77, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:27:27', '2021-03-29 03:27:27'),
	(102, 1, 2, 5, 'Seorang nenek berusia 70 tahun mengalami penurunan fungsi spingter internal dan eksternal. Hal tersebut menyebabkan sang nenek sering mengompol atau BAK sebelum sampai di kamar mandi dan hal tersebut sangat sering terjadi.\r\nApakah tindakan keperawatan utama yang dapat perawat lakukan pada kasus di atas?', 78, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:28:39', '2021-03-29 03:28:39'),
	(103, 1, 2, 6, 'Seorang perempuan 28 tahun datang ke IGD dengan status epileptikus. Hasil pengkajian, TD: 130/90 mmHg, frekuensi nadi: 112 x/menit, frekuensi napas: 24 x/menit, suhu: 39.0 C. Klien menunjukan periode kejang selama 40 detik setiap 15 menit.\r\nApakah yang harus dilakukan perawat pertama kali ?', 79, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:29:40', '2021-03-29 03:29:40'),
	(104, 1, 2, 5, 'Seorang laki-laki berusia 60 tahun tinggal di Panti Wreda, klien merupakan seorang pensiunan TNI AD dan selalu berpakaian rapi serta sering memerintah sesama penghuni panti. Klien sulit diatur dan mau menang sendiri. \r\nApakah kumpulan gejala psikologis pada kasus tersebut?', 80, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:30:46', '2021-03-29 03:30:46'),
	(105, 1, 2, 5, 'Seorang pria berusia 69 tahun tinggal di Panti Wreda dengan keluhan sulit tidur, tidak nafsu makan. Klien tampak selalu murung, sedih berkepanjangan dan sulit diajak berfikir.', 81, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:33:35', '2021-03-29 03:33:35'),
	(106, 1, 2, 5, 'Seorang laki-laki berusia 65 tahun tinggal di Panti Wreda, klien mengeluh mengalami penurunan pendengaran, pandangan kabur, dan mobilisasi dibantu menggunakan kursi roda. Hasil pengkajian didapatkan klien mengalami penurunan kekuatan otot ekstremitas bawah.\r\nApakah diagnosis keperawatan pada kasus tersebut?', 82, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:35:34', '2021-03-29 03:35:34'),
	(107, 1, 2, 5, 'Seorang perempuan berusia 67 tahun diantar keluarga ke Puskesmas karena sudah 3 bulan  batuk tidak sembuh-sembuh. Hasil pengkajian di peroleh pasien tampak kurus, malam hari banyak keringat, telah makan obat warung dan lingkungan rumahnya tampak kotor.\r\nApakah tindakan pertama yang dilakukan oleh perawat untuk menegakkan diagnosis penyakitnya? ', 83, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:37:47', '2021-03-29 03:37:47'),
	(108, 1, 2, 5, 'Seorang laki-laki berusia 70 tahun dirawat diruang Geriatri, sejak 2 hari lalu pasien mengeluhkan sesak. Hasil pengkajian: frekuensi napas 34x/menit, frekuensi nadi 100x/menit, TD 140/90 mm/Hg, batuk produktif, sputum di hidung, auskultasi suara nafas ronkhi. \r\nApakah intervensi pada kasus tersebut? \r\n', 84, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:39:29', '2021-03-29 03:39:29'),
	(109, 1, 2, 5, 'Seorang laki-laki berusia 78 tahun tinggal di Panti Wreda. Sejak 4 hari yang lalu mengeluh mual dan muntah, porsi makan hanya dihabiskan ?? porsi. Klien terbaring lemah di tempat tidur. Aktivitas dan rutinitas lainnya tidak bisa dilakukan oleh klien.\r\nApakah data yang harus dikaji lebih lanjut pada kasus tersebut?\r\n', 85, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:41:20', '2021-03-29 03:41:20'),
	(110, 1, 2, 5, 'Seorang perempuan berusia 67 tahun tinggal di Panti Wreda sejak lima tahun yang lalu. Klien mengalami katarak dan gangguan gaya berjalan, sejak saat itu klien menggunakan tongkat untuk membantunya berjalan. Klien menyatakan tidak berani berjalan jauh karena takut jatuh disebabkan lingkungan sekitar panti yang berundak dan lantai yang licin.\r\nApakah diagnosis keperawatan yang tepat untuk kasus tersebut?\r\n', 86, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:43:05', '2021-03-29 03:43:05'),
	(111, 1, 2, 5, 'Seorang laki-laki berusia 78 tahun dirawat dengan arthritis pada kedua lututnya. Pasien sering mengalami disorientasi, riwayat pernah terjatuh dari tempat tidur.\r\nManakah upaya pencegahan jatuh yang tepat?', 87, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:44:58', '2021-03-29 03:44:58'),
	(112, 1, 2, 5, 'Seorang laki-laki berusia 78 tahun mengalami kurang pendengaran pada telinga kanannya.\r\nBagaimanakah cara menyampaikan pesan lisan agar lebih mudah?\r\n', 88, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:46:43', '2021-03-29 03:46:43'),
	(113, 1, 2, 5, 'Seorang perempuan berusia 67 tahun tinggal di Panti Wreda mengeluh sering ngompol di celana terutama saat batuk dan tertawa sejak 1 bulan lalu. Klien terbiasa minum kopi sejak 30 tahun lalu. Tercium bau pesing dari pakaian klien, fungsi kognitif utuh.\r\nApakah tindakan yang paling tepat untuk kasus tersebut?\r\n', 89, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:48:38', '2021-03-29 03:48:38'),
	(114, 1, 2, 8, '1. Seorang Perempuan berusia 26 tahun sudah seminggu dirawat di Ruang Nuri RSJ. Menurut Ibunya, sejak kecil pasien sering dipukul dan dimarahi \r\n    oleh ayahnya, sehingga mengalami stres. Pada saat pengkajian di dapatkan data : tatapan mata tajam, tangan mengepal, dan berperilaku tidak \r\n    kooperatif.  \r\n\r\n    Apakah faktor predisposisi pada kasus tersebut?', 90, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 03:53:59', '2021-03-29 03:53:59'),
	(115, 1, 2, NULL, '2. Seorang perempuan usia 18 tahun dirawat di RSJ. Saat dikaji oleh perawat, pasien mengatakan dirinya tidak berguna dan tidak mampu \r\n   membanggakan orang tuanya. Setelah dikaji, pasien tampak menunduk dan nada suara pelan.\r\n\r\n   Apakah faktor predisposisi pada kasus tersebut?\r\n\r\n', 91, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:00:52', '2021-03-29 04:00:52'),
	(116, 1, 2, 8, '3. Seorang Perempuan berusia 26 tahun sudah seminggu dirawat di Ruang Nuri RSJ. Menurut Ibunya, sejak kecil pasien sering dipukuli dan dimarahi \r\n   oleh ayahnya, sehingga mengalami stres. Pada saat pengkajian di dapatkan data : tatapan mata tajam, alam perasaan depresi, adanya kerusakan \r\n   kognitif, dan adanya riwayat ancaman kekerasan pada orang lain.\r\n\r\n   Apakah diagnosis pada kasus tersebut?', 92, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:04:36', '2021-03-29 04:04:36'),
	(117, 1, 2, 8, '4. Seorang perempuan usia 19 tahun dirawat di RSJ. Saat dikaji oleh perawat, pasien mengatakan dirinya tidak berguna dan tidak mampu \r\n   membanggakan orang tuanya. Setelah dikaji, pasien tampak menunduk dan nada suara pelan.\r\n\r\n   Apakah intervensi terkait dukungan social pada kasus tersebut?', 93, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:09:54', '2021-03-29 04:09:54'),
	(118, 1, 2, 3, 'Seorang perempuan berusia 45 tahun sudah mempunyai 5 anak, datang ke poli kebidanan dan mengatakan ingin ber KB tetapi dilarang oleh suaminya. Menstruasi masih teratur, suaminya ingin punya anak lagi karena menurutnya banyak anak banyak rezeki. Hasil pemeriksaan TD 140/80 mmHg, nadi 85x/menit, suhu 37oC.\r\nSikap perawat dalam menghadapi pasien tersebut adalah ?', 94, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:16:59', '2021-03-29 04:16:59'),
	(119, 1, 2, 8, '5. Seorang perempuan berusia 18 tahun sudah seminggu dirawat di Ruang Nuri RSJ. Menurut ibunya, pasien memiliki riwayat tidak lulus perguruan \r\n    tinggi yang diinginkannya. Belum lama ini pasien mengalami kekerasan yang dilakukan oleh teman sekolahnya. Pasien di bawa ke RSJ karena sering \r\n    melempar barang yang ada di dekatnya. Pada saat dikaji, didapatkan pasien tampak menunjukan tatapan mata yang tajam.\r\n\r\n    Apakah faktor predisposisi pada kasus tersebut?', 95, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:17:28', '2021-03-29 04:17:28'),
	(120, 1, 2, 3, 'Seorang perempuan berusia 45 tahun sudah mempunyai 5 anak, datang ke poli kebidanan dan mengatakan ingin ber KB tetapi dilarang oleh suaminya. Menstruasi masih teratur, suaminya ingin punya anak lagi karena menurutnya banyak anak banyak rezeki. Hasil pemeriksaan TD 140/80 mmHg, nadi 85x/menit, suhu 37oC. Suami pasien setuju dengan saran dari petugas di poli untuk tidak hamil kembali.\r\nUntuk menghindari tuntutan hukum apa yang harus petugas kesehatan dilakukan ?', 96, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:18:26', '2021-03-29 04:18:26'),
	(121, 1, 2, 5, 'Seorang laki-laki berusia 70 tahun telah tinggal di sebuah panti jompo selama 6 tahun. Teman sekamar klien mengatakan satu minggu ini klien sering menangis dan mengatakan takut mati. Klien terlihat bersedih, sering gelisah, dan mengalami kesulitan tidur.\r\nApa yang harus dikaji oleh perawat pada kasus tersebut?\r\n', 97, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:20:01', '2021-03-29 04:20:01'),
	(122, 1, 2, 3, 'Seorang perempuan berusia 35 tahun dengan P1A0 dirawat di ruangan nifas hari kedua, melahirkan dengan SC, pasien mengeluh ASI baru keluar sedikit dan putting terasa nyeri. Ibu tidak menyusui bayinya karena takut. Hasil pemeriksaan tanda-tanda vital dalam batas normal, putting susu ibu tampak lecet kemerahan. \r\nPada kasus tersebut apakah anjuran yang paling tepat untuk ibu?', 98, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:21:38', '2021-03-29 04:21:38'),
	(123, 1, 2, 5, 'Seorang  perempuan berusia 68 tahun  tinggal di panti werdha. Klien mengeluh nyeri kaki, lutut, otot betisnya juga sesekali terasa ngilu. Pada saat melakukan Implementasi perawat M tidak memperhatikan lingkungan dan privasi klien sehingga aurat klien terlihat.\r\nApa etika yang di langgar oleh perawat pada kasus tersebut?\r\n', 99, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:22:00', '2021-03-29 04:22:00'),
	(124, 1, 2, 3, 'Seorang perempuan berusia 30 tahun dengan P2A0 dirawat di ruangan nifas, ibu melahirkan spontan dengan episiotomy, saat perawat akan melakukan pemeriksaan luka episiotomy pasien. \r\nBagaimanakah posisi pasien sebaiknya?', 100, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:23:06', '2021-03-29 04:23:06'),
	(125, 1, 2, 5, 'Seorang perempuan berusia 60 tahun yang tinggal di panti jompo mengatakan dirinya kesulitan menahan keluarnya air kencingnya pada saat batuk. Keluhan tersebut membuat klien enggan minum. Perawat menyarankan klien untuk menggunakan diapers.\r\nApa yang dapat klien lakukan dalam tahapan implementasi selanjutnya?\r\n', 101, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:23:57', '2021-03-29 04:23:57'),
	(126, 1, 2, 8, 'Seorang perempuan usia 17 tahun dirawat di ruang keswara RSJ. Saat dikaji oleh perawat, pasien mengatakan dirinya tidak berguna dan tidak mampu melakukan hal yang diharapkan oleh keluarganya. Pada saat dilakukan pengkajian didapatkan data bahwa pasien pernah dirawat 2 tahun yang lalu. Menurut tetangga yang mengantar, pasien memiliki ayah yang juga mengalami gangguan jiwa.  Apakah faktor penyebab gangguan pada klien di atas? \r\n\r\n\r\n\r\n\r\n\r\n   ', 403, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:24:20', '2021-04-07 23:51:10'),
	(127, 1, 2, 3, 'Seorang perempuan berusia 30 tahun dengan P2A0 dirawat di ruangan nifas, ibu melahirkan spontan dengan episiotomy, ditemukan adanya kemerahan pada luka episiotomy pasien, terdapat bengkak kebiruan disertai keluar cairan eksudat dari luka episiotomy. \r\nData objektif apakah yang harus dilakukan pemeriksaan berikutnya oleh perawat?', 103, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:24:28', '2021-03-29 04:24:28'),
	(128, 1, 2, 3, 'Seorang perempuan berusia 30 tahun dengan P2A0 dirawat di ruangan nifas hari kedua, ibu mengatakan bahwa produksi ASI belum keluar, terlihat bengkak didaerah payudara pasien, payudara teraba hangat. Ibu mengatakan bayinya rewel karena tidak mau menyusui.\r\nApakah intervensi yang harus dilakukan oleh perawat?', 104, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:25:37', '2021-03-29 04:25:37'),
	(129, 1, 2, 5, 'Seorang laki-laki berusia 67 tahun mengatakan bahwa akhir akhir ini dirinya seing mengalami rasa lapar dan haus diluar kebiasaan. Pada saat dihitung berat badan klien mengalami kenaikan drastis. \r\nApa perencanaan yang dapat dilakukan oleh perawat?\r\n', 105, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:26:04', '2021-03-29 04:26:04'),
	(130, 1, 2, 3, 'Seorang perempuan dengan P1A0 di rawat di ruangan nifas, pasien baru melahirkan 6 jam yang lalu secara spontan, perawat akan melakukan operan, sebelum operan perawat memeriksa kondisi ibu, terdapat kontraksi lemah pada uterus pasien, TFU sepusat.\r\nApakah yang harus diwaspadai pada ibu?', 106, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:27:42', '2021-03-29 04:27:42'),
	(131, 1, 2, 5, 'Seorang perempuan berusia 77 tahun tinggal disebuah panti jompo. Klien mengeluh mengalami kesulitan tidur beberapa malam ini. Klien mengatakan selalu ingat pada suaminya yang telah meninggal, setelah dilakukan pengkajian emosional didapatkan emosional positif.\r\n\r\n', 107, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:27:43', '2021-03-29 04:27:43'),
	(132, 1, 2, 8, '7. Seorang perempuan berusia 16 tahun, menjalani operasi pada wajahnya akibat kesalahan penggunaan kosmentik. Menurut keluarganya klien sering \r\n    berkaca lalu menangis, murung dan tidak mau bertemu dengan orang lain karena malu dan merasa wajahnya sangat buruk. Klien juga mengatakan \r\n    bahwa dirinya jelek. Pada saat di kaji, klien tampak mengurung diri di kamar.\r\n\r\n    Apakah respon stresor internal yang mungkin muncul pada pasien tersebut?', 108, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:28:34', '2021-03-29 04:28:34'),
	(133, 1, 2, 3, 'Seorang perempuan dengan P1A0 di rawat di ruangan nifas, pasien baru melahirkan 6 jam yang lalu secara spontan, perawat akan melakukan operan, sebelum operan perawat memeriksa kondisi ibu, terdapat kontraksi lemah pada uterus pasien, TFU sepusat. \r\nBerapakah normal TFU ibu ?', 109, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:28:58', '2021-03-29 04:28:58'),
	(134, 1, 2, 5, 'Seorang perempuan berusia 60 tahun tinggal bersama istri dan cucunya. Keluarga mengatakan bahwa beberapa hari ini klien sering menangis karena baru saja pensiun dan dan merasa tidak berguna karena tidak berpenghasilan. Hasil pengkajian emosional positif. \r\nApa yang harus di kaji oleh perawat ketika melakukan kunjungan kepada klien tersebut?\r\n', 110, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:29:23', '2021-03-29 04:29:23'),
	(135, 1, 2, 8, '8. Seorang laki-laki berusia 37 tahun datang ke poli sebuah puskesmas dengan keluhan gelisah, tidak bisa tidur, dan tidak nafsu makan. Keluhan ini \r\n    terjadi sejak pasien mengetahui bahwa dirinya terkena stroke. Pasien mengatakan: “saya merasa tidak berguna karena tidak bisa mencari nafkah \r\n    akibat sakit yang saya derita”\r\n\r\n    Apakah gangguan konsep diri yang bermasalah pada kasus di atas?', 111, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:31:40', '2021-03-29 04:31:40'),
	(136, 1, 2, 3, 'Seorang perempuan dengan P1A0 di rawat di ruangan nifas, pasien baru melahirkan 6 jam yang lalu secara spontan, perawat mendengar bayi ibu menangis kuat, saat didekatkan jari telunjuk perawat ke mulut bayi, bayi tampak menoleh kearah telunjuk perawat dan membuka mulutnya.\r\nHal ini dikenal dengan istilah?', 112, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:31:49', '2021-03-29 04:31:49'),
	(137, 1, 2, 3, 'Seorang perempuan dengan P1A0 di rawat di ruangan nifas, pasien baru melahirkan 6 jam yang lalu secara spontan, perawat melakukan pemeriksaan reflex pada bayi, perawat bertepuk tangan kuat didekat bayi, ditemukan data bahwa bayi menoleh kesisi dengan tangan ditekuk.\r\nHal ini dikenal dengan istilah?', 113, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:33:03', '2021-03-29 04:33:03'),
	(138, 1, 2, 5, 'Seorang laki-laki berusia 68 tahun yang tinggal di sebuah panti. Klien mengeluh sakit kaki kanan. Seorang perawat sedang melakukan implementasi keperawatan dengan rendam air hangat pada kaki klien. Namun Pada saat pemberian kompres klien tidak sengaja menyenggol ember air rendaman sehingga terdapat air genangan di lantai. Perawat membiarkan air genangan tersebut, sementara terlihat lansia lain berjalan lalu lalang di dekat air genangan tersebut.\r\nApa prinsip etik yang di langgar oleh perawat pada kasus tersebut?\r\n', 114, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:34:07', '2021-03-29 04:34:07'),
	(139, 1, 2, 8, '9. Seorang laki-laki berusia 45 tahun dirawat di ruang perkutut RSJ. Pasien dibawa ke RSJ dengan alasan tidak mau mandi selama satu bulan. Pada saat \r\n    pengkajian, penampilan pasien tampak kotor, dan tercium bau tidak sedap. Hal ini dilakukan pasien sejak mengalami perceraian dengan istrinya. \r\n    Sebelumnya pasien pernah dirawat di RSJ 6 tahun yang lalu.\r\n\r\n    Apa tindakan pertama perawat pada kasus di atas?', 115, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:35:05', '2021-03-29 04:35:05'),
	(140, 1, 2, 6, 'Seorang perawat yang bertugas di IGD, saat waktu menjelang operan dinas datang tiga orang pasien kecelakaan lalu lintas, pasien 1 : Berteriak kesakitan, ada pendarahan di kaki kanan, pasien 2 : Diam, tampak pendarahan dari kepala. Pasien 3 : Pasien diam saja dan tidak ada tanda-tanda kehidupan.\r\nManakah yang harus diprioritaskan oleh perawat?', 116, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:39:38', '2021-03-29 04:39:38'),
	(141, 1, 2, 8, '10. Seorang laki-laki berusia 18 tahun mengalami musibah bahwa mobil kesayangannya hilang. Klien mengatakan hal ini tidak meungkin terjadi karena \r\n     mobilnya sudah di kunci ganda dan di jaga oleh satpam rumah.\r\n\r\n     Apakah tahap kehilangan yang terjadi pada klien tersebut?', 117, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:39:42', '2021-03-29 04:39:42'),
	(142, 1, 2, 6, 'Seorang laki-laki berusia 30 tahun dilarikan ke IGD karena menderita luka bakar dengan luas 50%.  Pasien terkena ledakan tabung gas, luka bakar grade II-III, hasil pemeriksaan fisik : TD ; 100/70 mmHg, frekuensi nadi 100 x/menit, GCS 9.\r\nBerdasarkan metode triase 5 level, pada level manakah pasien tersebut berada?', 118, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:42:02', '2021-03-29 04:42:02'),
	(143, 1, 2, 8, '11. Seorang laki-laki berusia 30 tahun dibawa ke UGD RSJ. Pasien berbicara kasar dan menendang benda-benda yang berada di sekitarnya. Menurut \r\n      keluarga, pasien dibawa ke RSJ karena mencoba membakar rumah tetangga dan marah-marah tanpa sebab. Klien memiliki riwayat perceraian \r\n      dengan istrinya 1 tahun yang lalu.\r\n\r\n      Apakah masalah keperawatan utama pada pasien tersebut?', 119, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:43:25', '2021-03-29 04:43:25'),
	(144, 1, 2, 6, 'Seorang laki-laki berusia 17 tahun didapatkan tidak sadarkan diri setelah mengalami tabrakan motor di tepi jalan. Saat perawat datang dan mendekati korban di TKP terlihat ada lecet pada bagian kepala pasien. Pasien juga mengalami perdarahan pada daerah lengan dan kaki.\r\nTindakan prioritas apakah yang harus dilakukan oleh perawat?', 120, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:44:12', '2021-03-29 04:44:12'),
	(145, 1, 2, 5, 'Seorang perempuan berusia 60 tahun tinggal bersama anaknya, klien mengeluh susah menahan keinginannya untuk BAK pada malam hari, karena kamar klien jauh dari wc. Perawat berencana memberikan  implementasi dengan cara ....\r\nApa yang dapat perawat lakukan dalam tahapan implementasi?\r\n', 121, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:45:29', '2021-03-29 04:45:29'),
	(146, 1, 2, 6, 'Seorang laki-laki berusia 40 tahun mengalami kecelakaan lalu lintas, dibawa ke rumah sakit rujukan oleh perawat dengan diagnosa Cidera kepala, saat dilakukan upaya evakuasi pasien menggunakan ambulans, pasien mendadak nafasnya berhenti.\r\nTindakan yang harus segera anda kerjakan adalah?', 122, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:46:54', '2021-03-29 04:46:54'),
	(147, 1, 2, 8, '12. Seorang laki-laki berusia 40 tahun dibawa ke RSJ oleh keluarga. Saat pengkajian, pasien mengatakan mendengar suara seorang perempuan yang \r\n      menghina dirinya, pasien tidak nyaman dan mengeluarkan kata-kata kasar dan meminta suara  itu untuk pergi. Keluarga mengatakan pasien sering \r\n      terlihat berbicara sendiri, tampak melakukan gerakan memukul-mukul dan mengusir. Padahal tidak terlihat ada orang lain yang mengganggu \r\n      pasien.\r\n\r\n      Apakah masalah keperawatan utama pada pasien tersebut?', 123, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:47:04', '2021-03-29 04:47:04'),
	(148, 1, 2, 5, 'Seorang laki-laki berusia 72 tahun tinggal bersama anak dan cucunya. Beberapa bulan terakhir ini klien mengatakan malas makan. Hasil perhitungan BMI klien adalah gizi kurang.\r\nApa perencanaan yang dapat dilakukan oleh perawat ', 124, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:48:03', '2021-03-29 04:48:03'),
	(149, 1, 2, 6, 'Seorang wanita berusia 40 tahun memiliki anak berusia 4 tahun yang mengalami perdarahan dari kepala, hidung dan telinga, dokter dan perawat menyarankan dilakukan pemasangan CVP. \r\nTermasuk dalam masalah etik manakah perawat tersebut?', 125, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:48:56', '2021-03-29 04:48:56'),
	(150, 1, 2, 5, 'Seorang perempuan berusia 60 tahun tinggal disebuah panti wrheda. Klien mengeluh mengalami kesulitan tidur kembali saat tengah malam. Sehingga klien selalu tertidur saat mengikuti kegiatan panti. Klien terlihat murung dan gelisah pada saatmenceritakan hal tersebut karena teman teman sekamarnya selalu membullynya.  Pada saat pengkajian perawat melakukan pengkajian terkait kecemasan dan mendokumentasikan tingkat kecemasan.\r\nApa yang dapat dilakukan oleh perawat dalam melakukan pengkajian lanjutan?', 126, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:50:01', '2021-03-29 04:50:01'),
	(151, 1, 2, 8, '13. Seorang laki-laki berusia 25 tahun dirawat di RSJ. Pasien mengatakan bahwa dirinya jelek dan tidak berharga. Selama berinteraksi dengan perawat, \r\n      pasien lebih sering menunduk, kontak mata kurang dan terlihat sedih.\r\n\r\n      Manakah tindakan keperawatan utama yang dilakukan  pada pasien tersebut?', 127, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:50:22', '2021-03-29 04:50:22'),
	(152, 1, 2, 6, 'Seorang wanita berusia 20 tahun datang ke IGD dalam kondisi penurunan kesadaran. Pasien mengalami trauma tumpul di daerah abdomen. Pengantar mengatakan bahwa pasien dipukul perutnya oleh suaminya menggunakan tabung gas. Hasil pengkajian fisik TTV TD: 100/70 mmHg, frekuensi Nadi :102 x/menit, frekuensi nafas : 26x/menit, Suhu 37,5 C. \r\nManakah data objektif berikutnya yang harus ditemukan oleh perawat ?', 128, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:51:03', '2021-03-29 04:51:03'),
	(153, 1, 2, 5, 'Seorang laki laki ysia 78 tahu tinggal di panti wredha, sering mengeluh pusing dan terasa berat di leher bagiann belakang, sering terbangun pada malam hari dan keluar utuk menonton TV.  Saat dilakukan pengakjian didapatka Td 170/100, perawat menemukan garam dan kecap di kamar klien, kemudian mengambil garam dan kecap agar tidak dikomsumsi berlebih oleh klien.\r\nApa prinsip etik yang diterapkan perawat pada kasus tersebut?\r\n', 129, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:52:03', '2021-03-29 04:52:03'),
	(154, 1, 2, 5, 'Seorang  laki-laki usia 67 tahun  mengalami diare. Hasil pengkajian diperoleh data: BAB Cair ? 4 kali perhari, kulit dan membran mukosa kering, TD 100/70mmHg, T = 380 C, klien mengeluh perut melilit, lemas dan tidak mampu berjalan sendiri ke kamar mandi.\r\nApakah masalah keperawatan  yang paling tepat pada kasus tersebut?\r\n', 130, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:53:47', '2021-03-29 04:53:47'),
	(155, 1, 2, 6, 'Seorang laki-laki berusia 30 tahun, datang ke IGD mengalami pendarahan saluran cerna. Hasil pengkajian : Agama Islam, riwayat penyakit keganasan di sangkal, alergi obat disangkal. Tekanan darah 90/70mmHg. Klien akan dilakukan transfusi darah. Tetapi pasien menolak karena hal ini bertentangan dengan prinsif yang dianutnya.\r\nPrinsip etik apakah yang  terjadi pada kasus tersebut ?', 131, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:54:20', '2021-03-29 04:54:20'),
	(156, 1, 2, 8, '14. Seorang perempuan berusia 35 tahun, dibawa keluarganya ke UGD RSJ dengan keluhan merasa dirinya tidak berguna, tidak memiliki kemampuan, \r\n      serta merasa dirinya bodoh. Saat dikaji pasien sering menundukkan kepala, kontak mata kurang dan terlihat sedih. Pasien memiliki riwayat tidak \r\n      lulus ujian masuk perguruan tinggi.\r\n\r\n      Apa masalah utama yang tepat pada kasus tersebut?', 132, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:55:13', '2021-03-29 04:55:13'),
	(157, 1, 2, 5, 'Perempuan  72 tahun tinggal di panti wredha semenjak dua bulan yang lalu.  Hasil pengkajian didapatkan klien memiliki 2 anak yang ada di luar kota dan tidak pernah menjenguknya selam berada di panti wredha dan mengatakan bahwa ia merasa dibuang oleh anak-anaknya. Klien mengatakan merasa ketakutan jika meninggal tidak sempat bertemu lagi dengan anak-anaknya. Hasil observasi menunjukkan bahwa klien tampak menarik diri dan tidak mengikuti kegiatan di panti.\r\nApakah prioritas pengkajian keperawatan pada kasus tersebut?\r\n', 133, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:55:44', '2021-03-29 04:55:44'),
	(158, 1, 2, 6, 'Seorang klien laki-laki berusia 45 tahun di bawa ke IGD oleh keluarganya. Hasil pengkajian klien mengalami perdarahan di daerah kepala, trauma thoraks dan luka lebam di daerah abdomen. Tekanan Darah: 100/70 mmHg, Frekuensi Nadi: 130x/menit, Suhu 37 C, frekuensi nafas : 33x/menit, terdengar ronkhi.\r\nManakah prioritas kriteria yang paling tepat pada kasus tersebut?', 134, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:57:09', '2021-03-29 04:57:09'),
	(159, 1, 2, 5, 'Perempuan usis 74 tahun tinggal di panti wredha. Klien jatuh di kamar mandi 2 hari yang lalu, dan mengeluh sakit pada bagian bokong dan kaki sehingga menggunakan tongkat untuk berjalan. klien mengatakan bahwa ia  jatuh pertama kalinya, kejadian jatuh ini terjadi ketika ia tergesa-gesa.\r\nApakah intervensi tindakan keperawatan pada kasus tersebut?', 135, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:57:37', '2021-03-29 04:57:37'),
	(160, 1, 2, 6, 'Pada saat anda di perjalanan tiba- tiba ada pengendara sepeda motor yang tabrakan, kemudian anda keluar dan berusaha untuk menyelamatkan klien tabrakan tersebut. Dari hasil pengkajian diperoleh data nadi teraba, tidak ada gerakan dada dan aliran udara pernapasan klien gawat darurat. \r\nDari kasus diatas apakah tindakan selanjutnya yang harus anda lakukan?', 136, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:58:58', '2021-03-29 04:58:58'),
	(161, 1, 2, 5, 'Perempuan usia 68 tahun tinggal di panti wredha selama 2 minggu, mengeluh lemas, pusing sering terbangun pada malam hari dan sulit kembali untuk tidur  Hasil pengkajian menunjukan: TD 130/90 mmHg, RR: 23x/mnt; Suhu: 37o C. Pada saat dilakukan wawancara klien tampak sering menguap.\r\nApakah masalah keperawatan pada kasus tersebut?', 137, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 04:59:22', '2021-03-29 04:59:22'),
	(162, 1, 2, 5, 'Laki-laki berusia 67 tahun, tinggal di panti wredha.  Saat dilakukan wawancara, perawat harus meningkatkan volume suara pada saat bertanya. Klien mengatakan bahwa tiga hari yang lalu ia jatuh saat akan mengambil makan karena licin. perawat memberikan tongkat untuk membantu klien berjalan, tapi ia jarang menggunakannya. Saat dilakukan pemeriksaan fisik tampak luka memar pada pergelangan kaki kanan klien. \r\nApakah prioritas pengkajian pada kasus tersebut?', 138, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:01:05', '2021-03-29 05:01:05'),
	(163, 1, 2, 6, 'Seorang pasien dengan kasus sirosis hepatis, pada saat dilakukan pengkajian klien mengatakan merasa sangat gerah, haus,dan nyeri pada bagian luka operasi dan pinggang belakang. Menurut klien nyeri pada daerah pinggul diakibatkan oleh bekas anestesi yang dilakukan sebelum operasi dan rasanya sangat sakit sekali sehingga klien minta perawat untuk menjelasan terkaitnyeri post anestesi yang dialaminya.\r\nDari kasus diatas peran perawat apakah yang sedang dijalankan oleh perawat saat ini?', 139, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:02:29', '2021-03-29 05:02:29'),
	(164, 1, 2, 5, 'Perempuan usia 69 tahun, memiliki riwayat stroke hemoragik semenjak 3 tahun yang lalu. Hasil pengkajian perawat didapat data Kekuatan otot kaki kanan 3, tangan kanan 3, kaki kiri 5 tangan kiri 5. Klien mengatakan bahwa ia masih bisa berjalan perlahan dengan menggunakan tongkat. Perawat bertujuan meningkatkan flesibilitas pada sendi klien.\r\nApakah intervensi keperawatan pada kasus tersebut?', 140, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:03:07', '2021-03-29 05:03:07'),
	(165, 1, 2, 8, '15. Seorang pasien perempuan, berusia 35 tahun, dirawat di ruang tenang RSJ, 1 minggu yang lalu melakuknan upaya bunh diri denag menggantung \r\n      diri.  Ia mengatakan, “ Pacar saya meninggalkan saya. Saya perempuan yang gagal, tidak punya pekerjaan yang baik, jelek dan miskin”. Semua yang \r\n      diungkapkan pasien berfokus pada kekurangan diri sendiri akibat pemikiran negatif terhadap diri sendiri.\r\n\r\n      Apa yang menyebabkan pasien memiliki pandangan negatif terhadap dirinya?', 141, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:03:53', '2021-03-29 05:03:53'),
	(166, 1, 2, 5, 'Seorang laki-laki berusia 67 tahun tinggal di panti wredha dengan keluhan ekstremitas atas dan bawah tidak dapat digerakkan secara aktif, kulit disekitar area penonjolan tulang tampak kemerahan, klien tampak lemas. Tanda vital Tekanan Darah 150/90 mmHg, Nadi 88 x/menit, Suhu 37,7°C, pernafasan 20x/menit.\r\nApakah implementasi yang tepat dilakuakan perawat pada kasus tersebut?\r\n', 142, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:05:03', '2021-03-29 05:05:03'),
	(167, 1, 2, 6, 'Seorang laki-laki berusia 40 tahun datang ke IGD dengan penurunan kesadaran, riwayat terjebak dalam ruangan tertutup, sputum tercampur arang, terdapat luka bakar di sekitar hidung, bibir dan mulut. Napas 28 kali permenit. \r\nMasalah apa yang dialami pasien tersebut?', 143, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:11:24', '2021-03-29 05:11:24'),
	(168, 1, 2, 8, '16. Seorang laki-laki berusia 26 tahun dibawa ke UGD RSJ. Pasien berbicara kasar dan menendang benda-benda yang berada di sekitarnya. Menurut \r\n      keluarga, pasien dibawa ke RSJ karena telah memecahkan kaca tetangga dan marah-marah tanpa sebab. Perawat telah mengidentifikasi penyebab \r\n      dan tanda gejala marah.\r\n\r\n      Apakah tindakan utama pada pasien tersebut?', 144, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:11:30', '2021-03-29 05:11:30'),
	(169, 1, 2, 5, 'Perempuan usia 69 tahun, yang tinggal di panti wredha mengeluhkan   nyeri terjadi di sendi lutut hasil penkajian sendi lutut dan ibu jari bengkak dan kemerahan,  Ekspresi wajah meringis saat sendi digerakkan. Skala nyeri 4. Tekanan darah 140/90 mmHg, Nadi 82 kali/mnt, pernapasan 18 kali/menit.\r\nApakah implementasi keperawatan pada kasus tersebut?\r\n', 145, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:12:17', '2021-03-29 05:12:17'),
	(170, 1, 2, 5, 'Laki-laki usia 61 tahun dirawat di ruang geriatrik mengeluh lemas, terdapat  dikaki sebelah kanan sejak 2 bulan yang lalu, luka tampak hitam dan ada pus. Gula darah; 300 mg/dl, leukosit ;12.000.\r\nApakah intervensi keperawatan pada kasus tersebut?\r\n', 146, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:13:58', '2021-03-29 05:13:58'),
	(171, 1, 2, 6, 'Seorang  laki-laki berusia 50 tahun  dibawa  ke IGD akibat penurunan  kesadaran. Perawat melakukan pemeriksaan fisik ditemukan pernafasan tampak kusmaull, bau aseton (+). Pemeriksaan Gula Darah Sewaktu : 442 mg/dL, pemeriksaan ketonurin (+++).  Pasien dianjurkan diawat di ruang ICU. Keluarga pasien menolak dan meminta tetap dirawat di ruang biasa.\r\nMasalah etik apa yang terjadi pada kasus diatas?', 147, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:14:12', '2021-03-29 05:14:12'),
	(172, 1, 2, 8, '17. Seorang perempuan berusia 28 tahun dibawa ke RSJ oleh keluarga. Saat pengkajian, pasien mengatakan melihat bayangan hitam besar yang selalu \r\n      mengejar dirinya, mengeluarkan kata-kata kasar dan meminta bayangan hitam itu untuk pergi. Keluarga mengatakan pasien sering terlihat berbicara \r\n      sendiri, tampak melakukan gerakan memukul-mukul dan mengusir. Padahal tidak terlihat ada orang lain yang mengganggu pasien. Perawat telah \r\n      mengajarkan cara menghardik halusinasi.\r\n\r\n      Apakah tindakan keperawatan utama pada pasien tersebut?', 148, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:15:25', '2021-03-29 05:15:25'),
	(173, 1, 2, 6, 'Seorang laki-laki berusia 57 tahun dibawa ke IGD akibat mengalami sesak nafas berat. Pasien adalah pasien gagal ginjal kronik yang tidak menjalani hemodialisis secara teratur. Hasil pemeriksaan fisik suara nafas ronchi pada lapang paru kiri dan kanan, oedema ekstrimitas positif. Selanjutnya pasien dilakukan hemodialisis.\r\nApakah evaluasi tindakan keperawatan pada klien tersebut?', 149, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:16:01', '2021-03-29 05:16:01'),
	(174, 1, 2, 6, 'Seorang ibu membawa anaknya berusia 1,5 tahun ke IGD karena diare sudah dua hari. Hari ini BAB cair sudah 8 kali. Hasil pengkajian didapatkan anak tampak lemah, mata cekung, mukosa bibir kering, turgor jelek dan agak rewel. BB : 12 kg. \r\nBerapakah kebutuhan cairan anak tersebut?', 150, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:17:47', '2021-03-29 05:17:47'),
	(175, 1, 2, 8, '18. Seorang pasien laki-laki, berusia 25 tahun, dirawat di ruang tenang RSJ, 1 minggu yang lalu mencoba menggantung diri.  Ia mengatakan, “ Pacar \r\n      saya meninggalkan saya. Saya pemuda yang gagal, tidak punya pekerjaan yang baik, jelek dan miskin”. Semua yang diungkapkan pasien berfokus \r\n      pada kekurangan diri sendiri akibat pemikiran negatif terhadap diri sendiri. Perawat telah mengidentifikasi aspek positif yang masih dimiliki pasien.\r\n\r\n      Apa tindakan utama yang dilakukan berikutnya?', 151, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:19:43', '2021-03-29 05:19:43'),
	(176, 1, 2, 6, 'Seorang pasien laki-laki berusia 20 tahun, korban perkelahian di sekolah, diantar ke unit gawat darurat dengan luka tusuk di abdomen. Pasien mengerang kesakitan, perdarahan masiv di sekitar pisau yang menancap. Pasien direncanakan akan segera dilakukan pembedahan. \r\nApakah tindakan yang harus dilakukan?', 152, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:22:45', '2021-03-29 05:22:45'),
	(177, 1, 2, 8, '19. Seorang laki-laki berusia 25 tahun datang ke UGD RSJ dengan keluhan selalu merasa sepi, tidak aman, bosan, ketidakmampuan berkonsentrasi, dan \r\n      perasaan ditolak. Saat dikaji, pasien terlihat banyak diam, tidak mau bicara, menyendiri, tidak mau berinteraksi, tampak sedih, afek datar dan  kontak \r\n      mata kurang.\r\n\r\n      Apa masalah keperawatan utama yang tepat pada kasus tersebut?', 153, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:23:26', '2021-03-29 05:23:26'),
	(178, 1, 2, 6, 'Seorang laki-laki usia 55 tahun dibawa ke ruang ugd pada waktu tengah malam, mengalami kecelakaan, terjadi obstruksi jalan napas dan membutuhkan tindakan intubasi segera namun pada saat itu tidak ada dokter yang sedang berjaga. Perawat mengalami dilema etik.\r\nPrinsip etik yang tepat untuk kasus ini adalah', 154, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:24:21', '2021-03-29 05:24:21'),
	(179, 1, 2, 6, 'Seorang perempuan berusia 38 tahun terserempet mobil ketika sedang mengendarai motor,  dibawa ke ruang unit gawat darurat, hasil pemeriksaan terdapat luka di bagian leher dan di dahi pasien, darah keluar dari hidung, telinga dan mulut.\r\nTindakan yang pertama kali harus dilakukan adalah', 155, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:25:50', '2021-03-29 05:25:50'),
	(180, 1, 2, 8, '20. Seorang perempuan berusia 35 tahun datang ke UGD RSJ dengan keluhan selalu merasa sepi, tidak aman, mudah bosan, ketidakmampuan \r\n      berkonsentrasi, dan perasaan ditolak. Hasil pengkajian, pasien terlihat banyak diam, tidak mau bicara, menyendiri, tidak mau berinteraksi, tampak \r\n      sedih, afek datar dan  kontak mata kurang. Perawat sudah membina hubungan saling percaya, membantu mengajarkan cara berkenalan.\r\n\r\n      Apa tindakan keperawatan utama berikutnya pada kasus tersebut?', 156, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:26:52', '2021-03-29 05:26:52'),
	(181, 1, 2, 6, 'Seorang laki-laki berusia 55 tahun datang ke unit gawat darurat diantar keluarganya, pada saat datang darah terlihat mengucur deras dari luka. Pasien mengalami perdarahan akibat bacokan benda tajam di kepala, Tanda-tanda vital terpantau tekanan darah 100/70 mm Hg, Nadi 99x/menit dan respirasi 26 x/menit.\r\nMasalah keperawatan utama pada kasus tersebut adalah', 157, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:27:31', '2021-03-29 05:27:31'),
	(182, 1, 2, 6, 'Seorang laki-laki berusia 58 tahun datang ke ugd karena mengalami nyeri dada setelah bermain batminton. Tekanan darah 150/100mmHg, nadi 98x/menit, pernapasan 30x permenit. \r\nApakah tindakan yang harus dilakukan pertama kali oleh perawat?', 158, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:29:18', '2021-03-29 05:29:18'),
	(183, 1, 2, 6, 'Seorang perempuan usia 17 tahun dibawa ke ugd oleh temannya, tidak sadarkan diri setelah diserempet mobil ketika sedang berjalan. Terdengar suara ngorok, darah keluar dari hidung, lecet pada bagian kepala dan wajah, perdarahan juga terdapat pada kaki dan lengan. \r\nTindakan yang pertama kali dilakukan adalah', 159, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:31:09', '2021-03-29 05:31:09'),
	(184, 1, 2, 8, '21. Seorang laki-laki usia 27 tahun, dibawa di UGD dengan marah marah dan mau melukai dirinya sendiri, pasien menatap tajam, berusaha mencari \r\n      benda tajam disekelilingnya, pasien datang dengan kondisi tangan dan kaki terikat. Perawat akan melakukan pengkajian.\r\n\r\n      Apakah prinsip etik yang tepat pada kasus tersebut?', 160, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:32:29', '2021-03-29 05:32:29'),
	(185, 1, 2, 6, 'Tn. X umur 40 th, dibawa ke UGD dengan luka terbuka di kaki bagian bawah, dengan tepi jaringan kulit yang tidak beraturan. Klien dibawa ke UGD karena terserempet sepeda motor ketika sedang menyeberang 4 jam yang lalu. Luka terlihat mengeluarkan darah dan klien meringis kesakitan ketika kakinya digerakkan. Daerah sekitar luka terlihat bengkak. Tanda-tanda vital : Nadi 55 X/menit, Respirasi  14 X/menit dan tekanan darah 110/80 mmHg. Kulit klien dingin dan lembab.\r\nBila dilihat bentuknya, luka klien termasuk ....\r\n\r\n', 161, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:33:40', '2021-03-29 05:33:40'),
	(186, 1, 2, 6, 'Seorang pasien datang ke UGD dengan luka bakar. Menurut keluarganya pasien tersiram air panas. Terdapat kulit yang melepuh di kaki kiri, tangan kiri dan badan depan, basah dan berwarna kemerahan, pasien mengatakan nyeri.\r\nBerdasarkan presentase luas luka bakar (rule of nine), berapa persen luka bakarnya ?', 162, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:35:24', '2021-03-29 05:35:24'),
	(187, 1, 2, 8, 'Seorang perempuan usia 32 tahun dirawat di RSJ karena marah-marah dan bicara sendiri. Hasil pengkajian kontak mata tidak ada, menggeleng  kepala saat ditanya dan tidak mau berinteraksi, penampilan pasien tidak rapih. Pasein sudah diajarkan cara mengontrol marah, mengontrol  halusinasi, cara berkenalan dan merawat diri. Apakah evaluasi tindakan yang tepat pada kasus tersebut?', 403, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:36:11', '2021-04-08 01:29:14'),
	(188, 1, 2, 6, 'Seorang pasien datang ke UGD dengan luka bakar. Menurut keluarganya pasien tersiram minyak panas. Terdapat kulit yang melepuh di kaki kiri, tangan kiri dan badan depan, basah dan berwarna kemerahan. Setelah perawat mengkaji, terdapat jaringan epidermis dan sedikit dermis terkena.  Pasien mengatakan nyeri.\r\nBerdasarkan derajat luka bakar, pasien tersebut termasuk mengalami derajat luka bakar yang mana?', 164, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:37:26', '2021-03-29 05:37:26'),
	(189, 1, 2, 6, 'Seorang pasien datang ke UGD dengan luka bakar. Menurut keluarganya pasien tersengat listrik. Seluruh kulit menghitam, Terdapat kulit terkelupas, avascular, pucat, pasien mengatakan sedikit nyeri. Setelah perawat mengkaji, terdapat jaringan epidermis, dermis dan subkutan terkena.\r\nBerdasarkan derajat luka bakar, pasien tersebut termasuk mengalami derajat luka bakar yang mana?', 165, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:39:07', '2021-03-29 05:39:07'),
	(190, 1, 2, 6, 'Seorang pasien datang ke UGD dengan luka bakar. Menurut keluarganya ketika sedang bekerja di pabrik, pasien tersiram asam kuat. Luka mengenai badan depan. Terdapat kulit terkelupas, avascular, pucat, pasien mengatakan sedikit nyeri. Setelah perawat mengkaji, terdapat jaringan epidermis dan sedikit dermis terkena. \r\nBerdasarkan presentase luas luka bakar (rule of nine), berapa persen luka bakarnya ?', 166, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:41:05', '2021-03-29 05:41:05'),
	(191, 1, 2, 6, 'Ny. X dibawa ke IGD rumah sakit dengan keluhan sesak nafas. Pada saat dilakukan pemeriksaan fisik didapatkan pernafasan cepat dan dangkal, BB = 50 kg TB= 150 cm, TTV = RR = 30 x/menit, Nadi =90 x/menit\r\nMetode pemberian oksigen yang tepat untuk kasus diatas adalah..', 167, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:43:04', '2021-03-29 05:43:04'),
	(192, 1, 2, 8, 'Seorang laki-laki usia 50 tahun di rawat di RSJ karena suka bicara sendiri dan menganggap dirinya sebagai ulama besar. Hasil pengkajian klien menolak untuk berbicara dengan orang lain, badannya tercium bau, pakaian tidak rapih dan rambutnya berminyak dan berketombe. Pasien mengatakan ini adalah penampilan seorang ulama yang sebenarnya.\r\n\r\nApakah tujuan tindakan keperawatan pada kasus tersebut', 168, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:43:56', '2021-03-29 05:43:56'),
	(193, 1, 2, 6, 'Tn A umur 50 tahun masuk ke IGD dengan keluhan Sesak nafas sudah 2 minggu yang lalu sesak bertambah jika melakukan aktifitas. Pasien sebelumnya pernah didiagnosa TB Paru aktif dan minum obat tapi tidak teratur. Hasil pemeriksaan fisik didapatkan BB 50 kg, TB 165 Cm, TD 100/60 mmHg, RR 35x/menit Temperatur 37,5°C,  pengembangan dada a simetris, taktil premitus suara pada paru kanan lebih keras. Hasil laboratorium Hb 7,5 gr% Leuco 15000.000/mm2, AGD : PH 7,25 PO2 90 PCO2 49 HCO3 Normal. Diagnose medis efusi pleura.\r\nIntervensi keperawatan kolaboratif untuk mengatasi diagnose utama adalah…', 169, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:44:54', '2021-03-29 05:44:54'),
	(194, 1, 2, 6, 'Tn A umur 50 tahun masuk ke IGD dengan keluhan Sesak nafas sudah 2 minggu yang lalu sesak bertambah jika melakukan aktifitas. Pasien sebelumnya pernah didiagnosa TB Paru aktif dan minum obat tapi tidak teratur. Hasil pemeriksaan fisik didapatkan BB 50 kg, TB 165 Cm, TD 100/60 mmHg, RR 35x/menit Temperatur 37,5°C,  pengembangan dada a simetris, taktil premitus suara pada paru kanan lebih keras. Hasil laboratorium Hb 7,5 gr% Leuco 15000.000/mm2, AGD : PH 7,25 PO2 90 PCO2 49 HCO3 Normal. Diagnose medis efusi pleura.\r\nIntervensi keperawatan mandiri untuk mengatasi diagnose keperawatan utama adalah..', 170, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:46:32', '2021-03-29 05:46:32'),
	(195, 1, 2, 8, 'Seorang perempuan berusia 20 tahun, dirawat di RSJ dengan keluhan tidak keluar kamar dan mogok makan selama 1 minggu, keluarga mengatakan klien pernah dirawat sebelumnya karena mencoba memotong urat nadi ditangannya. Pada saat dikaji klien tampak menunduk, kontak mata kurang, klien mengatakan saya merasa sudah tidak ada artinya suster, saya sudah kotor tidak berharga lagi, klien tampak kotor dengan rambut acak-acakan, dan sesekali suka menangis tampa sebab\r\n\r\nApakah diagnosa keperawatan utama untuk kasus diatas?', 171, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:46:45', '2021-03-29 05:46:45'),
	(196, 1, 2, 6, 'Seorang laki-laki berusia 40 tahun diantar ke IGD dengan keluhan sesak nafas sejak 2 hari. Hasil Pemeriksaan didapatkan data klien tampak sesak, sianosis, nafas cepat dan dangkal, nafas cuping hidung, pada auskultasi paru terdengar bunyi ronchi, Tekanan darah 100/70, Nadi 100kali permenit, Suhu 37,9oC, Pernafasan 30 kali permenit.\r\nApakah masalah keperawatan prioritas pada kasus tersebut ....', 172, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:48:29', '2021-03-29 05:48:29'),
	(197, 1, 2, 6, 'Seorang laki-laki berusia 56 tahun datang ke IGD dengan keluhan sesak nafas. Sesak nafas masih dirasakan pasien walaupun pasien dalam posisi tidur. Frekuensi nafas 30 kali permenit.\r\nApakah masalah keperawatan prioritas pada kasus tersebut ....', 173, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:50:01', '2021-03-29 05:50:01'),
	(198, 1, 2, 8, 'Seorang perempuan berusia 28 tahun, dibawa ke poli rawat jalan RSJ dengan keluhan sering menangis dan tertawa sendiri, menurut keluarga seminggu yang lalu pasien tiba-tiba marah-marah tampa sebab dan mengatakan semua orang disini tidak berguna akan kubunuh saja semuanya, tidak ada seorangpun yang bisa menghargai aku.. Keluarga menyatakan pasien juga tidak mau keluar rumah dan menolak untuk mandi.\r\n\r\nApakah intervensi keperawatan pada kasus diatas ?', 174, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:51:18', '2021-03-29 05:51:18'),
	(199, 1, 2, 8, 'Seorang perawat melakukan home visit pada keluarga pasien post rawat 6 hari. Pada saat dikaji pasien sudah dapat berinteraksi tetapi kontak mata masih kurang, pasien juga mengatakan masih malu untuk keluar rumah takut diejek oleh tetangganya, rambut kurang rapih. Keluarga mengatakan pasien sudah membaik karena tidak ngamuk lagi, tidak suka berbicara dan tertawa sendiri.\r\n\r\nApakah Diagnosa keperawatan pada kasus diatas ?', 175, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:55:28', '2021-03-29 05:55:28'),
	(200, 1, 2, 8, 'Seorang laki-laki usia 45tahun, dibawa ke RSJ dengan keluhan mengamuk dan menyerang orang lain. Pada saat dikaji, pasien tampak menyendiri tidak mau berinteraksi dengan orang lain, menyendiri dipojok, dan menunduk. Menurut keluarga dirumah pasien tidak mau mandi, sering berbicara sendiri  dan menangis tampa sebab.\r\n\r\nApakah tindakan keperawatan pada kasus diatas ?', 176, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 05:58:47', '2021-03-29 05:58:47'),
	(201, 1, 2, 8, 'Seorang Perempuan berusia 32 tahun baru 3 hari masuk RSJ , dan  tengah mendapat perawatan, pada saat dikaji klien tampak rambut acak-acakan, tidak mau makan, bila makan berantakan, BAB dan BAK sembarangan, badan bau, pakaian kotor, rambut dan kulit kotor,  gigi kotor disertai mulut bau, penampilan tidak rapi.\r\n\r\nApakah yang harus dievaluasi pada kasus diatas?', 177, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 06:02:24', '2021-03-29 06:02:24'),
	(202, 1, 2, 8, 'Seorang laki-laki usia 25tahun dirawat di RSJ. Pada saat dikaji tatapan mata klien tampak tajam, tangan mengepal dan ketika menjawab selalu dengan nada suara tinggi. Perawat mengajarakan kepada klien tehnik nafas dalam untuk mengurangi kemarahannya.\r\n\r\nPenanganan marah jenis apakah pada kasus diatas?', 178, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 06:28:06', '2021-03-29 06:28:06'),
	(203, 1, 2, 8, 'Perempuan berusia 35 tahun, dibawa ke rumah sakit jiwa karena marah dan berteriak-teriak. Ketika ditanya klien mengatakan bahwa dirinya adalah seorang artis terkenal, sehingga orang tidak boleh sembarangan bicara dengannya. Tiga tahun yang lalu klien pernah dirawat dengan keluhan yang sama.\r\n\r\nApakah tujuan asuhan keperawatan pada kasus di atas?', 403, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 06:31:36', '2021-04-07 23:51:31'),
	(204, 1, 2, 8, 'Seorang perempuan usia 39 tahun dirawat di ruang akut RS jiwa sudah 2 hari. Hasil observasi perawat :   kontak mata tidak ada, selalu menunduk, selalu diam hanya dan tak mampu memulai pembicaraan. pasien hanya mengangguk dan menggelengkan kepala.\r\n\r\nApakah tehnik perawat  komunikasi terapeutik yang tepat untuk kasus diatas?', 180, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 06:35:42', '2021-03-29 06:35:42'),
	(205, 1, 2, 8, 'Seorang laki-laki usia 20 tahun di rawat di rumah sakit jiwa menolak  makan dan minum berdekatan dengan teman sekamarnya, selalu tiduran di  tempat tidur dengan posisi janin, badan tercium bau dan rambut lengket dan kotor.\r\n\r\nApakah prioritas intervensi yang dilakukan oleh perawat?', 403, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 06:41:20', '2021-04-08 01:13:55'),
	(206, 1, 2, 8, 'Seoarang laki-laki usia 47 tahun dirawatt di rumah sakit jiwa. Pasien tidak mau keluar kamar karena merasa takut. Hasil pengkajian pasien mengatakan merasa tidak tahu siapa diringa dan dia dimana berada ditengah tengah orang asing.\r\n\r\nApakah hasil pengkajian perawat pada kasus diatas?', 182, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 06:44:44', '2021-03-29 06:44:44'),
	(207, 1, 2, 8, 'Laki-laki dirawat di ruang akut RSJP Jawa Barat. Saat dikaji oleh perawat klien tampak agresif, mondar-mandir dan berteriak-teriak memaki dengan ucapan kasar, kadang mengepalkan tangannya seakan akan ingin memukul. Melihat perilaku klien tersebut perawat memutuskan untuk mengikat/merestrain klien.\r\n\r\nApakah aspek legal etis yang dilakukan oleh perawat?', 183, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 06:47:46', '2021-03-29 06:47:46'),
	(208, 1, 2, 8, 'Laki-laki usia 40 tahun dirawat di rumah sakit jiwa.  Hasil pengkajian  klien tidak mampu mempertahankan kontak mata,  tidak mampu memulai pembicaraan , wajah terlihat sedih, selalu menghindar jika di dekati pasien lain, badan tercium bau pesing, rambut acak-acakan.\r\n\r\nApakah intervensi keperawatan yang dilakukan perawat pada kasus diatas?', 184, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 06:51:05', '2021-03-29 06:51:05'),
	(209, 1, 2, 8, 'Perawat telah mengajarkan cara menghardik untuk mengontrol halusinasi  keapada pasien dengan cara tutup telinga bapak, yakin di dalam hati bahwa suara itu tidak nyata dan mengatakan ” bohong...dengan tekanan sura menghentak untuk memutus halusinasi  pada pertemuan sebelumnya.\r\n\r\nApakah prioritas intervensi keperawatan untuk pertemuan selanjutnya?', 185, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 07:07:46', '2021-03-29 07:07:46'),
	(210, 1, 2, 8, 'Laki- laki usia 35 tahun dirawat di ruang tenang Rs Jiwa menunjukkan respon yang baik  mampu memandang perawat meskinpun belum mempertahankan kontak mata dan sudah mampu menjawab pertanyaan walau dengan jawaban singkat. Klien sudah terlihat mulai mengobrol dengan teman sekamar walau sebentar-sebentar.\r\n\r\nApakah terapi aktivitas yang tepat pada kasus tersebut?', 186, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 07:17:39', '2021-03-29 07:17:39'),
	(211, 1, 2, 8, 'Seorang perempuan usia 19 tahun  di rawat di RS Jiwa, mondar-mandir dan  tekana suara keras dan pandangan masih tajam mata tajam. Hasil pengkajian pasien merasa kesal karena tadi pagi makanannya diambil oleh teman sekamarnya, perawat mengajarkan klien dengan latihan fisik untuk mengontrol rasa marah.\r\n\r\nApakah implemetasi yang perawat lakukan?', 187, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 07:20:52', '2021-03-29 07:20:52'),
	(212, 1, 2, 8, 'Seorang perempuan berusia 22 tahun mengalami tidak mau bergabung dengan teman-teman di ruangan selalu menyendiri, pada saat dikaji penampilan kotor, pasien menggeleng kepala saat ditanya sudah mandi atau belum, rambut kotor dan acak-acakan, badan  bau, kuku kotor dan tercium bau pesing dikamar pasien.\r\n\r\nApakah prioritas intervensi yang perawat lakukan?', 188, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 07:24:02', '2021-03-29 07:24:02'),
	(213, 1, 2, 8, 'Perempuan usia 26 tahun dirawat di rumah sakit,  bayi  pasein meninggal setelah 1 jam dilahirkan pasien  sudah 2 hari tidak mau berinteraksi. Saat dilakukan komunikasi teurapeutik perawat bertanya mengenai kondisi pasien. Pasien  diam dengan afek sedih.\r\n\r\nApakah teknik komunikasi teurapeutik yang tepat dilakukan perawat untuk merespon kasus diatas?', 189, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 07:27:25', '2021-03-29 07:27:25'),
	(214, 1, 2, 8, 'Seorang laki-laki berusia 35 tahun di atar oleh keluarganya ke RS.J dengan keluhan klien sering berbicara sendiri di kamar dan sering memukul-mukul kepalanya dengan tangan, keluhan ini sudah di alami klien lebih dari satu bulan. Tidak di temukan gejala seperti mengurung diri atau depresi pada pasien.\r\n\r\nTanda dan gejala apakah yang di tujukan oleh klien tersebut?', 190, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 07:31:17', '2021-03-29 07:31:17'),
	(215, 1, 2, 8, 'Pra-interaksi merupakan salah satu tahapan awal dalam komunikasi terapeutik yang dilakukan oleh seorang perawat dengan CI/Dosen.\r\n\r\nHal apa sajakah yang perlu di sampaikan pada saat melakukan pra-interaksi?', 191, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 07:36:23', '2021-03-29 07:36:23'),
	(216, 1, 2, 8, 'Seorang remaja perempuan 19 tahun di bawa ke RS.Jiwa karena menurut keluarga nya klien sering merasa tidak berguna dan merasa minder karena merasa berasal dari keluarga tidak mampu dan mengatakan sering di bully oleh teman-temannya di sekolahnya sehingga membuat klien tidak mau berinteraksi dengan orang lain serta tidak mau makan dan membersihkan diri sudah 1 minggu. Klien tampak murung, sedikit berbicara, dan sesekali sering menangis.\r\n\r\nApakah tindakan yang paling tepat saat perawat berinteraksi dengan pasien tersebut?', 192, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 07:41:26', '2021-03-29 07:41:26'),
	(217, 1, 2, 8, 'Seorang pasien laki-laki berusia 27 tahun merasa sangat gelisah saat mengetahui bahwa dirinya akan mendapatkan terapi kejut listrik atau ECT di RS.Jiwa, hal tersebut membuat pasien merasa tidak nyaman dan khawatir. Klien jalan mondar mandir dan berusaha bersembunyi.\r\n\r\nApakah masalah psikososial yang di alami oleh pasien tersebut?', 193, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 07:44:53', '2021-03-29 07:44:53'),
	(218, 1, 2, 8, 'Perawat yang sedang berinteraksi dengan pasien perilaku kekerasan, pasien tampak bergitu bersemangat saat berinteraksi dan sering gelisah, saat duduk badan nya sering condong ke depan dan terkadang pasien diam sejenak dengan tatapan yang tajam.\r\n\r\nTingkah laku seperti apakah yang harus di waspadai oleh seorang perawat saat menghadapi pasien dengan perlaku kekerasan?', 194, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 07:48:32', '2021-03-29 07:48:32'),
	(219, 1, 2, 8, 'Seorang perempuan 26 tahun salah satu warga di desa Sejahtera di laporkan oleh warga sedang mengamuk di rumahnya dan mengancam akan bunuh diri karena di keinginanya menjadi seorang artis tidak tercapai. Klien tampak berlarian di sekitar rumahnya.\r\n\r\nApakah tindakan pertama dalam menangani pasien diatas?', 195, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 07:54:14', '2021-03-29 07:54:14'),
	(220, 1, 2, 8, 'Seorang perawat berusaha membuat pasiennya merasa lebih di hargai dengan memberikan pujian kepada pasien, serta tidak memberikan penilain secara sepihak.\r\n\r\nManakah tindakan yang paling tepat saat berinteraksi dengan pasien dengan masalah harga diri rendah?', 196, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 07:58:13', '2021-03-29 07:58:13'),
	(221, 1, 2, 8, 'Keluarga sebagai salah satu grup atau kelompok yang dapat memberikan dukungan selama proses pengobatan pada klien dengan gangguan jiwa terutama saat klien sudah kembali kerumah.\r\n\r\nKegiatan atau terapi apakah yang yang dapat di lakukan di rumah oleh keluarga?', 197, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 08:02:02', '2021-03-29 08:02:02'),
	(222, 1, 2, 8, 'Seorang perempuan berusia 25 tahun, masuk ke RS.Jiwa dengan keluhan klien sering mengurung diri di kamar, dan tidak mau makan dan mandi kurang lebih 5hr. setelah di rawat kurang lebih 2 minggu,  saat ini klien di perbolehkan pulang ke rumah.\r\n\r\nDukungan lingkungan seperti apakah yang dapat di terapkan untuk pasien tersebut ketika di rumah ?', 198, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 08:06:23', '2021-03-29 08:06:23'),
	(223, 1, 2, 8, 'Seorang perempuan 37 tahun sedang mengalami fase 1 (acute) pada schizophrenia yang di deritanya, klien menunjukan prilaku yang agresif seperti halusinasi sampai dengan melakukan perilaku kekerasan kepada orang di sekitarnya.\r\n\r\nApakah tujuan keperawatan untuk fase ini ?', 199, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 08:11:37', '2021-03-29 08:11:37'),
	(224, 1, 2, 2, 'Seorang balita umur 14 Bulan dirawat di RS dengan keluhan demam sejak 3 hari yang lalu, tidak mau makan serta selalu menangis ketika BAK. Dari hasil pemeriksaan didapatkan data BB 9 Kg, suhu 400C, Leukosit 20.000 mm3, hasil kultur urin terdapat bakteri. Dokter mendiagnosis pasien mengalami infeksi saluran kemih. \r\nPertanyaan Soal : Apakah evaluasi yang dilakukan perawat pada kasus tersebut?\r\n', 201, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 11:17:32', '2021-03-29 11:18:10'),
	(225, 1, 2, 2, 'Seorang bayi umur 2 bulan di poli. Pada saat Buang Air Kecil tidak memancar dan selalu menangis, Didiagnosa hipospadia dan harus dilakukan operasi chordektomi. Ibu balita tampak cemas dan selalu bertanya kepada perawat.\r\nPertanyaan Soal : Apakah etiologi oleh perawat jika hendak mengangkat diagnosa cemas pada kasus di atas? ', 201, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 11:17:35', '2021-03-29 11:20:09'),
	(226, 1, 2, 2, 'Seorang bayi berusia 9 bulan di poliklinik tumbang puskesmas. Perawat A sedang melakukan pengkajian perkembangan pasien menggunakan KPSP, didapatkan hasil bahwa bayi dapat makan kue kering sendiri. \r\nPertanyaan Soal : Perkembangan apakah yang dapat dikaji dari bayi tersebut?', 202, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 11:21:11', '2021-03-29 11:21:11'),
	(227, 1, 2, 2, 'Seorang anak berusia 3 Tahun di poliklinik tumbang puskesmas. Perawat A sedang melakukan pengkajian perkembangan pasien menggunakan KPSP, didapatkan hasil anak dapat mencorat coret kertas tanpa bantuan.  \r\nPertanyaan Soal : Perkembangan apakah yang dapat dikaji dari bayi tersebut?', 203, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 11:22:07', '2021-03-29 11:22:07'),
	(228, 1, 2, 2, 'Seorang anak perempuan berusia 2 Tahun di bawa ibunya ke poliklinik pertumbuhan dan perkembangan (Tumbang) di Puskesmas. Ketika perawat mengkaji dengan menggunakan KPSP didapatkan hasil jumlah jawaban ya sebanyak 7.\r\nPertanyaan Soal : Apakah intervensi yang bisa dilakukan perawat untuk pasien tersebut?', 204, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 11:23:13', '2021-03-29 11:23:13'),
	(229, 1, 2, 2, 'Seorang anak laki-laki berusia 5 Tahun di rawat dengan diagnosa medis sindrom nefrotik. Dari hasil pengkajian didapatkan pasien tampak lemah dan pucat, moon face, edema di ekstremitas, hipoalbuminemia, kulit kering dan mudah lelah ketika beraktifitas.  \r\nPertanyaan Soal : Apakah masalah keperawatan prioritas pada pasien tersebut?\r\n', 205, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 11:27:10', '2021-03-29 11:27:10'),
	(230, 1, 2, 2, 'Seorang anak perempuan berusia 10 tahun dirawat dengan Dengue Hemoragic Fever. Pemeriksaan fisik klien mengatakan nyeri pada ulu hati saat dilakukan pemeriksaan palpasi pada abdomen, skala nyeri pasien 8, pasien mengatakan susah tidur karena nyeri, pemeriksaan laboratorium di dapatkan penurunan trombosit 69 (10^3/uL). dan hematocrit 38,7%\r\nPertanyaan Soal : Apakah diagnosa keperawatan utama pada kasus tersebut? ', 206, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 11:30:48', '2021-03-29 11:30:48'),
	(231, 1, 2, 2, 'Seorang anak perempuan berusia 10 Tahun di rawat dengan Broncopnemonia. Pasien sulit makan, dan terdapat bunyi nafas ronkhi. Respirasi 28 x/menit, denyut nadi 110 x/menit, suhu 37,20 BB 32 Kg. TB: 136 cm.\r\nPertanyaan Soal : Apakah implementasi keperawatan mandiri prioritas pada pasien tersebut?', 207, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 11:32:42', '2021-03-29 11:32:42'),
	(232, 1, 2, 2, 'Seorang anak perempuan berusia 5 Tahun di rawat dengan Tubercolosis. pasien dengan riwayat demam tinggi, sulit makan dan sesekali muntah dahak, dan terdapat bunyi nafas ronkhi. Respirasi 25 x/menit, denyut nadi 100 x/menit, suhu 36,50, terdapat sputum, BB 16 Kg. TB: 86 cm.\r\nPertanyaan Soal : Apakah masalah keperawatan prioritas pada pasien tersebut?', 208, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 11:39:12', '2021-03-29 11:39:12'),
	(233, 1, 2, 2, 'Seorang anak laki-laki berusia 9 bulan dirawat dengan diagnosis medis Bronkopnemonia hari ke 7. Pasien terlihat rewel dan selalu menangis ketika dokter atau perawat datang sehingga tidak kooperatif ketika diberikan tindakan medis.\r\nPertanyaan Soal : Apakah implementasi keperawatan yang tepat pada kasus tersebut? ', 209, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 11:40:26', '2021-03-29 11:40:26'),
	(234, 1, 2, 2, 'Seorang bayi usia 3 hari dengan riwayat parus SC, kehamilan 37 minggu, BB lahir 250gram, RR 72Xmenit. Apakah data pengkajian yang harus dilakukan pada bayi tersebut', 210, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 11:41:17', '2021-03-29 11:41:17'),
	(235, 1, 2, 2, 'Seorang bayi usia 3 hari dengan riwayat parus SC, kehamilan 37 minggu, BB lahir 250gram, RR 72Xmenit. PCH  retraksi dada. Apakah tindakan perawatan yang harus dilakukan', 211, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 11:42:14', '2021-03-29 11:42:14'),
	(236, 1, 2, 2, 'Bayi A DIRAWAT DI Ruang perinatology setelah dikaji BB 2000 grammasa gestan 32 minggu. Bayi kurang aktif. Bagaimana pengkajian yang harus dilakukan oleh perawat', 212, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 11:43:17', '2021-03-29 11:43:17'),
	(237, 1, 2, 2, 'Bayi A dengan gestasi 32 minggu, BB 2000 GRAM, bayi kurang aktif dan suhu badan 36,1 Celcius. Apakah masalah keperawatan yang muncul', 218, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 11:48:11', '2021-03-29 12:03:33'),
	(238, 1, 2, 2, 'Bayi A dengan gestasi 32 minggu berat badan 2000gram, kulit tipis kurang aktif, di ukur suhu tubuh 35,10 C. Pertanyaan soal\r\nApakah tindakan yang harus dilakukan terhadap bayi tersebut\r\n', 214, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 11:49:16', '2021-03-29 11:49:16'),
	(239, 1, 2, 2, 'Seorang ibu membawa banyinya dengan keluhan banyinya tidak mau nete. Berat badan 8800 gram, setelah dikaji gestasi 38, bb 2500 gram dianjurkan dirawat pemberian ASI. Setelah 5 hari bayi mau nete melalui oral. Apa yang harus dilakukan perawat sebelum bayi pulang?', 215, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 11:50:15', '2021-03-29 11:50:15'),
	(240, 1, 2, 2, 'Bayi B setelah dirawat di ruang perinatology 10 hari bayi tersebut boleh pulang dilakuakn perawat pengkajian: ASI ibu banyak bayi menolak, bayi aktif.\r\nApa yang harus dilakukan perawat untuk ibu bayi tersebut', 218, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:03:06', '2021-03-29 12:03:22'),
	(241, 1, 2, 7, 'Perawat mengunjungi keluarga, didapatkan seorang laki-laki sebagai kepala keluarga berusia 62 tahun didiagnosis TB Paru dan tinggal bersam istrinya berusia 60 tahun. Hasil pemeriksaan, klien sedang menjalani pengobatan OAT selama 1 bulan, mengeluh mual apalagi setelah makan obat, BB 48 Kg, dan TB 164 cm. Apakah tindakan yang tepat sesuai kasus tersebut?\r\n', 373, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:03:16', '2021-03-30 06:46:53'),
	(242, 1, 2, 2, 'Seorang ibu membawa banyinya ke poli anak 2 hari yang lal. Bayi kelihatan kuning, lahir spontan 37 minggu BB Lhair 2500 gram, hasil Bill 9.8 gr/ dl, Pertanyaan soal\r\nApa klasifikasi hyper bilirubin yang terjadi pada kasus diatas\r\n', 218, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:05:05', '2021-03-29 12:05:05'),
	(243, 1, 2, 2, 'Seorang ibu membawa banyinya ke poli anak 2 hari yang lal. Bayi kelihatan kuning, lahir spontan 37 minggu BB Lhair 2500 gram, hasil Bill 9.8 gr/ dl. bayi tidak disarankan untuk dirawat.Tindakan apa yang harus dilakukan perawat?', 219, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:06:55', '2021-03-29 12:06:55'),
	(244, 1, 2, 7, 'Perawat mengunjungi keluarga, didapatkan seorang perempuan sebagai kepala kepala keluarga berusia 62 tahun, suaminya sudah meninggal 2 tahun yang lalu, dan tinggal bersama anaknya berusia 27 tahun dan 18 tahun. Ibu bekerja sebagai pedagang di pasar, penghasilannya bisa memenuhi kebutuhan rumah tangga dan dapat menyekolahkan anaknya hingga kuliah. Kedua anaknya mengatakan sangat menghormati dan manyayangi ibunya\r\nMasalah keperawatan yang tepat sesuai kasus tersebut?\r\n\r\n', 374, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:07:45', '2021-03-30 06:43:38'),
	(245, 1, 2, 2, 'Seorang bayi B datang ke ruang peristi dari ruang bersalin lahir 5C dengan gestasi 34 minggu, BB 2000 Gram. Setelah dikaji bayi gemetar sampai kaki, kelihatan lemah. Hasil Bill 12.8 mg/dl. Apa yang harus dilakukan perawat?', 221, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:08:06', '2021-03-29 12:08:06'),
	(246, 1, 2, 2, 'Seorang anak perempuan berusia 7 tahun sedang dirawat di ruang perawatan anak. Hasil pengkajian: Suhu 42°C intermitten, lidah kotor, mulut kering, mual-muntah, mengeluh sakit kepala, nyeri tekan pada perut kuadran atas.\r\nPertanyaan soal:\r\nApakah data yang diperlukan untuk memvalidasi hasil pengkajian pada kasus tersebut?\r\n', 222, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:08:54', '2021-03-29 12:08:54'),
	(248, 1, 2, 2, 'Seorang batita laki-laki berusia 3 tahun mengalami BAB lebih dari lima kali dalam 24 jam, dengan konsistensi cair, muntah-muntah, keadaaan umum lemah, mata cekung, oligouria, membran mukosa bibir kering, turgor jelek. \r\nPertanyaan soal:\r\nApakah masalah keperawatan utama pada kasus tersebut?\r\n', 374, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:09:46', '2021-03-30 04:19:16'),
	(249, 1, 2, 2, 'Batita perempuan berusia 2 tahun dibawa oleh ibunya ke RS dengan keluhan, BAB cair lebih dari 4 kali. Hasil pengkajian: keadaan umum lemah, mukosa bibir kering, mata cekung, frekuensi nadi 120x/mnt, Suhu 38° C, frekuensi napas 30x/mnt. Ibu pasien mengatakan anaknya rewel, muntah  kurang lebih 6 kali sebelum masuk rumah sakit dan tidak ada nafsu makan. \r\nPertanyaan soal:\r\nApa data lain yang perlu dikaji untuk menilai keseimbangan cairan pada kasus tersebut?\r\n', 228, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:10:27', '2021-03-29 12:12:10'),
	(250, 1, 2, 2, 'Batita perempuan usia 3 tahun dengan BB 8Kg, TB 70cm. Menurut keterangan ibu anaknya sering mengalami demam, cepat letih, tidak ada nafsu makan, nyeri sendi, dan tulang, nyeri abdomen, BB menurun. Hasil pengkajian: hati bengkak teraba 1 jari, limpa bengkak teraba 1 jari, serta pupil edema. \r\nPertanyaan soal:\r\nApakah diagnosis keperawatan utama pada kasus tersebut? \r\n', 235, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:11:18', '2021-03-29 12:16:32'),
	(251, 1, 2, 2, 'Seorang ibu datang ke RS membawa anak perempuannya yang berusia 12 tahun dengan keadaan muntah-muntah hebat, perawat bertindak mulai dari pengkajian hingga evaluasi sesuai dengan proses keperawatan dan menjalankan tindakan medis sesuai dengan pendelegasian tertulis yang diberikan. \r\nPertanyaan soal:\r\nApakah peran perawat pada kasus tersebut?\r\n', 227, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:11:59', '2021-03-29 12:11:59'),
	(252, 1, 2, 2, 'Bayi berusia 1 minggu dengan BB 2800gram telah dilakukan kolostomi dikarenakan malformasi ano rektal letak tinggi dengan fistula recto uretra. Hasil pengkajian, distensi abdomen (-), BB saat lahir 3000gram, kolostomi efektif dengan feces konsistensi cair, dan warna kuning. Hasil laboratorium: leukosit 9500 / mm3.\r\nPertanyaan soal:\r\nApakah intervensi keperawatan yang tepat pada kasus tersebut?\r\n', 228, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:12:56', '2021-03-29 12:12:56'),
	(253, 1, 2, 7, 'Perawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 21 tahun, tinggal bersama istri dan anaknya laki-laki yang berusia 12 bulan. Hasil pemeriksaan: BB lahir 2000 gr, BB saat dikaji 5,5 Kg, panjang badan 70 cm. Ibunya mengatakan anaknya sudah diberikan makanan tambahan, susah makan dan sehari hanya 4 sendok. Apakah masalah keperawatan yang tepat sesuai kasus tersebut?\r\n', 229, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:13:23', '2021-03-29 12:13:23'),
	(254, 1, 2, 2, 'Anak laki-laki usia 5 tahun dibawa orang tuanya ke RS dengan kemungkinan diagnosis sindroma nefrotik.\r\nPertanyaan soal:\r\nManakah gejala yang sebaiknya diobservasi oleh perawat?\r\n', 230, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:13:42', '2021-03-29 12:13:42'),
	(255, 1, 2, 2, 'Seorang anak laki-laki berusia 10 tahun, menurut keterangan ibunya anak sering mengeluh pusing, sulit makan, badan lemas, mata berkunang-kunang, malas bermain. Hasil pengkajian: BB 20Kg, TB 100cm, kulit pucat, nafas pendek, pandangan kabur, apatis, kulit lembab dan dingin.\r\n\r\nPertanyaan Soal\r\nApakah specimen yang harus disiapkan perawat untuk mengetahui penyebab kasus tersebut?\r\n', 231, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:14:27', '2021-03-29 12:14:27'),
	(256, 1, 2, 7, 'Perawat mengunjungi keluarga, didapat seorang perempuan sebagai kepala keluarga berusia 53 tahun dan tinggal sendirian. Hasil pemeriksaan: TD 180/90 mmHg, frekuensi napas 20 x/mnt, frekuensi nadi 85 x/mnt, BB 66 Kg dan TB 155 cm. Klien menyataan sering nyeri dan pegal pada tengkuk. Apakah masalah keperawatan pada kasus tersebut?', 232, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:15:01', '2021-03-29 12:15:01'),
	(257, 1, 2, 2, 'Seorang anak laki-laki berusia 10 tahun, menurut keterangan ibunya anak sering mengeluh pusing, sulit makan, badan lemas, mata berkunang-kunang, malas bermain. Hasil pengkajian: BB 20Kg, TB 100cm, kulit pucat, nafas pendek, pandangan kabur, apatis, kulit lembab dan dingin.\r\n\r\nPertanyaan Soal\r\nApakah jenis pemeriksaan laboratorium yang perlu dilakukan pada kasus tersebut?\r\n', 233, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:15:12', '2021-03-29 12:15:12'),
	(258, 1, 2, 2, 'Balita laki-laki berusia 4 tahun di bawa ibunya ke poli anak dengan keluhan diare sebanyak 9x/hari. Hasil pengkajian: keadaan umum lemah, turgor kulit tidak elastis, mukosa bibir kering, kulit sekitar anus terlihat kemerahan, dan anak selalu menangis jika perawat mendekatinya.\r\n\r\nPertanyaan Soal\r\nApakah masalah keperawatan utama pada kasus tersebut?\r\n', 234, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:15:54', '2021-03-29 12:15:54'),
	(259, 1, 2, 7, 'Perawat mengunjungi keluarga, didapatkan seorang laki-laki sebagai kepala keluarga berusia 62 tahun didiagnosis TB Paru dan tinggal bersam istrinya berusia 60 tahun. Hasil pemeriksaan, klien sedang menjalani pengobatan OAT selama 1 bulan, mengeluh mual apalagi setelah makan obat, BB 48 Kg, dan TB 164 cm. Apakah masalah keperawatan sesuai kasus tersebut?', 235, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:16:38', '2021-03-29 12:16:38'),
	(260, 1, 2, 2, 'Bayi E yang berusia 10 bulan dengan berat badan 8kg, panjang badan 68cm dengan temperature 38.5 C datang dengan keluhan diare 5x/hari cair dan terdapat darah dalam fesesnya. Perawat Dewi melakukan pengkajian dan tidak menemukan tanda bahaya umum, tidak ada batuk atau sesak nafas, tidak ada mata cekung, dan cubitan kulit kembali dalam waktu 1 detik.Apakah tindakan yang harus Perawat Dewi lakukan terhadap Bayi E?', 237, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:17:27', '2021-03-29 12:17:48'),
	(261, 1, 2, 7, 'Perawat mengunjungi keluarga, didapatkan seorang perempuan sebagai kepala kepala keluarga berusia 62 tahun, suaminya sudah meninggal 2 tahun yang lalu, dan tinggal bersama anaknya berusia 27 tahun dan 18 tahun. Ibu bekerja sebagai pedagang di pasar, penghasilannya bisa memenuhi kebutuhan rumah tangga dan dapat menyekolahkan anaknya hingga kuliah. Kedua anaknya mengatakan sangat menghormati dan manyayangi ibunya. Apakah data pengkajian yang sesuai dengan kasus tersebut?\r\n\r\n', 237, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:18:18', '2021-03-29 12:18:18'),
	(262, 1, 2, 7, 'Perawat mengunjungi keluarga, didapatkan seorang perempuan sebagai kepala kepala keluarga berusia 62 tahun, suaminya sudah meninggal 2 tahun yang lalu, dan tinggal bersama anaknya berusia 27 tahun dan 18 tahun. Ibu bekerja sebagai pedagang di pasar, penghasilannya bisa memenuhi kebutuhan rumah tangga dan dapat menyekolahkan anaknya hingga kuliah. Kedua anaknya mengatakan sangat menghormati dan manyayangi ibunya. Apakah data pengkajian yang sesuai dengan kasus tersebut?\r\n\r\n', 238, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:18:22', '2021-03-29 12:18:22'),
	(263, 1, 2, 2, 'Bayi A yang berusia 5 bulan dengan berat badan 5.2kg, panjang badan 58cm dengan temperature 38.9 C.  Ibu Bayi A mengatakan Bayi A tidak dapat menyusu dengan baik dan badan terasa panas. Berdasarkan bagan MTBS pengobatan yang harus dilakukan oleh Perawat A adalah paracetamol. Berapa dosis yang harus diberikan pada Bayi A?', 239, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:18:37', '2021-03-29 12:18:37'),
	(264, 1, 2, 2, 'Perawat Dina melakukan evaluasi hasil Uji Tuberkulin (Mantoux) test pada Anak L dan ditemukan pelebaran hasil 10mm di lengan kanan bawah. Berdasarkan system skoring berapakah skor yang diberikan oleh Perawar Dina terhadap hasil tersebut?', 240, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:19:12', '2021-03-29 12:19:12'),
	(265, 1, 2, 2, 'Anak L berusia 2.5 tahun dengan keluhan demam tinggi dan terus menerus dengan suhu 39.C sejak 3 hari yang lalu datang  ke Klinik MTBS. Perawat Lina mengklasifikasikan Anak L menderita Demam bukan Malaria. Apakah tindakan yang harus dilakukan Perawat Lina?', 241, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:20:02', '2021-03-29 12:20:02'),
	(266, 1, 2, 2, 'Perawat Tasya akan melakukan pengkajian MTBS kepada Bayi Abi yang berusia 4 bulan 11 hari yang datang ke Puskesmas Cicendo. Apakah pertanyaaan yang harus diajukan kepada Ibu dari Bayi Abi?   ', 242, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:20:45', '2021-03-29 12:20:45'),
	(267, 1, 2, 7, 'Kasus (Vignette)\r\nPerawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 25 tahun, tinggal bersama istri dan kedua anaknya. Pada saat pengkajian, istrinya menyatakan anak yang kedua pernah mengalami bronkhitis, suaminya masih merokok dan kadang-kadang di dalam rumah dan sudah dilarang tetapi sulit berhenti merokok. Apakah masalah keperawatan yang muncul sesuai kasus tersebut?', 243, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:20:55', '2021-03-29 12:20:55'),
	(268, 1, 2, 2, 'Pendekatan MTBS meliputi promotif, preventif dan kuratif termasuk dalam pemberian obat. Perawat Diana akan mengajari Ibu Naura cara memberikan obat oral di rumah. Pertanyaan soal\r\nApakah yang harus dilakukan oleh Perawat Diana?\r\n', 244, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:21:34', '2021-03-29 12:21:34'),
	(269, 1, 2, 7, 'Perawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 21 tahun, tinggal bersama istri dan anaknya laki-laki yang berusia 12 bulan. Hasil pemeriksaan: BB lahir 2000 gr, BB saat dikaji 5,5 Kg, panjang badan 70 cm. Ibunya mengatakan anaknya sudah diberikan makanan tambahan, susah makan dan sehari hanya 4 sendok. Apakah tindakan yang sesuai untuk kasus tersebut?', 245, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:22:15', '2021-03-29 12:22:15'),
	(270, 1, 2, 2, 'Perawat Doni melakukan pemeriksaan status HIV kepada Bayi Ina berusia 3 minggu yang diketahui masih mengkonsumi ASI dari Ibu yang terinfeksi HIV positive. Pertanyaan soal\r\nApakah intevensi yang harus dilakukan oleh Perawat Doni? \r\n', 246, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:22:27', '2021-03-29 12:22:27'),
	(271, 1, 2, 7, 'Perawat mengunjungi keluarga, didapat seorang perempuan sebagai kepala keluarga berusia 53 tahun dan tinggal sendirian. Hasil pemeriksaan: TD 180/90 mmHg, frekuensi napas 20 x/mnt, frekuensi nadi 85 x/mnt, BB 66 Kg dan TB 155 cm. Klien menyataan sering nyeri kepala dan pegal pada tengkuk dan tidak tahu secara jelas tentang hipertensi. Apakah rencana tindakan yang tepat untuk kasus tersebut?', 247, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:23:30', '2021-03-29 12:23:30'),
	(272, 1, 2, 7, 'Perawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 58 tahun, tinggal bersama istri dan kedua anaknya. Istrinya mengalami stroke sejak 6 tahun yang lalu, suami menyampaikan tidak tahu cara merawat istrinya dan malas membawa berobat ke puskesmas. Apakah data pengkajian yang sesuai dengan kasus tersebut?', 248, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:25:04', '2021-03-29 12:25:04'),
	(273, 1, 2, 7, 'Perawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 58 tahun, tinggal bersama istri dan kedua anaknya. Istrinya mengalami stroke sejak 6 tahun yang lalu, mengalami hemiplegi dekstra, dan aktivitasnya dibantu oleh suami atau kadang oleh tetangganya.  Apakah data yang dibutuhkan yang sesuai dengan kasus tersebut?', 249, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:26:40', '2021-03-29 12:26:40'),
	(274, 1, 2, 7, 'Perawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 58 tahun, tinggal bersama istri dan kedua anaknya. Istrinya mengalami stroke sejak 6 tahun yang lalu, mengalami hemiplegi dekstra, dan aktivitasnya dibantu oleh suami atau kadang oleh tetangganya. Apakah kriteria hasil yang sesuai dengan kasus tersebut?', 374, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:28:09', '2021-03-30 06:37:26'),
	(275, 1, 2, 2, 'Anak D berusia 4.5 tahun dengan keluhan demam tinggi dan terus menerus dengan suhu 39.5 C sejak 3 hari yang lalu datang  ke Klinik MTBS. Perawat Andi menemukan tandat-tanda syok pada Anak D. Apakah intervensi yang harus dilakukan Perawat Andi?', 251, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:29:20', '2021-03-29 12:29:20'),
	(276, 1, 2, 7, 'Perawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 58 tahun, tinggal bersama istri dan kedua anaknya. Istrinya mengalami stroke sejak 6 tahun yang lalu, mengalami hemiplegi dekstra, dan aktivitasnya dibantu oleh suami atau kadang oleh tetangganya. Apakah rencana tindakan sesuai dengan kasus tersebut?', 252, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:29:43', '2021-03-29 12:29:43'),
	(277, 1, 2, 2, 'Bayi M yang berusia 7 hari datang ke klinik MTBS. Perawat Linda melalukan pengkajian tali pusar . Apakah konseling yang harus diberikan oleh Perawat Linda  dalam merawat kebersihan tali pusar? ', 253, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:30:01', '2021-03-29 12:30:01'),
	(278, 1, 2, 2, 'Anak A berusia 2 tahun datang bersama Ayahnya  mengeluhkan nyeri telinga dan ada cairan keluar dari telinga selama 7 hari.  Apakah tindakan yang harus dilakukan oleh Perawat Nina?', 254, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:30:43', '2021-03-29 12:30:43'),
	(279, 1, 2, 2, 'Bayi perempuan berusia 1 bulan  dengan berat badan 1,.8 Kg di diagnosa Paten Ductus Arteriousus (PDA). Dari hasil pengkajian ditemukan bahwa refleks hisap lemah, tampak pucat dan lemah. Apakah data objektif yang menggambarkan bayi tersebut mengalami penurunan curah jantung?', 255, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:31:29', '2021-03-29 12:31:29'),
	(280, 1, 2, 7, 'Perawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 25 tahun, tinggal bersama istri dan kedua anaknya. Pada saat pengkajian, istrinya menyatakan anak yang kedua pernah mengalami bronkhitis, suaminya masih merokok dan kadang-kadang di dalam rumah dan sudah dilarang tetapi sulit berhenti merokok. Perawat memberikan penyuluhan kesehatan tentang bahaya merokok. Apakah evaluasi tindakan yang tepat untuk kasus tersebut?', 374, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:32:04', '2021-03-30 06:39:47'),
	(281, 1, 2, 2, 'Bayi perempuan berusia 2 bulan dirawat dengan diagnosis tetralogy of fallot (TOF). Setiap kali bayi menangis, tampak kebiruan. Apakah pendidikan kesehatan yang tepat diberikan pada kasus tersebut ?\r\n\r\n', 257, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:32:16', '2021-03-29 12:32:16'),
	(282, 1, 2, 2, 'Seorang anak laki-laki usia  6 tahun  dibawa oleh ibunya ke Poli Thalasemia dengan keluhan anak sering cepat lelah saat beraktifitas. Dari hasil pemeriksaan fisik wajah tampak pucat, konjungtiva anemis, kulit pucat keabuan (hemosiderosis). Hasil pemeriksaan laboratorium  Hb : 5 gr/dl, Sehingga anak ini harus dilakukan transfusi. Apa yang harus dilakukan perawat saat transfusi dilakukan? ', 258, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:33:02', '2021-03-29 12:33:02'),
	(283, 1, 2, 7, 'Perawat mengunjungi keluarga, didapat seorang perempuan sebagai kepala keluarga berusia 53 tahun dan tinggal sendirian. Hasil pemeriksaan: TD 180/90 mmHg, frekuensi napas 20 x/mnt, frekuensi nadi 85 x/mnt, BB 66 Kg dan TB 155 cm. Klien menyataan sering nyeri kepala dan pegal pada tengkuk. Apakah penyuluhan yang dibutuhkan keluarga tersebut?', 259, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:33:22', '2021-03-29 12:33:22'),
	(284, 1, 2, 2, 'Anak laki-laki usia 10 tahun terdiagnosa Leukeumia. Dari hasil pengkajian diperoleh data anak sering bertanya kepada perawat mengapa harus dilakukan kemoterapi, karena anak tersebut merasakan mual dan muntah. Namun ibunya melarang perawat memberitahukan penyakitnya pada anak tersebut.  Apakah dilema etik yang terjadi pada kasus tersebut? ', 260, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:33:50', '2021-03-29 12:33:50'),
	(285, 1, 2, 2, 'Seorang anak laki-laki berusia 8 tahun didiagnosa Sindroma Nefrotik (SN), diperoleh data klien tampak lemah, nafsu makan menurun, mengalami penurunan berat badan. Warna urin kuning pekat. Terdapat edema di daerah wajah dan ekstremitas bawah. Hasil pemeriksaan proteinuri +, Albumin 1,9 gr/dl. Pertanyaan soal\r\nApakah evaluasi yang dilakukan perawat untuk masalah keperawatan prioritas pada kasus di atas\r\n', 261, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:34:33', '2021-03-29 12:34:33'),
	(286, 1, 2, 7, 'Perawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 21 tahun, tinggal bersama istri dan anaknya laki-laki yang berusia 12 bulan. Hasil pemeriksaan: BB 5,5 Kg, tinggi badan 70 cm. ibunya menyatakan tidak tahu mengapa BB anaknya tidak naik-naik, padahal sudah diberikan daging, telur, dll. Apakah pengkajian lanjutan untuk mengetahui kondisi anak tersebut?', 262, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:34:47', '2021-03-29 12:34:47'),
	(287, 1, 2, 2, 'Seorang anak perempuan berusia 14 tahun,  mengeluh sudah 3 hari nyeri di daerah perut bawah. Hasil pengkajian diperoleh : Nyeri saat BAK, BAK tidak lancar, merasa tidak puas setelah BAK, ekspresi meringis, nafsu makan menurun dan susah tidur. Pertanyaan soal\r\nApakah tindakan keperawatan untuk meningkatkan luaran urin pada kasus tersebut ?\r\n', 263, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:35:42', '2021-03-29 12:35:42'),
	(288, 1, 2, 2, 'Seorang anak perempuan usia  15 tahun  dibawa oleh ibunya ke Poli anak dengan keluahan demam terus menerus selama 3 hari. Hasil pengkajian diperoleh data nyeri sendi dan nyeri kepala, kulit teraba dingin, nadi lemah, suhu 38,50C. Perawat melakukan uji torniquet. Didapatkan tekanan darah 110/70 dan ditentukan nilai tengah tekanan sistolik dan diastolik kemudian memompa manset sampai tekanan yang telah ditentukan. Apakah tindakan selanjutnya pada pemeriksaan tersebut?', 264, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:36:28', '2021-03-29 12:36:28'),
	(289, 1, 2, 7, 'Perawat mengunjungi keluarga, didapatkan seorang perempuan sebagai kepala kepala keluarga berusia 62 tahun, suaminya sudah meninggal 2 tahun yang lalu, dan tinggal bersama anaknya berusia 27 tahun dan 18 tahun. Ibu bekerja sebagai pedagang di pasar, penghasilannya bisa memenuhi kebutuhan rumah tangga dan dapat menyekolahkan anaknya hingga kuliah. Kedua anaknya mengatakan sangat menghormati dan manyayangi ibunya. Apakah kriteria evaluasi yang tepat untuk kasus tersebut?', 265, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:36:44', '2021-03-29 12:36:44'),
	(290, 1, 2, 2, 'Seorang anak laki-laki yang berusia 6 tahun  dibawa oleh ibunya ke Poli Thalasemia dengan keluhan mudah  sakit, ibu juga mengatakan anak sering cepat lelah saat beraktifitas. Dari hasil pemeriksaan fisik wajah tampak pucat, sklera anemis, . Hasil pemeriksaan laboratorium  Hb : 5 gr/dl, membutuhkan transfusi. Apakah tindakan selanjutnya setelah pemberian infus darah/ transfusi selesai?', 266, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:37:09', '2021-03-29 12:37:09'),
	(291, 1, 2, 2, 'Seorang anak perempuan  berumur 10 tahun dirawat di RS dengan diagnose medis leukemia dan telah diberikan kemoterapi. Anak tampak lemah, tidak nafsu makan, mengeluh perih pada area mulut.  Apakah tindakan keperawatan yang dilakukan untuk mengatasi  masalah asupan makanan?', 267, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:37:50', '2021-03-29 12:37:50'),
	(292, 1, 2, 7, 'Perawat mengunjungi keluarga, didapatkan seorang laki-laki sebagai kepala keluarga berusia 62 tahun didiagnosis TB Paru dan tinggal bersam istrinya berusia 60 tahun. Hasil pemeriksaan, klien sedang menjalani pengobatan OAT selama 1 bulan, mengeluh mual apalagi setelah makan obat, BB 48 Kg, dan TB 164 cm. Apakah kriteria evaluasi yang sesuai dengan masalah utama pada kasus tersebut?', 268, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:37:55', '2021-03-29 12:37:55'),
	(293, 1, 2, 2, 'Seorang anak perempuan, berusia 6 tahun dengan diagnosa medis ALL, hasil managemen cairan didapatkan membutuhkan cairan NaCl 60 cc/jam, terpasang infus makrodrip. Berapakah jumlah tetesan infus per menit?', 269, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:38:28', '2021-03-29 12:38:28'),
	(294, 1, 2, 7, 'Perawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 25 tahun, tinggal bersama istri dan kedua anaknya. Pada saat pengkajian, istrinya menyatakan anak yang kedua pernah mengalami bronkhitis, suaminya masih merokok dan kadang-kadang di dalam rumah dan sudah dilarang tetapi sulit berhenti merokok. Apakah tindakan yang sesuai dengan kasus tersebut?', 270, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:39:48', '2021-03-29 12:39:48'),
	(295, 1, 2, 7, 'Perawat melakukan kunjungan rumah pada pasien dengan stroke.  Keluarga mengetahui bahwa Bapak mengalami penyakit stroke. Keluarga mengetahui  bahwa penyakit stroke dapat membahayakan. Keluarga pun mengetahui bahwa Bapak harus segera mendapat terapi dan upaya pencegahan hipertensi agar stroke tidak semakin parah. Apakah fungsi perawatan keluarga yang didapatkan dari pengkajian tersebut?', 271, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:42:33', '2021-03-29 12:42:33'),
	(296, 1, 2, 7, 'Seorang perawat merumuskan tujuan perawatan pada klien dengan obesitas di keluarga. Tujuan diharapkan dapat dicapai dalam waktu dua minggu untuk mencapai pola nutrisi klien kembali seimbang. Apakah perencanaan keperawatan yang tepat untuk kasus tersebut?', 272, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:44:17', '2021-03-29 12:44:17'),
	(297, 1, 2, 7, 'Perawat menjelaskan pada keluarga bahwa tugas perkembangan keluarga saat ini adalah memperluas persahabatan keluarga besar dengan menambahkan peran orang tua, kakek dan nenek. Apakah tahap perkembangan keluarga pada kasus tersebut?', 273, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:45:48', '2021-03-29 12:45:48'),
	(298, 1, 2, 7, 'Perawat melakukan kunjungan rumah  dan membuat kesepakatan dengan keluarga untuk melakukan wawancara terkait riwayat kesehatan anggota keluarga. Apakah tahap asuhan keperawatan keluarga yang sedang dilakukan oleh perawat?', 274, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:48:23', '2021-03-29 12:48:23'),
	(299, 1, 2, 7, 'Perawat melakukan kunjungan rumah  dan membuat kesepakatan dengan keluarga untuk melakukan wawancara terkait struktur peran di keluarga. Apakah pertanyaan fokus  yang tepat dikaji oleh perawat?', 275, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:49:43', '2021-03-29 12:49:43'),
	(300, 1, 2, 7, 'Perawat mendapatkan data pertengkaran suami istri keluarga Tn. S seringkali disertai dengan pukulan dan makian kata kata yang kasar. Manakah isu dan legal etik dalam keperawatan keluarga yang sesuai dengan kasus diatas?   ', 276, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:51:12', '2021-03-29 12:51:12'),
	(301, 1, 2, 7, 'Perawat melakukan kunjungan rumah, ditemukan sebuah keluarga yang anggotanya terdiri dari seorang ibu tinggal bersama tiga orang anaknya, dua orang menginjak usia dewasa dan  satu orang anak usia sekolah. Mereka tinggal dalam satu rumah. Apakah type keluarga yang sesuai dengan kasus tersebut?', 277, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:52:33', '2021-03-29 12:52:33'),
	(302, 1, 2, 7, 'Perawat melakukan pengkajian pada sebuah keluarga besar tinggal di  pedesaan, dimana dalam satu rumah tinggal seorang Bpk. D (45 tahun) sebagai kepala keluarga , Ny. F (44 Tahun) dan anaknya seorang laki – laki dewasa (24 tahun), remaja perempuan 15 tahun, dan balita 4 tahun. Apakah tahapan perkembangan keluarga yang sesuai dengan kasus tersebut? ', 278, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:54:44', '2021-03-29 12:54:44'),
	(303, 1, 2, 7, 'Perawat melakukan pengkajian pada keluarga Tn.K (70 Tahun) dan Ny. K (65 tahun) tinggal berdua setelah anak terakhirnya menikah. Mereka tinggal berdua saling membantu satu sama lain dalam hal aktifitas sehari-hari seperti penyediaan makan, minum, serta saling mendukung dalam pelaksanaan kegiatan waktu luang. Apakah tugas perkembangan yang sesuai dengan hasil tersebut?', 279, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:56:04', '2021-03-29 12:56:04'),
	(304, 1, 2, 1, 'Perawat melakukan kunjungan keluarga dan merencanakan pemberian intervensi dengan stimulasi tumbuh kembang dengan mengenalkan warna-warna dasar pada anak. Apakah tahap perkembangan keluarga yang tepat sesuai kasus tersebut?\r\n', 280, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:57:39', '2021-03-29 12:57:39'),
	(305, 1, 2, 7, 'Perawat melakukan kunjungan keluarga dan merencanakan pemberian intervensi dengan latihan konsentrasi agar terjadi peningkatan prestasi belajar anak. \r\nApakah tahap perkembangan keluarga yang tepat sesuai kasus tersebut?\r\n', 281, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 12:59:04', '2021-03-29 12:59:04'),
	(306, 1, 2, 7, 'Perawat melakukan kunjungan rumah dan menjadwalkan pengkajian untuk mengetahui kemampuan matematis lansia.	\r\nApakah jenis pengkajian yang sesuai dengan kasus tersebut? \r\n', 282, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:00:31', '2021-03-29 13:00:31'),
	(307, 1, 2, 7, 'Perawat melakukan kunjungan rumah pada pasien lansia dengan diabetes. saat pengkajian lansia tersebut tidak mengetahui hari ini adalah hari senin, tanggal 7 Maret. Ny. N juga tidak mengetahui kapan waktu lahir dan usia saat ini. begitupula dengan data tempat tinggal saat ini, klien tidak menyadari bahwa tinggal bersama anaknya, karena selama ini terbiasa tinggal di panti. Selebihnya lansia mampu menjawab pertanyaan yang diajukan oleh perawat.\r\nBagaimanakah fungsi intelektual pada keluarga lansia tersebut?\r\n', 283, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:01:53', '2021-03-29 13:01:53'),
	(308, 1, 2, 7, 'Perawat melakukan kunjungan rumah  pada lansia yang memiliki riwayat penyakit diabetes sebelum masuk ke panti. Nenek Mani enggan ikut beraktivitas dengan teman-temannya dan hanya tidur saja di kamarnya. 3 minggu kemudian diketahui Nenek Mani memiliki lesi di area punggungnya. Lesi sebesar 5 Cm dan cukup dalam.	\r\nApakah intervensi keperawatan utama yang tepat oleh perawat pada lansia?\r\n', 284, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:03:22', '2021-03-29 13:03:22'),
	(309, 1, 2, 7, 'Perawat melakukan kunjungan rumah  dan melakukan upaya perencanaan dengan memberi kesempatan pada nenek untuk  memilih tindakan keperawatan yang akan diberikan pada nenek. Perawat mempertimbangkan pilihan nenek karena nenek tersebut cenderung mengurung diri dan terkadang menangis sendiri.	\r\nApakah faktor yang dipertimbangkan perawat saat melibatkan lansia dalam perencanaan asuhan keperawatan?\r\n\r\n', 285, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:04:39', '2021-03-29 13:04:39'),
	(310, 1, 2, 7, 'Perawat melakukan kunjungan rumah  dan mendapatkan data hasil pengkajian bahwa lansia bisa melakukan aktivitas secara mandiri, kecuali mandi, berpakaian dan satu lagi fungsi yang lain.	\r\nApakah nilai Katz Index pada lansia tersebut?\r\n', 286, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:06:12', '2021-03-29 13:06:12'),
	(311, 1, 2, 7, 'Perawat melakukan kunjungan rumah pada ibu post partum hari ke 6. Ibu mengeluhkan payudaranya nyeri dan bengkak.	\r\nApakah pengkajian fokus selanjutnya oleh perawat?\r\n', 287, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:07:51', '2021-03-29 13:07:51'),
	(312, 1, 2, 7, 'Perawat melakukan kunjungan rumah pada ibu post partum hari ke 6. Ibu mengeluhkan payudaranya nyeri dan bengkak.	\r\nApakah pengkajian fokus selanjutnya oleh perawat?\r\n', 288, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:10:01', '2021-03-29 13:10:01'),
	(313, 1, 2, 7, 'Seorang Perawat datang ke Keluarga dan menyajikan data tentang kondisi lingkungan yang dapat memicu penyakit TB pada kepala keluarga	Apakah perencanaan yang sesuai dengan kasus tersebut? \r\n', 289, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:11:24', '2021-03-29 13:11:24'),
	(314, 1, 2, 7, 'Perawat melakukan kunjungan rumah dengan kondisi bangunan semi permanen dengan luas 30 m2  yang ditempati oleh 5 orang anggota keluarga, dengan ventilasi dan sirkulasi udara kurang baik.	\r\nApakah resiko tinggi masalah kesehatan pada keluarga tersebut? ', 290, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:13:43', '2021-03-29 13:13:43'),
	(315, 1, 2, 7, 'Perawat melakukan kunjungan rumah pada An.S yang memiliki berat badan 40 Kg, tinggi badan 125 Cm, kebiasaan makan makanan cepat saji, dan jarang berolahraga.\r\nApakah diagnosa keperawatan yang tepat pada anak tersebut?\r\n\r\n', 291, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:15:16', '2021-03-29 13:15:16'),
	(316, 1, 2, 7, 'Perawat mengkaji fungsi perawatan keluarga. Keluarga selalu memberikan latihan gerak sendi kepada Bpk. E yang mengalami kelumpuhan akibat stroke agar tidak terjadi kekakuan otot dan anggota tubuhnya. \r\nBagaimana fungsi perawatan keluarga pada klien tersebut?\r\n\r\n', 292, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:16:40', '2021-03-29 13:16:40'),
	(317, 1, 2, 7, 'Perawat melakukan pengkajian satu keluarga terdapat balita mengalami sesak napas dan baru pulang dirawat di rumah sakit selama 1 minggu. Keluhan disertai diare dan sulit makan, tetapi ibunya belum membawa anaknya untuk berobat karena masih merasa kecapean. Suaminya tidak peduli, marah marah dan tidak membantu istrinya dalam mengurus anak dan rumahnya.  \r\nApakah masalah keperawatan yang sesuai dengan kasus tersebut?\r\n\r\n', 293, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:17:55', '2021-03-29 13:17:55'),
	(318, 1, 2, 7, 'Seorang perawat mengkaji sebuah keluarga dan mendapatkan data seorang ibu memiliki anak dengan kebutuhan khusus. Anak tersebut berusia 6 tahun dan menderita cerebral palsy sejak lahir. Ibu merasa cemas, ketakutan dan frustasi dalam mengasuh anak tersebut. Ayah dan ibu selalu bertengkar dan seringkali terjadi KDRT.\r\nApakah diagnosa keperawatan utama pada kasus tersebut?\r\n\r\n', 294, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:19:12', '2021-03-29 13:19:12'),
	(319, 1, 2, 7, 'Perawat melakukan kunjungan keluarga dan mendapatkan data gambaran diri setiap anggota keluarga, perasaan memiliki dan dimiliki dalam keluarga, dukungan keluarga terhadap anggota keluarga lainnya, kedekatan masing-masing anggota keluarga dan bagaimana keluarga mengembangkan sikap saling menghargai. \r\nApakah pengkajian keperawatan yang sesuai dengan kasus tersebut?\r\n\r\n', 295, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:20:38', '2021-03-29 13:20:38'),
	(320, 1, 2, 7, 'Perawat melakukan kunjungan rumah pada keluarga pasangan baru menikah, sedang merencanakan kehamilan anak pertama. Keluarga memerlukan pendidikan kesehatan lebih lanjut terkait peran ayah dan ibu dalam keluarga, kehamilan, KB, serta pemenuhan kebutuhan kebutuhan fisiologis dan psikologis ayah dan ibu\r\nApakah masalah keperawatan yang sesuai dengan kasus tersebut?\r\n', 296, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:21:45', '2021-03-29 13:21:45'),
	(321, 1, 2, 7, 'Perawat melakukan kunjungan rumah dan membuat perencanakan intervensi untuk melakukan latihan rentang gerak pada kaki pasien, tanpa mempertimbangkan masalah patah tulang pada pasien\r\nPrinsip etika manakah yang dilanggar pada  kondisi tersebut oleh perawat?\r\n', 297, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:23:04', '2021-03-29 13:23:04'),
	(322, 1, 2, 7, 'Perawat melakukan kunjungan rumah pada keluarga dengan masalah gizi buruk. Perawat menuliskan catatan perkembangan sesuai dengan kondisi aktual pasien saat ini, tidak ada yang ditulis secara asal dan dikira-kira.\r\nApakah prinsip etika yang dijaga oleh perawat dalam pemberian asuhan keperawatan?\r\n\r\n', 298, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:24:29', '2021-03-29 13:24:29'),
	(323, 1, 2, 7, 'Perawat melakukan kunjungan keluarga yang baru memiliki bayi berusia 2 bulan, Anaknya  mengalami masalah ISPA sejak 2 hari yang lalu. Bapak tidak peduli dengan sakit anaknya, dan pulang selalu larut malam. Komunikasi antar Ibu dan bapak kurang berjalan dengan lancar, selalu diwarnai dengan pertengkaran, dan keadaan keluarga tidak harmonis.	\r\nApakah rumusan diagnosa yang sesuai dengan kasus tersebut? \r\n\r\n', 299, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:25:43', '2021-03-29 13:25:43'),
	(324, 1, 2, 7, 'Perawat melakukan pengkajian pada keluarga dengan masalah stroke. Pengkajian difokuskan pada bagaimana kedekatan masing-masing anggota keluarga dalam berkomunikasi menjaga bapak yang sakit, serta bagaimana cara penyelesaian masalah oleh setiap anggota keluarga satu sama lain. \r\nApakah jenis pengkajian yang sesuai dengan hasil tersebut?\r\n\r\n', 300, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:26:54', '2021-03-29 13:26:54'),
	(325, 1, 2, 7, 'Perawat melakukan kunjungan keluarga didapatkan hasil pengkajian saat ada anggota keluarga yang sakit ringan seperti batuk, pilek, demam hanya mengkonsumsi obat-obatan yang dibeli di warung atau apotik seperti Decolgen, Paramex, dll. Tetapi, jika penyakitnya tidak kunjung sembuh (> 1 minggu) atau sakitnya parah maka keluarga Tn. C akan berobat ke dokter atau Rumah Sakit\r\nApakah Komponen pengkajian apa yang sesuai dengan uraian diatas?\r\n\r\n', 301, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 13:28:15', '2021-03-29 13:28:15'),
	(326, 1, 2, 10, 'Anda adalah perawat pelaksana di ruangan jiwa. Dikarenakan di ruangan bedah kekurangan perawat maka anda dipindahkan sementara oleh kepala bidang keperawatan ke ruangan tersebut. Hal itu membuat anda tidak nyaman. Tapi daripada menimbulkan konflik maka anda mengabaikan rasa tidak nyaman dan pergi ke ruagan bedah. \r\nApakah strategi konflik yang digunakan oleh perawat tersebut?', 312, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 17:42:43', '2021-03-29 18:44:49'),
	(327, 1, 2, 10, 'Ketua tim A dan Ketua tim B memiliki perbedaan pendapat dalam penghitungan beban kerja di ruangan dan hal tersebut diungkapkan dalam rapat ruangan. Keduanya saling berargumen dan tidak menyadari kalau argumennya memicu konflik karena melibatkan emosi. Dalam kondisi tersebut kepala ruangan menengahi konflik dan melihat kalau keduanya sebenarnya memiliki komitmen untuk menyelesaikan masalah\r\nApakah strategi konflik yang digunakan oleh perawat tersebut?', 303, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 17:48:05', '2021-03-29 17:48:05'),
	(328, 1, 2, 10, 'Perawat di ruangan Mawar melakukan timbang terima. Perawat melakukan segala persiapan timbang terima kemudian dikaukan proses penyampaian informasi tanpa memberikan kesempatan untuk klarifikasi. Timbang terima dilakukan hanya di nurse station.\r\nApakah prinsip timbang terima yang tidak dilakukan oleh perawat?', 304, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 17:51:37', '2021-03-29 17:51:37'),
	(329, 1, 2, 10, 'Dalam metode penugasan tim, rekan satu tim anda mendelegasikan pasien dengan memberikan laporan tertulis mengenai kondisi pasien. Pasien mengeluh perawat terus menerus menanyakan hal yang sama dengan yang ditanyakan perawat sebelumnya, tanpa ada tindakan selanjutnya, sehingga masalah pasien belum teratasi.\r\nApakah  yang harus dilakukan untuk mengatasi masalah tersebut?', 305, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 17:54:56', '2021-03-29 17:54:56'),
	(330, 1, 2, 10, 'Anda bekerja sebagai perawat pelaksana di ruangan bedah rumah sakit. Ketika sedang melakukan perawatan luka bersama perawat lain, anda lupa menyiapkan nacl. Teman anda langsung marah di hadapan pasien tapi anda langsung meminta maaf padahal anda tau sebenarnya tugas untuk mempersiapkan alat perawatan luka adalah tugas bersama.\r\nApakah strategi konflik yang dilakukan oleh perawat pelaksana?', 306, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 17:59:07', '2021-03-29 17:59:07'),
	(331, 1, 2, 10, 'Seorang perawat pelaksana ditunjuk sebagai ketua tim dalam shift pagi hari. Setelah melakukan timbang terima pasien, perawat langsung melakukan pre conference. Terdapat tiga orang perawat pelaksana dalam timnya. Pada saat dinas berlangsung ada pasien baru dan ketua tim langsung menerima pasien baru.\r\nApakah yang selanjutnya dilakukan oleh perawat tersebut sebagai ketua tim?', 307, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 18:02:56', '2021-03-29 18:02:56'),
	(332, 1, 2, 10, 'Seorang pasien dirawat dengan diagnosa post apendictomy 3 jam yang lalu,pada pasien terpasang infus dan kateter.\r\nApakah tingkat ketergantungan pada pasien?\r\n', 308, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 18:05:48', '2021-03-29 18:05:48'),
	(333, 1, 2, 10, 'Anda ditunjuk oleh Karu untuk merawat 5 pasien dan bertanggung jawab penuh selama 24 jam sampai dengan pasien pulang, anda diberikan kewenangan oleh Karu untuk melakukan proses asuhan keperawatan lengkap untuk ke empat pasien tersebut. Dalam melaksanakan implementasi anda juga dibantu oleh 3 orang perawat pelaksana.\r\nApakah jenis metode penugasan asuhan keperawatan tersebut?\r\n', 309, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 18:07:51', '2021-03-29 18:07:51'),
	(334, 1, 2, 10, 'Anda sedang dinas malem sebagai perawat associate diberikan tugas merawat pasien umur 35 tahun dengan diagnose Ca Paru.  Sekitar pukul 02.00 pasien mengalami penurunan kesadaran. \r\nApakah tindakan yang harus  dilakukan untuk menangani masalah tersebut ?\r\n', 310, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 18:10:10', '2021-03-29 18:10:10'),
	(335, 1, 2, 10, 'Seorang Perawat melakukan timbang terima dari shift pagi ke shift sore. Perawat  menjelaskan tentang tindakan mandiri perawat, tindakan kolaboratif yang sudah dilakukan dan menyampaikan  perkembangan pasien saat itu kepada perawat lain dalam kelompoknya dengan tertulis dan lisan.\r\nApakah peran yang dilaksanakan oleh perawat tersebut ?', 311, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 18:12:43', '2021-03-29 18:12:43'),
	(336, 1, 2, 6, 'Pasien berumur 50 tahun dirawat di ruang kardio rumahsakit Hasan Sadikin Bandung  karena sudah tiga bulan yang lalu berat badan selalu  naik dan bengkak di kedua tungkai. Saat dilakukan pengkajian didapatkan data klien mengeluh sesak terutama setelah ke kamar mandi,terdapat pitting edema 1 cm di kedua tungkai, JVP 5 + 4 cm,  tanda-tanda vital didapatkan TD 100/60 mmHg, N 100x/menit RR 24x/menit diagnosa medis CHF.\r\nDiagnosa keperawatan utama pada kasus diatas adalah..', 312, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 18:49:09', '2021-03-29 18:49:09'),
	(337, 1, 2, 6, 'Tn B umur 60 tahun dirawat di ruang kardio rumahsakit Dustira Bandung karena sudah tiga bulan yang lalu berat badan selalu  naik dan terasa sesak. Saat dilakukan pengkajian didapatkan data klien mengeluh sesak terutama setelah ke kamar mandi,terdapat pitting edema 1 cm di kedua tungkai tanda-tanda vital didapatkan TD 100/60 mmHg, N 100x/menit RR 24x/menit diagnosa medis CHF.\r\nKlasifikasi gagal jantung pada kasus diatas adalah', 313, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 18:50:46', '2021-03-29 18:50:46'),
	(338, 1, 2, 6, 'Tn A umur 45 tahun dirawat di ruang penyakit dalam karena sudah tiga bulan yang lalu tekanan darahnya naik berdasarkan informasi dari keluarganya kadang-kadang mencapai 190/110 mmHg. Saat dikaji pasien mengeluh nyeri di belakang leher  skala nyeri 5 (skala 0 – 10 ), tekanan darah 200/100 mmHg, N 100x/menit RR 24x/menit.\r\nPrioritas Diagnosa keperawatan pada kasus diatas adalah', 314, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 18:53:02', '2021-03-29 18:53:02'),
	(339, 1, 2, 6, 'Seorang laki-laki berumur 50 tahun dirawat  karena sudah 2 hari yang lalu mengelami nyeri dada sebelah kiri menjalar keleher dan punggung, Saat dikaji pasien mengeluh nyeri dada seperti tertimpah bendah keras , sekala nyeri 7 (0 – 10), TD 100/60 mmHg , frekuensi nadi 100 x/menit frekuensi nafas 25 x/menit dari hasil pemeriksaan darah troponin T 0,1 mm/dl gambar EKG didapatkan elevasi segmen ST di sadapan II,III dan AVF.\r\nApakah Prioritas Tindakan keperawatan yang tepat untuk pasien tersebut ', 315, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 18:54:38', '2021-03-29 18:54:38'),
	(340, 1, 2, 6, 'Seorang perempuan berumur 57 tahun dirawat diruang orthopedi karena mengalami kecelakaan lalu lintas (KLL). Saat dikaji pasien mengeluh Nyeri dengan skala 4  (0 – 10), ekimosis (+)  luka robek didaerah tibia 2 cm, keadaan luka kotor dan terdapat pus. hasil pemeriksaan photo thorax terdapat fraktur terbuka tibia.hasil Lab : leukosit 16.000 mm3, albumin 3,6 gr%  Pemeriksaan vital signs didapatkan TD 120/80 mmHg,  Frekuensi Nadi 76 x/menit, Frekuensi napas 16 x/menit, suhu 37°C.\r\nApakah Diagnosa keperawatan utama pada kasus tersebut', 316, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 18:56:13', '2021-03-29 18:56:13'),
	(341, 1, 2, 6, 'Ny. S umur 57 tahun dirawat diruang orthopedi karena mengalami kecelakaan lalu lintas (KLL) sejak 2 hari yang lalu. Saat menyeberang jalan seorang pendendara sepeda motor melaju dengan kecepatan tinggi dan menabrak pasien. Pasien Sadar saat kejadian. Nyeri (+),sekala 3 skala (0 – 10), ekimosis (+)  luka robek didaerah tibia 2 cm, perdarahan (+) dari hasil pemeriksaan photo thorax terdapat fraktur terbuka tibia. Pemeriksaan vital signs didapatkan TD 120/80 mmHg, Nadi 76 x/mnt, pernapasan 16 x/mnt, suhu 37°C.\r\nTindakan keperawatan utama yang dlakukan pada kasus diatas adalah', 317, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 18:58:07', '2021-03-29 18:58:07'),
	(342, 1, 2, 6, 'Seorang laki-laki berusia 60 tahun dirawat di ruang cardio karena sudah 5 bualan yang lalu mengalami sesak napas dan bengkak pada ekstremitas bawah, pasien di diagnosa mengalami gagal jantung kanan. Saat dikaji pasien mengeluh cepat lelah apalagi setelah ber aktifitas TD 100/60 mmHg , frekwensi jantung 110 x/menit frekuwensi napas 30 x/menit.\r\nDiagnosa keperawatan utama pada kasus tersebut adalah?', 318, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 18:59:38', '2021-03-29 18:59:38'),
	(343, 1, 2, 6, 'Seorang perempuan berusia 60 tahun dirawat di ruang cardio karena sudah 2 hari yang lalu mengelami nyeri dada sebelah kiri menjalar keleher dan punggung, Saat dikaji pasien mengeluh nyeri dada seperti tertimpah bendah keras TD 100/60 mmHg , frekwensi jantung 100 x/menit frekwensi napas 25 x/menit dari hasil pemeriksaan darah troponin T 60 mm/dl gambar EKG didapatkan elevasi segmen ST di sadapan II,III dan AVF.\r\nPada kasus diatas pasien mengalami?', 319, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 19:01:23', '2021-03-29 19:01:23'),
	(344, 1, 2, 6, 'Seorang Laki-laki berusia 40 tahun dirawat di ruang cardio karena sudah 2 hari yang lalu mengelami nyeri dada sebelah kiri menjalar keleher dan punggung, sekala nyer  Saat dikaji pasien mengeluh nyeri dada seperti tertimpah bendah keras, sekala nyer 5 (0 – 10)  TD 100/60 mmHg , frekwensi jantung 120 x/menit frekwensi napas 28 x/menit dari hasil pemeriksaan darah troponin T 60 mm/dl sekala nyer 5 (0 – 10).\r\nDiagnosa keperawatan utama ?', 320, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 19:03:09', '2021-03-29 19:03:09'),
	(345, 1, 2, 6, 'Seorang laki-aki berusia 45 tahun datang ke UGD RSHS Bandung dengan keluhan nyeri dada hilang timbu, bertambah hebat jika beraktifitas berat dan hilang pada saat iatirahat ,pada saat pengkajian ditemukan data TD 150/90, N 100x/menit,  RR 25x/ menit hasil EKG  adanya  T Invertid, di Lead II diagnosa Angina Stabil.\r\nInformasi seperti apa yang di butuhkan perawat untuk menentukan diagnosis tersebut?', 321, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 19:04:49', '2021-03-29 19:04:49'),
	(346, 1, 2, 5, 'Suatu hari perawat melakukan penyuluhan terkait dengan diit pada hipertensi pada klien yberusia 70th. Pada saat dilakukan evaluasi tanya jawab, klien tidak bisa menjawab satupun pertanyaan terkait materi yang diberikan.\r\nApa yang menyebabkan klien tidak dapat menjawab materi yang diberikan....', 322, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 20:26:10', '2021-03-29 20:26:10'),
	(347, 1, 2, 5, 'Seorang perempuan berusia 60 tahun tinggal dip anti wreda. Klien terlihat kurus dan lemah, beberapa kegiatan ADLnya harus dibantu, sering mengeluh tidak bisa tidur, sering menangis sendiri karena ada kegelisahan yang dipikirkan tentang anaknya, melamun dan sulit mengingat jangka pendek.\r\nApakah bentuk pengkajian yang tepat untuk kasus tersebut?', 323, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 20:28:59', '2021-03-29 20:28:59'),
	(348, 1, 2, 5, 'Seorang laki-laki usia 65 tahun berada dirumah, tidak punya pekerjaan dan penghasilan dia juga hidup sendiri tidak mempunyai keluarga dan teman. Hasil pengkajian klien cenderung mengurung diri dirumah, lemas, kurang makan, tidak beraktivitas yang membuat klien tersebut semakin tertekan dan depresi. \r\nMasalah apakah yang muncul pada keadaan lansia tersebut secara umum?', 324, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 20:30:44', '2021-03-29 20:30:44'),
	(349, 1, 2, 5, 'Seorang perawat mengajarkan tentang teknik senam otak bagi lansia di PSTW, diakhir sesi penyuluhan, perawat meminta lansia untuk melakukan senam otak seperti yang sudah diajarkan dalam penyuluhan tersebut.\r\nApakah jenis evaluasi tepat dilakukan pada kasus tersebut?', 325, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 20:38:11', '2021-03-29 20:38:11'),
	(350, 1, 2, 5, 'Seorang laki-laki berusia 69 tahun tinggal di Panti Sosial Tresna Werda mengeluhkan sudah dua hari teman sekamarnya mengamuk dan semalam tidak bisa tidur karena masih ribut dan marah-marah. Klien bisa tidur dari jam 02.00 sampai 03.00. Klien tampak tertidur di kursi, selama 45 menit pada siang hari, wajah terlihat pucat. \r\nManakah masalah utama pada kasus diatas?', 326, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 20:40:37', '2021-03-29 20:40:37'),
	(351, 1, 2, 5, 'Seorang perempuan berusia 62 tahun dirawat di Rumah Sakit dengan kasus stroke. Pasien mengalami paralisis dibagian eksternal bawah dan atas sebelah kanan, rero dan aktivitas berjalan dibantu, makan dan minum dibantu. Pasien akan pulang besok.\r\nApakah discharge planning yang tepat pada kasus diatas?', 327, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 20:42:28', '2021-03-29 20:42:28'),
	(352, 1, 2, 5, 'Seorang perempuan lansia usia 70 tahun dibawa keluarganya ke physiater. Keluarga mengatakan 5 bulan terakhir, nenek lansia tersebut mengurung diri dikamar, hanya mau mandi 1x sehari, nafsu makan menurun, dan tidak mau menceritakan masalahnya. \r\nApa teknik yang tepat bagi anda sebagai perawat profesional demi menggali masalah yang dialami klien lansia tersebut?', 328, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 20:46:03', '2021-03-29 20:46:03'),
	(353, 1, 2, 5, 'Lansia menderita penyakit paru obstruktif menahun (PPOK), 1 Minggu terakhir keluhan sesa bertambah berat. Hasil X-Ray tampak Hipertrofi Ventrikel kanan sehingga timbul edema pada kedua tungkai kaki, Kulit tampak pucat, denyut nadi tidak teratur. Klien tersebut bertanya apakah hidupnya tidak akan lama lagi? \r\nApa jawaban yang tepat untuk pasien tersebut?', 329, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 20:49:51', '2021-03-29 20:49:51'),
	(354, 1, 2, 5, 'Kakek usa 71 tahun pada 2 hari lalu jatuh dikamar mandi, akibat kejadian tersebut, klien mengeluh tidak mampu menahan urine sampai ke Wc lagi. Hasil pemeriksaan tidak ditemukan gangguan sistem perkemihan kakek tersebut. \r\nManakah kelainan eliminasi urin yang dialami kakek?', 330, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 20:51:21', '2021-03-29 20:51:21'),
	(355, 1, 2, 5, 'Perempuan usia 63 tahun mengalami depresi akibat suaminya meninggal karena kecelakaan, saat melakukan pengkajian didapatkan data bahwa pasien pernah melakukan 3 kali percobaan mengakhiri hidupnya dengan meminum racun. \r\nApa tindakan pertama yang dapat dilakukan pada kasus diatas?', 331, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 20:52:44', '2021-03-29 20:52:44'),
	(356, 1, 2, 10, 'Kepala ruang Melati sedang melakukan penilaian kinerja triwulan. Hasil  menunjukkan tidak ada inisiatif, kurang berpikir kritis dalam menganalisis hasil pengkajian dan hanya bekerja sesuai rutinitas. Dari kesimpulan menujukan adanya stagnansi prestasi kerja perawat dalam memberikan asuhan keperawatan. \r\n\r\nPertanyaan soal\r\nApa yang prioritas  yang harus dilakukan kepala ruangan  dalam kasus tersebut?\r\n', 332, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:05:52', '2021-03-29 23:05:52'),
	(357, 1, 2, 10, 'Di ruang rawat inap penyakit dalam sedang dilaksanakan rapat ruangan. Dalam melakukan perubahan didapatkan seorang perawat tidak bersedia untuk melakukan perubahan karena jika perubahan tersebut dilakukan akan mengakibatkan dirinya menjadi jarang mendapatkan kesempatan dalam mengikuti pelatihan – pelatihan yang diadakan oleh rumah sakit. \r\n\r\nPertanyaan soal\r\nApa faktor penghambat (Restraining force) yang menurunkan minat perawat untuk berubah?\r\n', 333, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:08:03', '2021-03-29 23:08:03'),
	(358, 1, 2, 10, 'Seorang perawat yang bekerja di ruang operasi. Biasanya bekerja di ruang 4 untuk kasus umum. Tapi hari ini perawat tersebut dipindahkan ke ruang orthopedi merasa asing dengan kebiasaan yang dilakukan oleh dokter ortopedi. Pada saat operasi berlangsung, perawat melakukan kesalahan dan dokter marah sambil berkata “dasar bodoh”. Perawat marah sekali dan malu dengan pernyataan dokter tersebut. \r\n\r\nPertanyaan soal\r\nApakah straegi konflik yang tepat dalam situasi tersebut?\r\n', 334, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:10:31', '2021-03-29 23:10:31'),
	(359, 1, 2, 10, 'Seorang perawat perempuan bersuia 25 tahun  adalah ketua tim di ruangan Melati tidak menyukai cara kerja angota timnya yang selalu bekerja tanpa ada kordinasi dengan ketua tim. Perawat tersebut menegur anggota timnya dengan halus dan memandang konflik sebagai hal yang alami dan tidak perlu dihindari. \r\nPertanyaan soal\r\nApakan cara pandang yang dilakukan perawat pada kasus tersebut?\r\n', 335, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:12:14', '2021-03-29 23:12:14'),
	(360, 1, 2, 10, 'Kepala ruangan Melati mendapat laporan ada dokter yang selalu memaki pekerjaan perawat dan selalu menyalahkan perawat apabila terdapat kesalahan dalam melakukan pelayanan pada pasien. Mengetahui hal tersebut kepala ruangan tidak mengambil tindakan apapun dan terkesan untuk menghindari konflik yang sedang terjadi. \r\n\r\nPertanyaan soal\r\nApa cara pandang yang dilakukan kepala ruangan tersebut?\r\n', 336, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:14:07', '2021-03-29 23:14:07'),
	(361, 1, 2, NULL, 'Kepala ruang Bougenville adalah perawat yang memiliki kepribadian kurang mau mendengarkan pendapat bawahannnya. Sehingga bawahan seringkai tidak dapat berkomunikasi dan terkesan acuh tak acuh pada kepala ruangannya, perintah dari kepala ruangan serdiabaikan. Konflik pun sering terjadi antara bawahan dan kepala ruangan. \r\n\r\nPertanyaan soal\r\nApakah sumber konflik yang terdapat pada kasus tersebut?\r\n', 337, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:17:06', '2021-03-29 23:17:06'),
	(362, 1, 2, 10, 'Di suatu wilayah terdapat 2 rumah sakit  yang letaknya berdekatan. 1 RS telah mendapatkan akreditasi JCI sedangkan yang 1 RS belum mendapatkannya. Pada kedua rumah sakit ini selalu terjadi konflik dalam persaingan pelayanan kesehatan. \r\n\r\nPertanyaan soal\r\nStrategi konflik untuk kedua rumah sakit yang paling tidak tepat?\r\n', 338, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:18:38', '2021-03-29 23:18:38'),
	(363, 1, 2, 10, 'Perawat B dan perawat C memiliki perbedaan pendapat dalam penghitungan beban kerja di ruangan dan hal tersebut diungkapkan dalam rapat ruangan. Keduanya saling berargumen dan tidak menyadari kalau argumennya memicu konflik karena melibatkan emosi. Dalam kondisi tersebut kepala ruangan menengahi konflik danm melihat kalau perawat B dan C sebenarnya memiliki komitmen untuk menyelesaikan masalah. \r\n\r\nPertanyaan soal\r\nApakah strategi konflik yang tepat pada kondisi tersebut?\r\n', 339, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:20:09', '2021-03-29 23:20:09'),
	(364, 1, 2, 10, 'Seorang perawat perempuan yang berdinas di ruang rawat inap ditegur oleh keluarga pasien karena memberikan obat tanpa konfirmasi dengan keluarga pasien.  Perawat berdalih bahwa pasien dalam kondisi yang sadar dan perawat sudah konfirmasi dengan pasien tersebut.  Perawat mencoba menjauh dari keluarga pasien .\r\n\r\nPertanyaan soal\r\nApa mekanisme penanganan konflik yang dilakukan oleh perawat tersebut\r\n', 340, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:21:52', '2021-03-29 23:21:52'),
	(365, 1, 2, 10, 'Pada saat dinas malam perawat ditegur oleh temannya dikarenakan perawat tersebut melakukan tindakan yang mempunyai memiliki resiko terhadap keselamatan  pasien. Situasi tersebut membuat perawat yang ditegur menjadi marah dan perawat yang menegur mengabaikannnya.\r\nPertanyaan soal\r\n\r\nApa mekanisme konflik yang dilakukan oleh perawat tersebut?\r\n', 341, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:23:12', '2021-03-29 23:23:12'),
	(366, 1, 2, 10, 'Perawat sedang melakukan irigasi luka steril pada pasien. Teman sejawatnya memasuki ruangan dan memberitahu perawat bahwa dokter menelepon dan meminta berbicara.\r\n\r\nPertanyaan soal\r\nApakah tindakan tepat yang harus di lakukan oleh perawat tersebut?\r\n', 344, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:25:04', '2021-03-29 23:26:51'),
	(367, 1, 2, 10, 'Seorang perawat baru, melakukan orientasi kerja di ruang rawat inap dalam. Tampak ragu, takut salah, dan cenderung mengerjakan tugas secara berulang-ulang  dalam memberikan asuhan keperawatan pada pasien.\r\nApakah yang harus dilakukan perawat baru tersebut untuk mencegah kondisi di atas?', 343, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:26:43', '2021-03-29 23:26:43'),
	(368, 1, 2, 10, 'Dalam metode penugasan tim, rekan satu tim anda mendelegasikan pasien dengan memberikan laporan tertulis mengenai kondisi pasien. Pasien mengeluh perawat terus menerus menanyakan hal yang sama dengan yang ditanyakan perawat sebelumnya, tanpa ada tindakan selanjutnya, sehingga masalah pasien belum teratasi.\r\nApakah tindakan yang  dibutuhkan dalam metode tim untuk mengatasi hal tersebut?', 344, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:28:40', '2021-03-29 23:28:40'),
	(369, 1, 2, 10, 'Perawat A mendapatkan tugas mengelola pasien sejumlah 10 orang. Perawat melakukan pekerjaannya tidak sistematis dan tidak efektif. Semua pasien mendapatkan jenis pelayanan yang sama. Hal ini sangat membingungkan dan memberatkan tugasnya sebagai perawat.\r\nApa tindakan pertama yang harus dilakukan perawat A agar asuhan keperawatan diberikan dengan efektif dan efisien sesuai dengan kondisi pasien', 345, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:30:27', '2021-03-29 23:30:27'),
	(370, 1, 2, 10, 'Diruang perawatan bedah, gterdapat pasien berusia 56 th, 2 jam paska apendictomy, nampakkesakitan, belum bisa mobilisasi sendiri,  terpasang infus.\r\nApakah klasifikasi tingkat ketergantungan pasien di atas?', 346, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:31:55', '2021-03-29 23:31:55'),
	(371, 1, 2, 10, 'Diruang perawatan bedah, gterdapat pasien berusia 56 th, 2 jam paska apendictomy, nampakkesakitan, belum bisa mobilisasi sendiri,  terpasang infus. \r\nApakah klasifikasi tingkat ketergantungan pasien di atas?', 347, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:33:39', '2021-03-29 23:33:39'),
	(372, 1, 2, 10, 'Di sebuah ruang perawatan penyakit dalam seorang pasien sedang dirawat dengan diagnosa medis Stroke. Pada hari ini perawat asosiet akan melakukan implementasi ROM pasif, membantu makan dan memberikan obat kepada pasien tersebut. Sebelum melakukan  ke-tiga hal di atas, pasien diberi kesempatan untuk memilih kegiatan mana dulu yang akan dilakukan.\r\nApakah prinsip etik yang diterapkan oleh perawat tersebut?', 348, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:35:19', '2021-03-29 23:35:19'),
	(373, 1, 2, 10, 'Pada saat Anda dan perawat lain melaksanakan  proses operan dinas (hand over) pagi hari, ditemukan hal-hal yang harus ditindaklanjuti pada pagi hari tersebut, diantaranya harus rontgen, pasien Tn. A mengalami aritmia, pasien Tn. O, BAB di tempat tidur, pasien Ny. C mengalami gejala hipoglikemia, pasien Tn. E kehabisan persediaan obat. \r\nApakah tindakan keperawatan yang harus prioritaskan?', 349, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:37:04', '2021-03-29 23:37:04'),
	(374, 1, 2, 10, 'Anda sebagai perawat di ruang penyakit dalam, Pada saat dinas pagi anda ditugaskan sebagai Katim, sekitar jam 09.00, datang pasien baru dengan diagnosa Stroke.\r\nApakah yang harus anda lakukan sebagai Katim?', 350, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:38:47', '2021-03-29 23:38:47'),
	(375, 1, 2, 10, 'Anda merawat pasien Tn. O dengan kondisi: semua aktivitas dan pergerakan pasien dengan pengawasan, observasi TTV tiap 4 jam, pasien makan dan minum melalui NGT, dan anda pun hharus mencatat intake dan out put dengan ketat.\r\nApakah klasifikasi pasien diatas ?', 351, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:40:58', '2021-03-29 23:40:58'),
	(376, 1, 2, 10, 'Anda sedang dinas malem sebagai perawat asosiet pada metode primer dan diberikan tugas merawat pasien Tn. O umur 35 tahun dengan diagnose Ca Paru.  Sekitar pukul 02.00, Tn O mengalami penurunan kesadaran. \r\nApakah tindakan yang harus anda lakukan untuk menangani masalah tersebut? ', 352, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:42:50', '2021-03-29 23:42:50'),
	(377, 1, 2, 10, 'Seorang perawat assosiate (PA) berdinas malam diberikan tugas oleh perawat primer (PP) untuk merawat pasien dengan diagnosa Ca Paru.  Sekitar pukul 02.00, pasien tersebut  mengalami penurunan kesadaran dan penurunan tanda-tanda vital. \r\nApakah yang PA lakukan pada kasus tersebut?', 353, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:45:08', '2021-03-29 23:45:08'),
	(378, 1, 2, 10, 'Sekelompok perawat pelaksana yang dipimpin oleh ketua tim di ruangan rawat inap sedang mengadakan diskusi tentang  rencana tindakan keperawatan  yang akan dilakukan pada pasien selama berdinas.\r\nApakah tindakan  yang dilakukan oleh ketua tim tersebut?', 354, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:47:34', '2021-03-29 23:47:34'),
	(379, 1, 2, 10, 'Seorang perawat pelaksana tidak melakukan identifikasi pasien sebelum melakukan pemasangan infus. Hal ini diketahui oleh ketua tim, dan langsung diingatkan.\r\nApakah kegiatan yang dilakukan oleh ketua tim?', 355, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:49:12', '2021-03-29 23:49:12'),
	(380, 1, 2, 10, 'Seorang perawat pelaksana berdinas di ruang rawat inap, mendapatkan tugas untuk melakukan tindakan perawatan luka dan pemeriksaan tanda-tanda vital. Perawat lainnya mendapatkan tugas pemasangan infus dan kebersihan diri pasien. Dokumentasi asuhan keperawatan dilakukan oleh ketua tim.\r\nApakah metode asuhan keperawatan yang digunakan di ruang rawat inap tersebut?    ', 356, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:51:04', '2021-03-29 23:51:04'),
	(381, 1, 2, 10, 'Seorang perawat bertugas sebagai perawat pelaksana di ruangan rawat inap, melakukan tindakan pemberian obat-obatan ke beberapa pasien. Pada saat memberikan obat ke pasien berikutnya, perawat tidak melakukan cuci tangan dengan alasan sudah melakukan diawal pada saat pemberian pasien pertama. Hal ini diketahui oleh ketua tim dan dicatat untuk dilakukan evaluasi .\r\nApakah tindakan yang dilakukan oleh ketua tim tersebut?', 357, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:52:50', '2021-03-29 23:52:50'),
	(382, 1, 2, 10, 'Perawat baru yang ditempatkan di ruangan bedah mendapat teguran dari ketua tim, karena terlalu lama dalam melakukan persiapan alat.  Perawat tersebut menjelaskan bahwa ada beberapa alat yang terlewatkan, sehingga harus mengingat kembali alat yang diperlukan. \r\nApakah tindakan yang dilakukan oleh ketua tim pada perawat  tersebut?', 358, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:54:35', '2021-03-29 23:54:35'),
	(383, 1, 2, 10, 'Seorang Perawat meminta izin kepada kepala ruangan untuk tidak masuk kerja karena harus menemani anaknya pada kegiatan outbond. Kepala ruangan tidak mengijinkan karena BOR ruang rawat mencapai 98% dengan tingkat ketergantungan partial.  \r\nApakah tindakan yang dilakukan oleh perawat  tersebut?', 359, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:56:27', '2021-03-29 23:56:27'),
	(384, 1, 2, 10, 'Seorang Perawat meminta izin kepada kepala ruangan untuk tidak masuk kerja karena harus menemani anaknya pada kegiatan outbond. Kepala ruangan tidak mengijinkan karena BOR ruang rawat mencapai 98% dengan tingkat ketergantungan partial.  \r\nApakah tindakan yang dilakukan oleh perawat  tersebut?', 360, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-29 23:58:27', '2021-03-29 23:58:27'),
	(385, 1, 2, 10, 'Seorang perawat  mendapatkan keluhan dari pasien yang sulit mendapatkan air panas untuk mandi. Disampaikan pula alat-alat untuk melakukan pemenuhan kebutuhan dasar sangat terbatas, sehingga perawat kesulitan memenuhi kebutuhan pasien. \r\nApakah yang dilakukan oleh perawat tersebut? ', 361, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 00:00:03', '2021-03-30 00:00:03'),
	(386, 1, 2, 10, 'Seorang perawat baru bekerja sebagai perawat pelaksana di ruang rawat inap. Perawat tersebut belum memiliki pengalaman bekerja di pelayanan, namun keinginan untuk belajar tinggi. Ketua tim banyak memberikan tugas melakukan tindakan keperawatan. \r\nApakah yang dilakukan oleh perawat tersebut? ', 362, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 00:01:32', '2021-03-30 00:01:32'),
	(387, 1, 2, 10, 'Seorang perawat setelah melakukan pemeriksaan tanda-tanda vital, menanyakan kembali keluhan pasien. Pasien mengatakan merasa tidak nyaman sudah 2 hari tidak menggosok gigi. Perawat itu membuat kontrak akan melakukan oral hygiene 2 jam kemudian. Namun hingga pergantian dinas, perawat tidak melakukannya karena sibuk mengatasi kondisi pasien lain yang kritis. \r\nApakah aspek etik legal yang dilalaikan oleh perawat tersebut?', 363, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 00:03:01', '2021-03-30 00:03:01'),
	(388, 1, 2, 10, 'Pasien Tn A Usia 45 tahun datang dari ruang operasi 3 jam yang lalu dilakukan apendiktomy masih tampak kesulitan untuk mobilisasi dibantu oleh perawat. Inpus masih terpasang\r\nApakah tingkat ketergantungan pada pasien tersebut?', 364, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 00:04:27', '2021-03-30 00:04:27'),
	(389, 1, 2, 10, 'Seorang pasien dirawat di ruang bedah. Anak 5 hari yang full operasi mastiodtomy. Rencana pulang besok setelah pemberian Th/INZ. Antibiotic IV. Untuk AD sudah bisadilakukan sendiri.  \r\nApakah tingkat ketergantungan pada pasien tersebut?', 365, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 00:05:59', '2021-03-30 00:05:59'),
	(390, 1, 2, 10, 'Bayi A usia 3 hari dirawat di ruang perinon dengandiagnosa hyperbillirubin. Dipasang phototherapy, terpasanginfus, antibiotic, pemberian ASI OGT menurut (Gillis, 1994)  \r\nKlasifikasi untuk bayi tersebut adalah?', 366, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 00:07:20', '2021-03-30 00:07:20'),
	(391, 1, 2, 10, 'Pasien Ny E datang ke UGD dianbter anaknya dengan keluhan sakit dada, nafas kelihatan sesak R52X/m. T90/70 mgHg, kaki bengkak, palfera bengkak, lemah. Pasien rutin control ke poli jantung dengan diagnose medic decompetatia coades.\r\nPasien harus dirawat dengan tingkat ketergantungan ?', 367, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 00:09:05', '2021-03-30 00:09:05'),
	(392, 1, 2, 10, 'Pasien  Tn A usia 30 tahun 2 hari lalu pus up apendiktomi. Rencan pulang besok sehingga harus melakukan ambulasi denga npengawasan, mandi, makan bisa melakukan sendiri.\r\nTingkat ketergantungan untuk pasien tersebut?  ', 368, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 00:10:32', '2021-03-30 00:10:32'),
	(393, 1, 2, 10, 'Ny H Usia 40 Tahun pastseksia 3 hari yang lalu. Anak ke 3 ada riwayat hypertensi absopsi TTU tiap 3 jam, masih diberikan, inpus terpasang. Untuk ambulasi masih dibantu.\r\nPasien tersebut tingkat ketergantungan ?', 369, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 00:12:02', '2021-03-30 00:12:02'),
	(394, 1, 2, 10, 'TN d usia 60 tahun dirawat di HCU dengan DM. Hasil glukosa darah 312 mg/dl. Adanya penurunan kesadaran. Menurut keluarga sehingga 2x dialkuakn hemodialisa selama 2 th. \r\nPasien harus dirawat dengan tingkat ketergantungan?', 370, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 00:13:24', '2021-03-30 00:13:24'),
	(395, 1, 2, 10, 'Bayi Ny E datang dari Ruang bersalin, setelah dikaji lahir 3 jam yang lalu dengan BB 1800Gram. Respirasi 64x/ml suhu 36,2 terpasang O2, terpasang inpus. Diagnose ada kelainan jantung bawaan, \r\nuntuk bayi tersebut diaktgori perawatan?', 371, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 00:15:14', '2021-03-30 00:15:14'),
	(396, 1, 2, 10, 'Pasien ny B usia 32 tahun4 jam paska apendiktomy masih Nampak kesulitan untuk mobilisasi masih dibantu, terpasang inpus, masih dapat therapy antibiotic.  \r\nuntuk klasifikasi pasien tersebut adalah', 372, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 00:16:37', '2021-03-30 00:16:37'),
	(397, 1, 2, 10, 'Seorang Pasien Anak Laki Laki Usia 14 Tahun Sedang Dipasangprosputi. hasil pemeriksaan HB 8,1 gram sedang ditransfusi labu 1. Setelah dikaji riwayat HB nya rendah dan selalu dapat respusi untuk pasien masih bisa mobilisasi sendiri \r\nuntuk kategori pasien tersebut?', 373, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 00:18:00', '2021-03-30 00:18:00'),
	(398, 1, 2, 3, 'Seorang perempuan dirawat di ruang ginekologi mengeluh mual dan ada sensasi muntah usai menjalani kemoterapi. Perawat melakukan pengkajian berat badan 60 dan  tinggi badan 165. Pasien mengatakan merasa mengalami penurunan berat badan.\r\nApakah intervensi yang tepat diberikan pada pasien tersebut?', 373, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 22:10:28', '2021-03-30 22:10:28'),
	(399, 1, 2, 3, 'Seorang  perempuan usia 45 tahun mengeluh nyeri di bagian perut. Hasil pengkajian menunjukkan terdapat benjolan di bagian perut. Pasien mengatakan sudah 6 bulan ini haid terus menerus tidak berhenti. Riwayat kesehatan dahulu menunjukan pasien pernah mengalami keputihan yang berbau dan berwarna.\r\nApakah Masalah keperawatan yang utama?', 374, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 22:11:44', '2021-03-30 22:11:44'),
	(400, 1, 2, 3, 'Seorang perempuan usia 38 tahun datang ke poliklinik dengan keluhan rasa panas dan nyeri saat kencing, terdapat leukorhoe yang disertai rasa gatal.Ia merasa terganggu saat coitus. Hasil pemeriksaan tampak introitus vagina berwarna merah, bengkak dan tertutup secret.\r\nApakah data lain yang diperlukan oleh perawat untuk menegakkan diagnosa?', 375, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 22:18:06', '2021-03-30 22:18:06'),
	(401, 1, 2, 3, 'Seorang perempuan usia 56 tahun dirawat post op histeroktomi atas indikasi ca ovarium. Pasien mengeluh tidak bisa tidur karena menahan nyeri. Hasil pemeriksaan fisik didapatkan nadi 60x/menit,TD 150/90 mmHg, RR 20x/menit.\r\nApakah diagnosa keperawatan yang tepat pada pasien tersebut?', 376, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 22:19:26', '2021-03-30 22:19:26'),
	(402, 1, 2, 3, 'Seorang perempuan usia 45 tahun dirawat di ruang melati. Pasien mengeluh nyeri pada pada benjolan yang terdapat pada bagian abdomen.\r\nApakah kriteria hasil prioritas untuk intervensi pasien?', 377, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-30 22:25:37', '2021-03-30 22:25:37'),
	(403, 1, 2, 3, 'Seorang perempuan usia 25 tahun merasa kebingungan memilih alat kontrasepsi yang tepat. Pasien meminta perawat untuk menjelaskan beberapa alternatif alat kontrasepsi yang dapat dipilih keuntungan dan kerugiannya. \r\nApakah peran perawat dalam kasus tersebut?', 378, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:21:12', '2021-03-31 02:21:12'),
	(404, 1, 2, 3, 'Seorang perempuan usia 40 tahun G6P5A0 hamil 32 minggu datang ke poliklinik bersama suaminya untuk memeriksakan kehamilan. Klien mengatakan tidak pernah ada keluhan selama kehamilan. Klien ingin menggunakan alat kontrasepsi setelah kelahiran anaknya tapi suaminya masih ingin memiliki anak lagi.\r\nApakah tindakan yang dilakukan oleh perawat?', 379, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:23:01', '2021-03-31 02:23:01'),
	(405, 1, 2, 3, 'Seorang perempuan usia 30 tahun datang ke poliklinik untuk melakukan konsultasi. Saat ini sedang menyusui secara ekslusif bayinya. Pasien bekerja sebagai karyawan swasta dan bermaksud untuk menunda kehamilan sampai jangka waktu 3 tahun. Ia juga menderita tekanan darah tinggi sejak melahirkan anak pertama. Pasien takut untuk dilakukan pemasangan IUD.\r\nApakah jenis alat kontrasepsi yang paling tepat untuk kasus tersebut?', 380, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:24:17', '2021-03-31 02:24:17'),
	(406, 1, 2, 3, 'Seorang perempuan usia 35 tahun P5A0 datang ke poliklinik kebidanan untuk menggunakan alat kontrasepsi. Pasien memiliki riwayat persalinan terakhir dengan eklampsi. Suami pasien memiliki kepercayaan dalam agama bahwa kontrasepsi itu haram.\r\nApakah tindakan yang dilakukan oleh perawat?', 381, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:25:35', '2021-03-31 02:25:35'),
	(407, 1, 2, 3, 'Seorang perempuan usia 34 tahun datang ke puskesmas untuk melakukan konsultasi KB. Pasien telah memiliki 2 orang anak. Sebelumnya pasien menggunakan alat kontrasepsi pil dan suntik. Pasien mengeluh  menjadi gendut dan jerawatan dengan menggunakan alat kontrasepsi tersebut. Pasien merasa malu.\r\nApakah masalah keperawatan pasien tersebut?', 382, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:26:40', '2021-03-31 02:26:40'),
	(408, 1, 2, 3, 'Seorang perempuan berusia 31 Tahun P3A0 di kamar bersalin setelah melahirkan bayi laki-laki dengan APGAR score 10 dan berat badan 3700 gram. Pasien telah disuntikkan oksitosin 10 UI secara intramuscular dan setelah 15 menit plasenta lahir. \r\nApakah tujuan tindakan injeksi yang dilakukan tenaga kesehatan tersebut pada pasien? ', 383, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:27:58', '2021-03-31 02:27:58'),
	(409, 1, 2, 3, 'Seorang perempuan berusia 30 Tahun, G1A0, ke UGD jam 06.00 WIB dengan keluhan mulas. Dari pengkajian didapatkan tekanan darah 110/70 mmHg, frekuensi  napas 22x/menit, denyut nadi 80 x/menit, suhu 36,50c, his teratur sebanyak  kali dalam 10 menit dengan durasi 30 detik dan hasil periksa dalam, pembukaan 3 cm, ketubah utuh, porsio masih tebal.\r\nApakah pengkajian lanjutan yang harus dilakukan?', 384, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:29:12', '2021-03-31 02:29:12'),
	(410, 1, 2, 3, 'Seorang perempuan berusia 25 Tahun, G1P0 di rawat di kamar bersalin telah melahirkan bayi laki-laki secara normal dengan berat badan 3000 gram, APGAR Score 10. Bayi telah dibersihkan dengan handuk kecuali telapak tangan dan telah dilakukan pemotongan tali pusat. \r\nApakah implementasi selanjutnya pada kasus tersebut? ', 385, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:30:14', '2021-03-31 02:30:14'),
	(411, 1, 2, 3, 'Seorang perempuan berusia 28 tahun, P2A0, di kamar bersalin setelah melahirkan bayi laki-laki, BB 3700 gram 1 jam yang lalu. Dari hasil pengkajian: Tekanan darah 100/70 mmHg, frekuensi nadi 88 x/menit, frekuensi napas 24 x/menit, tidak ada kontraksi dan ada jahitan robekan perineum derajat 2.\r\nApakah diagnosa keperawatan utama pada kasus tersebut?', 386, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:31:46', '2021-03-31 02:31:46'),
	(412, 1, 2, 3, 'Seorang perempuan berusia 33 tahun, P2A1, di kamar bersalin setelah melahirkan bayi laki-laki, BB 3500 gram. Dari hasil pengkajian: Tekanan darah 100/70 mmHg, frekuensi nadi 88 x/menit, frekuensi napas 24 x/menit, tidak ada kontraksi dan ada jahitan robekan perineum derajat 2.\r\nApakah tindakan yang harus dilakukan?', 387, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:33:05', '2021-03-31 02:33:05'),
	(413, 1, 2, 3, 'Seorang perempuan berusia 26 tahun, G1P0A0 usia kehamilan 40 minggu datang dengan keluhan perutnya mulas-mulas. TFU 32 cm, belum ada tanda-tanda pembukaan serviks dan pasien tampak lemas.\r\nApakah intervensi keperawatan utama yang bisa dilakukan oleh perawat?', 388, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:36:23', '2021-03-31 02:36:23'),
	(414, 1, 2, 3, 'Seorang perempuan usia 28 tahun, G2P1A0 di kamar bersalin, mules-mules sejak 8 jam yang lalu dan bertambah sering dan kuat disertai keluarnya lendir darah pervaginam. Hasil pemeriksaan: kontraksi uterus setiap 10 menit sekali dengan durasi 30 detik dan denyut jantung janin 120 kali permenit. \r\nApakah tindakan selanjutnya yang dilakukan? ', 389, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:37:24', '2021-03-31 02:37:24'),
	(415, 1, 2, 3, 'Seorang perempuan usia 28 tahun G1P1A0, datang ke UGD dengan keluhan mulas-mulas sejak 8 jam yang lalu disertai keluarnya lendir darah pervaginam, Hasil pemeriksaan: pembukaan lengkap, his kuat dan teratur, perineum tampak menonjol, vulva membuka, dan ada dorongan meneran yang kuat.\r\nApakah tindakan selanjutnya yang harus dilakukan?', 390, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:38:26', '2021-03-31 02:38:26'),
	(416, 1, 2, 3, 'Seorang perempuan usia 36 tahun, G1P2A0 datang ke klinik bersalin dengan keluhan mules mules yang semakin kuat dan sering serta keluar cairan bening dan lendir darah. Hasil pengkajian: DJJ 140x/menit, skala nyeri 9 saat his datang, his 2 kali dalam 10 menit dengan durasi 30-40 detik, pembukaan 7 cm. \r\nApakah masalah keperawatan yang menjadi prioritas?', 391, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:39:36', '2021-03-31 02:39:36'),
	(417, 1, 2, 3, 'Seorang perempuan berusia 35 Tahun, P4A0 di Recovery room post sectio caesaria. Satu jam setelah melahirkan, perawat melakukan pengkajian terhadap fundus uteri, dan didapati fundus uteri lembek, kontraksi lemah dan lokhea sangat banyak. \r\nApakah tindakan yang paling tepat dilakukan oleh perawat?', 392, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:41:06', '2021-03-31 02:41:06'),
	(418, 1, 2, 3, 'Seorang perempuan berusia 26 tahun G2P1A0 dirujuk ke UGD dengan keluhan  pergerakan janin lemah,dan  saat bayinya lahir tampak tubuh merah namun pada bagian ekstremitas pucat, nadi teraba 80x/menit, suara tangisan bayi sangat lemah, gerak ektremitas fleksi namun ada juga yang ekstensi, bayi tampak sesak. \r\nBerapakah nilai APGAR score pada kasus tersebut?', 393, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:42:06', '2021-03-31 02:42:06'),
	(419, 1, 2, 3, 'Seorang bayi laki-laki dilahirkan dalam keadaan spontan didapatkan saat pengkajian awal seluruh tubuh bayi berwarna merah muda ekstremitas kebiruan, denyut jantung 89 x/menit, bayi menangis lemah, gerakan bayi tampak fleksi hipotonus pada bagian yang lain, frekuensi napas irregular. \r\nBerapakah nilai APGAR Score pada tersebut?', 394, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:42:49', '2021-03-31 02:42:49'),
	(420, 1, 2, 3, 'Seorang ibu berusia 40 tahun P3A1 partus prematurus spontan,  melahirkan seorang bayi di ruang VK puskesmas, Hasil Pengkajian :  tampak sianosis, frekuensi nadi 30x/menit, tidak ada respon, frekuensi nafas 20x/menit.\r\nApakah implementasi perawat yang harus segera untuk dilakukan pada kasus?', 395, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:44:08', '2021-03-31 02:44:08'),
	(421, 1, 2, 3, 'Seorang bayi bereaksi saat dilakukan bonding yaitu mata terbuka, focus pada wajah dan suara ibu dan reflek isap kuat. \r\nApakah intervensi yang dapat perawat lakukan pada tahap ini?', 396, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:45:11', '2021-03-31 02:45:11'),
	(422, 1, 2, 3, 'Seorang wanita berusia 23 tahun, P1A0 Partus Maturus spontan,  diberikan bayinya pada tahap bonding, ia mulai menyentuh bayinya, melakukan kontak mata, mengajak bicara dan menciumi aroma bayinya.\r\nApakah respon bonding yang terjadi pada kasus...', 397, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:46:26', '2021-03-31 02:46:26'),
	(423, 1, 2, 3, 'Seorang wanita berusia 26 tahun G2P1A0 melahirkan bayi berjenis kelamin laki-laki, saat proses kelahiran bayi tidak langsung menangis sehingga perawat melakukan rangsangan taktil dengan menepuk atau menyentuh telapak kaki bayi, namun bayi belum berespon.\r\nApakah stimulasi lain yang dapat perawat lakukan pada kasus?', 398, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:47:30', '2021-03-31 02:47:30'),
	(424, 1, 2, 3, 'Seorang perempuan berusia 23 tahun G2P1A0 melahirkan anaknya di Ruang VK, dilakukan IMD (Inisiasi Menyusui Dini), pada proses tersebut ada beberapa tahapan dan prinsip, terutama yang dilakukan kepada bayi yaitu dengan tidak mengelap dan mencuci  bagian tangannya.\r\nApakah Tujuan Tindakan Tersebut pada kasus ?', 399, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 02:59:55', '2021-03-31 02:59:55'),
	(425, 1, 2, 3, 'Seorang wanita berusia 26 tahun G1P0A0 dibawa ke ruang VK, lahirlah seorang bayi laki-laki,  perawat membantu proses kelahiran di bagian pengelolaan bayi baru lahir. Hasil pengkajian didapatkan bayi belum menangis dan kulit pucat.\r\nApakah tindakan yang pertama kali harus dilakukan?', 400, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 03:01:01', '2021-03-31 03:01:01'),
	(426, 1, 2, 3, 'Seorang perempuan berusia 24 tahun, G2P1A0 , dibawa ke ruang bersalin dan melahirkan seorang anak laki-laki dengan Berat lahir 3100gram, dan panjang badan 50cm. menangis keras dan tampak pergerakan ekstremitas aktif dan bayi dipersiapkan untuk boonding dengan ibunya.\r\nKapankan waktu paling tepat dilakukan tindakan pada kasus?', 401, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 03:02:05', '2021-03-31 03:02:05'),
	(427, 1, 2, 3, 'Seorang bayi perempuan dilahirkan dengan berat badan lahir 2800gr dan panjang badan 49cm, setelah terstimulasi bayi menangis dan seluruh badan memerah Kemudian bayi ditempatkan di dada ibu,  masuk ke tahap relaksasi saat tubuh bayi mulai berhenti menangis dan bergerak secara perlahan-lahan.\r\nApakah tindakan perawat selanjutnya pada kasus?', 402, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-31 03:11:57', '2021-03-31 03:11:57'),
	(428, 2, 2, 8, 'Seorang laki-laki usia 34 tahun dibawa ke UGD karena mengalami kecelakaan. Hasil dari pengkajian, ektremitas bawah sebelah kanan pasien mengalami remuk dan harus segera di amputasi, kesadaran klien compos mentis, TD 14 mmhg, nadi 92x/mnt, pasien terlihat gelisah, muka pucat, emosi tidak nyaman.\r\n\r\nApakah tindakan keperawatan yang tepat pada kasus tersebut..\r\n', 1, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:01:54', '2021-04-05 07:01:54'),
	(429, 2, 2, NULL, '\r\nSeorang perempuan usia 62 tahun dirawat di RSU karena mengalami masalah dengan BAB, menderita wasir sejak 3 bulan yang lalu dan akan dilakukan operasi. Hasil pengkajian pasien terlihat takut, sulit tidur, TD 130mmhg, Nadi 90 x/mnt, muka pucat.\r\n\r\nApakah masalah keperawatan yang tepat pada kasus diatas\r\n\r\n', 2, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:09:25', '2021-04-05 07:09:25'),
	(430, 2, 2, 8, 'Seorang laki-laki usia 34 tahun dibawa ke UGD karena mengalami kecelakaan. Hasil dari pengkajian, ektremitas bawah sebelah kanan pasien mengalami remuk dan harus segera di amputasi, kesadaran klien compos mentis, TD 14 mmhg, nadi 92x/mnt, pasien terlihat gelisah, muka pucat, emosi tidak nyaman.\r\n\r\nApakah tindakan keperawatan yang tepat pada kasus tersebut..\r\n', 3, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:19:47', '2021-04-05 07:19:47'),
	(431, 2, 2, 8, 'Seorang perempuan usia 22 tahun, dirawat di RSJ. Hasil pengkajian pasien mengatakan “semua laki-laki yang ingin mendekati saya punya maksud jelek pada saya, mereka menggunakan ilmu pellet agar saya cinta sama mereka dan memberikan keperawanan saya”.Afek labil, sering mengerak gerakan tangannya tanpa disadari dan gelisah.\r\n\r\nApakah Tujuan tindakan pada kasus tersebut ?\r\n', 4, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:22:45', '2021-04-05 07:22:45'),
	(432, 2, 2, 8, 'Seorang laki-laki usia 29 tahun, dirawat di ruang  akut RSJ. Hasil pengkajian pembicaraan pasien masih inkoheren, kontak mata tidak dapat dipertahankan, ekspresi wajah ketakutan, mudah terdistraksi, menarik diri dari lingkungan, pernah melakukan percobaan bunuh diri.\r\nSaat digali pasien bingung dengan apa yang dia rasakan\r\n\r\nApakah tahapan halusinasi yang tepat pada kasus tersebut\r\n', 5, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:26:17', '2021-04-05 07:26:17'),
	(433, 2, 2, 8, 'Seorang laki-laki 65 tahun berada dirumah, hasil pengkajian pasien sudah mengalami stroke selama 5 tahun, pasien merasa tidak ada tindakan apapun yang bisa merubah kondisinya saat ini, pasien merasa diasingkan oleh keluarganya, merasa malu dengan kondisi saat ini, keraguan tentang kesembuhannya. Hasilobservasi ditemukan pasien menghindari orang lain, ekspresi muka murung, apatis dan pasif.\r\n\r\nApakah diagnose yang tepat pada kasus tersebut..\r\n', 6, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:29:16', '2021-04-05 07:29:16'),
	(434, 2, 2, 8, 'Seorang laki-laki usia 30 tahun di rawat di RSJ. Pasien mengikuti kegitan TAK selama 25 menit, pasien terlihat gelisah, tidak focus dalam kegiatan TAK, tiba-tiba pasien meninggalkan tempat tanpa ada alasan.\r\n\r\nApakah tindakan yang tepat pada kasus tersebut\r\n', 7, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:32:23', '2021-04-05 07:32:23'),
	(435, 2, 2, 8, 'Seorang laki-laki usia 39 tahun dirawat di RSJ karena sudah 3 bulan tidak mau lagi minum obat. Pasien mulai sering murung karena 1 tahun yang lalu ditinggal meninggal oleh ibunya, sampai saat ini pasien belum bekerja dan belum menikah.\r\n\r\nApakah faktor presipitasi yang tepat pada kasus diatas..\r\n', 8, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:34:55', '2021-04-05 07:34:55'),
	(436, 2, 2, 8, 'Seorang laki-laki usia 45 tahun dirawat di RSJ dengan marah-marah karena ada sura-suara yang didengarnya. Hasil pengkajian pasien mengatakan “Semua orang ingin mencelakaiku karena mereka tidak mengiginkan aku menjadi seorang presiden padahal aku ini adalah calon kuat dalam pemilihan nanti”. Pasien tidak mau makan, tidak bisa tidur dan kurang memperhatikan kebersihan.\r\n\r\nApakah rencana tindakan keperawatan yang utama pada kasus diatas..\r\n', 9, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:37:11', '2021-04-05 07:37:11'),
	(437, 2, 2, 8, 'Seorang perawat melakukan kunjungan rumah pada seorang perempuan usia 24 tahun setelah 3 minggu dirawat di RSJ. Didapatkan data dari keluarga pasien sudah mulai malas minum obat karena setelah minum obat pasien sering merasa mengantuk dan banyak makan sehingga badannya menjadi sangat gendut, kini pasien tidak mau minum obat karena sudah merasa sembuh.\r\n\r\nApakah tindakan keperawatan yang tepat pada kasus tersebut..\r\n', 10, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:39:36', '2021-04-05 07:39:36'),
	(438, 2, 2, 9, 'Hasil pengkajian perawat di suatu wilayah mendapatkan kasus diare yang terjadi pada anak dibawah 5 tahun sebanyak 50% pada 3 bulan terakhir ,  perawat kemudian mengkaji status semua anak balita\r\nApa prinsip etik yang diterapkan perawat pada kasus tersebut?\r\n', 11, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:41:04', '2021-04-05 07:41:04'),
	(439, 2, 2, 8, 'Seorang perempuan usia 25 tahun, datang ke poli kulit, post luka bakar. Hasil pengkajian didaerah mukanya terdapat luka bekas luka bakar, pasien terlihat sedih, banyak menunduk, sesekali menutup mukanya dengan kedua tangannya, dank lien mengatakan sekarang dia berubah beda dengan yang lainnya.\r\n\r\nApakah tindakan keperawatan pada kasus tersebut..\r\n', 12, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:42:23', '2021-04-05 07:42:23'),
	(440, 2, 2, 3, 'Ny NN berusia 34 tahun dengan G3P2A0 datang ke poli kandungan untuk memeriksakan kehamilannya. Hasil pengkajian didapatkan data HPHT tanggal 26 Januari 2019.  Hasil pemeriksaan TTV didapatkan TD: 110/70mmHg, RR:18x/menit, HR:84x/menit.\r\nKapan taksiran persalinan pada kasus diatas?', 13, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:42:40', '2021-04-05 07:42:40'),
	(441, 2, 2, 9, 'Perawat bersama-sama kader melakukan kegiatan posyandu, pada saat penimbangan ada anak yang menangis meronta-ronta tidak mau ditimbang, akhirnya perawat dan kader menganjurkan anak ditimbang sambil digendong ibunya. Hasil timbangan keduanya dikurangi dengan berat badab ibu.\r\nApa prinsip etik yang diterapkan perawat pada kasus tersebut?\r\n', 14, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:43:11', '2021-04-05 07:43:11'),
	(442, 2, 2, 3, 'Ny NN berusia 34 tahun dengan G3P2A0 datang ke poli kandungan untuk memeriksakan kehamilannya. Hasil pengkajian didapatkan data HPHT tanggal 26 Januari 2019.  Hasil pemeriksaan TTV didapatkan TD: 120/70mmHg, RR:18x/menit, HR:86x/menit.\r\nBerapakah usia kehamilan pada kasus diatas?', 15, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:44:48', '2021-04-05 07:44:48'),
	(443, 2, 2, 3, 'Ny MD berusia 30 tahun kehamilan 29 minggu  datang ke poli kandungan untuk konsultasi kehamilan. Dari hasil pengkajian didapatkan data memiliki anak hidup 2 dan pernah mengalami keguguran 1 kali pada anak ketiga. \r\nApakah status obstetri pada kasus diatas?', 16, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:46:23', '2021-04-05 07:46:23'),
	(444, 2, 2, 9, 'Berdasarkan hasil pengkajian di suatu wilayah binaan, terjadi wabah penyakit Diare. Dilaporkan seorang balita meninggal dunia. Masyarakat mengatakan diare pada ada adalah hal yang biasa bahwa anak akan meningkat kepintarannya jadi tidak memerlukan pelayanan kesehatan\r\nApakah data inti komunitas yang harus dikaji lebih lanjut pada kasus diatas?', 17, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:46:40', '2021-04-05 07:46:40'),
	(445, 2, 2, 8, 'Seorang perempuan berusia 60 tahun dirawat di RS karena menderita penyakit stroke yang tidak kunjung sembuh. Pada saat dilakukan pengkajian, pasien ditemukan TTV dengan nadi meningkat, TD 160 mmHg, terlihat menangis, sulit tidur dan gelisah. Diagnosa keperawatan pada pasien tersebut adalah ansietas.\r\n\r\nApakah tindakan keperawatan yang pertama kali dilakukan pada pasien tersebut?\r\n\r\n', 18, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:47:46', '2021-04-05 07:47:46'),
	(446, 2, 2, 3, 'Ny D berusia 24 dengan G1P0A0 hamil 30 minggu  datang ke poli kandungan untuk melakukan pemeriksaan kehamilan. Dari hasil pengkajian leopold diperoleh pada daerah kanan ibu teraba keras seperti papan dan pada sisi kiri ibu teraba bagian-bagian terkecil janin,\r\nPemeriksaan tersebut merupakan pemerikssan leopold berapa?', 19, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:48:03', '2021-04-05 07:48:03'),
	(447, 2, 2, 9, 'Hasil survey di Desa C diperoleh data;  jumlah penduduk 2514 jiwa, Jumlah balita 67 orang, hasil data KMS 5 % balita berada pada garis kuning, 1 % berada di garis merah, 10 % balita menderita ISPA, 2% balita menderita diare, cakupan imunisasi Polio 10 %. Posyandu berjalan rutin dengan angka kunjungan 60 %.\r\nApakah  prioritas masalah pada kasus diatas ?', 20, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:49:49', '2021-04-05 07:49:49'),
	(448, 2, 2, 3, 'Ny R berusia 33 tahun kehamilan 25 minggu datang ke poli kandungan untuk memeriksakan kehamilan. Dari hasil pengkajian didapatkan data memiliki anak hidup 1, pernah melahirkan dua kali tetapi anaknya yang satu meninggal setelah dilahirkan dan tidak memiliki riwayat keguguran. \r\nApakah status obstetri pada kasus diatas?', 21, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:50:00', '2021-04-05 07:50:00'),
	(449, 2, 2, 8, 'Seorang perempuan berusia 14 tahun sejak satu minggu ini dirawat di Ruang Nuri RSJ. Pasien di bawa ke RSJ karena sering mengamuk. Pada saat dikaji, didapatkan pasien tampak berperilaku kasar, tangan mengepal dan tatapan mata tajam. Pasien juga memiliki riwayat keluarga yang mengalami gangguan jiwa.\r\n\r\nApakah faktor predisposisi pada kasus tersebut?\r\n\r\n', 22, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:50:14', '2021-04-05 07:50:14'),
	(450, 2, 2, 9, 'Seorang perawat mengkaji sebuah kecamatan didapatkan data terjadi 5 kasus TBC  pada usia dewasa,  penderita 2 orang sdh mendapakan pengobatan TBC selama 2 bulan, dan 3 orang sudah mendapatka pengobata 5 bulan\r\nApakah intervensi prioritas yang perlu dilakukan perawat?', 23, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:52:03', '2021-04-05 07:52:03'),
	(451, 2, 2, 8, 'Seorang perempuan berusia 47 tahun mendapatkan kabar dari RS bahwa anaknya mengalami kecelakaan dan meninggal dalam perjalanan menuju RS. Klien mengatakan bahwa anaknya tidak mungkin meninggal karena tadi pagi anaknya masih sehat dan baik baik saja. Klien mengatakan bahwa kabar yang didengarnya itu tidak benar.\r\n\r\nApakah tahap kehilangan yang terjadi pada pasien tersebut?\r\n\r\n', 24, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:52:39', '2021-04-05 07:52:39'),
	(452, 2, 2, 3, 'Ny A berusia 28 tahun datang ke poliklinik kandungan dengan status obstetric G3P2A0 dengan usia kehamilan 10 minggu dengan keluhan mual muntah sudah 10 kali selama 12 jam hingga nyeri ulu hati, setiap makanan yang dimakan langsung dimuntahkan begitu juga jika minum. Berdasarkan hasil pemeriksaan, ibu tersebut didiagnosa hyperemesis gravidarum.\r\nDiagnosa keperawatan yang utama adalah', 25, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:52:49', '2021-04-05 07:52:49'),
	(453, 2, 2, 9, 'Berdasarkan hasil pengkajian perawat terdapat 7 orang ibu hamil di desa X,   5 dari ibu hamil mengatakan memiliki kenyakinan untuk makan dalam piring kecil agar jabang bayi memiliki wajah yang imut.\r\nApakah prioritas intervensi terhadap kasus di atas ? ', 26, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:54:23', '2021-04-05 07:54:23'),
	(454, 2, 2, 3, 'Ny C berusia 26 tahun, menikah pada awal april tahun 2019, datang ke klinik obgin dengan keluhan mual muntah, terlambat menstruasi 24 hari. Menstruasi terakhir 16 Juli 2019. Hasil beta HCG dinyatakan positif hamil.\r\nKapan taksiran persalinan ibu tersebut?', 27, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:54:53', '2021-04-05 07:54:53'),
	(455, 2, 2, 8, 'Seorang laki-laki berusia 48 tahun dirawat di RS Umum akibat TBC. Saat dikaji oleh perawat, pasien terlihat sedih, sulit tidur, ketakutan, dan gelisah, menyesali diri dan merasa bersalah karena tidak bisa mencari nafkah untuk keluarganya. Diagnosa keperawatan pada klien tersebut adalah ansietas.\r\n\r\nApakah tindakan keperawatan yang pertama kali dilakukan pada klien tersebut?\r\n\r\n', 28, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:55:55', '2021-04-05 07:55:55'),
	(456, 2, 2, 9, 'Saat perawat melakukan wawancara pada anak sekolah , didapatkan sebagian besar 75% remaja putri mengalami dismenorea dan remaja mengkonsumsi cairan soda dan kacang kacang yang menurut kepercayaan mereka akan memperlancar menstruasi\r\nApa pengkajian selanjutnya dilakukan oleh perawat? \r\n', 29, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:56:06', '2021-04-05 07:56:06'),
	(457, 2, 2, 3, 'Ny K berusia 22 tahun, datang ke puskesmas dengan keluhan mual muntah di pagi hari. Dari hasil anamnesa didapatkan ibu terlambat haid selama 4 minggu, setelah dilakukan pemeriksaan urin, didapatkan PP test positif. Perawat menegakkan diagnosa G2P1A0.\r\nApa arti diagnosa perawat tersebut?', 30, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:56:11', '2021-04-05 07:56:11'),
	(458, 2, 2, 3, 'Perawat melakukan pengkajian terhadap NY V dengan usia kehamilan 34 minggu. Perawat mengukur TFU dengan ukuran centimeter.\r\nHasil yang didapatkan adalah?', 31, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:57:29', '2021-04-05 07:57:29'),
	(459, 2, 2, 9, 'Dinas keshatan mengadakan Skrining HIV pada daerah lokalisasi, didapatkan 16 orang terinfeksi. Selanjutnya ODHA diberikan pengobatan gratis dan pendampingan gratis dari puskesmas\r\nApakah upaya kesehatan yang dilakukan oleh puskesmas tersebut? ', 32, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:57:51', '2021-04-05 07:57:51'),
	(460, 2, 2, 8, 'Seorang Perempuan berusia 29 tahun sudah seminggu dirawat di Ruang Rajawali RSJ. Menurut Ibunya, sejak kecil pasien sering dipukul dan dimarahi oleh ayahnya, sehingga mengalami stres. Pada saat pengkajian di dapatkan data : menyebutkan Bahasa kasar, tangan mengepal, dan mengamuk.  \r\n\r\nApakah faktor predisposisi pada kasus tersebut?\r\n\r\n', 33, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:58:13', '2021-04-05 07:58:13'),
	(461, 2, 2, 3, 'Ny H berusia 39 tahun G3P2A0 datang ke klinik kandungan untuk memeriksakan kehamilannya. Saat dilakukan pemeriksaan leopold I didapatkan hasil pemeriksaan TFU 33cm diatas simpisis.\r\nBerapakan usia kehamilan ibu tersebut?', 34, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:58:41', '2021-04-05 07:58:41'),
	(462, 2, 2, 3, 'Seorang perempuan berusia 30 tahun G4P1A2 mengaku usia kehamilan 37minggu, datang ke puskesmas untuk memeriksakan kandungannya, mengeluh perdarahan pervaginam, hasil pemeriksaan USG tampak plasenta menutupi jalan lahir.\r\nApakah data objektif pengkajian yang harus didapatkan oleh perawat?\r\n', 35, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:59:42', '2021-04-05 07:59:42'),
	(463, 2, 2, 9, 'Di suatu wilayah berdasarkan hasil pengkajian perawat terdapat 78% lansia menderita Hipertensi. Penderita hipertensi tersebut sudah mendapatkan obat hipertensi secara rutin dari puskesmas. Namun penderita hipertensi semakin meningkat di daerah tersebut\r\nApakah pengkajian selanjutnyayang harus dilakukan perawat komunitas?', 36, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 07:59:44', '2021-04-05 07:59:44'),
	(464, 2, 2, 8, 'Seorang perempuan usia 18 tahun dirawat di RSJ. Saat dikaji oleh perawat, pasien mengatakan dirinya tidak berguna dan tidak mampu membanggakan orang tuanya. Setelah dikaji, pasien tampak menunduk dan nada suara pelan.\r\n\r\nApakah faktor predisposisi pada kasus tersebut?\r\n\r\n', 37, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:00:39', '2021-04-05 08:00:39'),
	(465, 2, 2, 3, 'Seorang perempuan berusia 19 tahun G1P0A0 mengaku usia kehamilan 20 minggu, datang ke IGD RS dengan keluhan mengalami perdarahan, klien mengeluh nyeri yang hebat dibagian bawah perut, hasil pengkajian : konjungtiva pucat, nadi 105 x/menit, suhu 38 C, TD 90/60 mmHg.\r\nApakah keadaan emergency yang terjadi pada pasien?\r\n', 38, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:01:11', '2021-04-05 08:01:11'),
	(466, 2, 2, 9, 'Seorang laki-laki usia 63 tahun menderita hipertensi datang ke posbindu untuk pemeriksaan rutin tekanan darah. Klien mengeluh pusing dan merasa kaku dibagian tekuk, hal ini dirasakan setelah makan kikil 2 hari yang lalu. Klien dianjurkan untuk diperiksa kolesterol.\r\nDimanakah prosedur selanjutnya dilakukan?', 39, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:02:08', '2021-04-05 08:02:08'),
	(467, 2, 2, 3, 'Seorang perempuan berusia 19 tahun G1P0A0 mengaku usia kehamilan 20 minggu, datang ke IGD RS dengan keluhan mengalami perdarahan, klien mengeluh nyeri yang hebat dibagian bawah perut, hasil pengkajian : konjungtiva pucat, nadi 105 x/menit, suhu 38 C, TD 90/60 mmHg.\r\nApakah diagnose keperawatan prioritas pada pasien tersebut?\r\n', 40, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:02:17', '2021-04-05 08:02:17'),
	(468, 2, 2, 3, 'Seorang perempuan berusia 30 tahun G4P1A2 mengaku usia kehamilan 37 minggu, datang ke puskesmas untuk memeriksakan kandungannya, mengeluh perdarahan pervaginam, hasil pemeriksaan USG tampak plasenta menutupi jalan lahir.\r\nApakah diagnosa medis yang dialami oleh pasien tersebut?\r\n', 41, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:03:22', '2021-04-05 08:03:22'),
	(469, 2, 2, 8, 'Seorang Perempuan berusia 30 tahun sudah seminggu dirawat di Ruang Merpati RSJ. Menurut tetangganya pasien sering diperlakukan kasa, sehingga mengalami stress fisik. Pada saat pengkajian di dapatkan data : tatapan mata tajam, alam perasaan depresi, adanya kerusakan kognitif, dan adanya riwayat ancaman kekerasan pada orang lain. \r\n\r\nApakah diagnosis pada kasus tersebut?\r\n\r\n', 42, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:03:35', '2021-04-05 08:03:35'),
	(470, 2, 2, 9, 'Pengkajian perawat komunitas di wilayah X ditemukan 12 ibu hamil, dimana sebanyak 25% ibu hamil memiliki Hb dibawah 11, 5% mengatakan mual-mual dan 2% melakukan pemeriksaan kehamilan pada paraji/dukun beranak serta  95% selalu rutin ke puskesmas\r\nUpaya preventif yang paling tepat dilakukan ?', 43, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:03:53', '2021-04-05 08:03:53'),
	(471, 2, 2, 3, 'Seorang perempuan berusia 30 tahun G1P0A0 mengaku usia kehamilan 37 minggu, datang ke puskesmas untuk memeriksakan kandungannya, mengeluh sering BAK.\r\nApakah penyebab sering BAK pasien tersebut?\r\n', 44, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:04:24', '2021-04-05 08:04:24'),
	(472, 2, 2, 3, 'Seorang perempuan berusia 30 tahun G1P0A0 mengaku usia kehamilan 12 minggu, datang ke puskesmas untuk memeriksakan kandungannya, mengeluh sering BAK.\r\nApakah penyebab sering BAK pasien tersebut?\r\n', 45, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:05:47', '2021-04-05 08:05:47'),
	(473, 2, 2, 8, 'Seorang perempuan usia 22 tahun dirawat di RSJ. Saat dilakukan pengkajian oleh perawat, pasien mengatakan dirinya selalu kalah dari prestasi kakaknya sehingga tidak mampu membanggakan orang tuanya. Hasil pengkajian : pasien tampak menunduk dan nada suara pelan.\r\n\r\nApakah intervensi terkait dukungan social pada kasus tersebut?\r\n\r\n', 46, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:06:02', '2021-04-05 08:06:02'),
	(474, 2, 2, 9, 'Seorang perawat puskesmas melakukan pengkajian di SD. Diperoleh data bahwa 60% siswanya mengalami batuk pilek dan 40% sering mengalami diare. Anak-anak sering membawa minuman, makanan dan permen dengan warna mencolok. Di depan sekolah banyak pedagang yang menjual minuman manis dan kembang gula.  \r\nApakah promosi kesehatan yang paling tepat untuk kasus diatas?\r\n', 47, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:06:09', '2021-04-05 08:06:09'),
	(475, 2, 2, 3, 'Seorang perempuan berusia 56 tahun dirawat dengan Cancer Serviks pasien mengeluh mual muntah, nafsu makan berkurang, perawat melihat porsi makan hanya habis 1/4nya, pasien sedang menjalani kemotherapi yang ke3. Pemeriksaan lab. Hb : 9 mg/dl.\r\nApakah penyebab mual muntah pasien tersebut?\r\n', 48, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:07:06', '2021-04-05 08:07:06'),
	(476, 2, 2, 3, 'Seorang perempuan berusia 56 tahun dirawat dengan Cancer Serviks pasien mengeluh mual muntah, nafsu makan berkurang, perawat melihat porsi makan hanya habis 1/4nya, pasien sedang menjalani kemotherapi yang ke3. Pemeriksaan lab. Hb : 9 mg/dl.\r\nApakah yang harus diobservasi ketat oleh perawat pada pasien tersebut?\r\n', 49, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:08:12', '2021-04-05 08:08:12'),
	(477, 2, 2, 9, 'Hasil pengkajian di satu Desa, didapat¬kan data: 30% masyarakat mengalami hiper¬tensi; 25% berusia produktif, 20% penderita stroke ringan; 45% Pendidikan tidak lulus SD; Masyarakat di wilayah tersebut pada umumnya terbiasa menyediakan makanan tinggi natrium / asin; Masyarakat menga¬takan belum pernah mendapatkan informasi tentang kesehatan.\r\nApakah peran utama perawat pada kasus tersebut?\r\n', 50, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:08:27', '2021-04-05 08:08:27'),
	(478, 2, 2, 8, 'Seorang perempuan berusia 28 tahun sudah sebulan dirawat di Ruang Gelatik RSJ. Menurut ibunya, pasien memiliki riwayat gagal menikah. Belum lama ini pasien mengalami kekerasan yang dilakukan oleh teman kerjanya. Pasien di bawa ke RSJ karena sering mengamuk dan mengatakan kalimat kasar. Pada saat dikaji, didapatkan pasien tampak menunjukan tatapan mata yang tajam. \r\n\r\nApakah faktor predisposisi pada kasus tersebut?\r\n\r\n', 51, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:08:31', '2021-04-05 08:08:31'),
	(479, 2, 2, 3, 'Seorang perempuan berusia 36 tahun dirawat dengan keluhan fluor albus yang hebat didaerah genitalianya, riwayat bergunta ganti pasangan dibenarkan oleh pasien, pasien mengeluh gatal dan panas di daerah kemaluannya. Pasien menderita Gonorhoe.\r\nApakah penyebab fluor albus hebat pada pasien tersebut?\r\n', 52, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:09:21', '2021-04-05 08:09:21'),
	(480, 2, 2, 9, 'Hasil pengkajian di satu Desa, didapa¬tkan data: 30% masyarakat mengalami hipertensi; 25% berusia produktif, 20% penderita; Masyarakat umumnya terbiasa makan-makanan tinggi natrium/asin; Hasil wawancara dengan kader kesehatan menga¬takan penderita hipertensi di wilayah tersebut hanya 10% yang mau datang untuk memer¬iksakan kesehatan pada saat ada posyandu. \r\nApakah strategi penanganan masalah untuk membentuk perilaku sehat mandiri di mas-yarakat?', 53, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:10:28', '2021-04-05 08:10:28'),
	(481, 2, 2, 3, 'Seorang perempuan berusia 36 tahun dirawat dengan keluhan fluor albus yang hebat didaerah genitalianya, riwayat bergunta ganti pasangan dibenarkan oleh pasien, pasien mengeluh gatal dan panas di daerah kemaluannya. Pasien menderita Gonorhoe.\r\nApakah diagnose keperawatan prioritas pada pasien tersebut?\r\n', 54, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:10:37', '2021-04-05 08:10:37'),
	(482, 2, 2, 8, 'Seorang perempuan usia 17 tahun dirawat di ruang keswara RSJ. Saat dikaji oleh perawat, pasien mengatakan dirinya tidak berguna dan tidak mampu melakukan hal yang diharapkan oleh mertuanya. Pada saat dilakukan pengkajian didapatkan data bahwa pasien pernah dirawat 2 tahun yang lalu. Menurut tetangga yang mengantar, pasien baru saja menikah dengan suaminya yang memiliki latar belakang budaya batak.\r\n\r\nApakah faktor pencetus gangguan pada klien di atas?\r\n\r\n', 55, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:10:58', '2021-04-05 08:10:58'),
	(483, 2, 2, 3, 'Seorang perempuan berusia 27 Tahun, G2P0A1, ke UGD jam 00.00 WIB dengan keluhan mulas sejak 17.00 WIB. Dari pengkajian didapatkan tekanan darah 120/80 mmHg, frekuensi napas 22x/menit, denyut nadi 80 x/menit, suhu 36,50c, his teratur sebanyak 2x dalam 10 menit dengan durasi 30 detik dan pembukaan 3 cm.\r\nPada pukul berapakah pasien diperkirakan melahirkan bayinya?\r\n', 56, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:11:39', '2021-04-05 08:11:39'),
	(484, 2, 2, 9, 'Hasil pengkajian di salah satu Desa: Pen¬duduk lansia 30% dari total penduduk, 10% Lansia menderita Hipertensi; 20% Lansia mengeluhkan nyeri pada persendian kaki ataupun tangan; Masyarakat sering makan makanan yang kandungan natrium tinggi; Tingkat Pendidikan diwilayah ini 30% tidak lulus SD; 5% Lansia juga mengeluhkan nyeri pada tulang belakang. Hanya 5% Lansia rutin memeriksakan kesehatan ke Posyandu lansia. Kader kesehatan mengatakan lansia sangat jarang memeriksakan kesehatannya.\r\nApakah data utama yang perlu di kaji lebih lanjut pada kasus tersebut?\r\n', 57, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:12:05', '2021-04-05 08:12:05'),
	(485, 2, 2, 3, 'Seorang perempuan usia 30 tahun, G1P0A0 datang ke klinik bersalin dengan keluhan mules yang semakin kuat dan sering serta keluar cairan bening dan lendir darah. Hasil pengkajian: DJJ 150x/menit, skala nyeri 9 saat his datang, his 2 kali dalam 10 menit dengan durasi 30-40 detik, pembukaan 4 cm.\r\nApakah masalah keperawatan yang menjadi prioritas?\r\n', 58, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:13:32', '2021-04-05 08:13:32'),
	(486, 2, 2, 9, 'Hasil pengkajian di satu Desa: Penduduk lansia 30% dari to¬tal penduduk, 10% Lansia menderita Hip¬ertensi; 20% Lansia mengeluhkan nyeri pada persendian Kaki ataupun tangan; 5% Lansia juga mengeluhkan nyeri pada tulang belakang. Lansia 10% Tinggal sendiri atau dengan pasangan lansia tidak ada anggo¬ta keluarga lainnya. Hanya 5% Lansia rutin memeriksakan kesehatan ke Posyandu lansia yang ada diwilayah tersebut. Kader keseha¬tan mengatan lansia diwilayah tersebut sangat jarang memeriksakan kesehatan¬nya. \r\nApakah masalah keperawatan pada kasus tersebut?\r\n', 59, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:14:05', '2021-04-05 08:14:05'),
	(487, 2, 2, 3, 'Seorang perempuan berusia 25 Tahun, G1P0 di rawat di kamar bersalin telah melahirkan bayi laki-laki secara normal dengan berat badan 2700 gram. Dari hasil pengkajian, bayi aktif bergerak, bayi langsung menangis kuat, warna kulit kemerahan, denyut nadi 100 x/menit, dan bayi langsung bersin setelah lahir. \r\nBerapakah  penilaian skor APGAR pada bayi tersebut? \r\n', 60, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:14:22', '2021-04-05 08:14:22'),
	(488, 2, 2, 8, 'Seorang pasien dibawa  di intalasi gawat darurat (IGD) di RS.Jiwa, keluarga mengatakan sejak 1 minggu yang lalu klien menunjukan tanda-tanda agresif, mondar mandir, gelisah dan selalu ingin membuat keributan di lingkungan sekitarnya.\r\n\r\nTindakan apakah yang harus di prioritaskan dalam menagani pasien tersebut?\r\n\r\n', 61, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:14:57', '2021-04-05 08:14:57'),
	(489, 2, 2, 3, 'Seorang perempuan berusia 15 tahun, G1P0, dibawa ke UGD bersama ibunya dengan keluhan perdarahan. Dari hasil pengkajian: Tekanan darah 110/70 mmHg, frekuensi nadi 22 x/menit, frekuensi napas 80 x/menit, usia kehamilan 20 minggu, kontraksi lemah, tidak teraba gerakan janin dan tidak terdengar bunyi jantung janin.  \r\nApakah tindakan yang utama dilakukan pada pasien tersebut?\r\n', 62, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:15:54', '2021-04-05 08:15:54'),
	(490, 2, 2, 9, 'Hasil pengkajian di wilayah binaan didapa¬tkan data: 35% Penduduk usia produktif mengalami hipertensi sedang-Berat. Kader kesehatan mengatakan 5% dari penderita hip-ertensi mengalami stroke dan 3% mengalami stroke berulang; masyarakat terbiasa dengan makanan yang digoreng dan berlemak. 20% penderita hipertensi jarang memeriksakan kesehatan. 90% dari penderita hipertensi memiliki perilaku merokok. \r\nApakah masalah keperawatan utama pada kasus diatas?\r\n\r\n', 63, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:16:16', '2021-04-05 08:16:16'),
	(491, 2, 2, 3, 'Seorang perempuan berusia 20 tahun, G1P0 ke UGD dengan keluhan nyeri perut dan perdarahan. Tekanan darah 100/70 mmHg, denyut nadi 24 x/menit, frekuensi napas 80 x/menit, usia kehamilan <37 minggu, ada kontraksi, dan terdiagnosa intrauterine fetal distress. Dokter telah menjelaskan kondisi janin dan penatalaksanaannya. Lalu dilakukan section caesaria atas indikasi permintaan pasien karena tidak kuat nyeri kontraksi.\r\nApakah pelanggaran etik yang terjadi jika terjadi pada kasus tersebut?\r\n', 64, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:17:20', '2021-04-05 08:17:20'),
	(492, 2, 2, 8, 'Seorang perempuan berusia 40th. mengatakan saat ini masih sangat sedih karena ditinggal suaminya kawin dengan wanita lain. Klien sudah dirawat di RS Jiwa sudah 1 bulan. Dan saat di lakukan pengkajian klien selalu mengatakan “ saya adalah wanita yang paling cantik didunia ini dan semua laki2 yang ada di RS ini naksir saya, tetapi saya tidak mau dengan mereka”. \r\n\r\nApakah pertanyaan yang harus perawat ajukan, untuk menghadapi pasien tersebut?\r\n', 65, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:17:40', '2021-04-05 08:17:40'),
	(493, 2, 2, 3, 'Seorang perempuan berusia 24 tahun, G1P0A0 usia kehamilan 37 minggu datang dengan keluhan perutnya mulas yang semakin sering, terdapat bercak darah di celana dalamnya dan pasien tampak cemas. TFU 32 cm, kepala sudah masuk 3/5, hasil pemeriksaan dalam : portio teraba lunak, pembukaan serviks 7 cm, selaput ketuban utuh.\r\nApakah intervensi keperawatan utama yang bisa dilakukan oleh perawat?\r\n', 66, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:19:27', '2021-04-05 08:19:27'),
	(494, 2, 2, 9, 'Hasil pengkajian di desa: 35% Penduduk usia produktif mengalami hipertensi se¬dang-berat. Kader mengatakan 10% dari penderita hipertensi mengalami stroke dan 3% mengalami stroke berulang; Masyarakat terbiasa dengan makanan yang digoreng dan berlemak. 20% penderita hipertensi jarang memeriksakan kesehatan. 90% memiliki perilaku merokok. 30% penderita hipertensi mengatakan pasrah dengan keadaannya dan terbiasa dengan kehidupannya. Tidak ada ke¬giatan kesehatan di masyarakat yang dapat diikuti masyarakat. \r\nApakah intervensi keperawatan utama pada kasus tersebut?\r\n\r\n', 67, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:19:52', '2021-04-05 08:19:52'),
	(495, 2, 2, 8, 'Seorang perempuan 28 tahun saat di wawancara selalu melakukan gerakan berulang-ulang yaitu mengagaruk garuk rambutnya, namun saat di tanya apakah rambut klien gatal, klien menjawab bahwa rambutnya tidak gatal.\r\n\r\nPerilaku apakah yang di tunjukan oleh pasien pada kasus di atas?\r\n', 68, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:20:14', '2021-04-05 08:20:14'),
	(496, 2, 2, 3, 'Seorang perempuan usia 28 tahun, G2P1A0 di kamar bersalin, mules-mules sejak 8 jam yang lalu dan bertambah sering dan kuat. Hasil pemeriksaan: kontraksi uterus setiap 10 menit sekali dengan durasi 30 detik dan pembukaan 5 cm dengan selaput ketuban masih utuh.\r\nApakah evaluasi selanjutnya yang diharapkan? \r\n', 69, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:20:30', '2021-04-05 08:20:30'),
	(497, 2, 2, 5, 'Seorang laki-laki berusia 65 tahun tinggal bersama istrinya di sebuah panti. Keluarga mengatakan satu minggu ini klien sering melamun dan mengatakan takut akan kematian. Klien terl;ihat bersedih, seing gelisah, dan mengalami kesulitan tidur.\r\nApa yang harus dikaji oleh perawat pada kasus tersebut?', 70, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:21:14', '2021-04-05 08:21:14'),
	(498, 2, 2, 3, 'Seorang perempuan usia 25 tahun, G1P0A0 di kamar bersalin, mules-mules sejak 8 jam yang lalu dan bertambah sering dan kuat. Hasil pemeriksaan: pembukaan 5 cm, his setiap 10 menit sekali dengan durasi 30 detik, DJJ 140 kali/menit.\r\nPada tahap manakah fase persalinan pasien?\r\n', 71, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:21:45', '2021-04-05 08:21:45'),
	(499, 2, 2, 8, 'Seorang pasien laki-laki (20 th) saat dikaji klien mengatakan: ”saya sangat tidak berguna, saya sangat malu,....rasanya saya ingin pergi jauh saja”. Menurut keluarga pernyataan tersebut muncul sejak 4 bulan yang lalu setelah pasien beberapa kali tidak bisa masuk di Universitas yang klien inginkan\r\n\r\nApakah masalah keperawatan utama pada kasus di atas?\r\n', 72, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:22:52', '2021-04-05 08:22:52'),
	(500, 2, 2, 3, 'Seorang perempuan usia 34 tahun, P1A0 di kamar bersalin, tampak lemas setelah lahir plasenta, uterus teraba lembek, tidak ada kontraksi uterus, dan  perdarahan pervaginam lebih dari 300 cc. \r\nApakah tindakan yang harus dilakukan selanjutnya?\r\n', 73, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:23:02', '2021-04-05 08:23:02'),
	(501, 2, 2, 3, 'Seorang perempuan berusia 35 Tahun, P4A0 di Recovery room post sectio caesaria. Satu jam setelah melahirkan, perawat melakukan pengkajian terhadap fundus uteri, dan didapati fundus uteri lembek, kontraksi lemah dan lokhea sangat banyak. Apakah tindakan yang paling tepat dilakukan oleh perawat?\r\nApakah tindakan yang paling tepat dilakukan oleh perawat?\r\n', 74, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:24:01', '2021-04-05 08:24:01'),
	(502, 2, 2, 5, 'Seorang  perempuan berusia 70 tahun  tinggal di panti werdha. Klien mengeluh nyeri pada sendi lutut, otot betisnya juga sesekali terasa kebas. Pada saat melakukan Implementasi untuk menurunkan rasa sakit, perawat M melakukan kompres jahe. Pada saat pemberian kompres perawat membiarkan sarung klien tersingkap sampai paha. pintu kamar klien terbuka.\r\nApa etika yang di langgar oleh perawat pada kasus tersebut?', 75, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:24:18', '2021-04-05 08:24:18'),
	(503, 2, 2, 3, 'Wanita dengan usia kehamilan 10 minggu datang ke UGD dengan keluhan mual dan muntah yang terus menerus muncul. Intensitas mual dan muntah semakin meningkat setiap harinya. \r\nPendidikan kesehatan apa yang paling tepat diberikan kepada klien?', 76, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:25:10', '2021-04-05 08:25:10'),
	(504, 2, 2, 8, 'Seorang laki laki 37 tahun dirawat di RS Jiwa, dengan alasan masuk RS karena klien tidak mau berbicara dengan siapapun dan selalu menunduk jika di tanya, setelah 1 minggu di rawat klien masih tidak mau berbicara dengan orang, hanya dengan perawat saja klien berinteraksi walaupun klien masih menunjukan sikap yang pasif, namun terkadang klien mulai dapat melakukan kontak mata saat interaksi dengan perawat, berbicara sangat lirih dan seperlunya saja, penampilan klien tampak tidak terawat\r\n\r\nData manakah yang menunjukan bahwa klien membina hubungan saling percaya dengan perawat? \r\n', 77, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:25:45', '2021-04-05 08:25:45'),
	(505, 2, 2, 3, 'Wanita dengan usia kehamilan 10 minggu datang ke UGD dengan keluhan mual dan muntah yang terus menerus muncul. Mual dirasakan setiap pagi hari dan setelah makan disertai dengan muntah yang berlebihan. Klien mengeluh tidak nafsu makan, hanya sedikit makanan yang dapat masuk. Konsistensi muntah cair dan terasa pait ditenggorokan. Setelah dilakukan pemeriksaan, didapatkan berat badan klien turun dan suhu tubuh meningkat. \r\nApakah diagnosa keperawatan prioritas pada kasus di atas?', 78, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:26:14', '2021-04-05 08:26:14'),
	(506, 2, 2, 5, 'Seorang perempuan berusia 60 tahun yang tinggal di panti jompo mengatakan dirinya mengalami inkontinensia urin baik siang maupun malam. Keluhan tersebut membuat klien menjadi jarang minum padahal klien mengalamikehausan. Perawat menyarankan klien untuk menggunakan diapers.\r\nApa yang dapat klien lakukan dalam tahapan implementasi selanjutnya?', 79, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:26:37', '2021-04-05 08:26:37'),
	(507, 2, 2, 3, 'Seorang perawat sedang membuat rencana perawatan untuk klien yang mengalami distosia dan memasukkan beberapa intervensi keperawatan dalam rencana perawatan. \r\nPerawat memprioritaskan rencana perawatan dan memilih yang mana dari intervensi keperawatan berikut sebagai prioritas tertinggi?', 80, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:27:36', '2021-04-05 08:27:36'),
	(508, 2, 2, 8, 'Seorang klien mengatakan saat ini masih mendengar suara suara aneh namun tidak ada wujudnya, dan klien merasa terganggu dengan suara-suara tersebut. Klien sudah diajarkan bagaimana cara menghardik pada pertemuan sebelumnya dan klien mengatakan sudah mempraktikan tehnik tersebut. Namun ketika di tanya oleh perawat apakah halusinasinya hilang saat klien menghardik?, klien menjawab tidak tahu\r\n\r\nApakah strategi pelaksanaan (SP) yang harus dilakukan oleh perawat saat ini?\r\n', 81, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:27:56', '2021-04-05 08:27:56'),
	(509, 2, 2, 9, 'Didapatkan data kasus pengguna Narkoba di suatu wilayah: 25% pengguna ganja; 10% pengguna sabu-sabu dan 10% pengguna her¬oin; 30% dari yang di rehabilitasi meng-gunakan jarum suntik dan positif HIV. 10 remaja dilaporkan telah mengikuti rehabil¬itasi di pusat rehabilitasi yang di kelola Pe¬merintah. \r\nApakah pencegahan masalah keperawatan utama pada kasus tersebut?\r\n', 82, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:28:06', '2021-04-05 08:28:06'),
	(510, 2, 2, 5, 'Seorang laki-laki berusia 65 tahun mengatakan bahwa akhir akhir ini dirinya seing mengalami rasa lapar lebih dari biasanya. BMI klien menunjukan bahwa klien mengalami obesitas. \r\nApa perencanaan yang dapat dilakukan oleh perawat', 83, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:28:22', '2021-04-05 08:28:22'),
	(511, 2, 2, 3, 'Klien dengan kehamilan aterm datang ke kamar bersalin dengan kala I fase aktif. Kemajuan dilatasi serviks klien hanya meningkat dari 2 cm ke 3 cm selama lebih dari 8 jam. Dia didiagnosa mengalami hipotonik distosia dan diresepkan untuk mendapatkan oksitosin untuk meningkatkan kontraksi. \r\nAspek paling penting yang harus diperhatikan oleh perawat berkenaan dengan intervensi pada kasus di atas adalah?', 84, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:28:53', '2021-04-05 08:28:53'),
	(512, 2, 2, 3, 'Setelah dilakukan pemeriksaan USG pada klien dengan usia kehamilan aterm yang mengalami perdarahan vagina sedang. Hasil USG mengindikasikan, klien kemungkinan mengalami plasenta previa. \r\nBerdasarkan hasil pemeriksaan USG, persiapan tindakan prioritas apa yang harus dilakukan oleh perawat?', 85, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:29:43', '2021-04-05 08:29:43'),
	(513, 2, 2, 9, 'Didapatkan data penduduk di Desa: 30% adalah remaja, 12% remaja bersekolah se-dangkan sisanya ada yang sudah bekerja dan sebagian besar pengangguran; Angka kenakalan remaja belakangan ini meningkat, dari pencurian, narkoba; 15% remaja setelah tamat SMP sudah menikah; 12% dari remaja yang menikah mengalami masalah pada ke-hamilan yaitu abortus. Kader mengatakan belum ada penyuluhan kesehatan remaja. \r\nApakah topik pendidikan kesehatan yang utama pada kasus diatas?', 86, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:30:24', '2021-04-05 08:30:24'),
	(514, 2, 2, 3, 'Klien dengan diagnosa plasenta previa sedang menjalani manajemen observasi (expectant management) tanpa diberikan treatment apapun. Keadaan klien dan fetus stabil. Perawat sedang melakukan pengkajian tentang kemungkinan klien untuk pulang ke rumah. \r\nUngkapan tepat dari klien mana yang membuat perawat berpikir kembali, bahwa perawatan di rumah tanpa intervensi apapun mungkin tidak cocok untuk kasus ini?', 87, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:30:57', '2021-04-05 08:30:57'),
	(515, 2, 2, 1, 'Seorang perawat komunitas melakukan kegiatan posyandu balita sistim lima meja yang meliputi : (1) Balita didaftar dalam formulir pencatatan balita, (2) Penimbangan anak dan balita dan mencatat hasil penimbangan pada secarik kertas yang terselip di KMS. (3) Memindahkan hasil penimbangan anak dari secarik kertas ke KMS nya\r\nApakah langkah selanjutnya dalamkegiatan posyandu tersebut diatas ?\r\n\r\n', 88, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:32:12', '2021-04-05 08:32:12'),
	(516, 2, 2, 3, 'Seorang wanita dengan usia kehamilan 35 minggu datang ke rumah sakit. Dari data pengkajian didapatkan bahwa plasenta klien menutupi setengah jalan lahirnya. Perawat memberikan penjelasan tentang keadaan penyakit klien. \r\nPerawat menjelaskan treatment apa yang biasanya dilakukan untuk pasien dengan diagnosa pada kasus di atas?', 89, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:32:41', '2021-04-05 08:32:41'),
	(517, 2, 2, 8, 'Seorang laki-laki 34 tahun yang mengalami waham kebesaran selalu mengatakan bahwa dirinya seorang dokter, dan terkadang berganti lagi menjadi seorang presiden dan profesor, klien tampak dapat merawat dirinya sendiri, selalu agresif dan tidak mau mengalah.\r\n\r\nApakah hasil yang diharapkan setelah perawat memberikan intervensi keperawatan pada pasien tersebut?\r\n', 90, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:32:55', '2021-04-05 08:32:55'),
	(518, 2, 2, 3, 'Wanita dengan usia kehamilan berada pada trimester akhir di rawat atas dasar kenaikan tekanan darah hingga 160/110 mm Hg dalam keadaan bed rest. Klien mengeluh adanya penglihatan blur, edema dan sesak nafas. \r\nBerikut ini merupakan komplikasi yang terjadi klien yang paling tepat adalah', 91, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:33:48', '2021-04-05 08:33:48'),
	(519, 2, 2, 3, 'Wanita dengan usia kehamilan berada pada trimester akhir di rawat atas dasar kenaikan tekanan darah hingga 160/110 mm Hg dalam keadaan bed rest. Klien mengeluh adanya penglihatan blur, edema dan sesak nafas.  \r\nApakah diagnosa keperawatan prioritas dari kasus di atas?', 92, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:34:56', '2021-04-05 08:34:56'),
	(520, 2, 2, 9, 'Hasil pengkajian di satu desa, didapatkan data: 30% masyarakat mengalami hipertensi; 25% berusia produktif, 10% penderita pernah mengalami stroke ringan; Masyarakat terbiasa makan-makanan tinggi natrium/ asin; Pemilik warung-warung mengatakan menjual ikan asin laris diwilayah tersebut; 45% Pendidikan tidak lulus SD; 70% bekerja sebagai Petani; kader kesehatan mengatakan 70% masyarakat tidak pernah berolah raga. \r\nApakah masalah keperawatan pada kasus tersebut?\r\n', 93, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:35:10', '2021-04-05 08:35:10'),
	(521, 2, 2, 8, 'Pengkajian sebagai proses awal dalam memberikan asuhan keperawatan. Untuk mengkaji faktor predisposisi terjadinya gangguan jiwa ada beberapa hal yang harus di tanyakan kepada pasien/keluarga pasien.\r\n\r\nPertanyaan apakah yang harus perawat utarakan kepada klien/keluarga klien tersebut?\r\n', 94, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:35:15', '2021-04-05 08:35:15'),
	(522, 2, 2, 3, 'Perawat homecare melakukan kunjungan rumah kepada klien yang memiliki diagnosa pre-eklampsia. Keadaan umum dan tanda tanda vital klien tidak menunjukan klien pertumbuhan gejala menuju pre-eklampsia berat. Sebelum mengakhiri kunjungan, perawat melakukan Pendidikan kesehatan terhadap klien tentang tanda tanda pertumbuhan gejala yang menjadi acuan klien harus segera pergi ke pelayanan kesehatan. \r\nTanda dan gejala apakah yang tepat berdasarkan kasus di atas?', 95, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:36:14', '2021-04-05 08:36:14'),
	(523, 2, 2, 8, 'Seorang laki-laki berusia 32 tahun sering berteriak, memukul dirinya sendiri dan mengamuk. Saat dilakukan pengkajian  pandangan mata klien tajam, nada suara tinggi, berbicara tidak jelas dan tangan sering mengepal. Klien sering berjalan mondar mandir, dan sering menggaruk-garuk kepalanya.\r\n\r\nApakah tujuan umum dari rencana keperawatan pada kasus di atas?\r\n', 96, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:37:48', '2021-04-05 08:37:48'),
	(524, 2, 2, 9, 'Hasil pengkajian di satu Desa, didapat¬kan data: 30% masyarakat mengalami hiper¬tensi; 25% berusia produktif, 10% penderita stroke ringan; Masyarakat di wilayah terse¬but pada umumnya terbiasa menyediakan makanan tinggi natrium / asin; Masyarakat mengatakan belum pernah mendapatkan in¬formasi tentang kesehatan. \r\nApakah topik penyuluhan yang tepat pada kasus tersebut?\r\n', 97, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:38:37', '2021-04-05 08:38:37'),
	(525, 2, 2, 3, 'Seorang perempuan usia 35 tahun P4A0 post partum normal hari ke 12 datang ke poliklinik dengan keluhan nyeri hebat pada daerah paha dan kali sulit digerakan.Pasien juga mengatakan demam disertai mengigil. Tekanan darah 130/70 mmHg, nadi 90x/menit, suhu 38,5, respirasi 24x/menit.\r\nApakah pemeriksaan fisik yang harus dilakukan selanjutnya?', 98, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:38:54', '2021-04-05 08:38:54'),
	(526, 2, 2, 8, 'Seorang perempuan 45th sedang berinteraksi dengan perawat di RS.Jiwa, saat perawat bertanya tentang alasan klien di bawa ke RS, klien tampak hanya menatap perawat, dan ketika perawat mencoba membuat klien tertawa beberapa kali namun tetap diam dan tidak ada perubahan roman muka \r\n\r\nAfek apakah yang sedang dialami oleh pasien tersebut?\r\n', 99, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:39:55', '2021-04-05 08:39:55'),
	(527, 2, 2, 3, 'Seorang perempuan usia 30 tahun P3A0 post partum normal hari ke 7 datang ke poliklinik dengan keluhan demam. Hasil pemeriksaan fisik menunjukkan dari kemaluan keluar cairan berbau tidak sedap. Tekanan darah 100/70 mmHg, nadi 90x/menit, suhu 39, respirasi 28x/menit.\r\nApakah masalah keperawatan yang tepat pada pasien?', 100, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:40:27', '2021-04-05 08:40:27'),
	(528, 2, 2, 9, 'Hasil pengkajian di satu Desa, didapat¬kan data: 30% masyarakat mengalami hiper¬tensi; 25% berusia produktif, 20% penderita stroke ringan; 10% Masyarakat kebiasaan minum–minum alkohol saat perayaan; Mas¬yarakat di wilayah tersebut pada umumnya terbiasa menyediakan makanan tinggi natri¬um/asin; Perawat memberikan penyuluhan kesehatan pada kelompok penderita hiper¬tensi. \r\nApakah hasil evaluasi tindakan keperawatan pada kasus tersebut?', 101, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:41:50', '2021-04-05 08:41:50'),
	(529, 2, 2, 5, 'Seorang perempuan berusia 67 tahun tinggal disebuah panti jompo. Klien mengeluh mengalami kesulitan tidur beberapa hari terakhir ini. Klien mengatakan selalu ingat pada anak anaknya, setelah dilakukan pengkajian emosional didapatkan emosional positif.\r\nApa yang dapat dilakukan oleh perawat dalam melakukan pengkajian lanjutan?', 102, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:43:03', '2021-04-05 08:43:03'),
	(530, 2, 2, 3, 'Seorang perempuan usia 22 tahun P1A0 post partum normal hari ke 10 datang ke poliklinik mengeluh nyeri pada payudara dan panas dingin. Hasil pemeriksaan fisik ditemukan payudara kanan membesar dan nyeri, kulit merah, bengkak, puting susu lecet. TD 100/70 mmHg, suhu 38, nadi 90x/menit, respirasi 22x/menit.\r\nApakah intervensi untuk mencegah terjadinya kondisi tersebut ?', 103, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:43:43', '2021-04-05 08:43:43'),
	(531, 2, 2, 8, 'Seorang  laki-laki berusia 15 tahun dirawat di Rs Jiwa selama 7 hari. Pasien terlihat menyendiri tidak bergabung dengan pasien lain. Ketika dikaji pasien sesekali menatap perawat dan selalu menunduk, mengungkapkan malu karena tidak naik kelas, dan keluarga menganggap pasien sebagai anak yang nakal, tidak memiliki prestasi di sekolah dan berdea dengan kakaknya yang selalu juara kelas.  Klien merasa tidak berguna dan tidak mampu melakukan apa-apa.  \r\n\r\nApakah prioritas intervensi perawat pada kasus diatas?\r\n', 104, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:43:58', '2021-04-05 08:43:58'),
	(532, 2, 2, 9, 'Perawat melakukan pengkajian terkait sarana kesehatan yang ada di wilayah desa. Termasuk jumlah dokter, poskesdes, puskesmas serta cara masyarakat menjangkau tempat tersebut. \r\nApakah pengkajian yang tepat oleh perawat komunitas?\r\n\r\n', 105, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:44:17', '2021-04-05 08:44:17'),
	(533, 2, 2, 9, 'Seorang perawat komunitas melakukan pengkajian melalui kunjungan rumah untuk pengisian instrumen PIS PK. Data yang didapat diolah dan dikategorikan menjasi 12 indikator keluarga sehat. \r\nApakah jenis data yang didapatkan oleh perawat tersebut?\r\n\r\n', 106, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:45:54', '2021-04-05 08:45:54'),
	(534, 2, 2, 8, 'Seorang laki-laki  usia 38 tahun, sudah  1 minggu di Rumah Sakit Jiwa. Hasil  Pasien tidak mau makan dan selalu mencium bau amis dan bau kotoran, pasien selalu membuang ludah  dan menutup hidungnya.  Pasien mengatakan ada orang yang mencampuri makanannya dengan kotoran dan darah karena aka nada orang yang merebut hartanya, pasien bahwa dia ketrunan raja majapahit yang memiliki peta harta karun sehingga banyak orang yang akan memburunya.\r\n\r\nApakah intervensi yang akan dilakukan oleh perawat\r\n', 107, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:46:30', '2021-04-05 08:46:30'),
	(535, 2, 2, 3, 'Seorang perempuan usia 26 tahun P1A0 post partum normal hari ke 5 datang ke poliklinik mengeluh nyeri perut bagian bawah. Hasil pemeriksaan fisik tekanan darah 90/70 mmHg, suhu 39, nadi 100x/menit, respirasi 22x/menit.TFU 1 jari di bawah pusat , lokhea berwarna hijau dan berbau busuk.\r\nApakah pemeriksaan penunjang yang diperlukan untuk menegakkan diagnosa ?', 108, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:46:57', '2021-04-05 08:46:57'),
	(536, 2, 2, 3, 'Seorang perempuan usia 40 tahun P4A1 post partum normal hari ke 21 datang ke rumah sakit dengan keluhan nyeri perut bagian bawah dan demam. Hasil pemeriksaan tekanan darah 110/80 mmHg, nadi 100x/menit, rr 25x/menit, suhu 39, pemeriksaan dalam cavim douglas menonjol dan terisi pus.\r\n', 109, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:48:06', '2021-04-05 08:48:06'),
	(537, 2, 2, 3, 'Seorang perempuan usia 23 tahun post partum sc hari pertama P1A0 dirawat di ruang nifas. Hasi pemeriksaan fisik perdarahan banyak dan darah berbau menyengat. Tekanan darah 100/70 mmHg, Nadi 86x/menit, Respirasi 24x/menit, suhu 38 C.\r\nApakah tindakan selanjutnya yang harus dilakukan oleh perawat?', 110, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:48:55', '2021-04-05 08:48:55'),
	(538, 2, 2, 8, 'Seorang laki-laki berusia 45 tahun. Di rawat di ruang tenag selama 10 hari. Setelah keluarganya menegok pasien mengamuk karena tidak diajak pulang oleh keluarga. Perawat melakukan restrain sementara sampai perilaku terlihat tenang. Selama dilakukan restrain perawat melakkan observasi daerah lengan dan kaki yang agar tidak terjadi perlukaan.\r\n\r\nApakah prinsip etik yang dilakukan perawat?\r\n', 111, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:49:01', '2021-04-05 08:49:01'),
	(539, 2, 2, 3, 'Seorang perempuan usia 25 tahun POD ke 3 SC dirawat diruangan nifas dengan keluhan mual muntah dan nyeri luka operasi. Hasil pemeriksaan didapat tampak gelisah, bedrest, Frekuensi nadi: 98 X/mnt, Frekuensi pernafasan 24X/mnt Suhu: 39°C, terdapat luka post op SC horizontal dengan keadaan luka op pus (+), kemerahan (+), bengkak (+).  Hasil lab terbaru menunjukkan leukosit 15.000 /?l.\r\nApakah evaluasi yang tepat untuk mengukur keberhasilan intervensi ?', 112, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:50:20', '2021-04-05 08:50:20'),
	(540, 2, 2, 3, 'Seorang perempuan usia 56 tahun dirawat di ruang ginekologi rumah sakit. Pasien mengeluh tidak bisa tidur karena menahan nyeri luka post op mastektomi. Pasien juga gelisah dengan kondisinya saat ini. Hasil pengkajian TD 150/100 mmHg, Nadi 80x/menit, RR 23x/menit. \r\nApakah masalah keperawatan utama?', 113, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:51:12', '2021-04-05 08:51:12'),
	(541, 2, 2, 8, 'Laki-laki usia 45 tahun dirawat  di RSJ selama 3 hari mengatakan bahwa dia seorang ahli computer yang sedang di sembuyikan di RS Jiwa karena da misi pentin Negara yang sedang dirahasiakan. Dan pasien  mengatakan bahwa ia sedih dan kecewa setelah di PHK dari pekerjaannya. Pasien lebih sering dikamar karena merasa ada orang yang selalu mengawasinya. \r\n\r\nApakah implementasi yang tepat dilakukan oleh perawat?\r\n', 114, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:51:32', '2021-04-05 08:51:32'),
	(542, 2, 2, 3, 'Seorang perempuan usia 24 tahun dirawat di rumah sakit. Hasil pemeriksaan fisik teraba massa di abdomen. Hasil usg menunjukkan terdapat mioma uteri dan sudah terjadi perlengketan dengan uterus. Dokter menyarankan dilakukan histerektomi tapi pasien dan keluarga menolak karena pasien ingin memiliki keturunan.\r\nApakah tindakan yang harus dilakukan oleh perawat?', 115, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:52:07', '2021-04-05 08:52:07'),
	(543, 2, 2, 3, 'Seorang perempuan usia 20 tahun didiagnosa ca payudara  dan akan dilakukan tindakan  mastektomy . Pasien menolak untuk tindakan tersebut. Perawat memberikan informasi terkait penyakitnya dan pentingnya tindakan mastektomy. \r\nApakah prinsip etik yang sedang dilakukan oleh perawat?', 116, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:53:24', '2021-04-05 08:53:24'),
	(544, 2, 2, 8, 'Perempuan usia 28 tahun, sudah 1 minggu dirawat di Rumah Sakit Jiwa, sebelum masuk RS pasien menyayat nadinya dengan pisau. Pada saat pengkajian pasien mengatkan dia akan bahagia jika di surga tidak akan mengecewakan keluarga lagi dan menitipkan keluarganya pada perawat, pasien juga mengatakan sering didatangi oleh kakeknya dan mengajak dia bersamanya. Menurut keterangan keluarga kakenya sudah meninggal 5 tahun yang lalu.\r\n\r\nApakah prioritas masalah pada kasus diatas?\r\n', 117, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:54:08', '2021-04-05 08:54:08'),
	(545, 2, 2, 9, 'Seorang perawat komunitas melakukan pengkajian keperawatan komunitas di sebuah RW. Didapatkan data RW tersebut sulit dijangkau menggunakan kendaraan bermotor dikarenakan medan jalan yang sempit dan menanjak. masyarakat hanya bisa berjalan kaki untuk menuju RW tersebut.\r\nApakah pengkajian subsistem komunitas yang tepat dengan data diatas?\r\n\r\n', 118, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:55:50', '2021-04-05 08:55:50'),
	(546, 2, 2, 8, 'Seorang laki-laki usia 56 tahun dirawat di Rs jiwa selama 7 hari mengatakan mulutnya kering dan sulit buang air besar, pasien mendapatkan obat CPZ. Perawat meberikan pendidikan kesehatan mengenai cara minum obat yang benar dan menyarankan klien tidak berhenti minum obat\r\n\r\nApakah implementasi yang dilakukan perawat?\r\n', 119, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:56:34', '2021-04-05 08:56:34'),
	(547, 2, 2, 9, 'Seorang perawat komunitas melakukan pengkajian dengan mengumpulkan kelompok ibu hamil dan bertanya mengenai pemeriksaan antenatal yang sudah dilakukan selama trimester satu. \r\nApakah metode pengkajian yang tepat oleh perawat tersebut?\r\n\r\n', 120, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:57:18', '2021-04-05 08:57:18'),
	(548, 2, 2, 8, 'Seorang perempuan usia 16 tahun BB : 67 kg, TB = 145cm, tidak mau bermain dengan teman-temannya klien selalu dibully karena bentuk tubuhnya, klien mengkonsumsi obat penglangsing berlebihan yang menyebabkan klien harus ditarawat di RS.\r\n\r\nApakah yang harus di kaji oleh perawat?\r\n', 121, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:58:49', '2021-04-05 08:58:49'),
	(549, 2, 2, 9, 'Seorang perawat komunitas memberikan penyuluhan cuci tangan pakai sabun di setiap RW. Kegiatan ini didasari hasil pengkajian sebelumnya yang menyatakan tingginya angka kejadian penyakit diare dan thypus di wilayah kerja puskesmas.\r\nApakah strategi intervensi yang tepat digunakan oleh perawat?\r\n\r\n', 122, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 08:59:14', '2021-04-05 08:59:14'),
	(550, 2, 2, 8, 'Saat berkunujng ke keluarga perawat menemukan Laki-laki berusia 35 tahun,  tidak mau keluar rumah sejak klien di PHK,  istri klien bekerja menjadi tulang punggung keluarga.  Istri klien mengatakan klien selalum mengeluh pusing dan lemas sehingga mengabaikan aktivitas sehari-hari dan personal higiens. \r\n\r\nApakah masalah psikososial yang tepat pada kasus di atas?\r\n', 123, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:01:11', '2021-04-05 09:01:11'),
	(551, 2, 2, 9, 'Seorang perawat berkeliling di suatu wilayah dan menemukan kondisi produksi sayuran dan buah yang melimpah, namun tidak dimanfaatkan dengan baik oleh masyarakat. seringkali sayur dan buat tersebut membusuk akibat tidak dipanen. \r\nApakah intervensi komunitas yang tepat oleh perawat?', 124, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:02:07', '2021-04-05 09:02:07'),
	(552, 2, 2, 8, 'Seorang laki-laki usia 17 tahun dilakukan amputasi pada  tangan kirinya, karena kecelakaan motor sehingga cukup lama tidak sekolah, pasien tidak mau ditemui oleh teman-temannya,  klien selalu murung dan menagis.\r\n\r\nApakah komponen yang paling terganggu pada konsep diri kasus diatas?\r\n', 125, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:03:06', '2021-04-05 09:03:06'),
	(553, 2, 2, 9, 'Seorang perawat komunitas mendapatkan data kelompok ibu hamil yang tidak mau memeriksakan kehamilan pada tenaga kesehatan karna menganggap hal tersebut musyrik. cakupan pemberian tablet Fe rendah, cakupan pemberian imunisasi rendah, dan angka kematian ibu dan bayi meningkat setiap tahun.\r\nApakah prioritas intervensi komunitas pada kasus diatas?\r\n  \r\n', 126, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:03:35', '2021-04-05 09:03:35'),
	(554, 2, 2, 9, 'Seorang perawat melakukan pengkajian di sekolah dan mendapatkan data : 90% siswa kelas 1 memiliki kebersihan diri yang kurang, 50% anak memiliki karies gigi, dan 100% siswa tidak pernah cuci tangan setelah makan dan bermain.:\r\nApakah intervensi komunitas yang tepat?\r\n', 127, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:04:54', '2021-04-05 09:04:54'),
	(555, 2, 2, 8, 'Seorang perempuan usia 28 ahun datang ke IGD RS Jiwa di antar oleh keluarganya dengan keluhan klien sering berbicara sendiri dna tertawa sendiri di kamar dan sering memukul-mukul kepalanya dengan tangan, keluhan ini sudah di alami klien lebih dari satu bulan.\r\n\r\nApakah tanda dan gejala apakah yang di tujukan oleh klien ?\r\n', 128, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:05:16', '2021-04-05 09:05:16'),
	(556, 2, 2, 9, 'Perawat melakukan survey di suatu wilayah, didapatkan data sebagian besar anggota prolanis tidak berpartisipasi dalam kegiatan puskesmas padahal angka kejadian hipertensi dan diabetes tinggi setiap tahun.  :\r\nApakah masalah keperawatan utama pada kelompok komunitas tersebut?\r\n', 129, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:06:12', '2021-04-05 09:06:12'),
	(557, 2, 2, 8, 'Seorang laki-laki berusia 26 tahun dibawa ke UGD RSJ. Pasien berbicara kasar dan menendang benda-benda yang berada di sekitarnya. Menurut keluarga, pasien dibawa ke RSJ karena telah memecahkan kaca tetangga dan marah-marah tanpa sebab. Selain itu, pasien tampak sering malamun dan menyendiri di rumah.\r\n\r\nApakah masalah keperawatan utama pada pasien tersebut?\r\n', 130, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:07:22', '2021-04-05 09:07:22'),
	(558, 2, 2, 9, 'Hasil pengkajian perawat bahwa 6%  ibu-ibu usia dewasa madya mengalami masalah diabetes melitus dikarenakan ketidakseimbangan metabolisme. Ibu-ibu tersebut sebagian besar sudah mengetahui bahaya diabetes jika dibiarkan. Perawat akan melakukan upaya senam kaki diabetes untuk menjaga kemampuan otot kecil pada kaki klien tetap optimal.  l :\r\nApakah strategi intervensi keperawatan yang tepat?\r\n\r\n', 131, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:07:45', '2021-04-05 09:07:45'),
	(559, 2, 2, 8, 'Seorang laki-laki berusia 30 tahun dibawa ke RSJ oleh keluarga. Saat pengkajian, pasien mengatakan melihat bayangan hitam yang selalu mengejar dirinya, mengeluarkan kata-kata kasar dan meminta bayangan hitam itu untuk pergi. Keluarga mengatakan pasien sering terlihat berbicara sendiri, tampak melakukan gerakan memukul-mukul dan mengusir. Padahal tidak terlihat ada orang lain yang mengganggu pasien. \r\n\r\nApakah masalah keperawatan utama pada pasien tersebut?\r\n', 132, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:09:22', '2021-04-05 09:09:22'),
	(560, 2, 2, 9, 'Di sebuah wilayah terdapat balita stunting sejumlah 2% dari populasi balita di wilayah tersebut. orang tua sebagian besar rajin memeriksakan anaknya di posyandu dan seringkali berkumpul dalam kegiatan arisan. Perawat memotivasi kader untuk selalu memotivasi orang tua dalam pemenuhan nutrisi bagi anak.\r\nApakah strategi intervensi yang tepat dilakukan oleh perawat?\r\n', 133, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:09:22', '2021-04-05 09:09:22'),
	(561, 2, 2, 9, 'Perawat melakukan survey di suatu wilayah, didapatkan data sebanyak 25% ibu yang memiliki balita berpendidikan sekolah dasar dan berusia dibawah 20 tahun. Ibu-ibu tersebut memiliki kebiasaan memberikan mpasi pada bayi baru lahir agar bayinya kuat dan sehat.\r\nApakah masalah keperawatan pada kelompok ibu tersebut?\r\n\r\n', 134, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:11:16', '2021-04-05 09:11:16'),
	(562, 2, 2, 8, 'Seorang laki-laki berusia 35 tahun dirawat di RSJ. Pasien mengatakan bahwa dirinya jelek dan tidak berharga. Selama berinteraksi dengan perawat, pasien lebih sering menunduk, kontak mata kurang dan terlihat sedih.\r\n\r\nManakah tindakan keperawatan utama yang dilakukan  pada pasien tersebut?\r\n', 135, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:11:24', '2021-04-05 09:11:24'),
	(563, 2, 2, 9, 'Perawat melakukan pembinaan di RW 04. Didapatkan data bahwa sebagian lansia mengalami penyakit degeneratif seperti hipertensi dan diabetes. Posbindu PTM sudah dibentuk di wilayah tersebut, dan juga ada penjadwalan senam lansia rutin setiap hari minggu.  \r\nApakah masalah keperawatan pada masyarakat tersebut?\r\n\r\n\r\n', 136, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:13:14', '2021-04-05 09:13:14'),
	(564, 2, 2, 8, 'Seorang perempuan berusia 25 tahun, dibawa keluarganya ke UGD RSJ dengan keluhan merasa dirinya tidak berguna, tidak memiliki kemampuan, serta merasa dirinya bodoh. Saat dikaji pasien sering menundukkan kepala, kontak mata kurang dan terlihat sedih\r\n\r\nApa masalah utama yang tepat pada kasus tersebut? \r\n', 137, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:13:50', '2021-04-05 09:13:50'),
	(565, 2, 2, 8, 'Seorang pasien laki-laki, berusia 25 tahun, dirawat di ruang tenang RSJ, 1 minggu yang lalu mencoba menggantung diri.  Ia mengatakan, “ Pacar saya meninggalkan saya. Saya pemuda yang gagal, tidak punya pekerjaan yang baik, jelek dan miskin”. Semua yang diungkapkan pasien berfokus pada kekurangan diri sendiri akibat pemikiran negatif terhadap diri sendiri.\r\n\r\nApa yang menyebabkan pasien memiliki pandangan negatif terhadap dirinya?\r\n', 138, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:15:54', '2021-04-05 09:15:54'),
	(566, 2, 2, 9, 'Di salah satu RW terdapat 18 balita diantaranya 2 orang yang mengalami gizi buruk. Kedua orang tua balita belum membawa anaknya ke puskesmas. Ketua RW mengajukan kepada puskesmas untuk mengadakan PMT (Program Makanan Tambahan). \r\nApakah data yang harus dikumpulkan selanjutnya oleh perawat?\r\n\r\n', 139, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:16:31', '2021-04-05 09:16:31'),
	(567, 2, 2, 8, 'Seorang laki-laki berusia 26 tahun dibawa ke UGD RSJ. Pasien berbicara kasar dan menendang benda-benda yang berada di sekitarnya. Menurut keluarga, pasien dibawa ke RSJ karena telah memecahkan kaca tetangga dan marah-marah tanpa sebab. Perawat telah mengidentifikasi penyebab dan tanda gejala marah. \r\n\r\nApakah tindakan utama pada pasien tersebut?\r\n', 140, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:17:52', '2021-04-05 09:17:52'),
	(568, 2, 2, 9, 'Di salah satu RW terdapat 18 balita diantaranya 2 orang yang mengalami gizi buruk. Kedua orang tua balita belum membawa anaknya ke puskesmas. Ketua RW mengajukan kepada puskesmas untuk mengadakan PMT (Program Makanan Tambahan). \r\nApakah intervensi prioritas harus disusun oleh perawat?\r\n\r\n\r\n', 141, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:18:19', '2021-04-05 09:18:19'),
	(569, 2, 2, 8, 'Seorang perempuan berusia 28 tahun dibawa ke RSJ oleh keluarga. Saat pengkajian, pasien mengatakan melihat bayangan hitam besar yang selalu mengejar dirinya, mengeluarkan kata-kata kasar dan meminta bayangan hitam itu untuk pergi. Keluarga mengatakan pasien sering terlihat berbicara sendiri, tampak melakukan gerakan memukul-mukul dan mengusir. Padahal tidak terlihat ada orang lain yang mengganggu pasien. Perawat telah mengajarkan cara menghardik halusinasi\r\n\r\nApakah tindakan keperawatan utama pada pasien tersebut?\r\n', 142, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:19:54', '2021-04-05 09:19:54'),
	(570, 2, 2, 9, 'Di salah satu RW terdapat 18 balita diantaranya 2 orang yang mengalami gizi buruk. Kedua orang tua balita belum membawa anaknya ke puskesmas. Ketua RW mengajukan kepada puskesmas untuk mengadakan PMT (Program Makanan Tambahan). \r\nApakah masalah keperawatan yang sesuai?\r\n\r\n', 143, 1, NULL, NULL, '=', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:19:54', '2021-04-05 09:19:54'),
	(571, 2, 2, 8, 'Seorang pasien laki-laki, berusia 25 tahun, dirawat di ruang tenang RSJ, 1 minggu yang lalu mencoba menggantung diri.  Ia mengatakan, “ Pacar saya meninggalkan saya. Saya pemuda yang gagal, tidak punya pekerjaan yang baik, jelek dan miskin”. Semua yang diungkapkan pasien berfokus pada kekurangan diri sendiri akibat pemikiran negatif terhadap diri sendiri. Perawat telah mengidentifikasi aspek positif yang masih dimiliki pasien.\r\n\r\nApa tindakan utama yang dilakukan berikutnya?\r\n', 144, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:22:14', '2021-04-05 09:22:14'),
	(572, 2, 2, 9, 'Di salah satu RW terdapat 5 balita yang mengalami diare. Perawat koordinator desa sudah memberikan penyuluhan tentang diare pada kader sebanyak 2 kali.\r\nApakah kriteria keberhasilan yang tepat untuk kader?\r\n', 145, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:23:26', '2021-04-05 09:23:26'),
	(573, 2, 2, 8, 'Seorang laki-laki berusia 25 tahun datang ke UGD RSJ dengan keluhan selalu merasa sepi, tidak aman, bosan, ketidakmampuan berkonsentrasi, dan perasaan ditolak. Saat dikaji, pasien terlihat banyak diam, tidak mau bicara, menyendiri, tidak mau berinteraksi, tampak sedih, afek datar dan  kontak mata kurang. \r\n\r\nApa masalah keperawatan utama yang tepat pada kasus tersebut? \r\n', 146, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:24:11', '2021-04-05 09:24:11'),
	(574, 2, 2, 8, 'Seorang perempuan berusia 35 tahun datang ke UGD RSJ dengan keluhan selalu merasa sepi, tidak aman, mudah bosan, ketidakmampuan berkonsentrasi, dan perasaan ditolak. Hasil pengkajian, pasien terlihat banyak diam, tidak mau bicara, menyendiri, tidak mau berinteraksi, tampak sedih, afek datar dan  kontak mata kurang. Perawat sudah membina hubungan saling percaya, membantu mengajarkan cara berkenalan.\r\n\r\nApa tindakan keperawatan utama berikutnya pada kasus tersebut? \r\n\r\n', 147, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:26:25', '2021-04-05 09:26:25'),
	(575, 2, 2, 9, 'Di satu desa dilakukan Musawarah Masyarakat Desa (MMD). Pada saat MMD disajikan data 10 klien TB Paru, 1 klien gangguan jiwa, 45 klien hipertensi, 2 balita gizi buruk dan 15 klien diabetes melitus.\r\nKelompok manakah yang menjadi prioritas perawat? \r\n\r\n', 148, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:27:34', '2021-04-05 09:27:34'),
	(576, 2, 2, 5, 'Seorang perempuan berusia 61 tahun tinggal bersama istrinya. Keluarga mengatakan bahwa beberapa hari ini klien sering menangis karena baru saja pensiun dan takut tidak punya uang.  hasil pengkajian emosional menandakan status emosional positif. Klien cenderung murung, terlihat gelisah.\r\nApa yang harus di kaji oleh perawat ketika melakukan kunjungan kepada klien tersebut?', 149, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:32:21', '2021-04-05 09:32:21'),
	(577, 2, 2, 9, 'Hasil MMRW di salah satu RW pedesaan menunjukkan balita dengan berat badan pada garis kuning 2 orang dan BGM (bawah garis merah) 1  orang. Pos yandu sudah ada namun kunjungan balita ke pos yandu rendah. Terdapat 2 orang kader kesehatan.\r\nApakah intervensi yang utama yang dilakukan perawat untuk kader?\r\n\r\n\r\n', 150, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:33:55', '2021-04-05 09:33:55'),
	(578, 2, 2, 5, 'Seorang laki-laki berusia 63 tahun yang tinggal di sebuah panti jompo. Mengalami nyeri pada telapak kaki sebelah kanan. Seorang perawat sedang melakukan implementasi keperawatan dengan rendam air hangat pada kaki klien. Namun Pada saat pemberian kompres klien tidak sengaja menyenggol ember air rendaman sehingga terdapat air genangan di lantai. Perawat membiarkan air genangan tersebut, sementara terlihat lansia lain berjalan lalu lalang di dekat air genangan tersebut.\r\nApa prinsip etik yang di langgar oleh perawat pada kasus tersebut?', 151, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:34:41', '2021-04-05 09:34:41'),
	(579, 2, 2, 9, 'Di satu desa terdapat kepercayaan bumil harus menggunakan peniti pada pakaian di bagian dadanya. Perawat sudah melakukan pengkajian dan mereka menyatakan bahwa itu adalah kebiasan dari leluhurnya.\r\nApakah Intervensi yang tepat untuk bumil?\r\n\r\n', 152, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:35:47', '2021-04-05 09:35:47'),
	(580, 2, 2, 5, 'Seorang perempuan berusia 60 tahun tinggal bersama anaknya, klien mengeluh susah menahan keinginannya untuk BAK pada malam hari. Perawat berencana memberika implementasi.\r\nApa yang dapat perawat lakukan dalam tahapan implementasi?', 153, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:38:15', '2021-04-05 09:38:15'),
	(581, 2, 2, 9, 'Kelompok penderita Diabetes mellitus di Desa sebanyak 24 orang. Selanjutnya dilakukan pengkajian oleh perawat. Hasil pengkajian menunjukkan bahwa 90% menyatakan gejala penyakitnya berkurang dan kadar glukosa darah terkontrol. Sebanyak 90% menyatakan tidak ada masalah untuk mengikuti program puskesmas dan ingin tetap terjaga kesehatannya.\r\nApakah intervensi utama yang tepat?\r\n\r\n', 154, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:39:39', '2021-04-05 09:39:39'),
	(582, 2, 2, 5, 'Seorang laki-laki berusia 66 tahun tinggal bersama anak dan cucunya. Beberapa bulan terakhir ini klien mengatakan nafsu makannya menurun, sering merasa kenyang. Pada saat dilakukan penghitungan BMI didapatkan kesimpulan bahwa klien mengalami gizi kurang.\r\nApa perencanaan yang dapat dilakukan oleh perawat', 155, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:40:44', '2021-04-05 09:40:44'),
	(583, 2, 2, 9, 'Di satu desa terdapat 21 penderita TB Paru yang tersebar di semua RW. Untuk mencegah penularan, perawat melakukan penyuluhan tentang pencegahan penularan TB Paru tentang penggunaan masker, tempat membuang dahak dan imunisasi. Perawat mengundang seluruh pasien TB Paru dan keluarganya dan yang dapat hadir sebanyak 15 pasien dan keluarganya.\r\nApakah keberhasilan tindakan yang dilakukan perawat ?\r\n\r\n', 156, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:41:15', '2021-04-05 09:41:15'),
	(584, 2, 2, 5, 'Seorang perempuan berusia 60 tahun tinggal disebuah panti. Klien mengeluh mengalami kesulitan tidur kembali saat tengah malam. Hal ini menyebabkan klien merasa ngantuk pada siang hari dan tidak bisa mengikuti kegiatan di panti. Klien terlihat murung dan gelisah pada saatmenceritakan hal tersebut.  Pada saat pengkajian perawat melakukan pengkajian terkait kecemasan dan mendokumentasikan tingkat kecemasan.\r\nApa yang dapat dilakukan oleh perawat dalam melakukan pengkajian lanjutan?', 157, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:42:52', '2021-04-05 09:42:52'),
	(585, 2, 2, 9, 'Perawat puskesmas melakukan pengkajian pada masyarakat satu desa dan didapatkan masalah tingginya angka penyakit hipertensi. Perawat melakukan senam lansia yang hipertensi dan yang hadir mengikuti senam sebanyak 100%. Sebelum dan sesudah dilakukan senam dilakukan pemeriksaan tekanan darah.\r\nApakah keberhasilan tindakan yang dilakukan perawat?\r\n', 158, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:42:52', '2021-04-05 09:42:52'),
	(586, 2, 2, 9, 'Perawat puskesmas melatih kader tentang manajemen imunisasi. Kader diajarkan tentang program imunisasi dasar, alasan dan kegunaan, efek samping dan reaksi yang mungkin terjadi ketika dilakukan imunisasi. Jumlah kader yang mengikuti pelatihan sebanyak 22 peserta yang berasal dari 11 RW. Pelatihan dilaksanakan karena masih rendahnya cakupan imunisasi di RW tersebut\r\nApakah evaluasi yang tepat untuk keberhasilan tindakan tersebut?\r\n\r\n', 159, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:44:29', '2021-04-05 09:44:29'),
	(587, 2, 2, 5, 'Seorang perawat Ners sedang melakukan pengkajian pada lansia berusia 70 tahun. Hasil pengkajian didapatkan klien mengalami penurunan fungsi penglihatan, berjalan dengan bantuan tongkat. Penerangan remang-remang dan lantai tampak licin.\r\nApakah diagnosa keperawatan yang tepat pada kasus diatas?', 160, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:44:34', '2021-04-05 09:44:34'),
	(588, 2, 2, 9, 'Rumah yang dimiliki oleh sebagian besar warga berupa bangunan semi permanen dengan luas kurang lebih 30 m2 yang ditempati oleh 4 orang anggota keluarga, dengan ventilasi dan sirkulasi udara kurang baik.\r\nApakah masalah kesehatan yang berisiko pada kelompok masyarakat tersebut?\r\n\r\n', 161, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 09:47:42', '2021-04-05 09:47:42'),
	(589, 2, 2, 7, 'Saat kunjungan rumah didapatkan data: seorang laki-laki, berusia 58 tahun, mengeluh nyeri kepala sampai ke leher sejak 3 hari yang lalu, nyeri dirasakan seperti ditusuk-tusuk. Keluar¬ga mengatakan klien sudah mengurangi makan asin namun masih sering tergoda merokok. Su¬dah 4 bulan mengalami hipertensi tetapi belum kontrol secara teratur. Pada pemeriksaan didapat¬kan tekanan darah 160/90 mmHg, nadi 100 x/mt, frekuensi pernafasan 20 x/mt, suhu 73,1 oC.\r\nApakah masalah perawatan pada kasus diatas?\r\n', 162, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 20:20:23', '2021-04-05 20:20:23'),
	(590, 2, 2, 7, 'Saat kunjungan rumah didapatkan data: Laki-la¬ki, Bapak X, berusia 59 Tahun, mengeluh sering pusing. Keluarga mengatakan sudah 6 bulan mengalami hipertensi namun tidak dibawa kon¬trol teratur. Tekanan darah saat diperika 170/90 mmHg. Keluarga tidak membedakan makanan sehari-hari seluruh anggota keluarga.\r\nApakah data yang perlu dikaji lebih lanjut pada kasus diatas?\r\n', 163, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 20:22:16', '2021-04-05 20:22:16'),
	(591, 2, 2, 7, 'Seorang anak laki laki berusia 5 tahun tampak pucat. Keluarga mengatakan anak cepat lelah tidak seperti anak-anak sebaya yang lain. Hasil pemeriksaan: kulit bersih, konjungtiva anemis dan perut datar. Nadi 60 x/mnt, Pernapasan 16 x/ mnt, tekanan darah 95/60 mmHg, Anak tampak agak pucat, Keluarga mengatakan anak malas makan. Kebiasaan makan nasi dengan kecap, kerupuk dan jajan.\r\nManakah intervensi langsung pada kasus terse¬but?\r\n', 164, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 20:23:59', '2021-04-05 20:23:59'),
	(592, 2, 2, 7, 'Perawat  mengunjungi rumah keluarga, Ibu berusia 49 tahun, terdiagnosa menderita penyakit Diabetes Melitus sejak 2 bulan yang lalu dengan kadar gula darah 250 mg/dl pada pemeriksaan laboratorium terakhir 1 minggu yang lalu. Keluhannya saat ini adalah kaki sering kesemutan dan terasa kebas/ baal, sering kencing terutama malam hari. Klien terbiasa tidak pakai alas kaki saat beraktifitas sehari-hari. \r\nApakah prioritas masalah diagnosa keperawatan pada kasus diatas?\r\n', 165, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 20:25:14', '2021-04-05 20:25:14'),
	(593, 2, 2, 7, 'Perawat melakukan kunjungan rumah ibu dengan Diabetes Melitus. Ibu menceritakan bahwa 2 hari yang lalu dia pingsan dipagi hari setelah dari kamar mandi. Sebelum pingsan dia merasa pusing, lemas, tiba2 penglihatan gelap dan jatuh pingsan. Keluarga panik kemudian membawa Ibu ke Puskesmas dan dinyatakan mengalami hipoglikemia.\r\nApakah tindakan yang tepat diajarkan jika kejadian tersebut berulang?\r\n', 166, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 20:26:41', '2021-04-05 20:26:41'),
	(594, 2, 2, 7, 'Seorang laki-laki berusia 60 tahun, tinggal bersama keluarga. Hasil pengkajian ditemukan nyeri dan bengkak pada daerah persendian, cepat lelah, senang makan kacang kacangan. Hasil pemeriksaan fisik TD:130/80 mmHg, BB 65kg, TB 160 cm, asam urat 10 mg%. klien menolak untuk dilakukan tindakan keperawatan pemberian kompres hangat.\r\nApakah prinsip etik yang harus perawat terapkan terhadap kasus diatas?\r\n', 167, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 20:28:17', '2021-04-05 20:28:17'),
	(595, 2, 2, 7, 'Seorang perawat mendapat data bahwa kepala Keluarga dapat menjelaskan bahwa penyebab penyakit diare anaknya adalah karena jajan sembarangan. Apakah tugas kesehatan keluarga yang tepat?\r\n', 168, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 20:29:52', '2021-04-05 20:29:52'),
	(596, 2, 2, 7, 'seorang perawat mendata data pengkajian bahwa Keluarga dapat memantau pengobatan anaknya yang sakit TB Paru. Apakah tugas kesehatan keluarga yang tepat?', 169, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 20:33:10', '2021-04-05 20:33:10'),
	(597, 2, 2, 7, 'Seorang perawat mengkaji satu keluarga, didapatkan data keluarga terdiri dari ayah, ibu dan anak. apakah type keluarga yang tepat', 170, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 20:39:27', '2021-04-05 20:39:27'),
	(598, 2, 2, 7, 'Perawat mendapatkan data keluarga di rumah yaitu sangat kotor, ventilasi rumah kurang dan penataan perabot rumah tangganya kurang rapi. Kepala keluarga baru saja didiagnosa TB Paru. Data yang didapat perawat tersebut termasuk komponen pengkajian….', 171, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 20:40:37', '2021-04-05 20:40:37'),
	(599, 2, 2, 7, 'sebuah Keluarga memiliki seorang anak berumur 17 tahun. Ayah  sering bertengkar dengan anaknya karena komunikasi yang kurang terjalin dengan baik. Apakah data fokus yang harus dikaji perawat?', 172, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 20:42:33', '2021-04-05 20:42:33'),
	(600, 2, 2, 5, 'Seorang laki-laki berusia 65 tahun tinggal di panti wreda, klien mengeluh mengalami penurunan pendengaran, pandangan kabur, dan mobilisasi dibantu menggunakan kursi roda. Pada pengkajian fisik didapatkan klien mengalami penurunan kekuatan otot ekstremitas bawah.\r\nApakah diagnosa keperawatan prioritas pada kasus diatas?', 173, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 20:55:18', '2021-04-05 20:55:18'),
	(601, 2, 2, 5, 'Seorang pria berusia 74 tahun, mengalami kesulitan untuk bergerak dan berpindah tempat sejak klien dinyatakan stroke oleh dokter tresna wreda 3 bulan yang lalu. Pemenuhan kebutuhan dasar pada klien membutuhkan bantuan penuh dari perawat.\r\nApakah upaya preventive yang dapat dilakukan oleh perawat dalam upaya pemenuhan kebutuhan kenyamanan tempat tidur pada klien tersebut?', 174, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 20:58:16', '2021-04-05 20:58:16'),
	(602, 2, 2, 5, 'Seorang laki-laki berusia 78 tahun tinggal di panti wreda sudah 2 tahun yang ditempatkan diruang isolasi. Klien mengeluhkan nyeri pada luka di punggung bagian bawah, pada saat pengkajian di pungggung ada luka dengan diameter 10 cm. kondisi tubuh lemah, bau badan, kulit kusam, rambut kotor, bau mulut, kuku panjang, pakaian tidak rapi, dan tidak ganti 2 hari. Makan dibantu oleh teman dekatnya yang masih bisa beraktivitas, untuk BAB dan BAK dilakukan ditempat tidur. Hasil indeks Katz skornya 3 ketergantungan Total. Hasil pengkajian Mini Mental State Exam 20 kerusakan mental berat. Risiko jatuh 9 yaitu risiko jatuh Sedang.\r\nApakah diagnosa keperawatan yang muncul dari kasus diatas?', 177, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:00:44', '2021-04-05 21:03:04'),
	(603, 2, 2, 5, 'Seorang laki-laki berusia 69 tahun tinggal di panti wreda mengeluh ke perawat karena kulit kakinya yang terlihat hitan, kasar, tebal dan pecah-pecah. Klien mengatakan ia sebelumnya bekerja sebagai pemulung di Tempat Pembuangan Akhir (TPA) selama 20 tahun tanpa menggunakan alas kaki. Dari hasil pengkajian lansia: kulit tampak mengelupas, hitam, kotor dan tampak banyak bekas garukan kuku.\r\nApakah intervensi keperawatan yang tepat pada kasus diatas?', 176, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:02:30', '2021-04-05 21:02:30'),
	(604, 2, 2, 5, 'Seorang laki-laki berusia 60 tahun tinggal di panti wreda, klien merupakan seorang pensiunan TNI AD dimana klien selalu berpakaian rapi dan sering memerintah sesama penghuni panti. Klien sulit diatur dan mau menang sendiri. \r\nApakah kumpulan gejala psikologis pada kasus diatas disebut?', 177, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:05:26', '2021-04-05 21:05:26'),
	(605, 2, 2, 5, 'Seorang perempuan berusia 70 tahun tinggal di panti wreda mengeluh akhir-akhir ini sedang tidak nafsu makan karena sariawan dimulutnya. Dari hasil pengkajian pasien didapatkan data: gigi terlihat kotor serta banyak sisa makanan, mulut yang bau, bibir kering, pecah-pecah dan tampak stomatitis pada mukosa mulut dengan diameter 0,5 cm dan berwarna merah.\r\nApakah intervensi keperawatan prioritas pada pasien tersebut diatas?', 178, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:07:06', '2021-04-05 21:07:06'),
	(606, 2, 2, 5, 'Seorang Perempuan berusia 70 tahun tinggal di panti wreda dengan keluhan sering terbangun saat tidur dimalam hari, kesulitan saat akan mulai tidur kembali, badan lemas dan sering merasa ngantuk dipagi hari.\r\nApakah pengkajian selanjutnya pada kasus diatas?', 179, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:09:04', '2021-04-05 21:09:04'),
	(607, 2, 2, 5, 'Seorang perempuan berusia 74 tahun tinggal di panti wredha sejak satu tahun yang lalu. Klien mengeluh badannya terasa lemas dan susah menjangkau toilet sehingga ngompol di tempat duduk ataupun tempat tidur. Tercium bau pesing dari pakaian dan kamar klien. Hasil pengkajian fungsional berdasarkan Katz Index, klien termasuk dalam kategori D.\r\nApakah masalah keperawatan pada kasus di atas? ', 180, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:11:00', '2021-04-05 21:11:00'),
	(608, 2, 2, 5, 'Seorang perempuan berusia 74 tahun tinggal di panti sejak lima tahun yang lalu. Klien mengalami katarak dan gangguan gaya berjalan, sejak saat itu klien menggunakan tongkat untuk mebantunya berjalan. Klien menyatakan tidak berani berjalan jauh karena takut jatuh disebabkan lingkungan sekitar panti yang berundak dan lantai yang licin.\r\nApakah diagnosis keperawatan yang tepat untuk kasus di atas? ', 181, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:12:51', '2021-04-05 21:12:51'),
	(609, 2, 2, 5, 'Seorang kakek 72 tahun mengalami masalah pendengaran, klien tidak menggunakan alat bantu pendengaran. Dalam kehidupan sehari-hari klien sering jalan-jalan di lingkungan rumah yang terkadang ramai kendaraan hilir mudik.\r\nApakah upaya perawat saat memberikan intervensi kepada klien tersebut ?', 182, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:14:46', '2021-04-05 21:14:46'),
	(610, 2, 2, 5, 'Seorang perempuan 69 tahun mengalami penurunan daya ingat, tidak dapat menyebutkan siapa saja nama-nama cucunya. Untuk melakukan aktivitas sehari-hari seperti makan dan minum klien di bantu oleh keluarganya.\r\nPenurunan  apakah yang di alami klien berdasarkan kasus di atas ?', 183, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:16:48', '2021-04-05 21:16:48'),
	(611, 2, 2, 5, 'Seorang laki-laki (72th) mengeluh BAK jarang dan  hanya sedikit yang keluar sejak 4 hari yang lalu, namun asupan minum seperti biasa, keluhan lain yang di rasakan adalah adanya nyeri di sekitar pinggang.\r\nApakah diagnosa yang tepat pada kasus diatas ?', 184, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:19:09', '2021-04-05 21:19:09'),
	(612, 2, 2, 5, 'Seorang nenek 67 tahun dibawa ke puskemas dengan keluhan sesak nafas dan batuk berdahak Hasil pengkajian TD:130/89 mmHg, N: 67x/mnt, RR: 22 x/mnt, retraksi dada tidak simetris.\r\nApakah jenis perubahan fisiologis yang terjadi pada kasus di atas?', 185, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:21:07', '2021-04-05 21:21:07'),
	(613, 2, 2, 5, 'Lansia berusia 65 tahun dirawat di Rumah Sakit sejak satu minggu yang lalu. Dari hasil pengkajian klien terlihat lemah, klien mengatakan tidak ada keinginan untuk BAB sejak 1 minggu, perut kembung (+), peristaltik usus 4x/mnt.\r\nApakah diagnosa keperawatan yang tepat pada kasus diatas?', 186, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:22:54', '2021-04-05 21:22:54'),
	(614, 2, 2, 5, 'Seorang nenek usia 60 tahun tinggal di Panti Tresna Wreda sejak 1 tahun yang lalu. Klien memerlukan bantuan minimal dalam tindakan keperawatan.  Klien mampu melakukan aktivitas sehari-hari tanpa bantuan, hanya sesekali saja memerlukan bantuan petugas kesehatan.\r\nBerdasarkan pengkajian fungsional Katz Indeks, apakah kategori lansia di atas', 187, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:24:48', '2021-04-05 21:24:48'),
	(615, 2, 2, 5, 'Seorang laki-laki 85 tahun mengalami masalah psikososial, klien sering merasa khawatir apakah klien akan berumur panjang, mengingat begitu banyak penyakit yang diseritanya, seperti hipertensi dan asam urat, klien sering merasa tidak bisa tidur memikirkan hal yang di alaminya saat ini.\r\nDiagnosa apakah yang paling tepat pada kasus diatas ?', 188, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:26:27', '2021-04-05 21:26:27'),
	(616, 2, 2, 5, 'Seorang laki-laki 63 tahun mengalami hipertensi sejak 10 tahun yang lalu. Saat di kaji TD 157/92 mmHg. Klien sering bertanya tentang penyakit dan klien tampak murung dan sering melamun, namun jika ada teman nya yang datang, klien masih bisa bercanda dan melakukan aktifitas lain nya.\r\nApakah diagnosa yang tepat pada kasus di atas?', 189, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:28:14', '2021-04-05 21:28:14'),
	(617, 2, 2, 5, 'Seorang laki-laki usia 60 tahun tinggal di Panti Werdha, klien merupakan seorang pensiunan TNI AD yang  klien selalu berpakaian rapi dan sering memerintah sesama penghuni panti. Klien sulit diatur dan maunya menang sendiri.\r\nMasalah apakah yang di alami klien di atas?', 190, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:31:14', '2021-04-05 21:31:14'),
	(618, 2, 2, 5, 'Salah satu penghuni panti tresna werdha mengalami penurunan fungsi spingter internal dan eksternal. Hal tersebut menyebabkan perubahan pola eliminasi pasien.\r\nApakah prioritas masalah pada kasus di atas?', 191, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:33:12', '2021-04-05 21:33:12'),
	(619, 2, 2, 5, 'Seorang perempuan 80 tahun dibawa ke Puskesmas nampak lemas dengan keluhan nyeri kepala yang bertambah terutama ketika beraktivitas. Diketahui bahwa klien memiliki riwayat hipertensi dan DM. Perawat akan memberikan terapi oksigen dengan nasal kanul.\r\nApakah pengkajian yang perlu dilakukan sebagai dasar pemberian terapi oksigen?', 192, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:35:09', '2021-04-05 21:35:09'),
	(620, 2, 2, 5, 'Seorang laki-laki 68 tahun mengeluhkan badan terasa lemas karena tdak memiliki jam tidur yang cukup. Berdasarkan hasil pengkajian diketahui klien seringkali terbangun di malam hari karena nyeri di area lututnya yang juga menyebabkan klien berjalan dengan menggunakan bantuan tongkat.\r\nApakah masalah keperawatan utama pada klien?', 193, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:37:20', '2021-04-05 21:37:20'),
	(621, 2, 2, 5, 'Seorang laki-laki 65 tahun dengan hipertensi yang tidak terkontrol. Hasil pengkajian diketahui klien memiliki riwayat merokok, menyukai makanan padang namun tidak menyukai makanan yang diasinkan, tidak mengonsumsi alkohol. Hasil antopometri menunjukan BB 82Kg dan TB 160 cm.\r\nApakah faktor risiko hipertensi yang tidak dapat dirubah pada kasus tersebut?', 194, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:39:09', '2021-04-05 21:39:09'),
	(622, 2, 2, 5, 'Seorang laki-laki 70 tahun dengan riwayat merokok mengeluh batuk-batuk dan terdengar suara ronkhi ketika auskultasi. Klien kesulitan untuk mengeluarkan sputum. Hasil pemeriksaan didapatkan pasien mengalami pneumonia. \r\nApakah penyebab penumpukan sekret pada kasus tersebut?', 195, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:43:19', '2021-04-05 21:43:19'),
	(623, 2, 2, 5, 'Seorang perempuan berusia 70 tahun diketahui tidak dapat menahan rasa untuk BAK dan seringkali mengompol terutama pada malam hari. Klien merasa dirinya tidak berguna dan sering mengurung diri di dalam kamar. Hasil pengkajian ditemukan TD 130/80 mmHg, BB 55Kg, dan TB 165 cm.\r\nApakah masalah utama pada kasus tersebut?', 196, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:44:52', '2021-04-05 21:44:52'),
	(624, 2, 2, 5, 'Seorang perempuan 70 tahun sejak 4 bulan yang lalu mengeluh nyeri di area persendian dengan skala 4 (1-10), nyeri dirasakan terutama ketika pagi hari. Klien diberikan pengobatan analgetik. Hasil pengkajian klien menyebutkan karena nyerinya klien lebih memilih untuk tidur di kamarnya, nafsu makan menurun disertai mual dan muntah.\r\nApakah masalah keperawatan utama pada kasus tersebut?', 197, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:46:24', '2021-04-05 21:46:24'),
	(625, 2, 2, 5, 'Seorang perempuan 65 tahun dengan riwayat diabetes mellitus yang tidak terkontrol. Hasil pengkajian didapatkan klien mudah merasa lelah, banyak makan dan makanan ringan, sering BAK terutama di malam hari, hasil Gula Darah Sewaktu 230 mg/dL.\r\nApakah masalah keperawatan pada kasus tersebut?', 198, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 21:48:03', '2021-04-05 21:48:03'),
	(626, 2, 2, 10, 'Sebuah perusahaan manajemen baru telah mengakuisisi sebuah rumah sakit. Sejak akuisisi nama rumah sakit telah berubah, pernyataan visi baru telah didistribusikan, struktur departemen telah berubah, dan kantin staf telah dihilangkan. Manajemen memiliki rencana untuk banyak perubahan tambahan.. Apa yang harus terjadi pada saat ini?', 199, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:11:18', '2021-04-05 22:11:18'),
	(627, 2, 2, 10, 'Rumah Sakit B melakukan survei kepuasaan pada pasien dan hasilnya adalah negatif. Kemudian Manajemen mengadakan rapat untuk membahas peningkatan survei kepuasan pasien negatif. Pada model lewin, perubahan yang sedang terjadi pada Rumah sakit B berada pada tahapan apa?', 200, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:15:20', '2021-04-05 22:15:20'),
	(628, 2, 2, 10, 'Sebuah tim akreditasi mengevaluasi pernyataan misi organisasi rumah sakit A. Apa Tindakan yang paling tepat diambil oleh rumah sakit A?', 201, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:16:51', '2021-04-05 22:16:51'),
	(629, 2, 2, 10, 'Perawat memberitahukan bahwa ada empat kotak  IV  kateter  no 18 dari bagian farmasi meskipun standar  IV kateter yang digunakan padaruangan  adalah IV kateter no 20. Apa yang harus perawat lakukan?', 203, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:18:08', '2021-04-05 22:19:09'),
	(630, 2, 2, 10, 'Seorang laki-laki 43 tahun menderita laserasi kecelakaan pada lengan bawah dibawa ke bagian gawat darurat oleh keluarga. Hasil pemeriksaan menunjukkan laserasi membutuhkan perbaikan dengan jahitan, tetapi pasien menolak pengobatan. Tindakan apa yang harus diambil oleh perawat?', 203, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:20:24', '2021-04-05 22:20:24'),
	(631, 2, 2, 10, 'Pasien marah tentang asuhan keperawatan disampaikan pada dua shift dan tuntutan masa lalu untuk melihat rekam medisnya. Apa yang harus perawat pertimbangkan sebelum memenuhi permintaan ini?', 204, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:21:44', '2021-04-05 22:21:44'),
	(632, 2, 2, 10, 'Perawat sedang melakukan irigasi luka steril pada pasien. Teman sejawatnya memasuki ruangan dan memberitahu perawat bahwa dokter menelepon dan meminta berbicara. Tindakan keperawatan yang tepat adalah', 205, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:22:53', '2021-04-05 22:22:53'),
	(633, 2, 2, 10, 'Kepala ruangan A melakukan kebutuhan perhitungan tenaga di ruangan unit medikal bedah. Berdasarkan sensus harian selama 6 bulan diunit medikal bedah dengan kapasitas  25 TT dengan 19 klien rata-rata dirawat,  rata-rata minimal kontak dengan pasien yaitu 5 jam/ 24jam. Berapa total jam perawatan yang dibutuhkan dalam sehari?', 206, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:24:03', '2021-04-05 22:24:03'),
	(634, 2, 2, 10, 'Rumah sakit Y sedang dalam persiapan menghadapi akreditasi JCI . Rumah sakit berupaya mengubah kondisi rumah sakit jadi lebih baik sesuai dengan standar JCI terutama pelaksanaan patien safety. Untuk membuat budaya patient safety rumah sakit melakukan hal yang tidak sepantasnya dengan menyewa alat hanya untuk kepentingan pada saat visitasi.\r\nBerdasarkan kasus di atas, apa prinsip manajemen resiko yang sudah dilanggar oleh rumah sakit ?\r\n', 207, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:25:19', '2021-04-05 22:25:19'),
	(635, 2, 2, 10, 'Perawat dan kepala ruangan di ruangan penyakit dalam  melakukan diskusi pada pasien x dengan diagnosa medis efusi pleura kemudian perawat mendiskusikan hasil temuan pemeriksaan fisik serta data penunjang yang berhubungan dengan klien mengenai masalah keperawatan dan perawat menetapkan tindakan yang akan dilakukan. Sebelumnya pasien dilibatkan dalam diskusi bersama perawat ruangan dan kepala ruangan. Kegiatan yang dilakukan perawat di atas berada pada tahapan?', 208, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:26:26', '2021-04-05 22:26:26'),
	(636, 2, 2, 10, 'Di ruangan perawat kelas II sebuah rumah sakit terdapat perawat pelaksana dengan karateristik perawat yang dapat menyelesaikan masalah dengan kreatif. Tanggap dengan segala situasi dengan arah tujuan organisai. Perawat juga menganggap pekerjaannya bukan sebagai beban tapi pekerjaan yang menyenangkan. Dalam mengelola perawat dengan karakteristik tersebut. Apa yang paling tepat dilakukan kepala ruangan?', 209, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:27:32', '2021-04-05 22:27:32'),
	(637, 2, 2, 10, 'Perawat R sudah bekerja Di Ruang Bedah selama 6 bulan. Ia dikenal sebagai perawat yang rajin dan ulet, hubungan dengan teman perawat, pasien dan tim kesehatan lain baik.  Satu hal yang menjadi hambatan ia dalam bekerja adalah ia belum banyak paham tentang penanganan pasien kritis, saat melakukan tindakan-tindakan invasif dan dalam mendokumentasikan hasil asuhannya.  Namun ia memiliki keinginan yang kuat untuk terus belajar, sehingga ia banyak bertanya dan mendengar. Jika anda adalah atasan perawat Ruli, maka menurut anda berada di posisi manakah tahap perkembangan Ruli dan gaya kepemimpinan seperti apa yang akan anda lakukan ?', 210, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:28:47', '2021-04-05 22:28:47'),
	(638, 2, 2, 10, 'Di ruang HCU sebuah rumah sakit terlihat kepala ruang dan para perawat memiliki hubungan yang sangat dekat dalam batasan pekerjaan. Kepala ruangan sering mendiskusikan tentang pelayanan yang lebih baik dan para perawat pun aktif dalam memberikan masukan – masukan. Apakah gaya kepemimpinan yang dimiliki oleh kepala ruangan tersebut?', 211, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:29:59', '2021-04-05 22:29:59'),
	(639, 2, 2, 10, 'Perawat Y memberikan informasi nama obat, kegunaan obat, waktu pemberian efek samping, penanggung jawab pemberian dan wadah obat pada pasien dan keluarga. Setelah itu wadah obat diserahkan atau ditunjukkan pada keluarga setelah pemberian. Tindakan yang dilakukan oleh perawat berada pada ..', 212, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:31:08', '2021-04-05 22:31:08'),
	(640, 2, 2, 10, 'Perawat D memberikan salinan obat yang harus diminum oleh pasien A beserta kartu sediaan obat. Tindakan yang dilakukan oleh perawat adalah...', 213, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:32:30', '2021-04-05 22:32:30'),
	(641, 2, 2, 10, 'Di ruangan bedah umum sebuah rumah rumah sakit terdapat perawat pelaksana yang tidak ambisius dan lebih suka untuk diarahkan. Perawat juga lebih cenderung menunggu perintah dan kurang kreatif dalam menyelesaikan masalah. Dalam mengahadapi perawat dengan karakteristik individu tersebut maka kepala ruangan harus melakukan...', 214, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:33:43', '2021-04-05 22:33:43'),
	(642, 2, 2, 10, 'Karakteristik perawat yang kurang kreatif, tidak ambisius, dan lebih suka diarahkan harus dimotivasi. Motivasi yang paling tepat untuk perawat pada kasus tersebut adalah...', 215, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:34:48', '2021-04-05 22:34:48'),
	(643, 2, 2, 10, 'Unsur-unsur yang harus dinilai oleh pimpinan keperawatan di suatu rumah sakit dalam melakukan analisis lingkungan internal adalah, kecuali:', 216, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:36:01', '2021-04-05 22:36:01'),
	(644, 2, 2, 10, 'Dalam melakukan pengkajian lingkungan, pimpinan perawat menemukan bahwa tenaga keperawatan yang dimiliki baik ditinjau dari kualitas maupun kuantitas ternyata belum memenuhi standar untuk tercapainya pemberian pelayanan keperawatan yang prima. Dalam analisis SWOT, kondisi tersebut dikategorikan sebagai:', 217, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:37:13', '2021-04-05 22:37:13'),
	(645, 2, 2, 10, 'Dalam melakukan analisis SWOT, pimpinan keperawatan menemukan bahwa kemampuan perawat untuk memberikan pelayanan keperawatan masih kurang. Pimpinan keperawatan tersebut kemudian  merumuskan strategi: “Peningkatan kemampuan staf keperawatan melalui pelatihan yang didanai dari bantuan luar negeri”. Rumusan strategi tersebut merupakan:', 218, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:38:22', '2021-04-05 22:38:22'),
	(646, 2, 2, 10, 'Berikut ini merupakan indikator sasaran dalam pelayanan keperawatan, kecuali:', 219, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:39:35', '2021-04-05 22:39:35'),
	(647, 2, 2, 10, '“Semua pasien akan menerima pelayanan keperawatan terlebih dahulu tanpa memperhatikan kemampuan membayar”, merupakan:', 220, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:42:07', '2021-04-05 22:42:07'),
	(648, 2, 2, 10, 'Dalam penyusunan rencana operasional tahunan untuk pelayanan keperawatan, pimpinan keperawatan melakukan hal-hal sebagai berikut, kecuali:', 221, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:43:54', '2021-04-05 22:43:54'),
	(649, 2, 2, 10, 'Hal-hal yang harus dikaji dalam melakukan analisis SWOT dari faktor SDM keperawatan adalah:', 222, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:45:12', '2021-04-05 22:45:12'),
	(650, 2, 2, 10, 'Kebijakan, standar praktek keperawatan, pedoman/penduan pelayanan keperawatan, standard operating procedure, instruksi kerja yang dimiliki oleh keperawatan dalam suatu rumah sakit merupakan:', 223, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:46:32', '2021-04-05 22:46:32'),
	(651, 2, 2, 10, 'Kegiatan-kegiatan yang harus dilakukan oleh manajer keperawatan pada fungsi staffing adalah, kecuali:', 224, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:53:10', '2021-04-05 22:53:10'),
	(652, 2, 2, 10, 'Disebuah rawat inap anak, 3 orang anak terpasang kateter intravena dengan diagnosis anak 1:typoid, anak 2 : diare dengan dehidrasi sedang, dan anak 3 : DHF dengan DSS.\r\nManakah anak yang membutuhkan tindakan obervasi tanda-tanda vital setiap 1 jam sekali ?\r\n', 225, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:54:50', '2021-04-05 22:54:50'),
	(653, 2, 2, 10, 'Seorang perawat baru, melakukan orientasi kerja di ruang rawat inap dalam. Tampak ragu, takut salah, dan cenderung mengerjakan tugas secara berulang-ulang  dalam memberikan asuhan keperawatan pada pasien.Apa yang harus dilakukan perawat baru tersebut untuk mencegah kondisi di atas', 226, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:56:03', '2021-04-05 22:56:03'),
	(654, 2, 2, 10, 'Dalam metode penugasan tim, rekan satu tim anda mendelegasikan pasien dengan memberikan laporan tertulis mengenai kondisi pasien. Pasien mengeluh perawat terus menerus menanyakan hal yang sama dengan yang ditanyakan perawat sebelumnya, tanpa ada tindakan selanjutnya, sehingga masalah pasien belum teratasi.  \r\nTindakan yang  dibutuhkan dalam metode tim untuk mengatasi hal tersebut adalah ', 227, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:57:27', '2021-04-05 22:57:27'),
	(655, 2, 2, 10, 'Di ruang rawat inap, dibutuhkan peraturan tentang pembatasan jumlah pengunjung, adanya jadwal kunjungan, dibuat pembatasan usia yang boleh berkunjung, dan pembatasan jumlah penunggu pasien. Apakah Tujuan utamadari upaya tersebut?', 228, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:58:41', '2021-04-05 22:58:41'),
	(656, 2, 2, 10, 'Perawat “D” mendapatkan tugas mengelola pasien sejumlah 10 orang. Perawat melakukan pekerjaannya tidak sistematis dan tidak efektif. Semua pasien mendapatkan jenis pelayanan yang sama. Hal ini sangat membingungkan dan memberatkan tugasnya sebagai perawat. Apa tindakan pertama yang harus dilakukan perawat “D” agar asuhan keperawatan diberikan dengan efektif dan efisien sesuai dengan kondisi pasien', 229, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 22:59:50', '2021-04-05 22:59:50'),
	(657, 2, 2, 10, 'Hasilkajiansituasi :\r\n58% pengkajiantidakditulis di status pasienolehperawat\r\n3% status pasienmencantumkandiagnosekeperawatan yang munculpadapasien, baikactualmaupunpotensial, \r\n97% status pasientidakmencantumkanintervensikeperawatan.\r\n3% status mencantumkanimplementasisesuaidenganintervensikeperawatan yang telahdibuat.\r\n97% status pasiendalamlembarcatatanperkembangantidakmencantumkanevaluasi.\r\nDalammanajemenasuhankeperawatan, pengelolaanapa yang harusdilakukan? \r\n', 230, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:01:19', '2021-04-05 23:01:19'),
	(658, 2, 2, 10, 'Pasienberusia 56 th, 2 jam paskaapendictomy, Nampakkesakitan, belumbiasmobilisasisendiri,  terpasanginfus.Apakahklasifikasitingkatketergantunganpasien di atas? (berdasarkanteoridouglas, 1984)', 231, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:02:47', '2021-04-05 23:02:47'),
	(659, 2, 2, 10, 'Di sebuah ruang perawatan penyakit dalam seorang pasien sedang dirawat dengan diagnosa medis Stroke. Pada hari ini perawat asosiet akan melakukan implementasi ROM pasif, membantu makan dan memberikan obat kepada pasien tersebut. Sebelum melakukan  ke-tiga hal di atas, pasien diberi kesempatan untuk memilih kegiatan mana dulu yang akan dilakukan. Apakah prinsip etik yang diterapkan oleh perawat tersebut?', 232, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:04:03', '2021-04-05 23:04:03'),
	(660, 2, 2, 10, 'Perawat “D” mendapatkan tugas mengelola pasien sejumlah 10 orang. Perawat melakukan pekerjaannya tidak sistematis dan tidak efektif. Semua pasien mendapatkan jenis pelayanan yang sama. Hal ini sangat membingungkan dan memberatkan tugasnya sebagai perawat. Apa tindakan pertama yang harus dilakukan perawat “D” agar asuhan keperawatan diberikan dengan efektif dan efisien sesuai dengan kondisi pasien', 233, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:05:26', '2021-04-05 23:05:26'),
	(661, 2, 2, 10, 'Pasien dan keluarga diberitahukan tempat tidur yang akan ditempati, tetapi lingkungan seperti WC, ruang perawat, fasilitas, peraturan ruangan, perawat dan dokter yang merawat belum diorientasikan secara optimal. Dalam manajemen asuhan keperawatan, pengelolaan apa yang harus dilakukan oleh katim ?', 234, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:33:25', '2021-04-05 23:33:25'),
	(662, 2, 2, 10, 'Pasien berusia 56 th, 2 jam paska apendictomy, nampak kesakitan, belum bisa mobilisasi sendiri,  terpasang infus. Apakah klasifikasi tingkat ketergantungan pasien di atas? (berdasarkan teori douglas, 1984)', 235, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:34:22', '2021-04-05 23:34:22'),
	(663, 2, 2, 10, 'Pada saat shif sore anda ditugaskan sebagai perawat asociet pada metode Tim,  Anda diberikan tugas merawat pasien Tn. A umur 55 tahun dengan diagnosa medis sirosis hepatis, pada saat anda mengkaji lanjutan, didapatkan data bahwa Tn. A mengalami perburukan kondisi, pada renpra tidak ada tindakan untuk menangani masalah tersebut yang dibuat oleh ka Tim. Tindakan apakah yang harus dilakukan dalam kerangka metode penugasan Tim?', 236, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:35:55', '2021-04-05 23:35:55'),
	(664, 2, 2, 10, 'Pada saat Anda dan perawat lain melaksanakan  proses operan dinas (hand over) pagi hari, ditemukan hal-hal yang harus ditindaklanjuti pada pagi hari tersebut, diantaranya harus rontgen, pasien Tn. A mengalami aritmia, pasien Tn. O, BAB di tempat tidur, pasien Ny. C mengalami gejala hipoglikemia, pasien Tn. E kehabisan persediaan obat. Tindakan keperawatan apakah yang harus ditindaklanjuti terlebih dahulu?', 237, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:37:04', '2021-04-05 23:37:04'),
	(665, 2, 2, 10, 'Anda ditunjuk oleh Karu untuk merawat 5 pasien dan bertanggung jawab penuh selama 24 jam sampai dengan pasien pulang, anda diberikan kewenangan oleh Karu untuk melakukan proses asuhan keperawatan lengkap untuk ke empat pasien tersebut. Dalam melaksanakan implementasi anda juga dibantu oleh 3 orang perawat pelaksana. Apakah jenis metode penugasan asuhan keperawatan di atas? ', 238, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:38:07', '2021-04-05 23:38:07'),
	(666, 2, 2, 10, 'Anda ditempatkan bekerja di ruang A. Menurut anda banyak hal yang harus dirubah dan diperbaiki dari kondisi pelayanan asuhan keperawatan di ruang tersebut. Misalnya catatan keperawatan tidak diisi dengan lengkap, format dokumentasi belum lengkap,  format sulit diisi, data terpisah-pisah. Apakah tidakan yang harus anda lakukan dalam mengatasi masalah dokumentasi tersebut ?', 239, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:39:07', '2021-04-05 23:39:07'),
	(667, 2, 2, 10, 'Kepala ruangan menjadwalkan anda satu shif dengan salah seorang perawat yang sedang bermasalah dengan anda, dimana konflik tersebut sudah berlangsung lama dan belum terselesaikan. Jika ada dalam satu tim, dikhawatirkan akan mengganggu terhadap kerjasama tim dan kinerja dari masing-masing. Strategi yang paling tepat untuk menyelesaikan konflik tersebut adalah', 240, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:40:09', '2021-04-05 23:40:09'),
	(668, 2, 2, 10, 'Anda melihat teman sejawat anda dimarahi oleh dokter di depan pasien karena kesalahan dalam memberikan obat.  Terlihat perawat tersebut balik memarahi dokter karena kesalahannya tersebut akibat dokter salah memberikan resep obatnya. Apa yang pertama kali harus anda lakukan menghadapi situasi tersebut?', 241, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:41:22', '2021-04-05 23:41:22'),
	(669, 2, 2, 10, 'Anda bekerja di RS A tipe C tepatnya di ruang penyakit dalam. Pada hari pertama dinas, anda belum diorientasikan sistem kerja di ruangan, sehingga anda masih kebingungan. Anda oleh kepala rungan hanya ditugaskan untuk memberikan tindakan pemenuhan kebutuhan dasar seperti membantu makan minum, BAB, BAK, dan pemenuhan personal hygiene, dan perawat lain pun hanya diberikan satu jenis tugas. Metode pelayanan asuhan keperawatan tersebut adalah: ', 242, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:42:45', '2021-04-05 23:42:45'),
	(670, 2, 2, 10, 'Sesuai dengan kebijakan rotasi kerja, hari ini anda mulai dinas di ruang ICU selama 3 bulan ke depan. Oleh Kepala ruangan anda ditugaskan merawat 4 pasien dengan tanggung jawab selama 24 jam penuh. Dan anda harus merawat pasien mulai dari tahap pengkajian sampai membuat perencanaan lengkap, dalam pelaksanaan dan evaluasi bisa bekerjasama dan dibantu oleh perawat asosiet.\r\n Metode pelayanan asuhan keperawatan tersebut adalah:\r\n', 243, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:44:29', '2021-04-05 23:44:29'),
	(671, 2, 2, 10, 'Anda ditugaskan sebagai Katim, sekitar jam 09.00, datang pasien baru dengan diagnosa Stroke, sebagai Katim apa yang harus anda lakukan: ', 244, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:45:43', '2021-04-05 23:45:43'),
	(672, 2, 2, 10, 'Anda merawat pasien Tn. O dengan kondisi: semua aktivitas dan pergerakan pasien dengan pengawasan, observasi TTV tiap 4 jam, pasien makan dan minum melalui NGT, dan anda pun hharus mencatat intake dan out put dengan ketat. Berdasarkan  klasifikasi Douglas (1984), kondisi pasien tersebut masuk kedalam klasifikasi: ', 245, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:47:12', '2021-04-05 23:47:12'),
	(673, 2, 2, 10, 'Anda sedang dinas malem sebagai perawat asosiet pada metode primer dan diberikan tugas merawat pasien Tn. O umur 35 tahun dengan diagnose Ca Paru.  Sekitar pukul 02.00, Tn O mengalami penurunan kesadaran. Tindakan apa yang harus anda lakukan untuk menangani masalah tersebut  dalam kerangka metode penugasan Primer ? ', 246, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:48:47', '2021-04-05 23:48:47'),
	(674, 2, 2, 10, 'Anda ditempatkan bekerja di ruang  Emergency.  Anda menilai  proses triase yang biasa dilakukan tidak sesuai  dan tidak efektif.  Sehingga menurut anda proses triase harus diperbaiki. Apakah tidakan yang harus anda lakukan dalam mengatasi masalah Proses Triage tersebut ?     ', 247, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:50:05', '2021-04-05 23:50:05'),
	(675, 2, 2, 10, 'Anda sebagai karu, akan mendelegasikan tugas  pengawasan terhadap perawat baru  kepada salah seorang perawat senior yang satu sift dengan perawat baru tersebut. Langkah yang utama yang harus ditempuh agar pendelegasian efektif: ', 248, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-05 23:51:14', '2021-04-05 23:51:14'),
	(676, 2, 2, 6, 'Seorang laki-laki 29 tahun datang ke IGD dengan penurunan kesadaran. Hasil pengkajian, TD: 130/90 mmHg, frekuensi nadi: 92 x/menit, frekuensi napas: 22 x/menit. Klien diketahui positif mengonsumsi narkotika. Perawat akan melakukan pengkajian status neurologis.\r\nApakah yang perawat temukan pada hasil pengkajian pupil?', 249, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:28:41', '2021-04-06 01:28:41'),
	(677, 2, 2, 1, 'Seorang laki-laki usia 65 tahun dirawat diruang bedah dengan diagnosa BPH denga keluhan tidak bisa kencing. Pada pengkajia  ditemukan kencing tidak lancar (menetes), merasa nyeri dan tidak puas saat kencing. RR 25x/menit, HR 90 x/menit, TD 130/80 mmHg, suhu 37,20C. Apakah masalah keperawatan utama pada kasus tersebut ......\r\nApakah masalah keperawatan utama pada kasus tersebut ?\r\n', 250, 1, NULL, NULL, '-\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:32:31', '2021-04-06 01:32:31'),
	(678, 2, 2, 6, 'Seorang perempuan 28 tahun datang ke IGD dengan status epileptikus. Hasil pengkajian, TD: 130/90 mmHg, frekuensi nadi: 112 x/menit, frekuensi napas: 24 x/menit, suhu: 39.0 C. Klien menunjukan periode kejang selama 40 detik setiap 15 menit, klien terpasang oropharyngeal airway.\r\nApakah yang harus dilakukan perawat untuk mengevaluasi keberhasilan tindakan?', 251, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:34:20', '2021-04-06 01:34:20'),
	(679, 2, 2, 1, 'Seorang laki-laki usia 60 tahun datang ke RS dengan keluhan saat BAK aliran terputus-putus, memulai kencing yang lama dan mengedan saat BAK yang sudah dirasakan selama 7 hari. Pasien tampak meringis menahan nyeri dan lemas. TD 140/90 mmHg, RR 26 x/menit, S 370C dan vesica urinaria teraba penuh. Pasien didiagnosa BPH, saat dilakukan rectal grandding penonjolan prostat 4-5 cm kedalam rectum. \r\nApakah tindakan mandiri perawat yang harus dilakukan pada pasien tersebut?\r\n', 252, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:35:01', '2021-04-06 01:35:01'),
	(680, 2, 2, 6, 'Seorang laki-laki berusia 46 tahun datang ke IGD mengeluh kelemahan pada keempat ekstremitas yang semakin parah setelah mengalami kecelakaan lalu lintas 2 minggu sebelum masuk rumah sakit. Pasien jatuh dengan posisi terduduk. Sudah 1 minggu pasien tidak dapat mengontrol buang air besar dan buang air kecil, terdapat ulkus decubitus grade II di area sakrum klien.\r\nApakah masalah keperawatan utama pada pasien diatas?', 253, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:36:52', '2021-04-06 01:36:52'),
	(681, 2, 2, 1, 'Seorang pasien laki-laki, berumur 23 tahun mengalami pusing berkepanjangan dan akhirnya mengalami penurunan kesadaran. Hasil lab menunjukkan tingginya nilai Ureum dan Kreatinin.\r\nApa penyebab utama penurunan kesadaran pada pasien tersebut? \r\n', 254, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:37:02', '2021-04-06 01:37:02'),
	(682, 2, 2, 6, 'Seorang laki-laki usia 35 tahun datang ke IGD dengan cedera kepala akibat kecelakaan lalu lintas. Hasil pemeriksaan tingkat kesadaran dengan rangsangan nyeri di supra orbita, klien berespon dengan membuka mata, mengerang, dan lengan kanan mencoba untuk mendekati sumber rangsangan.\r\nApakah tingkat kesadaran yang dialami oleh klien?', 255, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:39:02', '2021-04-06 01:39:02'),
	(683, 2, 2, 1, 'Pasien wanita yang dilakukan tindakan operesi sectio caecaria karena perdarahan, mengalami perdarahan terus selama operasi, urine output selama operasi nol, tensi 80/50, nadi 105 x/menit pernafasan 28 x/menit, setelah selesai operasi pasien belum sadar, konjungtiva pucat, tangan dan kaki dingin, CRT <3 detik, Hb post operasi 7 gr/dl, Ht 50%, ureum 60 mg/dl dan kreatinin 2,5 mg/dl, 2 jam post operasi urine  masih nol, infus terpasang RL 60 gtt/menit. \r\nApakah jenis gagal ginjal akut yang dialami oleh pasien? \r\n', 256, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:39:14', '2021-04-06 01:39:14'),
	(684, 2, 2, 1, 'Pasien laki-laki usia 50 tahun, sebagai sopir bis lintas Sumatra, datang ke rumah sakit dengan keluhan mual, muntah, tidak nafsu makan, edema pada kaki, sesak nafas, lemah, cepat cape, urine output diperkirakan 800 cc /24 jam, hasil pemeriksaan ureum 150 mg/dl, kreatinin 3,5 mg/dl, Hb 10 gr/dl. GFR 40 ml/menit/1,73 m2 .Menurut penuturan pasien sering kurang minum karena malas sering kencing, terutama saat menyetir. \r\nApakah tahap CKD yang dialami pasien tersebut? \r\n', 257, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:41:14', '2021-04-06 01:41:14'),
	(685, 2, 2, 6, 'Seorang perempuan usia 25 tahun datang ke IGD dengan cedera kepala akibat kecelakaan lalu lintas nampak cenderung tidur. Hasil pemeriksaan tingkat kesadaran ketika dipanggil klien membuka mata, berbicara hanya sepatah kata lalu terdiam, namun masih dapat menggerakan tangan ketika diminta oleh perawat.\r\nBerapakan nilai GCS klien?', 258, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:42:19', '2021-04-06 01:42:19'),
	(686, 2, 2, 1, 'Seorang pasien pria, usia 25 tahun, datang ke puskesmas dengan keluhan keluhan nyeri pinggang, sulit BAK, dan BAK sedikit-sedikit saat malam hari yang sudah dirasakan selama 1 minggu ini. Pasien sudah berobat ke klinik mendapat ampicillin dan paracetamol tapi tidak membaik. Pemeriksaan fisik ditemukan badan teraba panas, konjungtiva pucat, pasien tampak apatis. Tanda-tanda vital : TD 130/80 mmHg, RR 24 x/menit, nadi 92x/menit, suhu 39°C. \r\nApakah fokus pemeriksaan pada kasus diatas adalah?\r\n', 259, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:43:31', '2021-04-06 01:43:31'),
	(687, 2, 2, 6, 'Seorang laki-laki 40 tahun Tn.M 40 tahun datang ke IGD dengan cedera kepala ringan disertai keluhan nyeri kepala setelah terjatuh di depan rumahnya. Hasil pengkajian ditemukan GCS E4V5M6, mual, luka terbuka di area dahi,TD: 130/70, frekuensi nadi 90x/menit, frekuensi nafas 22 x/menit.\r\nApakah masalah keperawatan utama pada klien tersebut?', 260, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:45:19', '2021-04-06 01:45:19'),
	(688, 2, 2, 1, 'Seorang laki-laki usia 65 tahun datang ke poliklinik mata dengan keluhan pandangan mata kiri kabur. Hasil pengkajian visus 3/6, TIO 26 mmHg, lensa tampak keruh, tampak bingung, pasien berjalan perlahan-lahan. TD : 140/90 mmHg, frekuensi nadi 82 x/menit, frekuensi napas 20x/menit. Suhu 37 oC\r\nApakah masalah keperawatan utama pada kasus tersebut?\r\n', 261, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:45:45', '2021-04-06 01:45:45'),
	(689, 2, 2, 1, 'Seorang laki-laki berusi 65 tahun terdiagnosa katarak sinilis, untuk mengatasi gangguan penglihatan tersebut pasien menjalani operasi dan di pasang lensa intra okuler (IOL), setelah 5 hari diperbolehkan pulang \r\nApakah pendidikan kesehatan yang wajib diberikan kepada pasien dan keluarga pada saat peasien pulang?\r\n', 262, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:47:47', '2021-04-06 01:47:47'),
	(690, 2, 2, 1, 'Seorang laki-laki umur 60 tahun datang ke RS mengeluh kencing sulit sudah 3 haru, pinggang sakit, mual, pada pemeriksaan fisik teraba bladder penuh. Pada saat perawat mencoba melakukan pamasangan foley catheter masuk 5 cm terdapat tahanan, sehingga alat tidak dapat masuk secara maksimal\r\nApakah tindakan selanjutnya yang harus dilakukan oleh perawat ?\r\n', 263, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:50:05', '2021-04-06 01:50:05'),
	(691, 2, 2, 6, 'Seorang laki-laki 35 tahun datang ke IGD dengan penurunan kesadaran akibat kecelakaan lalu lintas. Hasil pengkajian diketahui terdapat fraktur di medulla spinalis segmen cervical 6-7.\r\nApakah yang harus dilakukan oleh perawat pertama kali?', 264, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:51:19', '2021-04-06 01:51:19'),
	(692, 2, 2, 1, 'Seorang laki-laki umur 35 tahun dirawat di ruang penyakit dalam dengan CKD. Hasil pengkajian, pasien sesak, mual, muntah, edema ekstermitas, oliguri, Hb 7 mmHg, ureum 120 mg/dl, kreatinin 6,2 mg/dl, TD 150/90 mmHg, nadi 86 x/menit, napas 23 x/menit. Saat ini pasien diberikan intervensi pembatasan cairan dan kolaborasi tindakan hemodialisis\r\nApakah kriteria hasil yang diharapkan pada kasus tersebut?\r\n\r\n', 265, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:52:18', '2021-04-06 01:52:18'),
	(693, 2, 2, 1, '11.	Seorang laki-laki berusia 30 tahun, dirawat diruang isolasi dengan keluhan sesak nafas, batuk berdahak. Tanda-tanda vital: TD=120/80 mmHg, N=110x/mnt, P=33x/mnt, S=38.70C, suara nafas Ronchi (+), konjungtiva tampak anemis, turgor kulit menurun. Diagnosa medis TBC positif.\r\nApa diagnosa keperawatan prioritas yang tepat untuk kasus diatas?\r\n', 266, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:54:48', '2021-04-06 01:54:48'),
	(694, 2, 2, 1, 'Seorang laki-laki berusia 28 tahun, dirawat diruang penyakit dalam dengan keluahan diare yang sudah sebulan tidak sembuh meskpun sudah berobat ke dokter. Pekerjaannya adalah seorang bartender di sebuah club malam. Tanda-tanda vital: TD=120/80 mmHg, N=110x/mnt, P=28x/mnt, S=38.70C, konnung tiva tampak anemis, turgor kulit menurun. Diagnosa medis HIV positif.\r\nApa penyebab diare yang tidak kunjung sembuh pada kasus tersebut?', 267, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:57:29', '2021-04-06 01:57:29'),
	(695, 2, 2, 6, 'Seorang laki-laki 35 tahun datang ke IGD dengan penurunan kesadaran setelah mengalami kecelakaan lalu lintas. Hasil pengkajian TD: 160/100 x/menit, frekuensi nadi: 50 x/menit, frekuensi napas: 24 x/menit. Perawat akan mengukur tekanan perfusi serebral klien.\r\nBerapakan tekanan perfusi serebral Tn.F dengan anggapan tekanan intra kranial sebesar 15mmHg?', 268, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:57:44', '2021-04-06 01:57:44'),
	(696, 2, 2, 1, 'Seorang pasien mengeluh sakit kepala yang hebat, berkeringat tengah malam, demam. TD=120/70 mmHg, N=98x/mn, S=39°C, P: 28 x / menit. Teraba ada benjolan di leher kiri pasien. Leukosit 15.000/ µL. \r\nApa intervensi yang dilakukan untuk mengatasi masalah keperawatan yang muncul?\r\n', 269, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 01:59:37', '2021-04-06 01:59:37'),
	(697, 2, 2, 6, 'Seorang laki-laki 25 tahun datang ke IGD dengan penurunan kesadaran setelah kecelakaan lalu lintas. Hasil pengkajian diketahui klien nampak gelisah, terdapat discharge berupa darah di lubang hidung dan telinga, jejas di area belakang telinga kanan, serta nampak kehitaman di area mata.\r\nApakah tindakan pertama yang harus dilakukan perawat?', 270, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:00:32', '2021-04-06 02:00:32'),
	(698, 2, 2, 1, 'Seorang perempuan usia 21 tahun dirawat di rumah sakit karena keputihan yang tidak sembuh selama 3 bulan. Warna keputihan hijau kekuningan, bau busuk. Klien juga mengeluh nyeri pada daerah supra publis. TD=120/80mmHg, P=24x/menit, N=98x/mnt, S=38.50C. Dia didiagnosis HIV oleh dokter. Pasien mengatakan cemas dan takut akan penyakitnya terlebih 6 bulan lagi pasien akan menikah, dia sering melamun dan pandangannya kosong. \r\nApa masalah keperawatan prioritas pada pasien tersebut?\r\n', 271, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:01:59', '2021-04-06 02:01:59'),
	(699, 2, 2, 6, 'Seorang perempuan 28 tahun datang ke IGD dengan status epileptikus. Hasil pengkajian, TD: 140/90 mmHg, frekuensi nadi: 112 x/menit, frekuensi napas: 24 x/menit, suhu: 39.0 C. Klien menunjukan periode kejang.\r\nApakah yang harus dilakukan perawat  ?', 272, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:03:38', '2021-04-06 02:03:38'),
	(700, 2, 2, 1, 'Seorang wanita berusia 45 tahun mengalami perdarahan haid yang banyak selama	3 minggu. Klien mengeluh lemas, letih, lesu dan keringat dimalam hari. TD=90/70 mmHg, N=80 x/mnt, P=28x/mnt, S=37.50 C. Hasil laboratorium didapatkan Hb 10 g/dl. \r\nApa intervensi yang dilakukan untuk mengatasi masalah keperawatan yang muncul?\r\n', 273, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:04:10', '2021-04-06 02:04:10'),
	(701, 2, 2, 6, 'Seorang laki-laki berusia 50 tahun dibawa ke IGD dengan keluhan sesak nafas, edema pada tangan dan kaki, gatal-gatal pada kulit tangan, jarang berkemih, serta jumlah urine berkurang, nyeri punggung . Didapatkan hasil ureum kreatinin 1,8 mg/dL dan kesadaran delirium. Hasil pemeriksaan rontgen didapatkan adanya edema paru.\r\nApakah tindakan yang harus segera dilakukan pada kasus tersebut?', 274, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:05:34', '2021-04-06 02:05:34'),
	(702, 2, 2, 1, 'Seorang pasien didiagnosa mengalami anemia hemolitik dan mengeluh sangat lemas dan lelah. Ketika bergerak sedikit saja kepala terasa berat dan berkuang-kunang. TD=80/70 mmHg. Hb 9.5 g/dl. \r\nApa intervensi kolaborasi yang dilakukan untuk mengatasi tersebut?\r\n', 275, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:06:24', '2021-04-06 02:06:24'),
	(703, 2, 2, 6, 'Seorang laki-laki berusia 25 tahun mengalami kecelakaan bus, dibawa ke IGD dengan kondisi tertancap payung pada dadanya dan pasien mengalami perdarahan hebat. Pasien terlihat lemas, pucat, akral dingin, CRT >2 detik. Pada pemeriksaan tanda-tanda vital didapatkan hasil: TD 90/70, Nadi: 60x/menit.\r\nTindakan pertama yang harus dilakukan perawat adalah', 276, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:07:30', '2021-04-06 02:07:30'),
	(704, 2, 2, 1, 'Seorang berusia 20 tahun, dirawat dengan diagnose medis BDB. Berdasarkan hasil pengakajian: klien tampak menggigil, pusing disertai mual. Tekanan darah 100/70 mmHg, nadi 100 kali per menit, nafas 21 kali per menit dan suhu tubuh 29 derajat celcius, kulit tampak kemerahan dan CRT kurang dari 3 detik.\r\n	Berdasarkan aksus diatas, apakah masalah keperawatan yang tepat?\r\n', 277, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:08:35', '2021-04-06 02:08:35'),
	(705, 2, 2, 1, 'Seorang Laki-laki  usia 45 tahun dirawat di ruang penyakit dalam dengan diagnosa SLE dengan komplikasi kerusakan ginjal stadium akhir. Hasil pemeriksaan fisik didapatkan bengkak (odem anasarka) dan anuria. Hasil pemeriksaan laboratorium : BUN 90 mg/dl, kreatinin 7,2 mg/dl  \r\nApakah tidakan kolaborasi yang tepat terhadap kasus diatas?\r\n', 278, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:10:43', '2021-04-06 02:10:43'),
	(706, 2, 2, 6, 'Seorang laki-laki berusia 40 tahun mengalami kecelakaan mobil, dibawa ke IGD dengan kondisi sesak nafas dan nyeri dada. Dada terbentur setir mobil. Hasil pengkajian fisik didapatkan hasil: TD:80/60, nadi:  120x/memit, RR: 28x/menit, suhu 37 C, sesak nafas bertambah, didapatkan hasil pemewriksaan vena jugular 10cmH2o.\r\nPertanyaan soal\r\nApakah tindakan yang tepat untuk kasus tersebut?\r\n', 279, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:12:21', '2021-04-06 02:12:21'),
	(707, 2, 2, 1, 'seorang perawat pelaksana di Ruang Penyakit Dalam mengambil beberapa sampel darah untuk keperluan diagnostic pada penyakit HIV/AIDS. Secara tidak sengaja jarinya tertusuk jarum bekas pakai dari pasien tersebut .\r\n	Apakah tindakan yang harus segera dilakukan perawat tersebut ?\r\n', 280, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:12:48', '2021-04-06 02:12:48'),
	(708, 2, 2, 1, 'Seorang laki-laki berusia 35 tahun, dirawat diruang isolasi mengeluh malu dengan penyakit yang dideritanya karena akan menularkan ke orang lain. Pasien di Diagnosa TBC positif sejak 3 bulan yang lalu dan ada riwayat TB satu tahun yang lalu. Ketika dirumah pasien cenderung mengurung diri dikamar tidak mau bersosialiasasi.\r\nApa intervensi yang tepat untuk kasus diatas?\r\n', 281, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:19:18', '2021-04-06 02:19:18'),
	(709, 2, 2, 1, 'Seorang laki-laki berusia 30 tahun dirawat di RS dengan diagnosis apendiksitis. Tiga hari sebelumnya pasien mengeluh nyeri ulu hati yang kemudian menjalar ke daerah pusat dan perut kanan bawah, saat  saat dilakukan pemeriksaan fisik didapatkan adanya nyeri tekan dan nyeri lepas pada kuadran kanan bawah. \r\nBerikut adalaha pemeriksaan fisik yang dilakukan oleh perawat untuk mengetahui keluahan tersebut.\r\n', 282, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:21:13', '2021-04-06 02:21:13'),
	(710, 2, 2, 1, 'Seorang perempuan berusia 40 tahun dirawat di RS dengan diagnosis sirosis hepatis. Pada saat dilakukan pemeriksaan fisik tampak perut sudah mulai ascites. \r\nTindakan observasi apa yang bisa dilakukan perawat untuk memantau derajar perkembangan ascites ?\r\n', 283, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:22:59', '2021-04-06 02:22:59'),
	(711, 2, 2, 1, 'Seorang perempuan berusia 25 tahun tersiram air panas di dada, perut, dan tangan. Dari hasil pengkajian pasien mengeluh nyeri skala 5 dari 10, pemeriksaan fisik didapatkan kulit tampak merah dan terdapat bullae, TD = 90/60 mmHg, frekuensi nadi 120 x/menit, frekuensi pernafasan 28 x/menit, BB = 60 kg, mukosa bibir terlihat kering dengan produksi urin 100 cc/6 jam.\r\nApakah prioritas masalah keperawatan pada kasus tersebut ?\r\n', 284, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:24:44', '2021-04-06 02:24:44'),
	(712, 2, 2, 1, 'Seorang perempuan berusia 31 tahun datang ke polikliki RS dengan keluhan diare dan sakit perut sejak satu hari yang lalu. Hasil pemeriksaan fisik menunjukkan perut teraba tegang, bising usus 24x/menit dan diare 5-9 x/hari, turgor tidak eastis, frekuensi nadi 105 x/menit dan tekanan darah 110/80 mmHg\r\nApakah intervensi keperawatan yang paling tepatpada kasus tersebut ?\r\n', 285, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:27:31', '2021-04-06 02:27:31'),
	(713, 2, 2, 6, 'Seorang laki-laki berusia 45 tahun ditemukan tidak sadarkan diri oleh perawat di depan halaman Rumah Sakit. Hasil pemeriksaan didapatkan, nafas tidak teraba, nadi tidak teraba. Perawat segera meminta bantuan.\r\nApakah tindakan yang harus dilakukan selanjutnya?', 286, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:28:33', '2021-04-06 02:28:33'),
	(714, 2, 2, 1, 'Seorang laki-laki berusia 22 tahun dirawat di ruang penyakit dalam dengan diagnosis typhoid dengan hari rawat kedua. Dari hasil pengkajisn didapatkan pasien terlihat lemah, suhu 39 derajat celsius dan kadang meningkat sampai 40 derajat celsius, Td 100/70 mmHg, frekuensi nadi 110 x/menit, frekuensi pernafasan 19 x/menit. \r\nApakah kriteria hasil dalam intervensi keperawatan utama pada kasus tersebut ?\r\n', 287, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:29:19', '2021-04-06 02:29:19'),
	(715, 2, 2, 6, 'Seorang perempuan berusia 38 tahun mengalami kecelakaan lalu lintas dan dibawa ke IGD. Setelah dilakukan pemeriksaan didapatkan hasil tingkat kesadaran somnolen, pada saat auskultasi didapatkan suara nafas gurgling, TD: 100/80mmHg, frekuensi nadi 90x/menit, RR: 28x/menit, suhu: 37 C.\r\nManakah tindakan keperawatan yang dilakukan pada pasien tersebut?', 288, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:30:56', '2021-04-06 02:30:56'),
	(716, 2, 2, 6, 'Seorang laki-laki berusia 55 tahun di rawat di ruang ICU karena kecelakaan sepedah motor. Terdapat periorbital eckimosis dan tanda battle sign, keluar darah dari hidung dan mulut, terdengar bunyi ronkhi saat bernafas. Dari hasil pemeriksaan tanda-tanda vital didapatkan: TD: 100/60mmHg, nadi 120x/menit, RR: 30x/menit.\r\nApakah masalah utama keperawatan pada kasus d atas?', 289, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:32:41', '2021-04-06 02:32:41'),
	(717, 2, 2, 1, 'Seorang laki-laki berusia 24 tahun dirawat di ruang bedah dengan diagnosis Ca Colon.  Dari pemeriksaan penunjang pasien diharuskan untuk dilakukan tindakan colostomy. Pasien merasa malu dan sedih dengan kondisi yang menimpa dirinya. Tenaga kesehatan memberikan kebebasan kepada pasien untuk keberlangsungan tindakan selanjutnya\r\nAspek legal etik pada kasus tersebut ?\r\n', 290, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:33:20', '2021-04-06 02:33:20'),
	(718, 2, 2, 6, 'Seorang laki-laki berusia 44 tahun dirawat diruang ICU karena terserempet mobil, akan dilakukan pemasangan Naso Gastri Tube (NGT) atas indikasi penurunan kesadaran. Langkah-langkah pemasangan NGT sudah dilaksanakan oleh perawat, sekarang perawat melakukan pengukuran selang dari ujung dari sampai ke hidung dan dari hidung sampe ke ujung telinga.\r\nApakah tindakan yang akan dilakukan oleh perawat?', 291, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:34:50', '2021-04-06 02:34:50'),
	(719, 2, 2, 1, 'Seorang perempuan berusia 40 tahun dirawat di RS dengan keluhan hipertermi lebih dari 10 tahun, masih terdapat nafsu makan tetapi badan dirasakan lemah. Dari hasil pemeriksaan fisik didapatkan lidah, kulit, dan rambut kotor. Pemeriksaan tanda-tanda vital menunjukkan tekanan darah 110/70 mmHg, frekuensi nadi 110 x/menit, frekuensi pernafasan 19 x/menit dan suhu          39 derajat celsius. Hasil lab test widal positif (+).\r\nApakah prioritas intervensi pada kasus tersebut ?\r\n', 292, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:35:26', '2021-04-06 02:35:26'),
	(720, 2, 2, 6, 'Telah terjadi kebakaran, seorang laki-laki berusia 25 tahun terjebak dalam ruangan tertutup, dibawa ke ruang IGD karena penurunan kesadaran. Dari hasil pemeriksaam didapatkan hasil sputum bercampur arang, luka bakar disekitar hidung, bibir dan mulut, RR: 28x/menit.\r\nApakah tindakan yang dialami oleh pasien tesebut?', 293, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:37:19', '2021-04-06 02:37:19'),
	(721, 2, 2, 1, 'Seorang perempuan berusia 20 tahun dirawat selama 3 hari di RS dengan post operasi appendictomy. Pasien masih mengeuh nyeri dengan skala 3 dari 10 sehingga takut untuk melakukan pergerakan. Pada saat pemeriksaan fisik terdapat luka operasi pada kuadaran kanan bawah yang masih tampak basah.\r\nApakah prioritas tindakan keperawatan yang harus dilakukan pada kasus tersebut ?\r\n', 294, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:37:59', '2021-04-06 02:37:59'),
	(722, 2, 2, 1, 'Seorang perempuan berusia 25 tahun dirawat di RS karena menglami mual dan badan lemas. Hasil pemeriksaan fisik didapatkan data : warna kulit dan sklera ikterik, dan berat badan turun drastis. Pemeriksaan tanda-tanda vital didapatkan tekanan darah 110/60 mmHg, frekuensi nadi 76 x/menit, frekuensi pernafasan 21 x/menit, dan suhu 38,7 derajat celsius. Hasil pemeriksaan laboratorium yaitu darah HBSAg (+).\r\nApakah indikator utama keberhasilan pada kasus tersebut ?\r\n', 295, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:39:54', '2021-04-06 02:39:54'),
	(723, 2, 2, 6, 'Seorang perempuan berusia 60 tahun datang ke IGD, keadaan umum tampak pucat, terdapat pembesaran vena jugular, udem pada elstremitas. Hasil laboratorium didapatkan: ureum 30,5mg/dL, pasien mengatakan keluhan yang dirasakan adalah kaki kanan tidak dapat digerakkan, namun ketika sampai di RS pasien dianjurkan untuk cuci darah. Pasien juga mengatakan memilihi riwayat hipertensi dan diabetes meliitus. Dari hasil pemeriksaan fisik didapatkan: TD: 160/80, Nadi: 115x/menit, Suhu: 36,5 C, Nafas: 20x/menit.\r\nApakah diagnosa utama pada kasus tersebut?\r\n', 296, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:41:01', '2021-04-06 02:41:01'),
	(724, 2, 2, 1, 'Seorang perempuan berusia 25 tahun dirawat di ruang bedah dengan post op appendiktomi. Pasien dipasang kateter sudah 6 hari dan direncanakan untuk di cabut kateternya.\r\nApakah tindakan prioritas pada kasus tersebut ?\r\n', 297, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:41:41', '2021-04-06 02:41:41'),
	(725, 2, 2, 6, 'Seorang perempuan berusia 60 tahun datang ke IGD, terdapat fraktur distal tibia kanan dan dilakukan penghetian perdarahan dan pembidaian. Pasien terlihat meringis kesakitan, terdapat pembengkakan di sekitar area fraktiur.\r\nSetelah pembidaian selesai dilakukan, tindakan apa yang dilakukan?', 298, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:43:10', '2021-04-06 02:43:10'),
	(726, 2, 2, 1, 'Tn. X dirawat di rumah sakit dengan fraktur, terdapat hasil rontgen tulang dengan gambaran fraktur yang memotong tegak lurus atau komplit. Apa nama jenis fraktur tersebut ?', 299, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:43:25', '2021-04-06 02:43:25'),
	(727, 2, 2, 6, 'Seorang pasien datang ke UGD dengan luka bakar. Menurut keluarganya pasien tersiram air panas. Terdapat kulit yang melepuh di tangan kiri dan badan depan, basah dan berwarna kemerahan, pasien mengatakan nyeri.\r\nBerdasarkan presentase luas luka bakar (rule of nine), berapa persen luka bakarnya ?', 300, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:45:11', '2021-04-06 02:45:11'),
	(728, 2, 2, 6, 'Seorang pasien datang ke UGD dengan luka bakar. Menurut keluarganya pasien tersiram air panas. Terdapat kulit yang melepuh di tangan kiri dan badan depan, basah dan berwarna kemerahan. Setelah perawat mengkaji, terdapat jaringan epidermis dan sedikit dermis terkena.  Pasien mengatakan nyeri.\r\nBerdasarkan derajat luka bakar, pasien tersebut termasuk mengalami derajat luka bakar yang mana?', 301, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:47:15', '2021-04-06 02:47:15'),
	(729, 2, 2, 1, 'Seorang anak umur kurang dari 2 tahun, mengalami fraktur femur akibat adanya tumor tulang. Klien tersebut dilakukan traksi, apakah jenis traksi untuk klien tersebut ?', 302, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:49:05', '2021-04-06 02:49:05'),
	(730, 2, 2, 6, 'Seorang pasien datang ke UGD dengan luka bakar. Menurut keluarganya pasien tersengat listrik. Terdapat kulit terkelupas, avascular, pucat, pasien mengatakan sedikit nyeri. Setelah perawat mengkaji, terdapat jaringan epidermis dan sedikit dermis terkena.\r\nBerdasarkan derajat luka bakar, pasien tersebut termasuk mengalami derajat luka bakar yang mana?', 303, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:50:44', '2021-04-06 02:50:44'),
	(731, 2, 2, 1, 'Karakteristik hematogenous osteoyelitis adalah :', 304, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:53:32', '2021-04-06 02:53:32'),
	(732, 2, 2, 6, 'Seorang pasien datang ke UGD dengan luka bakar. Menurut keluarganya ketika sedang bekerja di pabrik, pasien tersiram asam kuat. Luka mengenai tangan kanan dan kiri. Terdapat kulit terkelupas, avascular, pucat, pasien mengatakan sedikit nyeri. Setelah perawat mengkaji, terdapat jaringan epidermis dan sedikit dermis terkena.\r\nBerdasarkan presentase luas luka bakar (rule of nine), berapa persen luka bakarnya ?', 305, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:53:33', '2021-04-06 02:53:33'),
