	(734, 2, 2, 6, 'Tn. X umur 40 th, dibawa ke UGD dengan luka terbuka di kaki bagian bawah, dengan tepi jaringan kulit yang tidak beraturan. Klien dibawa ke UGD karena terserempet sepeda motor ketika sedang menyeberang 4 jam yang lalu. Luka terlihat mengeluarkan darah dan klien meringis kesakitan ketika kakinya digerakkan. Daerah sekitar luka terlihat bengkak. Tanda-tanda vital : Nadi 55 X/menit, Respirasi  14 X/menit dan tekanan darah 110/80 mmHg. Kulit klien dingin dan lembab.\r\nApa tanda-tanda fungsiolesa dari luka klien....', 307, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:55:43', '2021-04-06 02:55:43'),
