	(736, 2, 2, 6, 'Ny. X dibawa ke IGD rumah sakit dengan keluhan sesak nafas. Pada saat dilakukan pemeriksaan fisik didapatkan pernafasan cepat dan dangkal, BB = 50 kg TB= 150 cm, TTV = RR = 30 x/menit, Nadi =90 x/menit.\r\nBerapa kebutuhan oksigen yang diperlukan Ny. X', 309, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 02:58:31', '2021-04-06 02:58:31'),
	(737, 2, 2, 1, 'Terbentuk benang-benang fibrin, Pembuluh darah membentuk jaringan untuk revaskularisasi merupakan proses penyembuhan tulang:', 310, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 03:00:10', '2021-04-06 03:00:10'),
	(738, 2, 2, 6, 'Tn A umur 50 tahun masuk ke IGD dengan keluhan Sesak nafas sudah 2 minggu yang lalu sesak bertambah jika melakukan aktifitas. Pasien sebelumnya pernah didiagnosa TB Paru aktif dan minum obat tapi tidak teratur. Hasil pemeriksaan fisik didapatkan BB 50 kg, TB 165 Cm, TD 100/60 mmHg, RR 35x/menit Temperatur 37,5°C,  pengembangan dada a simetris, taktil premitus suara pada paru kanan lebih keras. Hasil laboratorium Hb 7,5 gr% Leuco 15000.000/mm2, AGD : PH 7,25 PO2 90 PCO2 49 HCO3 Normal. Diagnose medis efusi pleura.\r\nEffusi pleura pada kasus diatas diakibatkan oleh....\r\n', 311, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 03:00:56', '2021-04-06 03:00:56'),
