	(740, 2, 2, 6, 'Tn A umur 50 tahun masuk ke IGD dengan keluhan Sesak nafas sudah 2 minggu yang lalu sesak bertambah jika melakukan aktifitas. Pasien sebelumnya pernah didiagnosa TB Paru aktif dan minum obat tapi tidak teratur. Hasil pemeriksaan fisik didapatkan BB 50 kg, TB 165 Cm, TD 100/60 mmHg, RR 35x/menit Temperatur 37,5°C,  pengembangan dada a simetris, taktil premitus suara pada paru kanan lebih keras. Hasil laboratorium Hb 7,5 gr% Leuco 15000.000/mm2, AGD : PH 7,25 PO2 90 PCO2 49 HCO3 Normal. Diagnose medis efusi pleura.\r\nBerdasarkan hasil analisa gas darah( AGD ) Tn A mengalami….\r\n', 313, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 03:03:10', '2021-04-06 03:03:10'),
	(741, 2, 2, 1, 'Seorang perempuan berusia 65 thn (Ny.T), dirawat di ruang penyakit dalam dengan Keluhan utama : Luka di kaki kanan akibat tersandung batu sejak 2 bulan. Pasien kemudian merasakan kakinya bengkak, teraba panas, berdarah (+), nanah (+). Hasil Pemeriksaan fisik : Keadaan umum: tampak sakit sedang, kompos mentis, TD  : 120/70 mmHg, N      : 90 x/mnt, RR  : 20 x/mnt, Suhu   : 37,5 C, Tinggi badan  : 153 cm, Berat badan :  51 kg, Mata: konjungtiva pucat, Ekstremitas : edema -/-, baal(+). Pasien baru mengetahui menderita DM. GDS : 423 mg/dL, Hb : 7,8 Mg/dL, Leukosit 11000. Komplikasi kronik yang dapat ditemukan pada Ny. T sesuai hasil pengkajian diatas adalah kecuali:', 314, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 03:03:48', '2021-04-06 03:03:48'),
	(742, 2, 2, 6, 'Seorang laki-laki berusia 40 tahun diantar ke IGD dengan keluhan sesak nafas sejak 2 hari. Hasil Pemeriksaan didapatkan data klien tampak sesak, sianosis, nafas cepat dan dangkal, nafas cuping hidung, pada auskultasi paru terdengar bunyi ronchi, Tekanan darah 100/70, Nadi 100kali permenit, Suhu 37,9oC, Pernafasan 30 kali permenit.\r\nManakah pemeriksaan laboratorium dan diagnostik yang diperlukan?', 315, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 03:05:02', '2021-04-06 03:05:02'),
	(743, 2, 2, 1, 'Tn B sudah didiagnosa hipertiroid sejak 5 tahun yang lalu. Datang ke UGD rumah sakit dengan keluhan sesak nafas dengan RR 30 x/mnt, jantung berdebar dengan cepat, pasien didiagnosa oleh dokter krisis tiroid. Diagnosa keperawatan  pada pasien Tn B berdasarkan prioritas adalah', 316, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 03:05:37', '2021-04-06 03:05:37'),
	(744, 2, 2, 6, 'Seorang laki-laki berusia 56 tahun datang ke IGD dengan keluhan sesak nafas. Sesak nafas masih dirasakan pasien walaupun pasien dalam posisi tidur.\r\nJenis pernafasan patologis yang dialami pasien tersebut?', 317, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 03:06:35', '2021-04-06 03:06:35'),
