	(746, 2, 2, 1, 'Tn.Akhmad umur 56 tahun datang ke Klinik mata dengan keluhan sudah 2 tahun menderita Katarak dia khawatir tidak bisa melihat lagi karena berprofesi sebagai guru di salahsatu sekolah menengah negri,baru-baru ini penglihatan semakin kabur.menurut istrinya dirumah Tn.Ahmad sering termenung dan jarang berbicara.hasil pemeriksaan didapat; ketajaman penglihatan menggunakan Snelen chart Klien tidak mampu membaca hingga baris terakhir,pemeriksaan Opthalmoscope mata bagian kanan seluruh lensa mata dan sebelah kiri sebagian lensa mata gelap.\r\nJenis katarak yang Tn.Akhmad alami adalah\r\n', 319, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 03:09:44', '2021-04-06 03:09:44'),
