	(750, 2, 2, 1, 'Seorang perempuan umur 50 tahun datang ruang penyakit dalam akibat nyeri  dada sebelah kiri menjalar keleher dan punggung, Saat dikaji pasien mengeluh nyeri dada seperti tertimpah bendah keras TD 100/60 mmHg , N 100 x/menit RR 25 x/menit dari hasil pemeriksaan darah troponin T 60 mm/dl gambar EKG didapatkan elevasi segmen ST di sadapan II,III dan AVF. Intervensi keperawatan utama pada kasus diatas adalah', 323, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 03:20:13', '2021-04-06 03:20:13'),
	(751, 2, 2, 1, 'Seorang laki-laki umur 45 tahun datang ke unit gawat darurat akibat nyeri  dada sebelah kiri menjalar keleher dan punggung, Saat dikaji pasien mengeluh nyeri dada seperti tertimpah bendah keras TD 100/60 mmHg , N 100 x/menit RR 25 x/menit dari hasil pemeriksaan darah troponin T 60 mm/dl gambar EKG didapatkan elevasi segmen ST di sadapan II,III dan AVF. Diagnose keperawatan utama pada kasus di atas ', 324, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 03:22:25', '2021-04-06 03:22:25'),
	(752, 2, 2, 1, 'Seorang laki-laki umur 60 tahun datang ke unit gawat darurat akibat nyeri  dada sebelah kiri menjalar keleher dan punggung, Saat dikaji pasien mengeluh nyeri dada seperti tertimpah bendah keras TD 100/60 mmHg , N 100 x/menit RR 25 x/menit dari hasil pemeriksaan darah troponin T 60 mm/dl gambar EKG didapatkan elevasi segmen ST di sadapan I, V5,V6. Tindakan kolaboratif yang harus dilakukan untuk memperbaiki sirkulasi koroner pada kasus diatas adalah', 325, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 03:24:58', '2021-04-06 03:24:58'),
	(753, 2, 2, 1, 'Tn A umur 50 tahun dating dirawat diruang Cardio Rumahsakit hasan sadikin Bandung sudah dua hari yang lalu . saat perawat mengkaji ditemukan klien tampak pucat, napas cepat. Klien mengeluh nyeri dada hebat menjalar ke punggung dan leher nyeri  lebih dari 30 menit dan tidak hilang dengan istirahat skala nyeri 9 ( rentang nyeri 0 -10), keluar kringat dingin. hasil pemeriksaan laboraturium didapatkan  CKMB 80 U/L, Troponin T 0,09 ng/ml, hasil pemeriksaan EKG didapatkan ST elevasi pada V3 V4  V1 dan V2\r\n    Berdasarkan kasus diatas Tn A mengalami\r\n', 326, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 03:27:23', '2021-04-06 03:27:23'),
	(754, 2, 2, 1, 'Laki-laki berusia 45 tahun dirawat di ruang penyakit dalam karena sudah tiga bualan yang lalu tekanan darahnya naik berdasarkan informasi dari keluarganya kadang-kadang mencapai 170/90 mmHg. Saat dikaji pasien mengeluh sakit kepala skala nyeri 7 (skala 0 – 10 ), saat dikaji tekanan dara 175/100 mmHg, frekwensi jantung 100x/menit frekwensi napas 24x/menit  Tindakan keperaatan yang tepat untuk mengatasi nyeri adalah', 327, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 03:29:42', '2021-04-06 03:29:42'),
	(755, 2, 2, 1, 'Seorang laki-laki berusia 60 tahun dirawat di ruang cardio karena sudah 5 bualan yang lalu mengalami sesak napas dan bengkak pada ekstremitas bawah, pasien di diagnosa mengalami gagal jantung kanan. Saat dikaji pasien mengeluh cepat lelah apalagi setelah ber aktifitas TD 100/60 mmHg , frekwensi jantung 110 x/menit frekuwensi napas 30 x/menit Diagnosa keperawatan utama pada kasus tersebut adalah?', 328, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 03:31:50', '2021-04-06 03:31:50'),
	(756, 2, 2, 5, 'Seorang perempuan 67 tahun terlihat murung dan tidak aktif mengikuti kegiatan yang diadakan oleh panti werdha. Hasil pengkajian ditemukan klien mengalami kerusakan ginjal dan juga gout, TD 170/90 mmHg. Klien seringkali menangis di sela-sela pengkajian yang dilakukan perawat. \r\nApakah instrumen pengkajian yang tepat untuk kasus tersebut?', 329, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:15:33', '2021-04-06 08:15:33'),
	(757, 2, 2, 5, 'Seorang laki-laki 80 tahun nampak berjalan dengan bantuan tongkat, mengalami penurunan visus di kedua belah mata. Klien mengatakan sulit untuk bergerak dan juga untuk berpindah ke kamar mandi.\r\nApakah instrument pengkajian yang tepat untuk menegakan diagnosa gangguan pemenuhan ADL pada klien?', 331, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:17:48', '2021-04-06 08:18:23'),
	(758, 2, 2, 5, 'Seorang perempuan 70 tahun mengalami penurunan fungsi pendengaran akibat kerusakan telinga bagian dalam (presbikusis). Pada saat pengkajian, perawat merasa kesulitan dalam berkomunikasi dengan klien dan seringkali komunikasi menjadi tidak nyambung. \r\nApakah teknik komunikasi yang tepat dilakukan perawat untuk berkomunikasi dengan klien?', 331, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:19:53', '2021-04-06 08:19:53'),
	(759, 2, 2, 5, 'Laki-laki berusia 73 tahun, datang ke RS karena keluhan pasien sudah tidak dapat masuk makanan sejak 3 hari yang lalu, lemas, Tekanan Darah 100/60 mmhg, nadi 60 x/mnt. Semua aktifitas dibantu.\r\nApakah hasil pengkajian kemandirian yang tepat pada kasus diatas.', 332, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:21:33', '2021-04-06 08:21:33'),
	(760, 2, 2, 5, 'Perempuan berusia 82 tahun, mengalami kesulitan untuk bergerak dan berpindah tempat. Dikarenakan sejak 3 tahun yang lalu klien jatuh dan mengalami patah tulang kaki. Hasil pengkajian kazt indek B, keseimbangan: resiko jatuh berat. Pemenuhan kebutuhan dasar  klien di bantuan sebagian oleh petugas panti.\r\nApakah upaya  preventive untuk mengatasi resiko jatuh?', 333, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:23:08', '2021-04-06 08:23:08'),
	(761, 2, 2, 5, 'Laki-laki berusia 56 tahun datang ke puskesmas meminta konsultasi pada perawat untuk pemenuhan kebutuhan nutrisi, klien ingin mengetahui pola makan yang baik sehubungan dengan usia yang menjelang lansia. \r\nApakah upaya pemenuhan  nutrisi yang dapat disarankan oleh perawat dalam memenuhi kebutuhan nutrisi pada klien?', 334, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:25:07', '2021-04-06 08:25:07'),
	(762, 2, 2, 5, 'Ny. K, usia 68 tahun sudah ditinggal meninggal oleh suaminya 4 tahun yang lalu, saat ini kondisi klien mulai menurun dan sering sakit-sakitan. Klien memiliki 3 orang anak yang sudah berkeluarga semua, diantara anaknya tidak ada yang mampu merawat dan mengurus ibunya karena kesibukan masing-masing. Ketiga anaknya memutuskan untuk membawa ibunya ke panti jompo.\r\nApakah bentuk isolasi yang tepat pada kasus tersebut?', 335, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:26:57', '2021-04-06 08:26:57'),
	(763, 2, 2, 5, 'laki-laki berusia 75 tahun berada di panti whreda, sudah mengalami penurunan pendengaran pada telinga bagian kanan. Klien sering mengalami kesulitan dalam komunikasi, sehingga klien sering di asingkan oleh teman-teman lansia di panti.\r\nCara komunikasi yang tepat pada lansia yang sudah terjadi penurunan pendengaran adalah:', 336, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:28:48', '2021-04-06 08:28:48'),
	(764, 2, 2, 5, 'Perempuan berusia 78 tahun. Tinggal di Panti selama 10 tahun sampai saat ini. Klien merasa nyaman secara psikologis klien tidak merasa sedih walaupun tidak pernah ada keluarga yang menjenguknya, klien selalu berfikir positif tentang pengalaman yang dialaminya.\r\nApakah tahapan yang dialami oleh klien berdasarkan teori Maslow?', 337, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:30:23', '2021-04-06 08:30:23'),
	(765, 2, 2, 5, 'Perempuan berusia 69 tahun. Tinggal di Panti sudah 3 tahun bersama pasangannya. Klien ditinggalkan oleh pasangannya 2 lulu yang lalu. Klien merasa ada sesuatu yang hilang dan merasa hidupnya tidak berdaya, tidak ada gunanya lagi, sering mengalami sulit tidur, jarang berinteraksi, amotivasi.\r\nApakah intervensi yang tepat pada kasus diatas..', 338, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:31:56', '2021-04-06 08:31:56'),
	(766, 2, 2, 5, 'Seorang lansia berumur 69 tahun sedang dirawat karena mengalami komplikasi akibat gagal ginjal, keadaan lemah. Pada saat akan dilakukan cuci darah perawat memberi penjelasan sebelum dilakukan tindakan untuk menyampaikan tujuan dan prosedur pelakasaanan, klien tampak memahami dan menyetujui persetujuan yang diajukan.\r\nApakah prinsip etik yang tepat pada kasus tersebut..', 339, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:33:32', '2021-04-06 08:33:32'),
	(767, 2, 2, 5, 'Laki-laki berusia 62 tahun, dirawat di Rumah Sakit karena mengalami stroke, semua kebutuhan klien dibantu oleh perawat. Kewajiban perawat dalam memberikan asuhan keperawatan untuk tidak melakukan hal yang membahayakan pasien atau orang lain. \r\nApakah prinsip etik yang tepat pada kasus diatas adalah', 340, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:34:56', '2021-04-06 08:34:56'),
	(768, 2, 2, 5, 'Laki-laki berusia 67 tahun berada dipanti werdha selama ± 6 tahun. Akhir-akhir ini klien merasa sering gelisah, mengalami gangguan tidur, tidak bersemangat, perasaan sedih, napsu makan menurun. Di dalam panti klien tidak memiliki teman dekat untuk bercerita, klien cederung tertutup.\r\nApakah tindakan tepat dilakukan perawat sesuai dengan peran dan fungsinya tersebut?', 341, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:36:20', '2021-04-06 08:36:20'),
	(769, 2, 2, 7, 'Seorang perawat Perawat akan melakukan pengkajian tentang fungsi keluarga pada keluarga. Apakah pertanyaan yang perlu disampaikan perawat?', 342, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:51:10', '2021-04-06 08:51:10'),
	(770, 2, 2, 7, 'Seorang Perawat melakukan pengkajian pada fungsi keluarga dalam membentuk sifat sifat kemanusiaan dan stabilisasi kepribadian anggota keluarga. Apakah fungsi keluarga yang tepat?\r\n \r\n\r\n', 343, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:55:17', '2021-04-06 08:55:17'),
	(771, 2, 2, 7, 'Seorang perawat keluarga mencatat data relevan sesuai masalah keluarga, yang merupakan data fokus terhadap masalah klien dan sesuai dgn situasi khusus. Apakah jenis karakteristik data yang tepat', 344, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:56:35', '2021-04-06 08:56:35'),
	(772, 2, 2, 7, 'Perawat dapat mencari sumber data untuk melengkapi asuhan keperawatan keluarga dari beberapa sumber, seperti Orang tua, suami atau istri, anak atau teman klien. Apakah sumber data yang tepat\r\n ', 345, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:57:36', '2021-04-06 08:57:36'),
	(773, 2, 2, 7, 'seorang perawat mengambil  data secara terus menerus terhadap anggota keluarga yang dibinanya, didapatkan data hasil Rontgen. Apakah metode yang tepat untuk mendapatkan sumber informasi tersebut\r\n ', 346, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 08:59:49', '2021-04-06 08:59:49'),
	(774, 2, 2, 7, 'seorang perawat mengambil  data secara terus menerus terhadap anggota keluarga yang dibinanya, didapatkan data tekanan darah pada saat itu. Apakah metode yang tepat untuk mendapatkan sumber informasi tersebut\r\n', 347, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:01:09', '2021-04-06 09:01:09'),
	(775, 2, 2, 7, 'Seorang perawat sedang melakukan pengkajian lingkungan, didapatkan data mengenai luas rumah, type rumah, jumlah ruangan, jumlah jendela. Manakah karakteristik lingkungan yang sedang dikaji perawat tersebut\r\n\r\n \r\n', 348, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:02:19', '2021-04-06 09:02:19'),
	(776, 2, 2, 7, 'Perawat melakukan kunjungan rumah pada kepala keluarga yang didiagnosis TB. Setelah dilakukan kunjungan laki-laki tersebut menyatakan bahwa sudah menjalani pengobatan selama 6 bulan, namun belum mengetahui apakah sudah sembuh dari penyakit TB atau belum. Apakah jenis pengkajian yang sesuai dengan kasus tersebut?\r\n\r\n\r\n', 349, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:03:38', '2021-04-06 09:03:38'),
	(777, 2, 2, 7, 'Perawat melakukan kunjungan rumah untuk perawatan luka pada seorang laki-laki berusia 30 tahun memiliki luka pada betis akibat terjatuh saat pekerjaan bangunan. Karena kecelakaan tersebut penghasilan keluarga yang tidak menetap setiap bulan. Keluarga mengeluh tidak bisa merawat luka kaki ke puskesmas karena tidak ada ongkos.\r\nApakah prinsip etik perawat yang sesuai dengan kasus tersebut?\r\n', 350, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:04:57', '2021-04-06 09:04:57'),
	(778, 2, 2, 7, 'Keluarga memiliki 3 orang balita masing-masing berusia 2, 4,dan 5 tahun. Anak pertamanya berusia 21 tahun dan pulang seminggu sekali saat libur kuliah. Saat ini rumah keluarga masih menumpang pada kakek dari pihak ibu.\r\nApakah tahap perkembangan keluarga yang tepat pada kasus tersebut?\r\n', 351, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:06:05', '2021-04-06 09:06:05'),
	(779, 2, 2, 7, 'Perawat melakukan kunjungan rumah untuk mengajarkan teknik komunikasi efektif bagi ibu dan anak remaja. intervensi dilakukan atas dasar perilaku berisiko yang pernah dilakukan anak merokok dan mabuk bersama teman-teman nya di stasiun.\r\nApakah peran perawat keluarga berdasarkan pernyataan di atas?\r\n \r\n', 352, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:07:22', '2021-04-06 09:07:22'),
	(780, 2, 2, 7, 'Perawat melakukan kunjungan keluarga dengan keluhan batuk terus menerus selama 1 bulan. Klien rutin minum obat batuk setiap hari, namun masih terasa sesak dan kesulitan mengeluarkan dahak. Berat badan bapak menurun sebanyak 5 kg disertai dengan berkurangnya nafsu makan.\r\nApakah prioritas tindakan yang perlu dilakukan terhadap keluarga diatas?\r\n\r\n', 353, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:09:20', '2021-04-06 09:09:20'),
	(781, 2, 2, 7, 'Perawat melakukan pengkajian pada keluarga pasangan baru menikah, sedang merencanakan kehamilan anak pertama dan perlu pendidikan kesehatan lebih lanjut terkait peran ayah dan ibu dalam keluarga, kehamilan, KB, serta pemenuhan kebutuhan kebutuhan fisiologis dan psikologis ayah dan ibu. Komunikasi keluarga terbuka dan koping adaptif.\r\nApakah diagnosa keperawatan yang tepat pada keluarga tersebut ?\r\n\r\n\r\n', 354, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:10:31', '2021-04-06 09:10:31'),
	(782, 2, 2, 7, 'Perawat melakukan kunjungan keluarga didapatkan data seorang anak laki laki berusia 7 bulan dengan berat badan 5 kg yang mengalami diare berulang setiap bulan, ibu tidak terbiasa mencuci tangan saat mengolah makanan.\r\nApakah tindakan prioritas oleh perawat?\r\n', 355, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:11:42', '2021-04-06 09:11:42'),
	(783, 2, 2, 7, 'Perawat melakukan kunjungan rumah pada keluarga. Klien seorang perempuan usia 50 tahun mengeluh nyeri pada area luka dan sering merasa lemas. Tampak luka gangren pada area kaki dan punggung. Hasil pemeriksaan gula darah sewaktu sebesar 200 mg/dl.\r\nApakah masalah keperawatan utama pada kasus tersebut ?\r\n', 356, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:12:57', '2021-04-06 09:12:57'),
	(784, 2, 2, 7, 'Perawat melakukan kunjungan rumah pada lansia 70 tahun. Didapatkan data klien mengeluh nyeri pada persendian lutut, tidak bisa berdiri dan ada terlihat ada pembengkakan.\r\nApakah masalah keperawatan pada kasus tersebut ?\r\n', 357, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:13:59', '2021-04-06 09:13:59'),
	(785, 2, 2, 7, 'Perawat melakukan kunjungan rumah, ditemukan data ibu post partum mengeluhkan payudaranya nyeri dan bengkak. ibu tidak menyusui bayi karena bayi sedang dirawat di rumahsakit.\r\nApakah perencanaan keperawatan yang dapat dilakukan oleh perawat?\r\n\r\n', 358, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:15:16', '2021-04-06 09:15:16'),
	(786, 2, 2, 7, 'Seorang remaja laki laki berusia 17 tahun datang ke puskesmas secara sukarela ingin melakukan pemeriksaan VCT (Tes HIV Sederhana) . Remaja tersebut datang sendiri tidak ditemani orang tua dan meminta perawat jangan memberi tahu keluarga perihal pemeriksaan VCT yang dilakukan\r\nApakah prinsip etik perawat yang sesuai dengan kasus tersebut?\r\n', 359, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:16:27', '2021-04-06 09:16:27'),
	(787, 2, 2, 7, 'Seorang perempuan berusia 40 tahun menderita hipertensi dengan tekanan darah sebesar 170/100 mmHg. Dokter meresepkan obat untuk dikonsumsi setiap malam sebelum tidur. Klien menyatakan keberatan untuk mengonsumsi obat karena merupakan zat kimia. Perawat memberikan pilihan mencoba minum obat yang diresepkan dan memberikan opsi lain berupa anjuran makan rendah garam untuk menu makan klien.\r\nApakah prinsip etik perawat yang sesuai dengan kasus tersebut?\r\n', 360, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:17:36', '2021-04-06 09:17:36'),
	(788, 2, 2, 7, 'Perawat melakukan pengkajian pada keluarga yang baru memiliki bayi berusia 2 bulan dan mengalami masalah gizi dibawah garis merah.  Bapaknya tidak peduli dengan kesehatan anaknya, dan pulang selalu larut malam. Komunikasi antara Ibu  dan Bapak kurang berjalan dengan lancar, selalu diwarnai dengan pertengkaran, dan keadaan keluarga tidak harmonis. Apakah diagnosa keperawatan yang tepat pada keluarga tersebut ?\r\n\r\n', 361, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:18:59', '2021-04-06 09:18:59'),
	(789, 2, 2, 7, 'Perawat melakukan kunjungan pada anak berusia 2 tahun yang memiliki berat badan 8 Kg, tinggi badan 85 cm, kebiasaan makan makanan cepat saji, dan jarang makan nasi. Apakah diagnosa keperawatan yang tepat pada keluarga tersebut', 362, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:20:33', '2021-04-06 09:20:33'),
	(790, 2, 2, 7, 'Perawat melakukan kunjungan pada anak berusia 2 tahun yang memiliki berat badan 8 Kg, tinggi badan 85 cm, kebiasaan makan makanan cepat saji, dan jarang makan nasi. Apakah diagnosa keperawatan yang tepat pada keluarga tersebut ?\r\n\r\n', 363, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:24:08', '2021-04-06 09:24:08'),
	(791, 2, 2, 7, 'Perawat melakukan kunjungan rumah, Keluarga mengatakan bahwa hubungan tetangga sekitar rumah sangat dekat dan dianggap saudaranya sendiri sehingga terbiasa saling  membantu bila salah satu mempunyai kegiatan di lingkungannya. Apakah pengkajian keperawatan yang tepat pada kasus tersebut ?\r\n\r\n', 364, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:25:13', '2021-04-06 09:25:13'),
	(792, 2, 2, 7, 'Perawat melakukan kunjungan dan ditemukan data jika ada anggota keluarga yang sakit ringan seperti batuk, pilek, demam hanya mengkonsumsi obat-obatan yang dibeli di warung atau apotik seperti Decolgen, Paramex, dll. Tetapi, jika penyakitnya tidak kunjung sembuh (> 1 minggu) atau sakitnya parah maka keluarga Tn. C akan berobat ke dokter atau puskesmas. Apakah pengkajian keperawatan yang tepat pada kasus tersebut ?\r\n\r\n', 365, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:34:36', '2021-04-06 09:34:36'),
	(793, 2, 2, 7, 'Di sebuah keluarga terdapat suami sebagai kepala keluarga, isteri dan 1 orang anak yang berusia 4 tahun. Hasil pengkajian keluarga menunjukkan anaknya sudah BAB mencret sebanyak 4 kali dalam 12 jam, feses lembek, masih aktif dan masih mau minum. Apakah masalah keperawatan yang tepat?\r\n\r\n\r\n', 366, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:35:34', '2021-04-06 09:35:34'),
