	(807, 2, 2, 7, 'Seorang laki-laki sebagai kepala keluarga berusia 58 tahun mengalami nyeri pada lutut selama 1 tahun. Klien tinggal bersama istri dan kedua anaknya. Menurut klien mengalami rematik dan akan memakan obat jika terasa sakit. Klien menyatakan tidak melakukan tindakan lainnya kecuali berobat ke puskesmas. Apakah data yang dibutuhkan selanjutnya?\r\n', 380, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:53:06', '2021-04-06 09:53:06'),
	(808, 2, 2, 7, 'Seorang laki-laki sebagai kepala keluarga berusia 58 tahun mengalami nyeri pada lutut selama 1 tahun. Klien tinggal bersama istri dan kedua anaknya. Menurut klien mengalami rematik dan akan memakan obat jika terasa sakit. Klien menyatakan tidak melakukan tindakan lainnya kecuali berobat ke puskesmas. Apakah masalah keperawatan yang tepat?\r\n', 381, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:54:37', '2021-04-06 09:54:37'),
	(809, 2, 2, 7, 'Seorang laki-laki sebagai kepala keluarga berusia 58 tahun mengalami nyeri pada lutut selama 1 tahun. Klien tinggal bersama istri dan kedua anaknya. Menurut klien mengalami rematik dan akan memakan obat jika terasa sakit. Klien menyatakan tidak melakukan tindakan lainnya kecuali berobat ke puskesmas. Apakah intervensi yang tepat?\r\n\r\n\r\n', 382, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 09:56:24', '2021-04-06 09:56:24'),
	(810, 2, 2, 6, 'Seorang perawat yang bertugas di IGD, saat waktu menjelang operan dinas datang dua orang pasien kecelakaan lalu lintas, pasien 1 : Berteriak kesakitan, ada pendarahan di kaki kanan, pasien 2 : Diam, tampak pendarahan dari kepala.\r\nManakah yang harus diprioritaskan oleh perawat?', 383, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:12:17', '2021-04-06 19:12:17'),
	(811, 2, 2, 6, 'Seorang laki-laki berusia 40 tahun dilarikan ke IGD dalam keadaan tidak sadar. Pernafasan tampak lambat dan tidak teratur. Setelah dianamnesis , pasien memiliki riwayat benturan kepala pada saat mengalami kecelakaan motor. TD ; 100/70 mmHg, frekuensi nadi 120 x/menit, GCS 8. Berdasarkan metode triase 5 level.\r\nPada level manakah pasien tersebut berada?', 384, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:13:49', '2021-04-06 19:13:49'),
	(812, 2, 2, 6, 'Seorang laki-laki berusia 18 tahun didapatkan tidak sadarkan diri setelah mengalami tabrakan motor di tepi jalan. Saat perawat datang dan mendekati korban di TKP terdengar suara ngorok, terdapat dapat darah keluar dari hidung, dan lecet pada bagian kepala. Pasien juga mengalami perdarahan pada daerah lengan dan kaki.\r\nTindakan prioritas apakah yang harsu dilakukan oleh perawat?', 385, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:15:21', '2021-04-06 19:15:21'),
	(813, 2, 2, 6, 'Seorang laki-laki berusia 45 tahun mengalami kecelakaan lalu lintas, dibawa ke IGD dengan diagnosa Cidera kepala, saat melakukan pemeriksan fisik,  pasien mendadak nafasnya berhenti. Petugas yang ada hanya anda dan seorang dokter, alat emergency tidak berada dekat anda.\r\nApakah tindakan yang harus segera anda kerjakan?', 386, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:16:50', '2021-04-06 19:16:50'),
	(814, 2, 2, 6, 'Seorang wanita berusia 30 tahun memiliki anak berusia 4 tahun yang mengalami perdarahan dari kepala, hidung dan telinga, dokter dan perawat menyarankan dilakukan pemasangan CVP, tetapi ibu pasien menolak. \r\nTermasuk dalam masalah etik manakah pasien tersebut?', 387, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:18:49', '2021-04-06 19:18:49'),
	(815, 2, 2, 6, 'Seorang wanita berusia 18 tahun datang ke IGD di sebuah rumah sakit dalam kondisi yang Lemah, BAB encer dirumah sebanyak 6 x, muntah sebanyak 3x, kondisi ini dialami sekitar 2 jam yang lalu, klien nampak keringat dingin, kulit tampak teraba hangat. Hasil pengkajian fisik TTV TD: 100/70 mmHg, frekuensi Nadi :72 x/menit, frekuensi nafas : 22x/menit, Suhu 37,5 C.\r\nManakah intervensi/rencana keperawatan utama pada kasus diatas?', 388, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:20:32', '2021-04-06 19:20:32'),
	(816, 2, 2, 6, 'Seorang laki-laki berusia 30 tahun, datang ke IGD mengalami pendarahan saluran cerna. Hasil pengkajian : Agama Islam, riwayat penyakit keganasan di sangkal, alergi obat disangkal. Tekanan darah 90/70mmHg. Klien akan dilakukan transfusi darah.\r\nManakah data penting yang harus dieksplorasi?', 389, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:22:03', '2021-04-06 19:22:03'),
	(817, 2, 2, 6, 'Seorang klien laki-laki berusia 45 tahun di bawa ke IGD oleh keluarganya. Hasil pengkajian klien mengalami perdarahan di daerah kepala, trauma thoraks dan pasien mengalami penurunan kesadaran. Tekanan Darah: 100/70 mmHg, Frekuensi Nadi: 130x/menit, Suhu 37 C, frekuensi nafas : 33x/menit, terdengar ronkhi. \r\nManakah prioritas kriteria yang paling tepat pada kasus tersebut?', 390, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:23:23', '2021-04-06 19:23:23'),
	(818, 2, 2, 6, 'Anda mendapat tugas dari perawat senior untuk merujuk klien ke RS yang lebih lengkap peralatanya. Pada saat anda di perjalanan tiba- tiba ada pengendara sepeda motor yang tabrakan, kemudian anda keluar dan berusaha untuk menyelamatkan klien tabrakan tersebut. Dari hasil pengkajian diperoleh data Nadi tidak teraba, tidak ada gerakan dada, dan aliran udara pernapasan klien gawat darurat. Klien sudah di bawa ke tempat yang aman. \r\nDari kasus diatas apakah tindakan selanjutnya yang harus anda lakukan?', 391, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:25:23', '2021-04-06 19:25:23'),
	(819, 2, 2, 6, 'Seorang pasien dengan kasus sirosis apendisitis, pada saat dilakukan pengkajian klien mengatakan merasa sangat gerah, haus,dan nyeri pada bagian luka operasi dan pinggang belakang. Menurut klien nyeri pada daerah pinggul diakibatkan oleh bekas anestesi yang dilakukan sebelum operasi dan rasanya sangat sakit sekali sehingga klien minta perawat untuk menjelasan terkaitnyeri post anestesi yang dialaminya.\r\nDari kasus diatas peran perawat apakah yang sedang dijalankan oleh perawat saat ini?', 392, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:26:59', '2021-04-06 19:26:59'),
	(820, 2, 2, 6, 'Seorang laki-laki umur 40 tahun datang ke unit gawat darurat RSHS Bandung akibat nyeri  dada sebelah kiri menjalar ke leher dan punggung, Saat dikaji pasien mengeluh nyeri dada seperti tertimpah bendah keras, skala nyer 8 rentang (0 – 10 ), TD 90/60 mmHg , frekwensi nadi 100 x/menit frekwensi napas 25 x/menit dari hasil pemeriksaan darah troponin T 60 mm/dl gambar EKG didapatkan elevasi segmen ST di sadapan II,III dan AVF.\r\nTindakan keperawatan yang tepet untuk mengatasi masalah diatas', 393, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:29:15', '2021-04-06 19:29:15'),
	(821, 2, 2, 6, 'Seorang perempuan umur 50 tahun datang ke unit gawat darurat akibat nyeri  dada sebelah kiri menjalar keleher dan punggung, Saat dikaji pasien mengeluh nyeri dada seperti tertimpah bendah keras TD 100/60 mmHg , frekwensi nadi 100 x/menit frekwensi napas 25 x/menit dari hasil pemeriksaan darah troponin T 60 mm/dl gambar EKG didapatkan elevasi segmen ST di sadapan II,III dan AVF.', 394, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:30:53', '2021-04-06 19:30:53'),
	(822, 2, 2, 6, 'Seorang laki-laki umur 45 tahun datang ke unit gawat darurat akibat nyeri  dada sebelah kiri menjalar keleher dan punggung, Saat dikaji pasien mengeluh nyeri dada seperti tertimpah bendah keras TD 100/60 mmHg , frekwensi nadi 100 x/menit frekwensi napas 25 x/menit dari hasil pemeriksaan darah troponin T 60 mm/dl gambar EKG didapatkan elevasi segmen ST di sadapan II,III dan AVF.\r\nDiagnosa keperawatan utama pada kasus di atas adalah', 395, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:32:39', '2021-04-06 19:32:39'),
	(823, 2, 2, 6, 'Seorang laki-laki umur 60 tahun datang ke unit gawat darurat akibat nyeri  dada sebelah kiri menjalar keleher dan punggung, Saat dikaji pasien mengeluh nyeri dada seperti tertimpah bendah keras TD 100/60 mmHg , frekwensi nadi 100 x/menit frekwensi napas 25 x/menit dari hasil pemeriksaan darah troponin T 60 mm/dl gambar EKG didapatkan elevasi segmen ST di sadapan I, V5,V6.\r\nTindakan medik 10 menit awal untuk memperbaiki perfusi otot jantung adalah', 396, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:34:29', '2021-04-06 19:34:29'),
	(824, 2, 2, 6, 'Seorang laki-laki berusia 55 tahun dirawat di ruang kardiologi , sudah tiga hari yang lalu pasien mengeluh sesak napas, frekuensi nafas : 30x/menit, Nadi 100x/menit , TD 90/50 mmHg,. Terdapat suara nafas tambahan ronchii di basal paru ICS 4 sebelah kiri. CRT < 3 detik, clubbing finger (+). Pemeriksaan Thorax foto: edema paru bilateral, CTR 58%.\r\nPenyebab terjadinya edema paru tersebut?', 397, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:36:14', '2021-04-06 19:36:14'),
	(825, 2, 2, 6, 'Seorang Perempuan berusia 50 tahun dirawat di ruang kardiologi , sudah tiga hari yang lalu pasien mengeluh sesak napas, frekuensi nafas : 33x/menit, Nadi 110x/menit , TD 90/50 mmHg,. Terdapat suara nafas tambahan ronchii di basal paru ICS 4 sebelah kiri. CRT < 3 detik, clubbing finger (+). Pemeriksaan Thorax foto: edema paru bilateral, CTR 58%.\r\nMasalah keperawatan utama yang tepat adalah?', 398, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:37:40', '2021-04-06 19:37:40'),
	(826, 2, 2, 6, 'Seorang perempuan berusia 40 tahun masuk ruangan UGD setelah mengalami cedera kepala berat karena kecelakaan lalu lintas. Tekanan intracranial di monitor adalah 40mmHg. Salah satu usaha dilakukan untuk menurunkan tekanan intracranial pasien tersebut.\r\nApakah posisi yang terbaik untuk klien tersebut?', 399, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:39:08', '2021-04-06 19:39:08'),
	(827, 2, 2, 6, 'Perempuan umur 40 tahun mengeluh sakit di daerah abdomen bawah, setelah diperiksa nampak ada jejas, nampak muka pucat dan keluar keringat dingin serta akral dingin. RR : 35 x/menit, Nadi : 120 x/menit kecil dan cepat, GCS : 14.\r\nTindakan kolaboratif yang harus segera diberikan :', 400, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:40:43', '2021-04-06 19:40:43'),
	(828, 2, 2, 6, 'Pasien berumur 50 tahun dirawat di ruang kardio rumahsakit Hasan Sadikin Bandung  karena sudah tiga bulan yang lalu berat badan selalu  naik dan bengkak di kedua tungkai. Saat dilakukan pengkajian didapatkan data klien mengeluh sesak terutama setelah ke kamar mandi,terdapat pitting edema 1 cm di kedua tungkai, JVP 5 + 4 cm,  tanda-tanda vital didapatkan TD 100/60 mmHg, N 100x/menit RR 24x/menit diagnosa medis CHF.\r\nDiagnosa keperawatan utama pada kasus diatas adalah', 401, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 19:42:23', '2021-04-06 19:42:23'),
	(829, 2, 2, 2, 'Seorang anak perempuan umur 1 tahun dirawat dengan diagnosa medis thypoid. Pasien tampak kurus, nafas cepat, selalu muntah setelah makan, rewel, konjungtiva anemis, turgor kulit > 2 detik, mukosa bibir kering, protein total dalam darah 6,40 g/dl (normal 6,6-8,7 g/dl). \r\nPertanyaan Soal : Apakah intervensi keperawatan yang tepat pada kasus di atas? ', 402, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:24:24', '2021-04-06 22:24:24'),
	(830, 2, 2, 2, 'Seorang anak laki-laki berusia 5 Tahun dirawat dengan diagnosis medis Bronkopnemonia. Pasien terlihat rewel dan selalu minta digendong ibunya. Pasien selalu menangis ketika dokter atau perawat datang.  Ibu pasien mengatakan bahwa anaknya dirumah tidak takut dengan orang lain dan sering bermain dengan teman-temannya. \r\nApakah implementasi keperawatan yang tepat pada kasus tersebut? ', 403, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:25:32', '2021-04-06 22:25:32'),
	(831, 2, 2, 2, 'Seorang anak perempuan berusia 18 bulan di rawat dengan diagnosa TBC, demam tinggi, malas makan dan minum, dan adanya suara tambahan saat tidur (stridor). Respirasi 20 x/menit, denyut nadi 110 x/menit, suhu 390 BB 12 Kg. TB: 72 cm.\r\nPertanyaan Soal : Apakah masalah keperawatan prioritas pada pasien tersebut? ', 404, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:27:25', '2021-04-06 22:27:25'),
	(832, 2, 2, 2, 'Seorang anak perempuan berusia 5 Tahun di rawat dengan Broncopnemonia. Pasien sulit makan, dan terdapat bunyi nafas ronkhi. Respirasi 28 x/menit, denyut nadi 110 x/menit, suhu 37,20 BB 12 Kg. TB: 86 cm. Apakah implementasi keperawatan mandiri prioritas pada pasien tersebut?', 405, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:28:19', '2021-04-06 22:28:19'),
	(833, 2, 2, 2, 'Seorang anak perempuan berusia 4 Tahun di rawat dengan Tubercolosis. pasien dengan riwayat demam tinggi, saat ini sulit makan, dan terdapat bunyi nafas ronkhi. Respirasi 25 x/menit, denyut nadi 100 x/menit, suhu 36,50, terdapat sputum, BB 10 Kg. TB: 86 cm. Apakah masalah keperawatan prioritas pada pasien tersebut?', 406, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:29:14', '2021-04-06 22:29:14'),
	(834, 2, 2, 2, 'Seorang anak 1 Tahun datang ke UGD diantar oleh ibunya dengan keluhan BAB lebih dari 10 kali dalam sehari dengan konsistensi cair, muntah, tidak mau makan dan minum serta rewel. Dari hasil pemeriksaan di dapatkan kondisi umum pasien compos mentis, BB 8,6 Kg, RR 24x/menit, Nadi 88 x/menit, suhu 38,5 derajat celcius, akral dingin, mata cekung, bibir kering, menggigil, bayi terlihat gelisah dan lemas. Dari data di atas, apakah diagnosa keperawatan utama pada pasien? ', 407, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:30:10', '2021-04-06 22:30:10'),
	(835, 2, 2, 2, 'Seorang anak berusia 17 Tahun dirawat dengan Typoid. Pasien mengeluh demam tinggi dan  nyeri di perut bagian bawah dengan skala nyeri 6 (skala 1-10). Tekanan darah 110/70 mmHg, suhu 400 c, RR 22x/menit, denyut nadi 80x/menit. \r\nDari data di atas, apakah evaluasi keperawatan utama pada pasien? ', 408, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:31:02', '2021-04-06 22:31:02'),
	(836, 2, 2, 2, 'Seorang bayi laki-laki baru lahir dirawat diruang perinatologi dengan BB 2200 gram, TB 45 cm dengan usia kehamilan 36 minggu. Dari pengkajian: denyut nadi 88x/menit, gerakan lemah, extremitas sedikit fleksi, tidak langsung menangis, warna tubuh kemerahan disertai warna biru di bagian extremitas.\r\nBerapakah APGAR score pada bayi tersebut?', 409, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:32:00', '2021-04-06 22:32:00'),
	(837, 2, 2, 2, 'Seorang anak laki-laki berusia 4 tahun dirawat dengan diagnosis medis Pneumonia. Pasien sempat febris namun saat ini suhu pasien 37,5 c, tampak sesak dan pernafasan cuping hidung dan RR 40 x/menit, bibir agak kebiruan dan pasien tampak lemas. Apakah diagnosa keperawatan yang tepat pada kasus tersebut? ', 410, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:32:55', '2021-04-06 22:32:55'),
	(838, 2, 2, 2, 'Seorang anak laki-laki berusia 6 bulan dirawat dengan diagnosis diare. BB Pasien 5000 gram, TB 65 cm. Pasien sudah BAB cair sebanyak 8 kali/hari. Mata tampak cekung, turgor kulit >3 detik, CRT > 2, tampak gelisah dan malas menetek.  Apakah kategori status nutrisi menggunakan z-score? ', 411, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:34:05', '2021-04-06 22:34:05'),
	(839, 2, 2, 2, 'Seorang bayi laki-laki dibawa ke IGD dengan keluhan sesak. Hasil pemeriksaan didapatkan pertumbuhan terhambat, anak terlihat pucat, banyak keringat bercucuran, ujung-ujung jari hiperemik. Diameter dada bertambah, sering terlihat pembonjolan dada kiri, dan diagnosa medis menyatakan VSD. Apakah data pengkajian yang paling menonjol pada kasus?', 412, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:35:09', '2021-04-06 22:35:09'),
	(840, 2, 2, 2, 'Seorang bayi perempuan mengalami kelainan jantung kongenital dibawa ke IGD dengan keluhan kesulitan bernafas. Hasil pemeriksaan didapatkan frekuensi nadi 204x/menit, kurus, bunyi jantung Murmur, sianosis, napas stridor. Apakah masalah keperawatan utama pada kasus?', 413, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:36:06', '2021-04-06 22:36:06'),
	(841, 2, 2, 2, 'Seorang balita laki-laki mengalami kelainan jantung kongenital dibawa ke IGD dengan keluhan kesulitan bernafas. Hasil pemeriksaan didapatkan perkembangan fisik yang kurang, tampak lemah, sianosis, tampak clubbing of finger, tampak kurang berinteraksi dengan anak-anak lainnya. Apakah Diagnosa  keperawatan yang tepat pada kasus?', 414, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:36:58', '2021-04-06 22:36:58'),
	(842, 2, 2, 2, 'Seorang balita perempuan mengalami kelainan jantung kongenital dibawa ke IGD dengan keluhan kesulitan bernafas. Hasil pemeriksaan didapatkan tampak lemah, sianosis, frekuensi nadi 180x/menit, frekuensi nafas 58x/menit, tampak clubbing of finger.Apakah kriteria hasil yang tepat pada kasus?', 415, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:38:01', '2021-04-06 22:38:01'),
	(843, 2, 2, 2, 'Seorang bayi perempuan lahir dengan TOF mengalami  gejala yang nyata yaitu adanya sianosis, letargi dan lemah, tampak clubbing of finger yang sangat jelas sekali. Apakah pengkajian lanjutan   pada kasus tersebut?', 416, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:39:02', '2021-04-06 22:39:02'),
	(844, 2, 2, 2, 'Seorang bayi laki-laki datang ke puskesmas dengan keadaan  nafas cepat, sesak nafas, retraksi, bunyi jantung tambahan (machinery mur-mur), cedera tungkai, hepatomegali. \r\nApakah fungsi observasi yang perawat lakuakan dengan data  pada kasus?\r\n', 417, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:40:15', '2021-04-06 22:40:15'),
	(845, 2, 2, 2, 'Seorang bayi laki-laki datang ke puskesmas dengan keadaan  nafas cepat, sesak nafas, retraksi, bunyi jantung tambahan (machinery mur-mur), cedera tungkai, hepatomegaly. Untuk lebih meningkatkan pengetahuan dan informasi bagi pasien dan keluarga pasien serta lebih kooperatif dalam tindakan pelaksanaan yang dilakukan perawat. Apakah tindakan yang harus dilakuakan  pada kasus?', 418, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:41:16', '2021-04-06 22:41:16'),
	(846, 2, 2, 2, 'Seorang bayi laki-laki mengalami masalah  : Tidak efektif pola nafas berhubungan dengan peningkatan resistensi vaskuler paru, kongesti pulmonal, diperlukan memantau keefektifan terapi pernafasan dan mencatat terjadinya komplikasi. \r\nApakah tindakan yang harus dilakuakan  pada kasus?\r\n', 419, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:43:02', '2021-04-06 22:43:02'),
	(847, 2, 2, 2, 'Seorang bayi laki-laki mengalami masalah  penyakit jantung bawan Perubahan nutrisi kurang dari kebutuhan tubuh berhubungan dengan kelelahan pada saat makan dan meningkatnya kebutuhan kalori. Perawat berupaya untuk mempertahankan keadaan nutrisinya. Apakah Intervensi yang harus dilakuakan  pada kasus?', 420, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:44:03', '2021-04-06 22:44:03'),
	(848, 2, 2, 2, 'Seorang balita perempuan dengan penyakit jantung bawaan dibawa ke puskesmas dengan mengalami masalah Tidak efektif pola nafas berhubungan dengan peningkatan resistensi vaskuler paru, kongesti pulmonal. Apakah kritaria hasil pada masalah  yang diharapkan  pada kasus?', 421, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:44:56', '2021-04-06 22:44:56'),
	(849, 2, 2, 2, 'Batita laki-laki berusia 1,5 tahun masuk RS dengan keluhan diare selama 4 hari. Hasil pengkajian: tampak rewel, muntah lebih dari 5 kali, dan feses cair. Suhu 38° C, frekuensi denyut jantung 98x/menit, dan frekuensi nafas 30x/menit, mata tampak cekung, bibir tampak kering dan turgor kulit buruk. Apakah tindakan keperawatan utama yang dapat dilakukan oleh perawat tersebut?', 422, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:45:54', '2021-04-06 22:45:54'),
	(850, 2, 2, 2, 'Seorang Batita laki-laki berusia 2 tahun mengalami BAB lebih dari 4 kali dengan konsistensi cair. Hasil pengkajian: BB 9Kg, frekuensi nadi 128x/mnt, Suhu 36,5° C, frekuensi napas 38x/mnt. Ibu klien mengatakan bahwa klien muntah  kurang lebih 8 kali sebelum masuk rumah sakit. Apakah masalah keperawatan utama pada kasus tersebut?', 423, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:46:47', '2021-04-06 22:46:47'),
	(851, 2, 2, 2, 'Seorang anak perempuan berusia 1 tahun 5 bulan dibawa oleh orang tuanya ke Rumah Sakit dengan keluhan: BAB lebih dari 4 kali dengan konsistensi cair. Hasil pengkajian: keadaan umum lemah, mukosa bibir kering, mata cekung, frekuensi nadi 120x/mnt, Suhu 38° C, frekuensi napas 30x/mnt. Ibu pasien mengatakan anaknya rewel, muntah  kurang lebih 5 kali sebelum masuk rumah sakit dan tidak ada nafsu makan. \r\nApa data lain yang perlu dikaji untuk menilai status hidrasi pada kasus tersebut?\r\n', 424, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:48:27', '2021-04-06 22:48:27'),
	(852, 2, 2, 2, 'Seorang bayi perempuan usia 10 bulan dibawa oleh ibunya ke RS dengan keluhan: BAB cair lebih dari 6 kali dan demam selama 2 hari. Hasil pengkajian: membran mukosa bibir kering, turgor kulit abdomen kembali dalam 2 detik, muntah 2x, nafsu makan berkurang, frekuensi nadi 110x/mnt, frekuensi napas 30x/mnt, Suhu 37,8° C, bokong bayi sering basah, dan oliguri.  Apakah tindakan keperawatan utama pada kasus tersebut? ', 425, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:49:22', '2021-04-06 22:49:22'),
	(853, 2, 2, 2, 'Seorang bayi perempuan usia 10 bulan dibawa oleh ibunya ke Puskesmas dengan keluhan: BAB cair lebih dari 6 kali sehari. Ibu mengatakan bayinya rewel, haus tetapi minum masih lahap. Hasil pengkajian: mata cekung, cubitan kulit perut kembali lambat, frekuensi nadi 110x/mnt, frekuensi napas 30x/mnt, Suhu 37,5° C. Apa klasikfikasi masalah kesehatan tersebut berdasarkan MTBS?', 426, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:50:12', '2021-04-06 22:50:12'),
	(854, 2, 2, 2, 'Anak laki-laki berusia 4 tahun dirawat di ruang anak dengan keluhan bengkak pada muka, sakit kepala dan berat badan meningkat drastis. Hasil pengkajian: mudah lelah, oedema seluruh tubuh, konjungtiva pucat, porsi makan tidak dihabiskan, dan hasil laboratorium: protein urin +3. Apakah masalah keperawatan utama pada kasus tersebut?', 427, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:51:28', '2021-04-06 22:51:28'),
	(855, 2, 2, 2, 'Anak laki-laki usia 7 tahun dirawat di RS dengan sindroma nefrotik. Hasil Pengkajian: pitting oedema di ekstremitas, asites, frekuensi napas 32x/menit. Hasil laboratorium: protein urine (+), albumin 2,3 gr/dL. Anak tersebut mendapatkan terapi steroid dan diuretik. Apakah intervensi utama untuk kasus tersebut?', 428, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:53:12', '2021-04-06 22:53:12'),
	(856, 2, 2, 2, 'Seorang anak laki-laki berusia 3 tahun dirawat di RS dengan keluhan bengkak di area wajah dan kelopak mata, dokter menyatakan bahwa anak tersebut mengalami nefrotik sindrome. Hasil pengkajian, perawat menemukan mata anak tertutup karena edema kelopak mata dan alis yang melekat  \r\nApakah tindakan prioritas perawat pada kasus tersebut?\r\n', 429, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:54:02', '2021-04-06 22:54:02'),
	(857, 2, 2, 2, 'Anak perempuan usia 12 tahun dirawat di rumah sakit dengan keluhan sudah 3 hari mengeluh nyeri pada daerah perut bawah. Hasil pengkajian: anak mengeluh nyeri saat buang air kecil, BAK tidak lancar, merasa tidak puas setelah BAK, ekspresi tampak meringis kesakitan, nafsu makan menurun dan susah tidur.  Apakah kriteria evaluasi yang diharapkan tercapai pada kasus tersebut?', 430, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:54:54', '2021-04-06 22:54:54'),
	(858, 2, 2, 2, 'Batita laki-laki berusia 2 tahun, datang ke RS dengan keluhan BAK nya sulit dilakukan dengan cara berdiri karena air kencingnya sering mengenai tubuhnya. Kemudian dari hasil pemeriksaan diketahui bahwa meatus uretranya terletak di bagian bawah pada batang penis dan di atas scrotal. Apakah intervensi yang tepat untuk mengatasi masalah tersebut?', 431, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:55:39', '2021-04-06 22:55:39'),
	(859, 2, 2, 2, 'Seorang anak perempuan berusia 12 tahun, dengan diagnosa medis ALL. Diperoleh hasil pengkajian suhu tubuh 380C,  akral terasa dingin, tampak lemah dan kurus, Hb : 9 gr/dl, L = 25.000/mm3. Kondisi tersebut tidak memungkinkan untuk dilakukan kemoterapi. Apakah Tindakan keperawatan agar pasien dapat dilakukan tindakan kemoterapi ?', 432, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:56:25', '2021-04-06 22:56:25'),
	(860, 2, 2, 2, 'Seorang mahasiswa ners mendapatkan pasien kelolaan di ruang perinatologi, tampak bayi gelisah dan menangis, setelah diobservasi diapers yang dipakai oleh bayi sudah penuh dan tampak ada feses, namun saat dia akan mengganti diapers, perawat ruangan menegurnya untuk tidak banyak menyentuh bayi tersebut karena waktu mengganti diapers masih 1 jam lagi bersamaan dengan waktu memberi susu. Prinsip etik apa yang diabaikan oleh perawat tersebut', 433, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:57:13', '2021-04-06 22:57:13'),
	(861, 2, 2, 2, 'Bayi perempuan berusia 1 bulan  dengan berat badan 1,.8 Kg di diagnosa Paten Ductus Arteriousus (PDA). Dari hasil pengkajian ditemukan bahwa berat badan bayi tersebut  < -3 SD yang diklasifikasikan gizi buruk, murmur (+), tampak pucat. Apakah yang mengakibatkan terjadinya gizi buruk pada bayi tersebut', 434, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:58:06', '2021-04-06 22:58:06'),
	(862, 2, 2, 2, 'Seorang anak laki-laki usia  6 tahun  dibawa oleh ibunya ke Poli Thalasemia dengan keluhan mudah  sakit, ibu juga mengatakan anak sering cepat lelah saat beraktifitas. Dari hasil pemeriksaan fisik wajah tampak pucat, konjungtiva anemis, kulit pucat keabuan (hemosiderosis). Hasil pemeriksaan laboratorium  Hb : 5 gr/dl,  Apakah  intervensi utama yang dilakukan? ', 435, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 22:58:56', '2021-04-06 22:58:56'),
	(863, 2, 2, 2, 'Seorang anak laki-laki berusia 8 tahun didiagnosa Sindroma Nefrotik (SN), diperoleh data klien tampak lemah, nafsu makan menurun, mengalami penurunan berat badan. Warna urin kuning pekat. Terdapat edema di daerah wajah dan ekstremitas bawah. Hasil pemeriksaan proteinuri +, Albumin 1,9 gr/dl. Apakah tindakan keperawatan prioritas untuk kasus di atas', 436, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 23:00:07', '2021-04-06 23:00:07'),
	(864, 2, 2, 2, 'Seorang anak perempuan berusia 10 tahun,  terdiagnosa medis CKD, hasil pengkajian didapatkan mengalami edema periorbital, distensi abdomen, hasil laboratorium hipoalbumin, hiponatremi dan hipokalsemi. Klien tampak lemas, tidak nafsu makan. RR : 24x/mnt, TD 150/90 mmHg. Apakah masalah keperawatan prioritas pada kasus tersebut ?', 437, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 23:00:51', '2021-04-06 23:00:51'),
	(865, 2, 2, 2, 'Seorang anak perempuan berusia 14 tahun,  mengeluh sudah 3 hari nyeri di daerah perut bawah. Hasil pengkajian diperoleh : Nyeri saat BAK, BAK tidak lancar, merasa tidak puas setelah BAK, ekspresi meringis, nafsu makan menurun dan susah tidur. Apakah kriteria evaluasi  pada kasus tersebut ?', 438, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 23:01:37', '2021-04-06 23:01:37'),
	(866, 2, 2, 2, 'Seorang anak perempuan usia  15 tahun  dibawa oleh ibunya ke Poli anak dengan keluahan demam terus menerus selama 3 hari. Hasil pengkajian diperoleh data nyeri sendi dan nyeri kepala, kulit teraba dingin, nadi lemah, suhu 38,50C. Perawat melakukan uji torniquet. Didapatkan tekanan darah 110/70 dan ditentukan nilai tengah tekanan sistolik dan diastolik. Apakah tindakan selanjutnya pada pemeriksaan tersebut?', 439, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 23:02:25', '2021-04-06 23:02:25'),
	(867, 2, 2, 2, 'Bayi perempuan berusia 2 bulan dirawat dengan diagnosis tetralogy of fallot (TOF). Direncanakan untuk pulang. Namun ibu cemas jika anak menangis lama akan tampak kebiruan. Apakah pendidikan kesehatan yang tepat diberikan pada kasus tersebut?', 440, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 23:03:11', '2021-04-06 23:03:11'),
	(868, 2, 2, 2, 'Seorang anak perempuan  berumur 10 tahun dirawat di RS dengan diagnose medis leukemia dan telah diberikan kemoterapi. Anak tampak lemah, tidak nafsu makan, mengeluh perih pada area mulut.  Apakah tindakan keperawatan yang dilakukan untuk mengatasi prioritas masalah tersebut?', 441, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 23:04:04', '2021-04-06 23:04:04'),
	(869, 2, 2, 2, 'Seorang bayi usia 3 hari di rawat di RS. Pada saat dilakukan timbang badan berat bada 2000 gram, ibu mengatakan lahir 9 bulan atau 38 minggu.\r\nApakah kategori bayi pada kasus?\r\n', 442, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 23:04:48', '2021-04-06 23:04:48'),
	(870, 2, 2, 2, 'Seorang bayi usia 3 hari di rawat di RS. Pada saat dilakukan timbang badan berat bada 1300 gram, ibu mengatakan lahir 9 bulan atau 38 minggu. Apakah tindakan prioritas pada kasus tersebut?', 443, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 23:05:39', '2021-04-06 23:05:39'),
	(871, 2, 2, 2, 'Seorang bayi usia 5 hari berat badan 1400 gram, suhu badan 35,6 Celcius, dirawat dalam incubator RR 64 X per-menit, kulit sangat tipis, akral dingin. Manakah kategori yang tepat pada kasus tersebut?', 444, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 23:06:30', '2021-04-06 23:06:30'),
	(872, 2, 2, 2, 'Seorang bayi baru lahir dirawat diruang peranotologi, hasil pemgkajian didapatkan ibu hamil belum cukup bulan, yaitu 22 minggu, berat badan 2000 gram, kulit tipis transparan, terdapat latugo. Berada pada kateogori apakah bayi pada kasus tersebut', 445, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 23:07:23', '2021-04-06 23:07:23'),
	(873, 2, 2, 2, 'Seorang bayi laki-laki usia 3 hari dibawa ke poli. Balita pada saat dikaji ibu menyatakan berat badan lahir 1800 gram, bayi 35.6C. Apakah penkes yang harus dilakukan perawat pada ibu bayi?', 446, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 23:08:14', '2021-04-06 23:08:14'),
	(874, 2, 2, 2, 'Seorang bayi usia enam hari setelah dilakukan  pengkajian terdapat icteric pada bagian muka dan abdomen bagian bawah. Hasil bilirubin 13,9 mg/dl. Termasuk kremer berapa bayi tersebut? Tindakan apa yang harus dilakukan selanjutnya, ', 447, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 23:09:05', '2021-04-06 23:09:05'),
	(875, 2, 2, 2, 'Seorang anak AN usia 5 tahun sedang dirawat di rumah sakit MH.Hoesin sudah 1  hari karena   penyakit   demam   berdarah.   AN   sangat   ketakutan   jika   perawat   datang   untuk memantau keadaan AN. Terlihat AN memeluk ibunya sangat erat. AN juga tidak mau makan dan sering menangis. Masalah keperawatan utama yang dapat disimpulkan pada\r\nkasus diatas adalah:\r\n', 448, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 23:09:53', '2021-04-06 23:09:53'),
	(876, 2, 2, 2, 'Seorang bayi usia enam hari setelah dilakukan  pengkajian terdapat icteric pada bagian muka dan abdomen bagian bawah. Hasil bilirubin 13,9 mg/dl. Apakah tindakan yang harus dilakukan perawat?', 449, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 23:10:39', '2021-04-06 23:10:39'),
	(877, 2, 2, 2, 'Bayi lahir berat badan 3000 gram setelah 24 jam terlihat ada ICHRK/ Kuning selama 5 hari. Billirubin serum hasinya kurang dari 5 miligram per desi liter. Bayi termasuk neonatal hyper billirubin. Klasifikasi yang terjadi sesuai kasus diatas?', 450, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 23:11:30', '2021-04-06 23:11:30'),
	(878, 2, 2, 2, 'Seorang Bayi A usia tujuh hari BB 2900 gr, PB 49 cm keluhan kuning. Lakukan pengkajian untuk menentukan kremer 1 yaitu', 451, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-06 23:12:09', '2021-04-06 23:12:09'),
	(879, 1, 1, 0, 'Seorang pasien wanita usia 55 tahun dirawat di ruang bedah perempuan. Pasien didiagnosis urolitiasis dan analisis laboratorium dari batu tersebut menunjukkan bahwa batu terdiri dari kalsium oksalat. Pasien menanyakan jenis makanan apa yang tidak boleh dikonsumsi. Apakah instruksi diet secara spesifik yang harus dijelaskan oleh perawat?\r\n', 403, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:00:02', '2021-04-21 08:00:02'),
	(880, 1, 1, 0, 'Seorang laki-laki usia 65 tahun dirawat di ruang bedah laki-laki. Pemeriksaan tekanan darah 130/90 mmHg, frekuensi nadi 100x/menit, frekuensi napas 23x/menit da suhu 37,5oC. Laki-laki tersebut telah menjalani prostatektomi transurethral untuk benigna prostat hipertrofi. Dia saat ini dirawat dengan irigasi kandung kemih continuos dan mengeluh nyeri pada kandung kemihnya. Skala nyeri 6 (0-10). Intervensi apa yang harus dilakukan pertama kali oleh perawat?\r\n', 404, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:04:21', '2021-04-21 08:04:21'),
	(881, 1, 1, 0, 'Seorang wanita usia 45 tahun terpasang kantung nefrostomi mengatakan kepada perawat, “Kantung kemih ini memalukan. Semua orang akan tahu bahwa saya tidak normal. Saya malu, bagaimana saya bisa keluar di depan umum lagi"  Apakah diagnosis keperawatan yang paling tepat untuk pasien tersebut?\r\n', 405, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:06:02', '2021-04-21 08:06:02'),
	(882, 1, 1, 0, 'Seorang wanita usia 50 tahun sedang menjalani pemeriksaan di poklinik bedah. Doter menginstruksikan untuk dilakukan pemeriksaan radiologi berupa rontgen KUB (kidney, ureter, blader) karena dicurigai terjadinya obstruksi saluran kemih. Apakah yang harus diterapkan perawat untuk mempersiapkan pemeriksaan tersebut?', 406, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:08:12', '2021-04-21 08:08:12'),
	(883, 1, 1, 0, 'Seorang wanita usia 60 tahun rawat jalan ke poliklinik mata. Klien telah menjalani operasi katarak dengan implan lensa 1 minggu yang lalu. Klien mengatakan kepada perawat bahwa 2 hari kemarin ia pergi ke rumah anaknya di luar pulau. Dia menggabungkan semua obat tetes mata yang diresepkan menjadi satu dalam satu wadah, agar lebih praktis sehingga cukup meneteskan 1 tetes saja. Apakah tanggapan terbaik perawat pada kasus tersebut?\r\n', 407, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:10:23', '2021-04-21 08:10:23'),
	(884, 1, 1, 0, 'Seorang laki-laki usia 43 tahun sedang dirawat di ruang hemodialisa, Klien dengan fistula arteriovenosa di lengan kiri dan sedang menjalani hemodialisis berisiko mengalami infeksi. Apakah yang harus dirumuskan perawat sebagai tujuan hasil terbaik untuk masalah klien tersebut? \r\n', 408, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:12:21', '2021-04-21 08:12:21'),
	(885, 1, 1, 0, 'Seorang laki-laki usia 58 tahun dating ke poliklinik urologi. Mengeluh nyeri pada pinggang dan lemas. Perawata melakukan pemeriksaan fisik head to toe. Perawat sedang mempersiapkan untuk palpasi ginjal pasien. Bagaimanakah seharusnya perawat memposisikan pasien untuk penilaian tersebut?\r\n\r\n', 409, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:13:57', '2021-04-21 08:13:57'),
	(886, 1, 1, 0, 'Seorang pasien berusia 78 tahun dirawat di ruang penyakit dalam. Klien menderita peyakit ginjak kronik stage 3 dan diajari tentang diet rendah kalium. Apakah jenis makanan yang bisa dimakan pasien ?\r\n\r\n', 410, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:17:39', '2021-04-21 08:17:39'),
	(887, 1, 1, 0, 'Seorang laki-laki usia 40 tahun dirawat di ruang bedah. Mengeluh nyeri hebat dengan skala nyeri 8 (1-10). Klien juga mengeluh mual dan berkeringat dingin.  Pemeriksaan tekanan darah 140/90 mmHg, frekuensi nadi 87 x/menit, frekuensi napas 20x/menit dan suhu 37,6oC. Hasil pencitraan diagnostik teridentifikasi batu ginjal asam urat berukuran 2 mm. Apakah intervensi keperawatan prioritas untuk pasien tersebut?\r\n\r\n', 411, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:18:57', '2021-04-21 08:18:57'),
	(888, 1, 1, 0, 'Seorang laki-laki usia 45 tahun dating ke poliklinik urologi di diagnosa batu ginjal. Klien mengeluh nyeri, nyeri yang dialaminya sangat kuat, tajam, dan seperti gelombang yang menjalar ke skrotum. Selain itu, dia menjelaskan rasanya ingin buang air kecil tapi sedikit air seni yang keluar. Berdasarkan tanda dan gejala pasien, di manakah lokasi batu ginjal?\r\n\r\n', 412, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:20:51', '2021-04-21 08:20:51'),
	(889, 1, 1, 0, 'Seorang laki-laki berusia 30 tahun, dirawat diruang isolasi dengan keluhan sesak nafas, batuk berdahak. Tanda-tanda vital: TD=120/80 mmHg, N=110x/mnt, P=33x/mnt, S=38.70C, suara nafas Ronchi (+), konjungtiva tampak anemis, turgor kulit menurun. Diagnosa medis TBC positif. Apa diagnosa keperawatan prioritas yang tepat untuk kasus diatas?\r\n\r\n', 413, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:22:06', '2021-04-21 08:22:06'),
	(890, 1, 1, 0, 'Seorang laki-laki berusia 28 tahun, dirawat diruang penyakit dalam dengan keluahan diare yang sudah sebulan tidak sembuh meskpun sudah berobat ke dokter. Pekerjaannya adalah seorang bartender di sebuah club malam. Tanda-tanda vital: TD=120/80 mmHg, N=110x/mnt, P=28x/mnt, S=38.70C, konnung tiva tampak anemis, turgor kulit menurun. Diagnosa medis HIV positif. Apa penyebab diare yang tidak kunjung sembuh pada kasus tersebut?\r\n\r\n', 414, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:23:25', '2021-04-21 08:23:25'),
	(891, 1, 1, 0, 'Seorang pasien mengeluh sakit kepala yang hebat, berkeringat tengah malam, demam. TD=120/70 mmHg, N=98x/mn, S=39°C, P: 28 x / menit. Teraba ada benjolan di leher kiri pasien. Leukosit 15.000/ µL. Apa intervensi yang dilakukan untuk mengatasi masalah keperawatan yang muncul?\r\n\r\n', 415, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:25:06', '2021-04-21 08:25:06'),
	(892, 1, 1, 0, 'Seorang perempuan usia 21 tahun dirawat di rumah sakit karena keputihan yang tidak sembuh selama 3 bulan. Warna keputihan hijau kekuningan, bau busuk. Klien juga mengeluh nyeri pada daerah supra publis. TD=120/80mmHg, P=24x/menit, N=98x/mnt, S=38.50C. Dia didiagnosis HIV oleh dokter. Pasien mengatakan cemas dan takut akan penyakitnya terlebih 6 bulan lagi pasien akan menikah, dia sering melamun dan pandangannya kosong. Apa masalah keperawatan prioritas pada pasien tersebut?\r\n', 416, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:26:19', '2021-04-21 08:26:19'),
	(893, 1, 1, 0, 'Seorang wanita berusia 45 tahun mengalami perdarahan haid yang banyak selama	3 minggu. Klien mengeluh lemas, letih, lesu dan keringat dimalam hari. TD=90/70 mmHg, N=80 x/mnt, P=28x/mnt, S=37.50 C. Hasil laboratorium didapatkan Hb 10 g/dl. Apa intervensi yang dilakukan untuk mengatasi masalah keperawatan yang muncul?\r\n', 417, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:27:22', '2021-04-21 08:27:22'),
	(894, 1, 1, 0, 'Seorang perawat pelaksana di Ruang Penyakit Dalam mengambil beberapa sampel darah untuk keperluan diagnostic pada penyakit HIV/AIDS. Secara tidak sengaja jarinya tertusuk jarum bekas pakai dari pasien tersebut. Apakah tindakan yang harus segera dilakukan perawat tersebut ?\r\n', 418, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:28:35', '2021-04-21 08:28:35'),
	(895, 1, 1, 0, 'Seorang laki-laki berusia 35 tahun, dirawat diruang isolasi mengeluh malu dengan penyakit yang dideritanya karena akan menularkan ke orang lain. Pasien di Diagnosa TBC positif sejak 3 bulan yang lalu dan ada riwayat TB satu tahun yang lalu. Ketika dirumah pasien cenderung mengurung diri dikamar tidak mau bersosialiasasi. Apa intervensi yang tepat untuk kasus diatas?\r\n', 419, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:29:56', '2021-04-21 08:29:56'),
	(896, 1, 1, 0, 'Seorang perempuan dirawat di rumah sakit dengan batuk tidak sembuh selama 1 bulan, sesak nafas,  keringet dingin tengah malam, dan  berat badan turun 4 Kg dalam waktu 1 bulan. Diduga pasien terkena TBC. Apa pemeriksaan diagnostik yang harus dilakukan?\r\n\r\n', 420, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:30:55', '2021-04-21 08:30:55'),
	(897, 1, 1, 0, 'Seorang pasien berusia 35 tahun, mengeluh sesak nafas serta mati rasa kaki. TD: 135/85 mmHg, N=100x/mn, P= 30 x/mn, S=38.5 °C. Foto thorax ditemukan adanya efusi pleural serta suspect TB.  Leukosit:  20.000 / µL, LED 30 mm. Apa pengkajian fokus yang diperlukan berdasarkan kasus diatas?\r\n', 421, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:31:59', '2021-04-21 08:31:59'),
	(898, 1, 1, 0, 'Seorang laki-laki usia 35 tahun, dirawat di ruang Anggrek dengan keluhan pusing dan lemah. TD : 120/80 mmHg , N: 92 x / menit, suhu: 37.5° C, RR: 28 x / menit. Mukosa bibir kering kotor, terdapat bercak-bercak putih disertai adanya pus. Apa intervensi kolaborasi yang dilakukan untuk menghambat proses infeki?\r\n', 422, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:33:39', '2021-04-21 08:33:39'),
	(899, 1, 1, 0, 'Perawat berkunjung ke keluagra didapatkan seorang perempuan (30 tahun) menikah dan memiliki seorang anak laki-laki usia 4 tahun, tampak lemah, pucat dan bersandar di kursi. Dilakukan pemeriksaan tekanan darah dengan hasil 100/70 mmHg, Klien mengatakan tidak mau makan karena mual terus menerus, klien mengatakan tidak berKB.  \r\n\r\nApakah pengkajian selanjutanya yang harus dilakukan perawat ?\r\n', 423, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:43:16', '2021-04-21 08:43:16'),
	(900, 1, 1, 0, 'Saat kunjungan rumah didapatkan klien anak laki laki berusia 2 tahun. Terlihat kurus, dengan rambut merah dan kering. Hasil KMS status gizi berada di garis kuning. Ibu klien mengatakan anaknya sehat walupun susah makan dan selalu datang ke posyandu setiap bulannya.   \r\n\r\nApakah fungsi perawatan kesehatan yang harus dikaji ?\r\n', 424, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:45:37', '2021-04-21 08:45:37'),
	(901, 1, 1, 0, 'Perawat berkunjung ke keluarga didapatkan klien seorang laki-laki usia 65 tahun dengan kondisi terbaring di tepat tidur, terdapat luka dekubitus pada bokong. Keluarga mengatakan kondisi ini terjadi karena klien menderita stroke, dan selalu memandikan klien dan memberikan bedak pada lukanya\r\n\r\nApakah diagnosa pada kasus tersebut ?\r\n', 425, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:50:18', '2021-04-21 08:50:18'),
	(902, 1, 1, 0, 'Saat kunjungan rumah, didapatkan klien anak  berusia 2 tahun, klien lemas. Saat diwawancara, keluarga mengatakan klien BAB lebih dari 4 kali dan cair sudah 2 hari keluarga hanya memberikan air gula merah pada klien. Keluarga mengatakan itu hal yang biasa pada anak karena akan mendapatkan perkambangan yang baru \r\n\r\nApakah masalah keperawatan dalam kasus diatas ?\r\n', 426, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:52:46', '2021-04-21 08:52:46'),
	(903, 1, 1, 0, 'Saat melakukan kunjungan rumah pada keluarga, didapatkan klien seorang laki laki berusia 38 tahun, dinyatakan mengalami TB paru sejak 3 bulan lalu. Saat menayakan kepatuhan obat keluarga mengatakan klien sudah tidak minum obat karena sudah merasa sembuh. \r\n\r\nApakah intervensi yang sesuai untuk kasus di atas?\r\n', 427, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:54:55', '2021-04-21 08:54:55'),
	(904, 1, 1, 0, 'Saat melakukan pengkajian keperawatan keluarga perawat menemukan beberapa maslah kesehatan keluarga yaitu masalah hipertensi pada ibu, gizi kurang pada anak dan gastritris pada kepala keluarga. Perawat berdiskusi dengan keluarga man masalah yang akan diprioritaskan dalam asuhan keperawatan.\r\n\r\nPrinsip etik manakah yang dilakukan perawat?\r\n', 428, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:57:17', '2021-04-21 08:57:17'),
	(905, 1, 1, 0, 'Saat kunjungan rumah ditemukan seorang pria (57) yang hidup sendiri. Klien melaporkan sudah 20 tahun ditinggal istrinya.  Klien merasa kesepian dan sering melamun, pola makan klien tidak teratur dan sering dengan menu mie instan, klien mengeluh sering sakit pada bagian perutnya\r\n\r\nApakah faktor predisposisi masalah klien tersebut?\r\n', 429, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 08:59:30', '2021-04-21 08:59:30'),
	(906, 1, 1, 0, 'Saat perawat berkunjung didapatkan 2 keluarga dlam 1 rumah. Masing-masing dari mereka telah memiliki pasangan dan keturunan. Dua kelurga tersebut  menggunakan fasilitas rumah dengan saling bergantian mengatur keluarganya secara terpisah.\r\n\r\nApakah type keluarga tersebut ?\r\n', 430, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:01:47', '2021-04-21 09:01:47'),
	(907, 1, 1, 0, 'Perawat melakukan kunjungan rumah dan memberikan implementasi kepada klien dengan mengajarkan keluarga untuk latihan ROM aktif pasif. Pada kunjungan ke-3 pearawat melakukan evaluasi implementasi tersebut.\r\n\r\nApa bentuk evaluasi dari kasus di atas?\r\n', 431, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:05:08', '2021-04-21 09:05:08'),
	(908, 1, 1, 0, 'Pada saat melakukan kunjungan rumah pada keluarga dengan anak balita, dan memberikat vitamin A pada bayi 5 bulan di keluarga tersebut. Keluarga sering bertanya kondisi anaknya normal atau tidak. Perawat memberikan edukasi mengenai tumbuh kembang pada balita.\r\n\r\nApa implementasi yang dilakukan oleh perawat?\r\n', 432, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:07:48', '2021-04-21 09:07:48'),
	(909, 1, 1, 0, 'Perawat mengunjungi keluarga, didapatkan seorang laki-laki sebagai kepala keluarga berusia 62 tahun didiagnosis TB Paru dan tinggal bersam istrinya berusia 60 tahun. Hasil pemeriksaan, klien sedang menjalani pengobatan OAT selama 1 bulan, mengeluh mual apalagi setelah makan obat, BB 48 Kg, dan TB 164 cm.\r\n\r\nApakah tindakan yang tepat sesuai kasus tersebut?\r\n', 433, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:11:06', '2021-04-21 09:11:06'),
	(910, 1, 1, 0, 'Perawat mengunjungi keluarga, didapatkan seorang perempuan sebagai kepala kepala keluarga berusia 62 tahun, suaminya sudah meninggal 2 tahun yang lalu, dan tinggal bersama anaknya berusia 27 tahun dan 18 tahun. Ibu bekerja sebagai pedagang di pasar, penghasilannya bisa memenuhi kebutuhan rumah tangga dan dapat menyekolahkan anaknya hingga kuliah. Kedua anaknya mengatakan sangat menghormati dan manyayangi ibunya\r\n\r\nMasalah keperawatan yang tepat sesuai kasus tersebut?\r\n', 434, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:13:36', '2021-04-21 09:13:36'),
	(911, 1, 1, 0, '\r\nPerawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 25 tahun, tinggal bersama istri dan kedua anaknya. Pada saat pengkajian, istrinya menyatakan anak yang kedua pernah mengalami bronkhitis, suaminya masih merokok dan kadang-kadang di dalam rumah dan sudah dilarang tetapi sulit berhenti merokok.\r\n\r\nApakah kriteria evaluasi yang tepat sesuai kasus tersebut?\r\n', 435, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:15:59', '2021-04-21 09:15:59'),
	(912, 1, 1, 0, 'Perawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 21 tahun, tinggal bersama istri dan anaknya laki-laki yang berusia 12 bulan. Hasil pemeriksaan: BB lahir 2000 gr, BB saat dikaji 5,5 Kg, panjang badan 70 cm. Ibunya mengatakan anaknya sudah diberikan makanan tambahan, susah makan dan sehari hanya 4 sendok.\r\n\r\nApakah masalah keperawatan yang tepat sesuai kasus tersebut?\r\n', 436, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:18:22', '2021-04-21 09:18:22'),
	(913, 1, 1, 0, 'Perawat mengunjungi keluarga, didapat seorang perempuan sebagai kepala keluarga berusia 53 tahun dan tinggal sendirian. Hasil pemeriksaan: TD 180/90 mmHg, frekuensi napas 20 x/mnt, frekuensi nadi 85 x/mnt, BB 66 Kg dan TB 155 cm. Klien menyataan sering nyeri dan pegal pada tengkuk.\r\n\r\nApakah masalah keperawatan pada kasus tersebut?\r\n\r\n', 437, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:20:50', '2021-04-21 09:20:50'),
	(914, 1, 1, 0, 'Seorang perempuan berusia 19 tahun dirawat di ruang bedah dengan diagnosa medis post laparatomi eksplorasi, pasien mendapatkan NaCl 500cc/24 jam, dengan faktor tetesan makrodrip. \r\nBerapa tetes permenit agar cairan habis dalam waktu 24 jam ?', 438, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:22:45', '2021-04-21 09:22:45'),
	(915, 1, 1, 0, 'Perawat mengunjungi keluarga, didapatkan seorang laki-laki sebagai kepala keluarga berusia 62 tahun didiagnosis TB Paru dan tinggal bersam istrinya berusia 60 tahun. Hasil pemeriksaan, klien sedang menjalani pengobatan OAT selama 1 bulan, mengeluh mual apalagi setelah makan obat, BB 48 Kg, dan TB 164 cm.\r\n\r\nApakah masalah keperawatan sesuai kasus tersebut?\r\n\r\n', 439, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:23:09', '2021-04-21 09:23:09'),
	(916, 1, 1, 0, 'Seorang perempuan berusia 18 tahun dirawat dengan diare. Pasien megatakan BAB dialami hingga 8 kali sehari sejak 2 hari yang lalu. Observasi tanda-tanda vital : tekanan darah 90/60 mmHg, frekuensi nadi 104 kali/menit, frekuensi pernafasan 26 kali/menit. Perawat melakukan pengkajian untuk mengidentifikasi gejala dehidrasi.\r\nPengkajian apakah yang dimaksud?', 440, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:24:05', '2021-04-21 09:24:05'),
	(917, 1, 1, 0, 'Seorang laki-laki berusia 35 tahun dirawat dengan diare lebih dari 2 minggu disertai demam naik turun. Pasien mengatakan selama sebulan mengalami penurunan berat badan 7 kg. IMT pasien saat ini = 17. Berat badan kurang\r\nApakah kriteria IMT pasien diatas ?', 441, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:25:28', '2021-04-21 09:25:28'),
	(918, 1, 1, 0, 'Perawat mengunjungi keluarga, didapatkan seorang perempuan sebagai kepala kepala keluarga berusia 62 tahun, suaminya sudah meninggal 2 tahun yang lalu, dan tinggal bersama anaknya berusia 27 tahun dan 18 tahun. Ibu bekerja sebagai pedagang di pasar, penghasilannya bisa memenuhi kebutuhan rumah tangga dan dapat menyekolahkan anaknya hingga kuliah. Kedua anaknya mengatakan sangat menghormati dan manyayangi ibunya.\r\n\r\nApakah data pengkajian yang sesuai dengan kasus tersebut?\r\n\r\n', 442, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:26:16', '2021-04-21 09:26:16'),
	(919, 1, 1, 0, 'Seorang laki-laki berusia 48 tahun dirawat di ruang penyakit dalam mengeluh lemas dikarenakan buang besar 15x perhari dengan konsistensi encer, terdapat lendir dan darah. Pemeriksaan fisik didapatkan data tekanan darah 90/50 mmHg, suhu 38,3 C, dan balance cairan 600cc per jam kerja. Perawat melakukan tindakan kolaboratif rehidrasi NaCl 20 ttm dan memberikan oralit. Buang air besar berkurang\r\nApakah kriteria hasil evaluasi dari tindakan kolaboratif tersebut ?', 443, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:27:14', '2021-04-21 09:27:14'),
	(920, 1, 1, 0, 'Seorang perempuan berusia 56 tahun akan dilakukan pemasangan NGT untuk memenuhi kebutuhan nutrisinya. Pada saat dilakukan pemasangan selang sampai ke batas pengukuran, selang bisa dimasukkan dengan mudah ke lambung.\r\nLangkah selanjutnya yang harus dilakukan perawat ?', 444, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:28:06', '2021-04-21 09:28:06'),
	(921, 1, 1, 0, 'Perawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 25 tahun, tinggal bersama istri dan kedua anaknya. Pada saat pengkajian, istrinya menyatakan anak yang kedua pernah mengalami bronkhitis, suaminya masih merokok dan kadang-kadang di dalam rumah dan sudah dilarang tetapi sulit berhenti merokok.\r\n\r\nApakah masalah keperawatan yang muncul sesuai kasus tersebut?\r\n\r\n', 445, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:28:45', '2021-04-21 09:28:45'),
	(922, 1, 1, 0, 'Seorang perawat melakukan pemeriksaan abdomen pada pasien yang dicurgai ascites. \r\nPemeriksaan tersebut merupakan ?', 446, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:29:08', '2021-04-21 09:29:08'),
	(923, 1, 1, 0, 'Seorang perempuan berusia 48 tahun dirawat di ruang bedah dengan diagnosa kanker kolon post kolostomi hari ke-1. Hasil pengkajian ditemukan belum ada produksi feces pada stoma. \r\nApakah tindakan perawat selanutnya ?', 447, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:30:13', '2021-04-21 09:30:13'),
	(924, 1, 1, 0, 'Perawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 21 tahun, tinggal bersama istri dan anaknya laki-laki yang berusia 12 bulan. Hasil pemeriksaan: BB lahir 2000 gr, BB saat dikaji 5,5 Kg, panjang badan 70 cm. Ibunya mengatakan anaknya sudah diberikan makanan tambahan, susah makan dan sehari hanya 4 sendok.\r\n\r\nApakah tindakan yang sesuai untuk kasus tersebut?\r\n', 448, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:31:26', '2021-04-21 09:31:26'),
	(925, 1, 1, 0, 'Seorang perempuan berusia 40 tahun dirawat di ruang bedah hari ke-5 didiagnosa ulkus diabetikum pada ekstremitas bawah kanan. Hasil pemeriksaan diameter luka 3 cm dengan kedalaman 0,5 cm sudah agak mengering. Kassa penutup luka sudah dibuka. \r\nApakah tindakan keperawatan selanjutnya pada kasus tersebut ?', 449, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:31:57', '2021-04-21 09:31:57'),
	(926, 1, 1, 0, 'Seorang perempuan berusia 23 tahun dirawat di ruang bedah didiagnosa tumor intestinal. Hasil pengkajian pasien menegeluh mual, nafsu makan menurun IMT 9,3 dari hasil pemeriksaan fisik pada abdomen terdapat ileustomi dengan kondisi kemerahan dan kantung yang penuh.                       \r\nApakah masalah keperawatan utama pada pasien tersebut ?', 450, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:33:59', '2021-04-21 09:33:59'),
	(927, 1, 1, 0, 'Perawat mengunjungi keluarga, didapat seorang perempuan sebagai kepala keluarga berusia 53 tahun dan tinggal sendirian. Hasil pemeriksaan: TD 180/90 mmHg, frekuensi napas 20 x/mnt, frekuensi nadi 85 x/mnt, BB 66 Kg dan TB 155 cm. Klien menyataan sering nyeri kepala dan pegal pada tengkuk dan tidak tahu secara jelas tentang hipertensi.\r\n\r\nApakah rencana tindakan yang tepat untuk kasus tersebut?\r\n\r\n', 451, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:34:15', '2021-04-21 09:34:15'),
	(928, 1, 1, 0, 'Sebelum melakukan pemeriksaan elektrokardiokram (EKG), perawat bertugas untuk menjelaskan prosedur tindakan yang akan dilakukan, kemudian perawat memberikan kebebasan bagi pasien untuk mau atau tidak dialkukan tindakan tersebut. \r\nApakah prinsip moral yang digunakan dalam proses keperawatan di atas?', 452, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:34:59', '2021-04-21 09:34:59'),
	(929, 1, 1, 0, 'Ny. Aumur 47 th mengalami kecelakaan lalu lintas (KLL) sejak 2 bulan yang lalu. Saat menyeberang jalan seorang pendendara sepeda motor melaju dengan kecepatan tinggi dan menabrak pasien. Sadar saat kejadian. Nyeri (+), ekimosis (+) didaerah femur kanan. Vulnus laseratum di regio dorsalis pedis dextra, knee dextra. Oleh keluarganya pasien di bawa ke dukun patah tulang. Hingga 2 bulan tidak ada perbaikan, pasien dan keluarga memutuskan untuk di rawat di rumah sakit. Pemeriksaan vital signs didapatkan TD 120/80 mmHg, Nadi76 x/mnt, pernapasan16 x/mnt, suhu 37°C.\r\nPengkajian lanjutan yang harus dilakukan perawat adalah …. ', 453, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:36:13', '2021-04-21 09:36:13'),
	(930, 1, 1, 0, 'Tn A Umur 40 tahun dirawat di ruang Orthopedi mengalami Mal Union Fractur Shaft Femur Dextra. Dilakukan operasi untuk release otot vastus (medialis, intermedius, lateral), dilanjutkan dengan insersi Kirschner Wire (K-Wire) dan sceletal traction pada tulang femur dextra bagian suprakondiler, namun saat diberikan beban 10 kg pasien merasa kesakitan skala nyeri 6 rentang (0 -10) tanda-tanda vital TD 120/70 mmHg, N 80 x/menit, RR 20 x/menit.\r\nTindakan yang tepat untuk mengatasi masalah pada Tn A', 454, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:37:28', '2021-04-21 09:37:28'),
	(931, 1, 1, 0, 'Seorang laki-laki usia 39tahun dirawat di RS hari ke 17 post operasi rekonstruski plat/pin tibia dextra, saat dikaji pasien mengatakan masih mengalami nyeri ringan dan sudah diperbolehkan Latihan berjalan dengan menggunakan kruk. Saat ini perawat sedang melatih pasien menggunakan kruk yang baik dan benar. \r\nBagaimana posisi kaki pasien yang sakit saat berjalan dengan menggunakan kruk?', 455, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:38:42', '2021-04-21 09:38:42'),
	(932, 1, 1, 0, 'Seorang laki-laki berusia 40 tahun dirawat di ruang ortopedi. Pasien mengeluh sulit menggerakkan tungkai kanannya setelah mengalami kecelakaan pada saat bekerja. Pada pemeriksaan kekuatan otot sendi terdapat keterbatasan gerak dan pada saat diminta tungkainya digerakkan pasien tidak dapat mengangkatnya atau tidak bisa menahan gravitasi.\r\nBerapa nilai kekuatan otot pasien tersebut?', 456, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:39:42', '2021-04-21 09:39:42'),
	(933, 1, 1, 0, 'Seorang laki-laki berusia 40 tahun dirawat di ruang ortopedi. Pasien mengeluh sulit menggerakkan tungkai kanannya setelah mengalami kecelakaan pada saat bekerja. Pada pemeriksaan kekuatan otot sendi terdapat keterbatasan gerak dan pada saat diminta tungkainya digerakkan pasien bisa mengangkat tapi Ketika diberi tahanan dari pemeriksa langsung terjatuh.\r\nBerapa nilai kekuatan otot pasien tersebut?', 457, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:40:23', '2021-04-21 09:40:23'),
	(934, 1, 1, 0, 'Ny. Y usia 67 tahun, dirawat di RS karena mengalami DM type II, terdapat ulkus pada ibu jari kaki dextra, pasien sudah menderita DM selama 7 tahun dan tidak rutin control, keluarga mengatakan klien makan melebihi ketentuan diet dan malas olah raga\r\nApakah indicator utama keberhasilan perawatan pada kasus di atas ?', 458, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:41:38', '2021-04-21 09:41:38'),
	(935, 1, 1, 0, 'Ny A dengan usia 58 th memiliki riwayat DM tipe 2 sejak 5 th yang lalu, saat dikaji klien mengeluh mempunyai luka di kaki, ada riwayat polidipsi, polipaghi, poliuri yang. Hari ini hasil GD sewaktu 75 mg/dl, klien mengeluh keluar keringat dingin, kepala pusing. Klien mendapat therapy insulin 10-10-10 makan 1 porsi tidak habis.\r\nDefinisi DM type 2 adalah….', 459, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:42:53', '2021-04-21 09:42:53'),
	(936, 1, 1, 0, 'Ny A dengan usia 58 th memiliki riwayat DM tipe 2 sejak 5 th yang lalu, saat dikaji klien mengeluh mempunyai luka di kaki, ada riwayat polidipsi, polipaghi, poliuri yang. Hari ini hasil GD sewaktu 75 mg/dl, klien mengeluh keluar keringat dingin, kepala pusing. Klien mendapat therapy insulin 10-10-10 makan 1 porsi tidak habis. \r\nPenyebab utama Luka (ulkus diabetik) yang terjadi pada Ny. A adalah...', 460, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:43:55', '2021-04-21 09:43:55'),
	(937, 1, 1, 0, 'Ny A dengan usia 58 th memiliki riwayat DM tipe 2 sejak 5 th yang lalu, saat dikaji klien mengeluh mempunyai luka di kaki, ada riwayat polidipsi, polipaghi, poliuri yang. Hari ini hasil GD sewaktu 75 mg/dl, klien mengeluh keluar keringat dingin, kepala pusing. Klien mendapat therapy insulin 10-10-10 makan 1 porsi tidak habis.\r\nKomplikasi kronik yang mungkin tidak dapat ditemukan pada Ny. A sesuai hasil pengkajian diatas adalah...', 461, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:45:09', '2021-04-21 09:45:09'),
	(938, 1, 1, 0, 'Tn. M, usia 70 tahun dirawat di RS dengan keluhan lemas, pusing disertai sering kencing dan haus. Hasil pemeriksaan fisik didapatkan kesdaran letargi, badan tampak kurus, kulit pruritus. TD 100/60 mmhg, HR 72x/mnt, RR 18x/mnt dan suhun 36,7oC.\r\nManakah data spesifik yang menunjukkan pasien kemungkinan mengalami DM?', 462, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 09:46:13', '2021-04-21 09:46:13'),
	(939, 1, 1, 0, 'Seorang laki-laki berusia 30 tahun dibawa ke RSJ. Hasil pengkajian didapatkan bahwa pasien sering menyalahkan diri sendiri dan berpikiran negatif tentang dirinya.  Riwayat pasien waktu kecil sering dibandingkan dengan kakaknya oleh orang tuanya, tidak lulus ujian sekolah SMP, sering tidak percaya diri dan terakhir seminggu lalu di PHK dari tempat kerjanya. \r\nManakah dari data di atas yang menunjukkan faktor presipitasi?\r\n', 463, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:26:49', '2021-04-21 22:26:49'),
	(940, 1, 1, 0, 'Perawat perempuan berusia 25 tahun,sedang melakukan asuhan kepada pasien kanker Rahim. Pada saat itu, tampak pasien menangis dan mengatakan “Kenapa ini terjadi pada saya?”Padahal kalau saya rajin melakukan kebersihan diri pada area reproduksi saya tidak mungkin jadi seperti ini”.\r\n\r\nApakah fase kehilangan pada pasien tersebut\r\n', 464, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:27:45', '2021-04-21 22:27:45'),
	(941, 1, 1, 0, 'Seorang perempuan berusia 25 tahun dirawat di RSJ. Ketika dikaji pasien tampak senyum sendiri, pandangan mata tajam, hidung terlihat mengendus-endus ,  menggaruk – garuk tangan, dan sering meludah. \r\n\r\nManakah data yang menujukkan gejala halusinasi penciuman?\r\n', 465, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:28:28', '2021-04-21 22:28:28'),
	(942, 1, 1, 0, 'Seorang laki-laki  berusia 35 tahun dirawat di RSJ karena sering sendirian dan berbicara sendiri. Saat dikaji ia masih takut berinteraksi dengan orang lain dan mengatakan bahwa dirinya kadang mendengar suara mantan kekasihnya  sudah lama meninggal. Setelah mendapatkan intervensi pasien sudah mau keluar kamar dan mulai bergabung dengan yang lain. \r\n\r\nApakah tindakan keperawatan selanjutnya yang tepat untuk pasien tersebut?\r\n', 466, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:29:08', '2021-04-21 22:29:08'),
	(943, 1, 1, 0, 'Mahasiswa sedang melakukan praktek di RSJ dan melakukan pengkajian pada pasien. Ditemukan data : lapang persepsi luas, indera tajam, motivasi meningkat, problem solving efektif, mudah tersinggung, pembelajaran meningkat,  Kelelahan, susah tidur, hipersensitif \r\n\r\nApakah masalah psikososial yang dialami oleh pasien?\r\n', 467, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:29:52', '2021-04-21 22:29:52'),
	(944, 1, 1, 0, ' Seorang perempuan usia 39 tahun dirawat di ruang akut RS jiwa sudah 2 hari. Hasil observasi perawat : pasien  boalk-balik ke kamar mandi untuk mencuci muka berialng ulang, saat dilakukan komunikasi teurapeutik pasien sering mengualng ulang pembicaraan.\r\nApakah  proses pikir yang terjadi pada pasien?', 468, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:31:32', '2021-04-21 22:31:32'),
	(945, 1, 1, 0, 'Seorang perempuan usia 39 tahun dirawat di ruang akut RS jiwa sudah 2 hari. Hasil observasi perawat : pasien  boalk-balik ke kamar mandi untuk mencuci muka berialng ulang, saat dilakukan komunikasi teurapeutik pasien sering mengualng ulang pembicaraan. Apakah  aktivitas motoric pada kasus diatas?', 469, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:32:15', '2021-04-21 22:32:15'),
	(946, 1, 1, 0, 'Seorang perempuan usia 26 tahun di rawat di rumah sakit jiwa. Pasien selalu menyendiri dan lebih sering tertidur dengan posisis janin, menolak  makan dan minum berdekatan dengan temanya dan tercium bau pesing di badan pasien \r\nApakah prioritas intervensi yang dilakukan oleh perawat?', 470, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:32:55', '2021-04-21 22:32:55'),
	(947, 1, 1, 0, 'Seoarang laki-laki usia 47 tahun dirawatt di rumah sakit jiwa. Pasien tidak mau keluar kamar karena merasa takut. Hasil pengkajian pasien mengatakan  berualng kali bahwa dirinya sudanh mati pada saat etrjadi tsunami acaeh. Apakah hasil pengkajian perawat pada kasus diatas?', 471, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:33:33', '2021-04-21 22:33:33'),
	(948, 1, 1, 0, ' Laki-laki usia 28 tahun dirawat di 5 hari di RSJ. Pasien sudah mulai kooperatif dan mampu melakukan terapi aktivitas kelompok. Sebelum melakukan terapi aktivitas perawat membagikan masker dan meminta semua anggota kelompok untuk menggunakan maskee serta mengatur jarak. Apakah aspek legal etis yang dilakukan oleh perawat', 472, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:34:15', '2021-04-21 22:34:15'),
	(949, 1, 1, 0, 'laki-laki usia 40 tahun dirawat di rumah sakit jiwa.  Hasil pengkajian  klien tidak mampu mempertahankan kontak mata,  tidak mampu memulai pembicaraan , wajah terlihat sedih, selalu menghindar jika di dekati pasien lain, badan tercium bau pesing, rambut acak-acakan. Apakah kriteria evaluasi prioritas pada kasus diatas?', 473, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:35:30', '2021-04-21 22:35:30'),
	(950, 1, 1, 0, '\r\nPerawat telah mengajarkan cara menghardik untuk mengontrol halusinasi  keapada pasien dengan cara tutup telinga bapak, yakin di dalam hati bahwa suara itu tidak nyata dan mengatakan ” bohong...dengan tekanan sura menghentak untuk memutus halusinasi  pada pertemuan sebelumnya. \r\n\r\n  Apakah kriteria evalusi pada kasus diatas?\r\n', 474, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:36:14', '2021-04-21 22:36:14'),
	(951, 1, 1, 0, '  Laki- laki usia 35 tahun dirawat di ruang tenang Rs Jiwa menunjukkan respon yang baik  mampu mampu berkomunikasi dengan klien yang lain. walaupun terkadang masih menganggap dirinya mendapatkan wahyu dari yang maha kuasa.  \r\nApakah terapi aktivitas yang tepat pada kasus tersebut?', 475, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:36:55', '2021-04-21 22:36:55'),
	(952, 1, 1, 0, 'Seorang perempuan usia 19 tahun  di rawat di RS Jiwa, mondar-mandir dan  tekana suara keras dan pandangan masih tajam mata tajam. Hasil pengkajian pasien merasa kesal karena tadi pagi makanannya diambil oleh teman sekamarnya, perawat mengajarkan klien kembali dengan latihan fisik 2 untuk mengontrol rasa marah\r\n\r\n    Apakah implemetasi yang perawat lakukan?\r\n', 476, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:37:36', '2021-04-21 22:37:36'),
	(953, 1, 1, 0, 'Seorang perempuan berusia 22 tahun di rawat di RSJ, pada saat dikaji penampilan kotor, pasien menggeleng kepala saat ditanya sudah mandi atau belum, rambut kotor dan acak-acakan, badan  bau, kuku kotor dan tercium bau pesing dikamar pasien. Apakah prioritas intervensi yang perawat lakukan?', 477, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:41:02', '2021-04-21 22:41:02'),
	(954, 1, 1, 0, 'Seorang perempuan berusia 27 tahun di RSJ sedang melakukan komunikasi dengan perawat, kontak mata sulit dipertahankan, klien tidak mampu memulai pembicaraan dan hanya menjawab pertanyaan “ya atau tidak”. Saat berlangsung tiba-tiba klien meninggalkan perawat begitu saja. \r\n\r\nApa tindakan selanjutnya yang harus dilakukan perawat..\r\n', 478, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:41:38', '2021-04-21 22:41:38'),
	(955, 1, 1, 0, 'Seorang perempuan berusia 31 tahun didignosa kanker mamae, dokter menyampaikan untuk segera melakukan tindakan pengangkatan. Hasil observasi klien terlihat gelisah, nafas tidak teratur dan wajah pucat. \r\n\r\nTindakan yang harus dilakukan oleh perawat adalah..\r\n', 479, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:42:19', '2021-04-21 22:42:19'),
	(956, 1, 1, 0, 'Seorang laki-laki berusia 29 tahun berada di ruang tenang RSJ. Saat interaksi perawat dan klien sudah siap dengan duduk berhadapan kemudian perawat mengingat kembalinya. Perawat membuka dengan menanyakan kabar, perasaan hari ini dan bagaimana dengan tidurnya semalam.\r\n \r\nManakah pertanyaan selanjutnya yang tepat pada fase orientasi.	\r\n', 480, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:42:58', '2021-04-21 22:42:58'),
	(957, 1, 1, 0, 'Seorang laki-laki berusia 25 tahun berada di ruang rawat dengan kondisi luka bakar daerah muka. Saat dikaji klien mengatakan saya belum menikah, apakah orang lain akan takut melihat saya. Ekspresi wajah sedih, intonasi suara pelan. \r\n\r\nApakah pengkajian lanjutan yang harus dilakukan..\r\n', 481, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:43:38', '2021-04-21 22:43:38'),
	(958, 1, 1, 0, 'Seorang perempuan berusia 27 tahun dirawat di RSJ. Klien berlatih cara mengontrol halusinasi dengan cara menghardik. Perawat: “Coba ulangi lagi apa yang sudah kita lakukan tadi..” \r\n\r\nApakah tahapan fase Strategi pelaksanaan yang dilakukan perawat ? \r\n', 482, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 22:44:24', '2021-04-21 22:44:24'),
	(959, 1, 1, 0, 'Seorang anak perempuan usia 8 tahun datang ke poliklinik anak dengan keluhan demam sejak 5 hari yang lalu. Hasil pengkajian: tampak lemah, ptekie diekstremitas atas tangan sebelah kanan, perdarahan gusi dan stomatitis pada lidah, akral dingin, warna kuku sianosis, TD :120/80mmhg, Nadi : 60X/mnt, RR : 21x/mnt, suhu : 36.7?c dan trombosit 32 (10^3/uL)\r\nApakah Intervensi prioritas pada kasus?', 484, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 23:38:37', '2021-04-21 23:44:48'),
	(960, 1, 1, 0, 'Seorang anak laki-laki berusia 5 tahun dibawa  ke UGD  dengan keluhan panas selama 4 hari dan keluar darah dari hidungnya.  Hasil pengkajian: nadi lemah < 20 mmHg, TD menurun , kulit dingin dan lembab serta tampak gelisah.  \r\nApakah data penunjang yang diperlukan pada kasus ?', 484, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 23:47:48', '2021-04-21 23:47:48'),
	(961, 1, 1, 0, 'Seorang anak laki-laki usia 7 tahun dirawat dibawa ke poliklinik dengan keluhan nyeri pada ulu hati saat dilakukan pemeriksaan palpasi pada abdomen, hasil pemeriksaan laboratorium di dapatkan penurunan trombosit 69 (10^3/uL). dan hematocrit 38,7%. \r\nApakah tindakan keperawatan prioritas pada kasus?', 485, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 23:52:22', '2021-04-21 23:52:22'),
	(962, 1, 1, 0, 'Seorang anak laki-laki berusia 9 tahun dibawa ke UGD di laporkan sebagai korban kebakaran di pasar. Hasil pengkajian didapatkan klien menjerit-jerit kesakitan, tampak luka bakar dengan kulit melepuh, sakit dan kemerahan, area kulit basah dan berwarna merah muda. \r\nApakah masalah keperawatan utama  pada kasus?', 486, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-21 23:58:20', '2021-04-21 23:58:20'),
	(963, 1, 1, 0, 'Seorang anak laki-laki berusia 7 tahun dibawa ke UGD dilaporkan sebagai korban kebakaran di sebuah pasar. Hasil pengkajian didapatkan Permukaan kulit terlihat kering, terlihat putih mengkilat seperti wax, kasar, kecokelatan, atau hangus, tampak tanda dehidrasi berat. \r\nApakah Intervensi prioritas yang dapat diberikan pada kasus?', 487, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:00:48', '2021-04-22 00:00:48'),
	(964, 1, 1, 0, 'Seorang balita perempuan sedang dirawat di ruang anak, hasil pengkajian didapatkan merasakan nyeri setiap kali duduk, skala nyeri 5 dan terasa sesak setiap turun dari tempat tidur. Bermain dilakukan di tempat tidur. \r\nApakah masalah keperawatan utama pada kasus ? ', 488, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:02:23', '2021-04-22 00:02:23'),
	(965, 1, 1, 0, 'Seorang anak perempuan, berusia 6 tahun dengan diagnosa medis ALL, hasil managemen cairan didapatkan membutuhkan cairan NaCl 60 cc/jam, terpasang infus makrodrip. \r\nBerapakah jumlah tetesan infus per menit? ', 489, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:04:15', '2021-04-22 00:04:15'),
	(966, 1, 1, 0, 'Seorang anak laki-laki berusia 11 tahun dirawat di ruang rawat anak, hasil pengkajian didapatkan IMT  -3 SD, nafsu makan menurun, Hb 10 gr/dl, lemah, porsi makan tidak habis\r\nApakah outcome jangka panjang yang dihasilkan dari intervensi keperawatan untuk mengatasi masalah nutrisi?  ', 490, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:06:30', '2021-04-22 00:06:30'),
	(967, 1, 1, 0, 'Seorang anak laki-laki, berusia 3 tahun, saat diberikan transfusi darah, suhu tubuh meningkat, tampak kemerahan pada kulit pasien. Pasien tampak lemah. Hal ini membuat orang tua marah, karena tidak ada penjelasan mengapa kondisi anaknya seperti itu\r\nApakah pelanggaran Etika pada kasus tersebut?  ', 491, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:08:45', '2021-04-22 00:08:45'),
	(968, 1, 1, 0, 'Seorang anak perempuan , berusia  8 tahun , telah menjalani kemoterapi, hasil pengkajian didapatkan  tampak bibir pecah dan area mulut stomatitis, nafsu makan menurun, klien tampak lemah. Didapatkan hasil Lab trombosit 105.000 sel/mm3, Hb 9,8 gr/dl\r\nApakah tindakan keperawatan prioritas untuk mengatasi masalah tersebut ', 492, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:10:44', '2021-04-22 00:10:44'),
	(969, 1, 1, 0, 'Perawat Nayla melakukan pendekatan MTBS untuk Anak Dina yang berusia 3 tahun 4 bulan, menderita batuk selama 1 minggu dan RR : 30x/menit. TIdak ada tanda-tanda Pneumonia berat. \r\nApakah tindakan  yang harus dilakukan oleh Perawat Nayla?', 493, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:13:36', '2021-04-22 00:13:36'),
	(970, 1, 1, 0, 'Seorang laki-laki usia 18 tahun, jatuh dari pohon kelapa, datang ke RS dengan frekuensi nafas cepat dan dangkal, klien mengeluh sakit pada daerah dada. Di daerah dada terlihat jejas luka, gerakan dada tampak asimetris (kebalikan dari dinding dada saat inspirasi atau ekspirasi). Nadi : 100 kali.  \r\nPertanyaan \r\nApakah diagnose medis yang tepat untuk pasien tersebut?\r\n', 494, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:19:33', '2021-04-22 00:19:33'),
	(971, 1, 1, 0, 'Seorang laki-laki berusia 18 tahun, jatuh dari pohon kelapa, datang ke RS dengan frekuensi nafas cepat dan dangkal, klien mengeluh sakit pada daerah dada. Di daerah dada terlihat jejas luka, gerakan dada tampak asimetris (kebalikan dari dinding dada saat inspirasi atau ekspirasi). Nadi : 100 kali. \r\nPertanyaan \r\nApakah masalah keperawatan prioritas pada kasus tersebut?\r\n', 495, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:21:42', '2021-04-22 00:21:42'),
	(972, 1, 1, 0, 'Seorang laki-laki berusia 20 tahun datang dibawa oleh keluarganya ke IGD dikarenakan mengalami luka tusuk benda tajam di daerah mediastinum, wajah pasien tampak pucat.\r\nPertanyaan \r\nBerikut ini adalah manifestasi klinis yang harus ditemukan oleh perawat :\r\n', 496, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:23:19', '2021-04-22 00:23:19'),
	(973, 1, 1, 0, 'Seorang laki-laki usia 22 tahun datang dibawa oleh keluarganya ke IGD dikarenakan mengalami luka tusuk benda tajam di daerah mediastinum, wajah pucat.\r\nPertanyaan \r\nBerikut adalah pemeriksaan diagnostic yang harus dilakukan pada klien :\r\n', 497, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:24:52', '2021-04-22 00:24:52'),
	(974, 1, 1, 0, 'Adanya penurunan resistensi pembuluh darah yang dapat menyebabkan terjadinya vasodilatasi pembuluh darah sehingga terjadi gangguan perfusi. \r\nPertanyaan \r\nApa yang sedang terjadi pada pasien tersebut?\r\n', 498, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:26:13', '2021-04-22 00:26:13'),
	(975, 1, 1, 0, 'Kasus (Vignette)\r\nSeorang laki-laki datang ke IGD dengan luka tusukan di bagian perutnya. Klien mengalami\r\npendarahan dan penurunan kesadaran. Pengkajian tanda-tanda vital didapatkan TD 90/70 mmHg, nadi 55x/menit, dan pernapasan 20x/menit. Akral dingin dan pucat, pengisian kapiler > 3 detik\r\n\r\nPertanyaan soal\r\nApakah masalah keperawatan utama pada kasus diatas?\r\n', 499, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:27:27', '2021-04-22 00:27:27'),
	(976, 1, 1, 0, 'Kasus (Vignette)\r\nSeorang pasien lakilaki berusia 17 tahun, korban perkelahian disekolah, diantar keunit gawat darurat dengan luka tusuk di abdomen. Pasien mengerang kesakitan, perdarahan masif disekitar pisau yang menancap. Pasien direncanakan akan segera dilakukan pembedahan. \r\n\r\nPertanyaan soal\r\nApakah tindakan yang harus dilakukan pada paien tersebut ?\r\n', 500, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:28:47', '2021-04-22 00:28:47'),
	(977, 1, 1, 0, 'Kasus (Vignette)\r\nAn. V, 7 tahun dibawa ke UGD rumah sakit karena mengalami asthma bronchial dengan pernafasan cepat dan terdengar wheezing. Kemudian diprogramkan untuk pemberian epinephrine.\r\n\r\nPertanyaan soal\r\nPemberian epinephrine bertujuan untuk\r\n', 501, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:30:01', '2021-04-22 00:30:01'),
	(978, 1, 1, 0, 'Kasus (Vignette)\r\nSaat dilakukan pemeriksaan pasien terlihat tidur namun membuka mata saat diberi rangsangan dengan suara keras, melakukan gerak menarik dari sumber rangsang dan suaranya tidak mengandung arti.\r\n\r\n\r\nPertanyaan soal\r\nPenulisan GCS yang benar dari data diatas adalah\r\n', 502, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:31:22', '2021-04-22 00:31:22'),
	(979, 1, 1, 0, 'Kasus (Vignette)\r\nHasil pemeriksaan Analisa Gas Darah (AGD) pasien trauma dada dengan WSD terpasang, menunjukan pH: 7,11 (N: 7,35-7,45) , pCO2 55 (N : 45-35), HCO3: 21 (N: 22-26), dan pO2: 62 (N : 80-100). \r\n\r\n\r\nPertanyaan soal\r\nInterprestasi hasil AGD tersebut adalah\r\n', 503, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:33:06', '2021-04-22 00:33:06'),
	(980, 1, 1, 0, 'Kasus (Vignette)\r\nSeorang perempuan  berusia 35 tahun diantar keluarganya ke UGD dengan kondisi penurunan kesadaran dialami sejak 15 menit yang lalu. Keluarga mengatakan pasien memiliki riwayat stroke. Hasil anamnesis, terdengar suara nafas snoring dan gelisah. Pemeriksaan tekanan darah 150/100 mmHg, frekuensi pernafasan 28 x/mt, frekuensi nadi 120 x/mt, dan suhu 37,9 C. Ners yang sdg shift melakukan head tilt chin lift. \r\n\r\nPertanyaan soal\r\nApakah tindakan selanjutnya\r\n', 504, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:34:45', '2021-04-22 00:34:45'),
	(981, 1, 1, 0, 'Kasus (Vignette)\r\nSeorang laki-laki berusia 45 tahun datang ke UGD dengan kondisi penurunan kesadaran akibat KLL 20 menit yang lalu. Nampak cedera pada kepala, terdengar bunyi gurgling, perdarahan pada telapak tangan. Pemeriksaan tekanan darah 110/60 mmHg, frekuensi pernafasan 14 x/mt, frekuensi nadi 100 x/mt, dan suhu 37,9. \r\n\r\nPertanyaan soal\r\nApakah masalah keperawatan prioritas\r\n', 505, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:36:08', '2021-04-22 00:36:08'),
	(982, 1, 1, 0, 'Kasus (Vignette)\r\nSeorang perawat bekerja pada suatu shift berjalan ke ruang rawat klien dan menemukan klien tidak sadarkan diri. Klien tidak bernafas, tidak teraba nadi, perawat dengan segera memanggil bantuan. \r\n\r\nPertanyaan soal\r\nApakah tindakan selanjutnya yang seharusnya dilakukan perawat\r\n', 506, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:37:04', '2021-04-22 00:37:04'),
	(983, 1, 1, 0, 'Perawat Farhan akan melakukan imunisasi kepada Bayi Aima yang berusia 3 bulan.\r\nApakah jenis imunisasi yang harus diberikan oleh Perawat Farhan? \r\n', 507, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:38:20', '2021-04-22 00:38:20'),
	(984, 1, 1, 0, 'Kasus (Vignette)\r\nSeorang laki-laki umur 45 tahun datang ke unit gawat darurat akibat nyeri  dada sebelah kiri menjalar keleher dan punggung, Saat dikaji pasien mengeluh nyeri dada seperti tertimpah bendah keras TD 100/60 mmHg , N 100 x/menit RR 25 x/menit dari hasil pemeriksaan darah troponin T 60 mm/dl gambar EKG didapatkan elevasi segmen ST di sadapan II,III dan AVF. \r\n\r\nPertanyaan soal\r\nDiagnosa keperawatan utama pada kasus diatas \r\n', 508, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:38:25', '2021-04-22 00:38:25'),
	(985, 1, 1, 0, 'Kasus (Vignette)\r\nPada pasien dengan ACS otot jantung masih reversible (masih dapat dikembalikan fungsinya), sehingga  dapat survive kembali, apabila dilakukan  penanganan yang cepat dan tepat terutama pada fase golden time, \r\nPertanyaan soal\r\nwaktu yang dibutuhkan untuk penangan tersebut adalah :\r\n', 509, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:39:36', '2021-04-22 00:39:36'),
	(986, 1, 1, 0, 'Seorang perempuan berusia 30 Tahun P2A0 di kamar bersalin setelah melahirkan bayi laki-laki dengan APGAR score 9 dan berat badan 3600 gram. Pasien telah disuntikkan oksitosin 10 UI secara intramuscular dan setelah 15 menit plasenta lepas. \r\nApakah tindakan selanjutnya  untuk pasien tersebut? ', 510, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:39:39', '2021-04-22 00:39:39'),
	(987, 1, 1, 0, 'Anak usia 3 tahun, BB 15 kg dibawa oleh ibunya ke Puskesmas dengan keluhan panas, diare, dan batuk sejak 3 hari yang lalu, diare + 5 x/ hari. Riwayat imunisasi lengkap. Belum pernah mendapatkan kapsul vitamin A sejak lahir.\r\nPada pemeriksaan fisik didapatkan nadi 100x/menit, RR 47x/ menit, T = 39.1°C, mata cekung, tidak ada tanda anemia, masih dapat minum biasa). Tidak didapatkan stridor maupun retraksi dinding dada. Cubitan kulit lambat kembalinya. Tidak ada edema, uji torniquet (-)\r\nApakah klasifikasi dari pasien tersebut?', 511, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:40:43', '2021-04-22 00:40:43'),
	(988, 1, 1, 0, 'Kasus (Vignette)\r\nSeorang perempuan  berusia 35 tahun diantar keluarganya ke UGD dengan kondisi penurunan kesadaran dialami sejak 15 menit yang lalu. Keluarga mengatakan pasien memiliki riwayat stroke. Hasil anamnesis, terdengar suara nafas snoring dan gelisah. Pemeriksaan tekanan darah 150/100 mmHg, frekuensi pernafasan 28 x/mt, frekuensi nadi 120 x/mt, dan suhu 37,9 C. Ners yang sdg shift melakukan head tilt chin lift. \r\n\r\nPertanyaan soal\r\nApakah tindakan selanjutnya\r\n', 512, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:41:09', '2021-04-22 00:41:09'),
	(989, 1, 1, 0, 'Seorang perempuan berusia 30 Tahun, G1A0, ke UGD jam 06.00 WIB dengan keluhan mulas. Dari pengkajian didapatkan tekanan darah 120/70 mmHg, frekuensi  napas 22x/menit, denyut nadi 80 x/menit, suhu 36,50c, his teratur sebanyak 3 kali dalam 10 menit dengan durasi 30 detik dan denyut jantung janin 120x/menit.\r\nApakah tindakan selanjutnya yang harus dilakukan?', 513, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:41:34', '2021-04-22 00:41:34'),
	(990, 1, 1, 0, 'Kasus (Vignette)\r\nSeorang laki-laki berusia 45 tahun datang ke UGD dengan kondisi penurunan kesadaran akibat KLL 20 menit yang lalu. Nampak cedera pada kepala, terdengar bunyi gurgling, perdarahan pada telapak tangan. Pemeriksaan tekanan darah 110/60 mmHg, frekuensi pernafasan 14 x/mt, frekuensi nadi 100 x/mt, dan suhu 37,9. \r\n\r\nPertanyaan soal\r\nApakah masalah keperawatan prioritas\r\n', 514, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:42:39', '2021-04-22 00:42:39'),
	(991, 1, 1, 0, 'Seorang perempuan berusia 25 Tahun, G1P0 di rawat di kamar bersalin telah melahirkan bayi laki-laki secara normal pervaginam dengan berat badan 3000 gram, APGAR Score 10. Mulut dan hidung bayi di suction dan Bayi diletakkan di handuk bersih di atas perut ibu. \r\nApakah implementasi selanjutnya pada kasus tersebut? ', 515, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:43:13', '2021-04-22 00:43:13'),
	(992, 1, 1, 0, 'Kasus (Vignette)\r\nSeorang perawat bekerja pada suatu shift berjalan ke ruang rawat klien dan menemukan klien tidak sadarkan diri. Klien tidak bernafas, tidak teraba nadi, perawat dengan segera memanggil bantuan. \r\n\r\nPertanyaan soal\r\nApakah tindakan selanjutnya yang seharusnya dilakukan perawat\r\n', 516, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:43:37', '2021-04-22 00:43:37'),
	(993, 1, 1, 0, 'Perawat Diana melakukan pengukuran berat badan dan mendapatkan Bayi Andini yang berusia 7 bulan berada pada posisi -3SD - < -2 SD\r\nApakah tindakan yang harus dilakukan oleh Perawat Diana?', 517, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:43:50', '2021-04-22 00:43:50'),
	(994, 1, 1, 0, 'Seorang laki-laki umur 45 tahun datang ke unit gawat darurat akibat nyeri  dada sebelah kiri menjalar keleher dan punggung, Saat dikaji pasien mengeluh nyeri dada seperti tertimpah bendah keras TD 100/60 mmHg , N 100 x/menit RR 25 x/menit dari hasil pemeriksaan darah troponin T 60 mm/dl gambar EKG didapatkan elevasi segmen ST di sadapan II,III dan AVF. \r\nDiagnosa keperawatan utama pada kasus diatas \r\n', 585, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:44:55', '2021-04-30 22:53:04'),
	(995, 1, 1, 0, 'Seorang perempuan berusia 28 tahun, P2A0, di kamar bersalin setelah melahirkan bayi laki-laki, BB 3700 gram 1 jam yang lalu. Dari hasil pengkajian: Tekanan darah 100/70 mmHg, frekuensi nadi 88 x/menit, frekuensi napas 24 x/menit, kontraksi lemah dan ada jahitan robekan perineum derajat 2.\r\nApakah tindakan selanjutnya pada kasus tersebut?', 519, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:45:04', '2021-04-22 00:45:04'),
	(996, 1, 1, 0, 'Kasus (Vignette)\r\nPada pasien dengan ACS otot jantung masih reversible (masih dapat dikembalikan fungsinya), sehingga  dapat survive kembali, apabila dilakukan  penanganan yang cepat dan tepat terutama pada fase golden time, \r\nPertanyaan soal\r\nwaktu yang dibutuhkan untuk penangan tersebut adalah :\r\n', 520, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:46:13', '2021-04-22 00:46:13'),
	(997, 1, 1, 0, 'Seorang perempuan berusia 30 tahun, P2A0, di kamar bersalin setelah melahirkan bayi laki-laki, BB 3500 gram. Dari hasil pengkajian: Tekanan darah 110/70 mmHg, frekuensi nadi 88 x/menit, frekuensi napas 24 x/menit, tidak ada kontraksi dan ada jahitan robekan perineum derajat 2.\r\nApakah tindakan yang harus dilakukan?', 521, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:46:14', '2021-04-22 00:46:14'),
	(998, 1, 1, 0, 'Perawat Fitri melakukan pengkajian Kuesioner Pra Skrining Perkembangan (KPSP) pada Anak Y yang berusia 3 bulan dan mendapatkan skor akhir 9 dari 10 pemeriksaan. \r\nApakah interpretasi dari hasil tersebut', 522, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:47:25', '2021-04-22 00:47:25'),
	(999, 1, 1, 0, 'Seorang perempuan berusia 24 tahun, G1P0A0 usia kehamilan 40 minggu datang dengan keluhan perutnya mulas-mulas. TFU 32 cm, belum ada tanda-tanda pembukaan serviks dan pasien tampak lemas.\r\nApakah intervensi keperawatan utama yang bisa dilakukan oleh perawat?', 523, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:47:28', '2021-04-22 00:47:28'),
	(1000, 1, 1, 0, 'Seorang perempuan usia 28 tahun, G2P1A0 di kamar bersalin, mules-mules dengan skala 9 sejak 8 jam yang lalu dan bertambah sering dan kuat disertai keluarnya lendir darah pervaginam. Hasil pemeriksaan: kontraksi uterus setiap 10 menit sekali dengan durasi 30 detik dan denyut jantung janin 120 kali permenit. \r\nApakah masalah keperawatan utama pada pasien? ', 524, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:48:53', '2021-04-22 00:48:53'),
	(1001, 1, 1, 0, 'Batita laki-laki berusia 3 tahun yang dirawat diruang perawatan anak tiba-tiba mengalami kejang. Hasil pengkajian didapatkan frekuensi nadi 108x/mnt, Suhu 38,9° C, dan kehilangan kesadaran. \r\nApa tindakan yang harus segera dilakukan oleh perawat untuk mencegah aspirasi jalan napas pada kasus tersebut?', 525, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:49:31', '2021-04-22 00:49:31'),
	(1002, 1, 1, 0, 'Seorang perempuan usia 28 tahun G1P1A0, datang ke UGD dengan keluhan mulas-mulas sejak 9 jam yang lalu disertai keluarnya lendir darah pervaginam, Hasil pemeriksaan: pembukaan lengkap, his kuat dan teratur, perineum tampak menonjol, vulva membuka, dan ada dorongan meneran yang kuat.\r\nApakah tindakan selanjutnya yang harus dilakukan?', 526, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:50:04', '2021-04-22 00:50:04'),
	(1003, 1, 1, 0, 'Seorang batita laki-laki berusia 3 tahun mengalami BAB lebih dari lima kali dalam 24 jam, dengan konsistensi cair, muntah-muntah, keadaaan umum lemah, mata cekung, oligouria, membran mukosa bibir kering, turgor jelek. \r\nApakah masalah keperawatan utama pada kasus tersebut?', 527, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:51:19', '2021-04-22 00:51:19'),
	(1004, 1, 1, 0, 'Seorang perempuan usia 36 tahun, G1P2A0 datang ke klinik bersalin dengan keluhan mules mules yang semakin kuat dan sering serta keluar cairan bening dan lendir darah. Hasil pengkajian: DJJ 140x/menit, skala nyeri 9 saat his datang, his 2 kali dalam 10 menit dengan durasi 30-40 detik, pembukaan 7 cm. \r\nApakah tindakan keperawatan yang tepat untuk pasien? ', 528, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:51:20', '2021-04-22 00:51:20'),
	(1005, 1, 1, 0, 'Seorang perempuan usia 30 Tahun, G3P2A0 akan melahirkan di kamar bersalin. Seorang ners mendampingi pertolongan persalinan normal  perempuan  tersebut. Pada saat melahirkan kepala, tidak ditemukannya lilitan tali pusat di leher bayi. \r\nTindakan apa yang selanjutnya harus dilakukan?', 529, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:52:34', '2021-04-22 00:52:34'),
	(1006, 1, 1, 0, 'Seorang bayi perempuan baru lahir masuk ruang perawatan anak, dalam 24 jam pertama tidak keluar mekonium, dua hari kemudian perut kembung, muntah berwarna hijau. Kemudian perawat melakukan pemeriksaan colok anus dan hasilnya keluar udara dan mekonium atau feses yang menyemprot. \r\nApakah implementasi keperawatan yang dilakukan pada kasus tersebut?', 530, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:52:58', '2021-04-22 00:52:58'),
	(1007, 1, 1, 0, 'Seorang perawat di IGD mengobervasi seorang pasien dengan umur 4 tahun dengan tanda-tanda peningkatan tekanan intracranial karena jatuh dari sepeda dan didiagnosa trauma kepala.\r\nApa tanda dan gejala dari keadaan tersebut?', 531, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:53:52', '2021-04-22 00:53:52'),
	(1008, 1, 1, 0, 'Seorang perempuan berusia 55 tahun dibawa ke IGD karena tertabrak motor, hasil pengkajian CAB palpasi nadi carotis tidak teraba, hasil pengkajian airway tidak terdengar (-), TD 0/0mmHg, terdapat luka disekitar tubuh. Pasien akan dilakukan resusitasi jantung paru.\r\nApa langkah pertama untuk mengatasi pasien diatas?', 532, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:55:11', '2021-04-22 00:55:11'),
	(1009, 1, 1, 0, 'Seorang anak laki-laki berusia 10 tahun mengalami kejang yang berulang, setelah dilakukan pemeriksaan suhu rectal hasilnya 39,2?. \r\nApakah tindakan prioritas perawat pada kasus tersebut? ', 533, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:55:46', '2021-04-22 00:55:46'),
	(1010, 1, 1, 0, 'Seorang laki-laki berusia 58 tahun dibawa ke IGD karena terjatuh saat sedang naek ke atap rumahnya memperbaiki genteng. Tertusuk besi tajam pada bagian kaki. Pasien tampak lemah kesakitan, terutama daerah kaki yang tertusuk besi tajam. Hasil pemeriksaan fisik didapatkan: tekanan darah: 90/60mmHg, frekuensi hadi: 92x/menit, frekuensi nafas: 25x/menit.\r\nApa tindakan yang tepat pada pasien di atas?', 534, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:56:26', '2021-04-22 00:56:26'),
	(1011, 1, 1, 0, 'Seorang laki-laki berusia 60 tahun dibawa ke IGD karena keringat dingin, kesadaran menurun setelah bermain badminton, pasien ada riwayat infark myocard acut dan asam urat. Pengkajian CAB nadi carotis teraba kecil dan lambat, TD 0/0mmHg, tampak sianosis, rencana dilakukan resusitasi jantung paru, perawat sudah mengatur posisi.\r\nApa tindakan pertama perawat pada pasien di atas?', 535, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:57:48', '2021-04-22 00:57:48'),
	(1012, 1, 1, 0, 'Seorang ibu membawa anak perempuannya yang berusia 2 tahun periksa di UGD karena diare sudah 2 hari. Hari ini BAB cair sudah 5 kali. Hasil pengkajian: anaknya tampah lemah, mata cekung,, mukosa bibir kering, turgor kembali lambat, dan rewel. Pada saat ditimbang BB 12Kg\r\nBerapakah kebutuhan cairan pada kasus tersebut?', 536, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:57:56', '2021-04-22 00:57:56'),
	(1013, 1, 1, 0, 'Seorang laki-laki berusia 40 tahun dibawa ke IGD karena terserempet mobil, pasien mengeluh tangan kirinya robek, nyeri dan tidak dapat diangkat.  Pasien mengatakan takut tangannya tidak bisa lagi berfungsi dengan baik. Hasil pemeriksaan fraktur terbuka, luka kotor dan perdarahan hebat. Tekanan darah 110/60mmHg, frekuensi nafas 24x/menit, frekuensi nadi 85x/menit.\r\nApa tindakan pertama perawat pada pasien di atas?', 537, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 00:59:04', '2021-04-22 00:59:04'),
	(1014, 1, 1, 0, 'Seorang laki-laki berusia 22 tahun dibawa ke IGD oleh tim ambulan setelah mengalami pingsan dirumahnya. Resusitasi jantung paru telah dilakukan namun tidak berhasil. Ibu pasien mengatakan kepada perawat bahwa pasien adalah seorang pendonor organ tubuh dan mata korban sudah didonasikan.\r\nManakah tindakan yang harus dilakukan perawat selanjutnya?', 538, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 01:00:33', '2021-04-22 01:00:33'),
	(1015, 1, 1, 0, 'Seorang laki-laki berusia 20 tahun, dibawa ke IGD setelah kecelakaan motor yang dialaminya. Hasil pengkajian didapatkan: nadi 80x/menit, akral teraba dingin, suhu 36,4, sianosis di ujung jari dan bibir. Pasien mengalami penurunan kesadaran, terdapat fraktur femur yang sudah dibidai.\r\nApakah tindakan yang tepat dilakukan perawat?', 539, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 01:02:07', '2021-04-22 01:02:07'),
	(1016, 1, 1, 0, 'Pasien perempuan umur 60 tahun dengan riwayat Chronic Obstruktive Pulmonary Disease  (COPD) dijadwalkan pagi ini untuk tindakan histrectomy dengan general anestesi. Diagnosa keperawatan yang ditegakkan adalah resiko tidak efektifnya pola nafas.\r\nManakah tujuan jangka pendek yang paling tepat untuk diagnosa tersebut?', 540, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 01:03:25', '2021-04-22 01:03:25'),
	(1017, 1, 1, 0, 'Pasien laki-laki berumur 50 tahun dengan head injury di rawat di intensive care unit. Hasil pemeriksaan fisik didapatkan hipercapnia dan mengalami penurunan kesadaran. Anda menduga bahwa pasien mengalami acute respirator failure.\r\nManakah  hasil analisa gadar darah yang dapat mengkonfirmasi diagnosis tersebut?', 541, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 01:04:57', '2021-04-22 01:04:57'),
	(1018, 1, 1, 0, 'Seorang laki-laki berumur 53 tahun. Kesadaran : Saporocoma, Keadaan umum : sakit berat, WSD terpasang : undulasi dan bubling  (+), slym (-), NGT (+), kateter urin (+), urine warna kuning pekat. Klien menggunakan otot bantu nafas dan pengembangan dada tidak simetris, Klien terpasang ventilator dengan mode SIMV, RR = 30x/menit, PEEP = + 5 cm H2O, FiO2 = 40%, Respiratory rate : 10 x/mnt, Vt : 400 cc. Respirasi : vesicular, Rh +/+. Wh -/-.Hasil AGD  pH  = 7.31; PaCO2 = 48;  PaO2 = 80; HCO3 = 24; SatO2 = 88%.\r\nMasalah keperawatan utama pada pasien adalah...', 542, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 01:06:07', '2021-04-22 01:06:07'),
	(1019, 1, 1, 0, 'Seorang perawat assosiate (PA) berdinas malam diberikan tugas oleh perawat primer (PP) untuk merawat pasien dengan diagnosa Ca Paru.  Sekitar pukul 02.00, pasien tersebut  mengalami penurunan kesadaran dan penurunan tanda-tanda vital.\r\nApakah yang PA lakukan pada kasus tersebut?', 543, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 20:41:04', '2021-04-22 20:41:04'),
	(1020, 1, 1, 0, 'Seorang Perawat Primer (PP) dan perawat assosiate (PA) dinas pagi sedang menerima laporan di nurse station dari PA dinas malam tentang kondisi pasien dan setelah laporan selesai, berkeliling e ruang rawat untuk memastikan kondisi pasien.\r\nApakah Kegiatan profesional yang dilakukan oleh perawat?', 544, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 20:42:43', '2021-04-22 20:42:43'),
	(1021, 1, 1, 0, 'Perawat Primer (PP) memberikan arahan dan membagi tugas yang akan dilakukan kepada Perawat Assosiate (PA) yang akan berdinas. Memastikan tindakankeperawatan untuk setiap pasien kepada PA.\r\nApakah Kegiatan profesional yang dilakukan oleh perawat?', 545, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 20:46:21', '2021-04-22 20:46:21'),
	(1022, 1, 1, 0, 'Seorang perawat pelaksana berdinas di ruang rawat inap, mendapatkan tugas untuk melakukan tindakan perawatan luka dan pemeriksaan tanda-tanda vital. Perawat lainnya mendapatkan tugas pemasangan infus dan kebersihan diri pasien. Dokumentasi asuhan keperawatan dilakukan oleh penanggung jawab dinas/ shift.\r\nApakah metode asuhan keperawatan yang digunakan di ruang rawat inap tersebut?', 546, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 20:47:51', '2021-04-22 20:47:51'),
	(1023, 1, 1, 0, 'Seorang perawat bertugas sebagai perawat pelaksana di ruangan rawat inap, melakukan tindakan pemberian obat-obatan ke beberapa pasien. Pada saat memberikan obat ke pasien berikutnya, perawat tidak melakukan cuci tangan dengan alasan sudah melakukan diawal pada saat pemberian pasien pertama. Ketua tim melakukan evaluasi kepatuhan cuci tangan pada perawat tersebut.\r\nApakah tindakan yang dilakukan oleh ketua tim tersebut?', 547, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 20:49:48', '2021-04-22 20:49:48'),
	(1024, 1, 1, 0, 'Perawat baru yang ditempatkan di ruangan bedah mendapat  teguran dari ketua tim, karena kurang tepat melakukan tindakan, ada beberapa prosedur yang terlewat. Hal ini akan membahayakan pasien.\r\nApakah tindakan yang dilakukan oleh ketua tim pada perawat  tersebut?', 548, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 20:51:15', '2021-04-22 20:51:15'),
	(1025, 1, 1, 0, 'Seorang Perawat meminta izin kepada kepala ruangan untuk tidak masuk kerja karena harus menemani anaknya pada kegiatan outbond. Kepala ruangan tidak mengijinkan karena BOR ruang rawat mencapai 98% dengan tingkat ketergantungan partial.\r\npakah tindakan yang dilakukan oleh perawat  tersebut?', 549, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 20:53:07', '2021-04-22 20:53:07'),
	(1026, 1, 1, 0, 'Setelah berdinas Perawat Primer (PP) mengumpulkan Perawat Assosiate (PA) menjelang pergantian dinas. PP melakukan evaluasi tindakan keperawatan setiap pasien kepada PA, mengetahui perkembangan pasien dan mencatat pemeriksaan atau tindakan yang harus dilakukan kepada pasien oleh perawat dinas berikutnya.\r\nApakah Kegiatan profesional yang dilakukan oleh perawat PP dan PA tersebut?', 550, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 21:00:29', '2021-04-22 21:00:29'),
	(1027, 1, 1, 0, 'Seorang perawat baru bekerja sebagai perawat pelaksana di ruang rawat inap. Perawat tersebut belum memiliki pengalaman bekerja di pelayanan, namun memiliki keinginan dan semangat yang tinggi untuk belajar. Ketua tim banyak memberikan tugas melakukan tindakan keperawatan. \r\nApakah yang dilakukan oleh perawat tersebut? ', 551, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 21:01:58', '2021-04-22 21:01:58'),
	(1028, 1, 1, 0, 'Seorang perawat setelah melakukan pemeriksaan tanda-tanda vital, menanyakan kembali keluhan pasien. Pasien mengatakan merasa tidak nyaman sudah 2 hari tidak menggosok gigi. Perawat itu membuat kontrak akan melakukan oral hygiene 2 jam kemudian. Namun hingga pergantian dinas, perawat tidak melakukannya karena sibuk mengatasi kondisi pasien lain yang kritis. \r\nApakah pelanggaran etik yang dilakukan oleh perawat tersebut?', 552, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 21:03:18', '2021-04-22 21:03:18'),
	(1029, 1, 1, 0, 'Seorang perawat bertugas untuk melakukan tindakan keperawatan berdasarkan perencanaan keperawatan yang sudah dibuat oleh perawat lainnya. Pada akhir shift Perawat tersebut harus melaporkan kondisi pasien pada perawat lain dikelompoknya.\r\nApakah metode penugasan yang diterapkan pada ruangan tersebut?', 553, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 21:04:45', '2021-04-22 21:04:45'),
	(1030, 1, 1, 0, 'Di sebuah ruangan perawat akan  melaporkan kondisi pasien pada shift berikutnya. Kedua kelompok dinas sudah siap dan berkumpul di Nurse Station . Karu mengecek kesiapan  tiap ketua  kelompok perawat.\r\nApakah tindakan selanjutnya yang dilakukan dalam kegiatan tersebut?', 554, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 21:06:34', '2021-04-22 21:06:34'),
	(1031, 1, 1, 0, 'Di ruangan sedang dilakukan pembahasan kasus dengan melibatkan pasien. Pasien adalah seorang laki laki dengan diagnosa stroke yang tidak menunjukkan perbakan kondisi dengan lama hari 7 hari.Pada kegiatan tersebut ada perawat yang melakukan validasi kebenaran dari masalah dan intervensi keperawatan serta rasional tindakan.\r\nApakah peran perawat dalam kasus tersebut?', 555, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 21:08:05', '2021-04-22 21:08:05'),
	(1032, 1, 1, 0, 'Di ruangan sedang dilakukan pembahasan kasus pasien dengan prognosis yang buruk. Kegiatan melibatkan semua perawat di ruangan dengan mengundang perawat ahli. Kemudianperawat melakuan Diskusi antar anggota tim dan pasien tentang masalah keperawatan yang dialami pasien.\r\nApakah tahapan yang sedang dilakukan pada kegiatan tersebut?', 556, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 21:12:19', '2021-04-22 21:12:19'),
	(1033, 1, 1, 0, 'Anda adalah seorang perawat pelaksana dan memiliki perbedaan pendapat dalam memberikan asuhan keperawatan pada pasien. Tanpa disadari saling berargumen dan memicu konflik karena melibatkan emosi. Dalam kondisi tersebut kepala ruangan menengahi konflik dan melihat kalau anda dan teman anda sebenarnya memiliki komitmen untuk menyelesaikan masalah.\r\nStrategi konflik apakah yang dilakukan oleh perawat tersebut?', 557, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 21:14:08', '2021-04-22 21:14:08'),
	(1034, 1, 1, 0, 'Anda adalah seorang perawat yang bekerja di ruang operasi untuk kasus umum. Tapi hari ini dipindahkan ke ruang orthopedi. Anda merasa asing dengan kebiasaan yang dilakukan oleh dokter ortopedi. Pada saat operasi berlangsung, anda melakukan kesalahan dan dokter marah pada anda. Anda kesal tapi posisi dokter lebih tinggi sehingga anda langsung meminta maaf.\r\nApakah strategi konflik yang dilakukan oleh kepala ruangan?', 558, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 21:16:45', '2021-04-22 21:16:45'),
	(1035, 1, 1, 0, 'Seorang laki laki  berusia 56 th, 2 jam paska apendictomy, nampak kesakitan, belum bisa mobilisasi sendiri, dan  terpasang infus.\r\nApakah tingkat ketergantungan pasien tersebut?', 559, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 21:18:11', '2021-04-22 21:18:11'),
	(1036, 1, 1, 0, 'Anda adalah ketua tim di ruangan bedah wanita. Anda selalu membuat rencana kegiatan sesuai rentang waktu.Anda bekerja berdasarkan kegiatan tersebut.\r\nApakah fungsi manajemen keperawatan dalam kasus ?', 560, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 21:19:55', '2021-04-22 21:19:55'),
	(1037, 1, 1, 0, 'Setelah melakukan timbang terima dengan perawat yang berdinas malam, perawat langsung memimpin kegiatan untuk mempersiapkan pemberian asuhan keperawatan pada pasien kelolaan di kelompoknya. Ketika ada pasien baru perawat tersebut langsung menerima pasien.\r\nApakah yang selanjutnya dilakukan oleh perawat tersebut?', 561, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 21:23:05', '2021-04-22 21:23:05'),
	(1038, 1, 1, 0, 'Dalam upaya melakukan peningkatan mutu pelayanan kesehatan terutama keperawatan pihak Rumah sakit memberikan kuesioner yang berisi tentang tanggapan pasein mengenai pelayanan yang didapatkan di rumah sakit.\r\nApakah indikator mutu pelayanan keperawatan yang sedang dikaji oleh rumah sakit?', 562, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-22 21:24:45', '2021-04-22 21:24:45'),
	(1039, 1, 1, 0, 'Seorang laki-laki usia 70 tahun tinggal di panti werdha sejak 3 bulan yang lalu. Klien mengeluh mengalami kesulitan tidur di malam hari. Klien juga megeluh lemah dan tidak bisa berkonsentrasi. Perawat melakukan pengkajian untuk mengetahui penyebab kesulitan tidur klien. \r\nApakah hasil pengkajian yang perlu adanya pengajaran lebih lanjut untuk meningkatkan kualitas tidur? \r\n', 563, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 01:42:40', '2021-04-23 01:42:40'),
	(1040, 1, 1, 0, 'Seorang wanita berusia 70 tahun baru-baru ini menjanda. Dia bekerja sebagai guru selama 40 tahun dan telah pensiun selama 5 tahun terakhir. Dia tidak memiliki anak dan tinggal sendirian.  Dia tinggal di daerah pedesaan yang tidak memiliki transportasi umum. \r\nApakah perubahan psikososial yang menjadi fokus perawat sebagai prioritas?\r\n\r\n', 564, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 01:44:04', '2021-04-23 01:44:04'),
	(1041, 1, 1, 0, 'Seorang wanita usia 75 tahun tinggal di panti werdha. Klien tersebut memiliki kacamata baru. Klien mengatakan “saya tidak bisa melihat dengan cukup baik, terutama saat membaca. Saya punya kaca mata baru, tapi masih sulit.”  \r\nApa yang harus perawat sarankan untuk lansia itu lakukan pertama kali?\r\n', 565, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 01:46:06', '2021-04-23 01:46:06'),
	(1042, 1, 1, 0, 'Seorang laki –laki usia 75 tahun dirawat di ruang Greatrik dengan keluhan sejak seminggu tidak  mau makan, minum sedikit. Pasien tampak lemas, pucat, turgor kulit menurun, mucosa mulut  kering . Pasien dipasang infuse Dextrose 5% , 20 tetes/mnt. Pasien mengeluh malas makan,  minum karena anak kesayangannya tidak pernah menjenguknya\r\nApa tindakan keperawatan utama terhadap pasien diatas ? \r\n', 566, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 01:47:41', '2021-04-23 01:47:41'),
	(1043, 1, 1, 0, 'Laki-laki usia 75 tahun datang ke seorang tenaga kesehatan dengan keluhan lututnya sering kaku, nyeri dan meradang pada area persendian namun sifatnya hilang timbul dengan skala nyeri  5. Laki-laki   tersebut   mengatakan   bahwa   sudah   2   tahun   menderita   sakit   seperti   ini   dan   sejak mengalami penyakit  ini   semua  aktifitas sehari-hari  terutama dalam hal  perawatan diri  (mandi, toileting,  berhias  dan   berpakaian)  dan   pergerakan  menjadi   terbatas   sehingga   membuat   dirinya menjadi malu  dan merasa tak berdaya.  Setelah diperiksa, lansia tersebut dikatakan  mengalami osteoarthritis\r\nApakah masalah keperawatan prioritas dalam kasus lansia diatas ? \r\n\r\n', 567, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 01:49:25', '2021-04-23 01:49:25'),
	(1044, 1, 1, 0, 'Seorang laki-laki berusia 65 tahun. Dikunjungi oleh perawat komunitas keluhan yang dirasakan pusing, penglihatan kabur, telinga berdengung, tengkuk tersa berat. Dikeluarga ada Riwayat hipertensi.\r\nApakah pemeriksaan yang tepat pada kasus tersebut…\r\n', 568, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 01:51:12', '2021-04-23 01:51:12'),
	(1045, 1, 1, 0, 'Seorang laki-laki berusia 71 tahun sejak 8 bulan yang lalu ditinggalkan oleh pasangannya. Hasil pengkajian klien kurang memperhatikan perawatan diri, tidak mau berinteraksi selara makan menurun, mengalami gangguan tidur dan terus memegang dan menatap foto pasangannya.\r\nApakah masalah keperawatan yang tepat pada kasus tersebut…\r\n\r\n', 569, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 01:52:23', '2021-04-23 01:52:23'),
	(1046, 1, 1, 0, 'Seorang laki-laki berusia 71 tahun sejak 8 bulan yang lalu ditinggalkan oleh pasangannya. Hasil pengkajian klien kurang memperhatikan perawatan diri, tidak mau berinteraksi selara makan menurun, mengalami gangguan tidur dan terus memegang dan menatap foto pasangannya.\r\nApakah masalah keperawatan yang tepat pada kasus tersebut…\r\n\r\n', 570, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 02:00:27', '2021-04-23 02:00:27'),
	(1047, 1, 1, 0, 'Seorang perempuan berusia 60 tahun datang ke puskesmas dengan keluhan pusing. Hasil pemeriksaan TD = 140/100mmhg, BB 88 kg TD 158 cm, klien mengatakan makan makanan sehat (tanpa santan. rendah garam. rendah gula dan tanpa minyak). Olahraga jalan kaki 30 mnt seminggu 3 kali, tidak merokok, tidak minum kopi dan alcohol, tidur cukup. \r\nApakah faktor resiko hipertensi yang tidak bisa dirubah pada kasus tersebut..\r\n\r\n\r\n', 571, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 02:02:25', '2021-04-23 02:02:25'),
	(1048, 1, 1, 0, 'Seorang laki-laki berusia 66 tahun berada di Panti. Hasil pengkajian terdapat luka terbuka didaerah kaki, kulit terasa panas, dan nyeri, daerah sekitar luka kotor. Kuku jempol Panjang dan keras seperti tanduk. Klien memiliki Riwayat DM.\r\nApakah intervensi yang tepat pada kasus tersebut..\r\n	\r\n\r\n', 572, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 02:03:37', '2021-04-23 02:03:37'),
	(1049, 1, 1, 0, 'Seorang perempuan berusia 76 tahun berada di Panti. Klien terlihat sering mondar-mandir tanpa tujuan, marah-marah, lupa dengan barang-barang yang dia simpan, tidak mau makan karena merasa sudah makan.\r\nApakah masalah psikososial pada kasus tersebut..\r\n\r\n\r\n', 573, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 02:04:58', '2021-04-23 02:04:58'),
	(1050, 1, 1, 0, 'Seorang laki-laki berusia 60 tahun tinggal di Panti Wreda. Hasil pengkajian didapatkan data nyeri pada daerah persendian dengan skala nyeri 5, cepat lelah. Hasil pemeriksaan diagnostik asam urat 10 mg%. perawat ingin melakukan tindakan akupresure tetapi takut tindakan tersebut bukan menjadi kewenangan perawat vokasional. \r\nManakah yang perlu dilakukan perawat gerontik untuk mengatasi masalah tersebut?\r\n', 574, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 02:06:18', '2021-04-23 02:06:18'),
	(1051, 1, 1, 0, 'Seorang laki-laki berusia 74 tahun, mengalami kesulitan untuk bergerak dan berpindah tempat sejak klien dinyatakan stroke oleh dokter tresna werda 3 bulan yang lalu. Pemenuhan kebutuhan dasar pada klien membutuhkan bantuan penuh dari perawat.\r\nApakah upaya preventif yang dapat dilakukan perawat dalam upaya pemenuhan kebutuhan kenyamanan tempat tidur pada kasus tersebut?\r\n', 575, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 02:07:58', '2021-04-23 02:07:58'),
	(1052, 1, 1, 0, 'Seorang laki-laki berusia 65 tahun tinggal di Panti Wreda, klien mengeluh mengalami penurunan pendengaran, pandangan kabur, dan mobilisasi dibantu menggunakan kursi roda. Hasil pengkajian didapatkan klien mengalami penurunan kekuatan otot ekstremitas bawah.\r\nApakah diagnosis keperawatan pada kasus tersebut?\r\n', 576, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 02:09:12', '2021-04-23 02:09:12'),
	(1053, 1, 1, 0, 'Seorang perempuan berusia 67 tinggal di Panti Werdha dengan riwayat hipertensi semenjak 10 tahun yang lalu. Hasil pengkajian: tekanan darah 160/100 mmHg, klien mengatakan sakit kepala berat, tengkuk/leher bagian bawah, mata kunang-kunang/pandangan kabur, dan telinga berdengung.\r\nApa intervensi keperawatan mandiri utama yang dilakukan pada kasus tersebut? \r\n', 577, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 02:10:46', '2021-04-23 02:10:46'),
	(1054, 1, 1, 0, 'Seorang laki-laki berusia 65 tahun dirawat di ruang isolasi panti werda sejak satu minggu yang lalu. Hasil pengkajian: klien terlihat lemah, bau feses, kulit perianal kemerahan, dan terdapat rembesan feses lunak, klien mengatakan tidak ada keinginan BAB.\r\nApa diagnosa keperawatan yang tepat pada kasus diatas?\r\n', 578, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 02:12:06', '2021-04-23 02:12:06'),
	(1055, 1, 1, 0, 'Seorang laki-laki berusia 70 tahun tinggal dipanti werdha kurang lebih sudah 10 tahun. Riwayat penyakit post stroke, klien mengalami kelumpuhan pada ekstremitas kiri dan perlu bantuan pemenuhan kebutuhan sehari-hari\r\nApakah tindakan yang paling tepat pada kasus tersebut?\r\n\r\n', 579, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 02:13:43', '2021-04-23 02:13:43'),
	(1056, 1, 1, 0, 'Seorang perempuan berusia 67 tahun tinggal di Panti Werdha sejak lima tahun yang lalu. Klien mengalami katarak dan gangguan gaya berjalan, sejak saat itu klien menggunakan tongkat untuk membantunya berjalan. Klien menyatakan tidak berani berjalan jauh karena takut jatuh disebabkan lingkungan sekitar panti yang berundak dan lantai yang licin. \r\nApakah diagnosis keperawatan yang tepat untuk kasus tersebut?\r\n', 580, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 02:15:37', '2021-04-23 02:15:37'),
	(1057, 1, 1, 0, 'Seorang perempuan berusia 67 tahun tinggal di Panti Werdha sejak lima tahun yang lalu. Klien mengalami katarak dan gangguan gaya berjalan, sejak saat itu klien menggunakan tongkat untuk membantunya berjalan. Klien menyatakan tidak berani berjalan jauh karena takut jatuh disebabkan lingkungan sekitar panti yang berundak dan lantai yang licin. \r\nApakah diagnosis keperawatan yang tepat untuk kasus tersebut?\r\n', 581, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 02:18:07', '2021-04-23 02:18:07'),
	(1058, 1, 1, 0, 'Seorang laki-laki berusia 78 tahun dirawat dengan arthritis pada kedua lututnya. Pasien sering mengalami disorientasi, riwayat pernah terjatuh dari tempat tidur. \r\nManakah upaya pencegahan jatuh yang tepat pada kasus tersebut?\r\n', 582, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 02:21:25', '2021-04-23 02:21:25'),
	(1059, 1, 1, 0, 'Seorang laki-laki berusia 64 tahun tinggal di Panti Wedha dan saat ini menderita Diabetes Melitus, hasil KGD 320 mg/dl. Klien mengatakan ada luka pada telapak kaki kanannya yang sampai sekarang tidak sembuh, kakinya terasa kesemutan ketika duduk melihat TV ataupun saat mengikuti jadwal kegiatan panti, klien mampu melakukan aktifitas seperti biasanya meskipun kadang merasakan cepat lelah\r\nApa intervensi keperawatan mandiri utama yang dilakukan pada kasus tersebut?\r\n', 583, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 02:24:29', '2021-04-23 02:24:29'),
	(1060, 1, 1, 0, 'Seorang laki-laki berusia 76 tahun di panti werdha sudah 2 tahun ditempatkan di ruang isolasi. Klien mengeluh nyeri pada luka di punggung bagian bawah pada saat pengkajian di punggung ada luka dengan diameter 10 cm, kondisi tubuh lemah, bau badan, kulit kusam, rambut kotor, bau mulut, kuku panjang, pakaian tidak rapi, dan tidak ganti 2 hari. Makan dibantu oleh teman dekatnya yang masih bias beraktivitas, BAB dan BAK dilakukan ditempat tidut. Hasil pengkajian Mini Mental State Exam 20 kerusakan mental berat, Risiko jatuh 9 yaitu risiko jatuh sedang.\r\nApakah diagnosa keperawatan yang tepat pada kasus diatas?\r\n', 584, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-23 02:27:32', '2021-04-23 02:27:32'),
	(1061, 2, 2, 6, 'Seorang laki-aki berusia 45 tahun datang ke UGD RSHS Bandung dengan keluhan nyeri dada hilang timbu, bertambah hebat jika beraktifitas berat dan hilang pada saat iatirahat ,pada saat pengkajian ditemukan data TD 150/90, N 100x/menit,  RR 25x/ menit hasil EKG  adanya  T Invertid, di Lead II diagnosa Angina Stabil.\r\nInformasi seperti apa yang di butuhkan perawat untuk menentukan diagnosis tersebut?\r\n', 452, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-30 23:07:03', '2021-04-30 23:07:03'),
	(1063, 2, 1, 0, 'Seorang laki-laki berusia 30 tahun, dirawat diruang isolasi dengan keluhan sesak nafas, batuk berdahak. Tanda-tanda vital: TD=120/80 mmHg, N=110x/mnt, P=33x/mnt, S=38.70C, suara nafas Ronchi (+), konjungtiva tampak anemis, turgor kulit menurun. Diagnosa medis TBC positif.\r\nApa diagnosa keperawatan prioritas yang tepat untuk kasus diatas?', 453, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 21:46:50', '2021-05-02 21:46:50'),
	(1064, 2, 1, 0, 'Seorang laki-laki berusia 28 tahun, dirawat diruang penyakit dalam dengan keluahan diare yang sudah sebulan tidak sembuh meskpun sudah berobat ke dokter. Pekerjaannya adalah seorang bartender di sebuah club malam. Tanda-tanda vital: TD=120/80 mmHg, N=110x/mnt, P=28x/mnt, S=38.70C, konnung tiva tampak anemis, turgor kulit menurun. Diagnosa medis HIV positif.\r\n\r\nApa penyebab diare yang tidak kunjung sembuh pada kasus tersebut?\r\n', 454, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 21:50:40', '2021-05-02 21:50:40'),
	(1065, 2, 1, 0, 'Seorang pasien mengeluh sakit kepala yang hebat, berkeringat tengah malam, demam. TD=120/70 mmHg, N=98x/mn, S=39°C, P: 28 x / menit. Teraba ada benjolan di leher kiri pasien. Leukosit 15.000/ µL. \r\n\r\nApa intervensi yang dilakukan untuk mengatasi masalah keperawatan yang muncul?\r\n', 455, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 22:28:17', '2021-05-02 22:28:17'),
	(1066, 2, 1, 0, 'Perawat berkunjung ke keluagra didapatkan seorang perempuan (30 tahun) menikah dan memiliki seorang anak laki-laki usia 4 tahun, tampak lemah, pucat dan bersandar di kursi. Dilakukan pemeriksaan tekanan darah dengan hasil 100/70 mmHg, Klien mengatakan tidak mau makan karena mual terus menerus, klien mengatakan tidak berKB.  \r\n\r\nApakah pengkajian selanjutanya yang harus dilakukan perawat ?\r\n', 456, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:04:01', '2021-05-02 23:04:01'),
	(1067, 2, 1, 0, 'Saat kunjungan rumah didapatkan klien anak laki laki berusia 2 tahun. Terlihat kurus, dengan rambut merah dan kering. Hasil KMS status gizi berada di garis kuning. Ibu klien mengatakan anaknya sehat walupun susah makan dan selalu datang ke posyandu setiap bulannya.   \r\n\r\nApakah fungsi perawatan kesehatan yang harus dikaji ?\r\n', 457, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:06:58', '2021-05-02 23:06:58'),
	(1068, 2, 1, 0, 'Perawat berkunjung ke keluarga didapatkan klien seorang laki-laki usia 65 tahun dengan kondisi terbaring di tepat tidur, terdapat luka dekubitus pada bokong. Keluarga mengatakan kondisi ini terjadi karena klien menderita stroke, dan selalu memandikan klien dan memberikan bedak pada lukanya\r\n\r\nApakah diagnosa pada kasus tersebut ?\r\n', 458, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:09:42', '2021-05-02 23:09:42'),
	(1069, 2, 1, 0, 'Saat kunjungan rumah, didapatkan klien anak  berusia 2 tahun, klien lemas. Saat diwawancara, keluarga mengatakan klien BAB lebih dari 4 kali dan cair sudah 2 hari keluarga hanya memberikan air gula merah pada klien. Keluarga mengatakan itu hal yang biasa pada anak karena akan mendapatkan perkambangan yang baru \r\n\r\nApakah masalah keperawatan dalam kasus diatas ?\r\n', 459, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:11:55', '2021-05-02 23:11:55'),
	(1070, 2, 1, 0, 'KASUS (vignete):\r\nSeorang wanita 50 tahun di bawa ke IGD RS karena mengalami luka bakar pada lengan kiri bagian atas, lengan kanan seluruhnnya, serta kaki kanan bagian atas, kulit kemerahan dan ada bullae, lecet, pasien merasa nyeri didaerah luka bakarnya,  TD 110/80 mmhg, nadi 110 x /mnt, RR 20x/mnt BB 47 kg.\r\nPertanyaan Soal : Berdasarkan presentase luas luka bakar (rule of nine), berapa persen luka bakarnya ?\r\n', 460, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:13:27', '2021-05-02 23:13:27'),
	(1071, 2, 1, 0, 'Saat melakukan kunjungan rumah pada keluarga, didapatkan klien seorang laki laki berusia 38 tahun, dinyatakan mengalami TB paru sejak 3 bulan lalu. Saat menayakan kepatuhan obat keluarga mengatakan klien sudah tidak minum obat karena sudah merasa sembuh. \r\n\r\nApakah intervensi yang sesuai untuk kasus di atas?\r\n', 461, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:14:35', '2021-05-02 23:14:35'),
	(1072, 2, 1, 0, 'Saat melakukan pengkajian keperawatan keluarga perawat menemukan beberapa maslah kesehatan keluarga yaitu masalah hipertensi pada ibu, gizi kurang pada anak dan gastritris pada kepala keluarga. Perawat berdiskusi dengan keluarga man masalah yang akan diprioritaskan dalam asuhan keperawatan.\r\n\r\nPrinsip etik manakah yang dilakukan perawat?\r\n', 462, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:16:35', '2021-05-02 23:16:35'),
	(1073, 2, 1, 0, 'KASUS (vignete):\r\nSeorang wanita 50 tahun di bawa ke IGD RS karena mengalami luka bakar pada lengan kiri bagian atas, lengan kanan seluruhnnya, serta kaki kanan bagian atas, kulit kemerahan dan ada bullae, lecet, pasien merasa nyeri didaerah luka bakarnya,  TD 110/80 mmhg, nadi 110 x /mnt, RR 20x/mnt BB 47 kg\r\nPertanyaan Soal : \r\nBerdasarkan derajat luka bakar, pasien tersebut termasuk mengalami derajat luka bakar yang mana?\r\n', 463, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:16:46', '2021-05-02 23:16:46'),
	(1074, 2, 1, 0, 'KASUS (vignete):\r\nSeorang wanita 50 tahun di bawa ke IGD RS karena mengalami luka bakar pada lengan kiri bagian atas, lengan kanan seluruhnnya, serta kaki kanan bagian atas, kulit kemerahan dan ada bullae, lecet, pasien merasa nyeri didaerah luka bakarnya,  TD 110/80 mmhg, nadi 110 x /mnt, RR 20x/mnt BB 47 kg\r\nPertanyaan Soal : \r\nHitung dengan menggunakan rumus baxter, kebutuhan cairan per 24 jam\r\n', 464, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:18:27', '2021-05-02 23:18:27'),
	(1075, 2, 1, 0, 'Saat kunjungan rumah ditemukan seorang pria (57) yang hidup sendiri. Klien melaporkan sudah 20 tahun ditinggal istrinya.  Klien merasa kesepian dan sering melamun, pola makan klien tidak teratur dan sering dengan menu mie instan, klien mengeluh sering sakit pada bagian perutnya\r\n\r\nApakah faktor predisposisi masalah klien tersebut?\r\n', 465, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:19:20', '2021-05-02 23:19:20'),
	(1076, 2, 1, 0, 'KASUS (vignete):\r\nSeorang klien berusia 45 tahun datang ke ruang IGD bersama teman kerjanya. Satu jam yang lalu, ketika klien dan temannya ingin memasang teralis rumah, klien tesengat listrik. Terdapat luka bakar pada telapak tangan sampai ke siku sebelah kiri dan kanan, kaki kanan sampai alat vital klien. Warna kulit kehitaman dan klien tidak merasa sakit pada area luka nya. BB klien 63 Kg\r\nPertanyaan Soal : Berdasarkan presentase luas luka bakar (rule of nine), berapa persen luka bakarnya ?\r\n', 466, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:19:45', '2021-05-02 23:19:45'),
	(1077, 2, 1, 0, 'KASUS (vignete):\r\nSeorang klien berusia 45 tahun datang ke ruang IGD bersama teman kerjanya. Satu jam yang lalu, ketika klien dan temannya ingin memasang teralis rumah, klien tesengat listrik. Terdapat luka bakar pada telapak tangan sampai ke siku sebelah kiri dan kanan, kaki kanan sampai alat vital klien. Warna kulit kehitaman dan klien tidak merasa sakit pada area luka nya. BB klien 63 Kg\r\nPertanyaan Soal : \r\nDerajat berapakah luka bakar pasien tersebut? Apa tandanya?\r\n', 467, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:21:29', '2021-05-02 23:21:29'),
	(1078, 2, 1, 0, 'Saat perawat berkunjung didapatkan 2 keluarga dlam 1 rumah. Masing-masing dari mereka telah memiliki pasangan dan keturunan. Dua kelurga tersebut  menggunakan fasilitas rumah dengan saling bergantian mengatur keluarganya secara terpisah.\r\n\r\nApakah type keluarga tersebut ?\r\n', 468, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:21:29', '2021-05-02 23:21:29'),
	(1079, 2, 1, 0, 'KASUS (vignete):\r\nNy. X dibawa ke IGD rumah sakit dengan penurunan kesadaran 15 menit yang lalu, keluarga mengatakan pasien mempunyai Riwayat stroke, terdengar suara nafas snoring dan pasien gelisah. TD 150/100 mmhg, nadi 120x/mnt, RR 28x/mnt dan suhu 37,9oC. Ners yang sedang bertugas melakukan Tindakan head tilt chin lift.\r\nPertanyaan Soal : \r\nApa Tindakan selanjutnya pada kasus tersebut?\r\n', 469, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:22:41', '2021-05-02 23:22:41'),
	(1080, 2, 1, 0, 'Perawat melakukan kunjungan rumah dam memberikan implementasi kepada klien dengan mengajarkan keluarga untuk latihan ROM aktif pasif. Pada kunjungan ke 3pearawat melakukan evaluasi implementasi tersebut\r\n\r\nApa bentuk evaluasi dari kasus diatas ?\r\n', 470, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:23:26', '2021-05-02 23:23:26'),
	(1081, 2, 1, 0, 'KASUS (vignete):\r\nSeorang perempuan usia 22 tahun diantar ke IGD dengan penurunan kesdaran akibat kecelakaan lalu lintas. Tampak luka pada kepala, terdengar bunyi nafas gargling, perdarahan pada daerah tangan, TD 110/60 mmhg, nadi 100x/mnt, RR 14x/mnt, suhu 36,4oC\r\nPertanyaan Soal : \r\nApakah masalah keperawatan prioritas pada kasus tersebut.\r\n', 471, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:23:50', '2021-05-02 23:23:50'),
	(1082, 2, 1, 0, 'KASUS (vignete):\r\nSeorang pasien anak A di rawat di PICU atas indikasi gagal nafas.\r\nPertanyaan Soal : \r\nBerdasarkan hasil analisa gas darah( AGD ) An A mengalami keadaan\r\n', 472, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:25:02', '2021-05-02 23:25:02'),
	(1083, 2, 1, 0, 'Seorang perempuan usia 21 tahun dirawat di rumah sakit karena keputihan yang tidak sembuh selama 3 bulan. Warna keputihan hijau kekuningan, bau busuk. Klien juga mengeluh nyeri pada daerah supra publis. TD=120/80mmHg, P=24x/menit, N=98x/mnt, S=38.50C. Dia didiagnosis HIV oleh dokter. Pasien mengatakan cemas dan takut akan penyakitnya terlebih 6 bulan lagi pasien akan menikah, dia sering melamun dan pandangannya kosong. \r\n\r\nApa masalah keperawatan prioritas pada pasien tersebut?', 473, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:25:06', '2021-05-02 23:25:06'),
	(1084, 2, 1, 0, 'Pada saat melakukan kunjungan rumah pada keluarga dengan anak balita, dan memberikat vitamin A pada bayi 5 bulan di keluarga tersebut. Keluarga sering bertanya kondisi anaknya normal atau tidak. Perawat memberikan edukasi mengenai tumbuh kembang pada balita\r\n\r\nApa implementasi yang dilakukan oleh perawat ?\r\n', 474, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:25:31', '2021-05-02 23:25:31'),
	(1085, 2, 1, 0, 'KASUS (vignete):\r\nSeorang  laki - laki  berusia  16  tahun  datang  ke  UGD  dengan  keluhan  kesulitan  bernafas  akibat kecelakan kendaraan bermotor, pada saat kejadian klien tidak memakai sabuk pengaman sehingga terbentur  stir  mobil.  Dari  pengkajian  didapatkan  nafas  cepat  dan  dangkal  dengan  frekuensi 34x/menit  dengan  terdapat  jejas  di  paru  kiri,  distensi  JVP  dan  pengembangan  tidak  simetris. \r\n\r\nPertanyaan Soal : \r\nApakah yang anda lakukan untuk mengatasi masalah pasien?\r\n', 475, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:26:18', '2021-05-02 23:26:18'),
	(1086, 2, 1, 0, 'KASUS (vignete):\r\nSeorang  laki-laki  usia  26  tahun    jatuh  dari  motor  dengan  kecepatan  tinggi  pada  pemeriksaan didapatkan  jejas  pada  dada,  respirasi  40  x/menit,  suara  jantung  melemah,  JVP  meningkat  +  7, tekanan darah 80/P . \r\n\r\nPertanyaan Soal : \r\nApakah yang dialami oleh klien?\r\n', 476, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:27:27', '2021-05-02 23:27:27'),
	(1087, 2, 1, 0, 'Perawat mengunjungi keluarga, didapatkan seorang laki-laki sebagai kepala keluarga berusia 62 tahun didiagnosis TB Paru dan tinggal bersam istrinya berusia 60 tahun. Hasil pemeriksaan, klien sedang menjalani pengobatan OAT selama 1 bulan, mengeluh mual apalagi setelah makan obat, BB 48 Kg, dan TB 164 cm.\r\n\r\nApakah tindakan yang tepat sesuai kasus tersebut?\r\n', 477, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:27:34', '2021-05-02 23:27:34'),
	(1088, 2, 1, 0, 'Seorang wanita berusia 45 tahun mengalami perdarahan haid yang banyak selama	3 minggu. Klien mengeluh lemas, letih, lesu dan keringat dimalam hari. TD=90/70 mmHg, N=80 x/mnt, P=28x/mnt, S=37.50 C. Hasil laboratorium didapatkan Hb 10 g/dl. \r\n\r\nApa intervensi yang dilakukan untuk mengatasi masalah keperawatan yang muncul?\r\n', 478, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:28:40', '2021-05-02 23:28:40'),
	(1089, 2, 1, 0, 'Seorang pasien berusia 35 tahun laki-laki, di bawa ke IGD dikarenakan penurunan kesadaran, pasien mengalami trauma di bagian abdomen, perawat mencurigai adanya trauma renal, pasien mengalami kecelakaan lalu lintas dengan menggunakan motor.\r\nPertanyaan \r\nApakah penyebab trauma renal pada pasien ?\r\n', 479, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:28:52', '2021-05-02 23:28:52'),
	(1090, 2, 1, 0, 'Perawat mengunjungi keluarga, didapatkan seorang perempuan sebagai kepala kepala keluarga berusia 62 tahun, suaminya sudah meninggal 2 tahun yang lalu, dan tinggal bersama anaknya berusia 27 tahun dan 18 tahun. Ibu bekerja sebagai pedagang di pasar, penghasilannya bisa memenuhi kebutuhan rumah tangga dan dapat menyekolahkan anaknya hingga kuliah. Kedua anaknya mengatakan sangat menghormati dan manyayangi ibunya\r\n\r\nMasalah keperawatan yang tepat sesuai kasus tersebut?\r\n', 480, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:29:41', '2021-05-02 23:29:41'),
	(1091, 2, 1, 0, 'Seorang pasien berusia 35 tahun laki-laki, di bawa ke IGD dikarenakan penurunan kesadaran, pasien mengalami trauma di bagian abdomen, perawat mencurigai adanya trauma renal, pasien mengalami kecelakaan lalu lintas dengan menggunakan motor.\r\nPertanyaan \r\nDerajat cedera pada ginjal akan terlihat dari pemeriksaan penunjang yang mana?\r\n', 481, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:30:02', '2021-05-02 23:30:02'),
	(1092, 2, 1, 0, 'Seorang perawat pelaksana di Ruang Penyakit Dalam mengambil beberapa sampel darah untuk keperluan diagnostic pada penyakit HIV/AIDS. Secara tidak sengaja jarinya tertusuk jarum bekas pakai dari pasien tersebut .\r\n\r\nApakah tindakan yang harus segera dilakukan perawat tersebut ?\r\n', 482, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:30:47', '2021-05-02 23:30:47'),
	(1093, 2, 1, 0, 'Seorang pasien berusia 35 tahun laki-laki, di bawa ke IGD dikarenakan penurunan kesadaran, pasien mengalami trauma di bagian thoraks, pasien mengalami kecelakaan lalu lintas dengan menggunakan motor, perawat melakukan tindakan emergency untuk membebaskan jalan nafas pasien.\r\nPertanyaan \r\nApakah nama tindakan tersebut ?\r\n', 483, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:31:28', '2021-05-02 23:31:28'),
	(1094, 2, 1, 0, 'Perawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 25 tahun, tinggal bersama istri dan kedua anaknya. Pada saat pengkajian, istrinya menyatakan anak yang kedua pernah mengalami bronkhitis, suaminya masih merokok dan kadang-kadang di dalam rumah dan sudah dilarang tetapi sulit berhenti merokok.\r\n\r\nApakah kriteria evaluasi yang tepat sesuai kasus tersebut?\r\n', 484, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:31:52', '2021-05-02 23:31:52'),
	(1095, 2, 1, 0, 'Seorang laki-laki berusia 35 tahun, dirawat diruang isolasi mengeluh malu dengan penyakit yang dideritanya karena akan menularkan ke orang lain. Pasien di Diagnosa TBC positif sejak 3 bulan yang lalu dan ada riwayat TB satu tahun yang lalu. Ketika dirumah pasien cenderung mengurung diri dikamar tidak mau bersosialiasasi.\r\n\r\nApa intervensi yang tepat untuk kasus diatas?\r\n', 485, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:32:26', '2021-05-02 23:32:26'),
	(1096, 2, 1, 0, 'Seorang pasien berusia 35 tahun laki-laki, di bawa ke IGD dikarenakan penurunan kesadaran, pasien mengalami trauma di bagian thoraks, pasien mengalami kecelakaan lalu lintas dengan menggunakan motor,  perawat melakukan tindakan emergency, primary survey : breathing.\r\nPertanyaan \r\nApakah intervensi yang akan dilakukan oleh perawat?\r\n', 486, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:32:51', '2021-05-02 23:32:51'),
	(1097, 2, 1, 0, 'Perawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 21 tahun, tinggal bersama istri dan anaknya laki-laki yang berusia 12 bulan. Hasil pemeriksaan: BB lahir 2000 gr, BB saat dikaji 5,5 Kg, panjang badan 70 cm. Ibunya mengatakan anaknya sudah diberikan makanan tambahan, susah makan dan sehari hanya 4 sendok.\r\n\r\nApakah masalah keperawatan yang tepat sesuai kasus tersebut?\r\n', 487, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:34:00', '2021-05-02 23:34:00'),
	(1098, 2, 1, 0, 'Seorang pasien berusia 35 tahun laki-laki, di bawa ke IGD dikarenakan penurunan kesadaran, pasien mengalami trauma di bagian abdomen, perawat mencurigai adanya trauma renal, pasien mengalami kecelakaan lalu lintas dengan menggunakan motor, perawat merencanakan kolaborasi operasi pada pasien.\r\nPertanyaan \r\nApakah indikasi dilakukannya laparatomi pada pasien ?\r\n', 488, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:34:20', '2021-05-02 23:34:20'),
	(1099, 2, 1, 0, 'Seorang ibu baru memiliki satu anak, anak ibu berusia 3 tahun, saat bermain sepeda anaknya terjatuh dan stang sepeda mengenai daerah abdomennya, terlihat urin disertai darah saat perawat memasang kateter urin pada anaknya, ibu tidak mampu memberikan pertolongan pertama dan langsung dibawa ke puskesmas terdekat, namun tidak dapat tertolong. Ibu tidak bisa menerima kejadian tersebut.	\r\nPertanyaan \r\nPada tahap berapakah proses kehilangan pasien tersebut?\r\n', 496, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:36:01', '2021-05-03 00:21:20'),
	(1100, 2, 1, 0, 'Perawat mengunjungi keluarga, didapat seorang perempuan sebagai kepala keluarga berusia 53 tahun dan tinggal sendirian. Hasil pemeriksaan: TD 180/90 mmHg, frekuensi napas 20 x/mnt, frekuensi nadi 85 x/mnt, BB 66 Kg dan TB 155 cm. Klien menyataan sering nyeri dan pegal pada tengkuk.\r\n\r\nApakah masalah keperawatan pada kasus tersebut?\r\n\r\n', 490, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:36:33', '2021-05-02 23:36:33'),
	(1101, 2, 1, 0, 'Seorang pasien dengan gagal nafas akut dikarenakan pneumonia berat, pH: 7,10, PCO2 60mmHg, HCO3 22 mmol/l.\r\nPertanyaan \r\nApakah interpretasi pasien tersebut?\r\n', 499, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:37:56', '2021-05-03 00:23:56'),
	(1102, 2, 1, 0, 'Perawat mengunjungi keluarga, didapatkan seorang laki-laki sebagai kepala keluarga berusia 62 tahun didiagnosis TB Paru dan tinggal bersam istrinya berusia 60 tahun. Hasil pemeriksaan, klien sedang menjalani pengobatan OAT selama 1 bulan, mengeluh mual apalagi setelah makan obat, BB 48 Kg, dan TB 164 cm.\r\n\r\nApakah masalah keperawatan sesuai kasus tersebut?\r\n\r\n', 492, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:38:36', '2021-05-02 23:38:36'),
	(1103, 2, 1, 0, 'Seorang anak mengalami tersedak snack yang sedang dimakannya saat mahasiswa perawat mengadakan penyuluhan pada kelompok ibu ibu dengan anak usia SD.\r\nPertanyaan \r\nApakah hal yang harus perawat lakukan terhadap anak tersebut?\r\n', 498, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:40:02', '2021-05-03 00:23:19'),
	(1104, 2, 1, 0, 'Perawat mengunjungi keluarga, didapatkan seorang perempuan sebagai kepala kepala keluarga berusia 62 tahun, suaminya sudah meninggal 2 tahun yang lalu, dan tinggal bersama anaknya berusia 27 tahun dan 18 tahun. Ibu bekerja sebagai pedagang di pasar, penghasilannya bisa memenuhi kebutuhan rumah tangga dan dapat menyekolahkan anaknya hingga kuliah. Kedua anaknya mengatakan sangat menghormati dan manyayangi ibunya\r\n\r\nApakah data pengkajian yang sesuai dengan kasus tersebut?\r\n\r\n', 494, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:41:02', '2021-05-02 23:41:02'),
	(1105, 2, 1, 0, 'Seorang anak sedang bermain dengan kucing yang terindikasi rabies kesayangannya tiba-tiba kucing menggigit tangan anak tersebut, ibu korban membawa anaknya ke Puskesmas.\r\nPertanyaan \r\nApakah data yang akan ditemukan oleh perawat terkait kasus anak tersebut?\r\n', 497, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:41:29', '2021-05-03 00:22:44'),
	(1106, 2, 1, 0, 'Seorang anak ditinggal didalam mobil oleh ibunya saat diparkiran, kondisi mobil AC menyala, ibu korban meninggalkan korban sendirian di dalam mobil untuk berbelanja di Mall, saat kembali kedalam mobil ibu mandapatkan anaknya sudah biru seluruh tubuhnya.\r\nPertanyaan \r\nApakah yang terpikirkan oleh perawat terkait cara keracunan pada anak tersebut?\r\n', 496, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:43:00', '2021-05-03 00:22:08'),
	(1107, 2, 1, 0, 'Perawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 25 tahun, tinggal bersama istri dan kedua anaknya. Pada saat pengkajian, istrinya menyatakan anak yang kedua pernah mengalami bronkhitis, suaminya masih merokok dan kadang-kadang di dalam rumah dan sudah dilarang tetapi sulit berhenti merokok.\r\n\r\nApakah masalah keperawatan yang muncul sesuai kasus tersebut?\r\n\r\n', 497, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:43:02', '2021-05-02 23:43:02'),
	(1108, 2, 1, 0, 'Perawat mengunjungi keluarga, didapat seorang laki-laki sebagai kepala keluarga berusia 21 tahun, tinggal bersama istri dan anaknya laki-laki yang berusia 12 bulan. Hasil pemeriksaan: BB lahir 2000 gr, BB saat dikaji 5,5 Kg, panjang badan 70 cm. Ibunya mengatakan anaknya sudah diberikan makanan tambahan, susah makan dan sehari hanya 4 sendok.\r\n\r\nApakah tindakan yang sesuai untuk kasus tersebut?\r\n', 498, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:45:08', '2021-05-02 23:45:08'),
	(1109, 2, 1, 0, 'Perawat mengunjungi keluarga, didapat seorang perempuan sebagai kepala keluarga berusia 53 tahun dan tinggal sendirian. Hasil pemeriksaan: TD 180/90 mmHg, frekuensi napas 20 x/mnt, frekuensi nadi 85 x/mnt, BB 66 Kg dan TB 155 cm. Klien menyataan sering nyeri kepala dan pegal pada tengkuk dan tidak tahu secara jelas tentang hipertensi.\r\n\r\nApakah rencana tindakan yang tepat untuk kasus tersebut?\r\n\r\n', 499, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-02 23:47:09', '2021-05-03 00:15:42'),
	(1110, 2, 1, 0, 'Seorang perempuan dirawat di rumah sakit dengan batuk tidak sembuh selama 1 bulan, sesak nafas,  keringet dingin tengah malam, dan  berat badan turun 4 Kg dalam waktu 1 bulan. Diduga pasien terkena TBC. \r\n\r\nApa pemeriksaan diagnostik yang harus dilakukan?\r\n', 500, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 02:13:23', '2021-05-03 02:13:23'),
	(1111, 2, 1, 0, 'Seorang pasien berusia 35 tahun, mengeluh sesak nafas serta mati rasa kaki. TD: 135/85 mmHg, N=100x/mn, P= 30 x/mn, S=38.5 °C. Foto thorax ditemukan adanya efusi pleural serta suspect TB.  Leukosit:  20.000 / µL, LED 30 mm. \r\n\r\nApa pengkajian fokus yang diperlukan berdasarkan kasus diatas?\r\n', 501, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 02:15:08', '2021-05-03 02:15:08'),
	(1112, 2, 1, 0, 'Seorang laki-laki usia 35 tahun, dirawat di ruang Anggrek dengan keluhan pusing dan lemah. TD : 120/80 mmHg , N: 92 x / menit, suhu: 37.5° C, RR: 28 x / menit. Mukosa bibir kering kotor, terdapat bercak-bercak putih disertai adanya pus. \r\n\r\nApa intervensi kolaborasi yang dilakukan untuk menghambat proses infeki?\r\n', 502, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 02:16:58', '2021-05-03 02:16:58'),
	(1113, 2, 1, 0, 'Pada saat pandemic, pemerinta secara aktif melakukan program vaksinasi masal dengan target 70% penduduk Indonesia sudah divaksin COVID-19. Hal tersebut dilakukan sebagai upaya untuk mendapatkan herd immunity.\r\n\r\nApa itu Herd Immunity (Kekebalan Kelompok) ?\r\n', 506, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 02:19:56', '2021-05-03 02:51:13'),
	(1114, 2, 1, 0, 'Tn. T usia 52 tahun, beragama islam dan merupakan salah satu karyawan swasta.  Masuk ke Rs tanggal 29 Agustus 2020 dengan keluhan Klien mengatakan demam sejak 15 Agustus 2020 disertai keluhan batuk kering. Keluhan saat ini pasien merasa demam naik turun dan hilang rasa mengecap. Pasien memiliki riwayat kontak erat dengan teman sekamar di tempat kerja yang menderita Covid-19, saat dilakukan pemeriksaan diagnostik pasien di konfirmasi menderita Covid-19. Nadi = 72x/menit, Suhu = 38,6 C, TD = 128/70 mmHg, RR = 24x/menit.\r\n\r\nInterevensi keperawatan prioritas yang tepat berdasatkan kasus diatas  adalah\r\n', 505, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 02:36:36', '2021-05-03 02:50:49'),
	(1115, 2, 1, 0, 'Pasien menderita Covid-19 mengatakan merasa tidak berdaya, karena harus diberikan perawatan isolasi dan sangat menyesal karena sebelumnya tidak mentaati protocol kesehatan. Klien merasa sangat sedih karena harus meninggalkan keluarga, dan tidak bisa bersama dengan istrinya, dan cemas akan kondisi keluarganya karena klien adalah tulang punggung keluarga.\r\n	\r\nDiagnosa yang tepat berdasarkan kasus diatas adalah…\r\n', 504, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 02:39:13', '2021-05-03 02:39:13'),
	(1116, 2, 1, 0, 'Tn. T usia 52 tahun, beragama islam dan merupakan salah satu karyawan swasta. Pasien memiliki riwayat kontak erat dengan teman sekamar di tempat kerja yang menderita Covid-19, saat dilakukan pemeriksaan diagnostik pasien di konfirmasi menderita Covid-19.  Pasien merasa kehilangan nafsu makan sehingga tidak menghabiskan makanannya. Klien mengalami kehilangan rasa mengecap, dan rasa makanan serasa hambar.\r\n\r\nInterevensi keperawatan yang tepat berdasatkan kasus diatas  adalah….kecuali\r\n', 506, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 02:53:02', '2021-05-03 02:53:02'),
	(1117, 2, 1, 0, 'Pasien menderita Covid-19 mengeluh sesak nafas dengan RR = 24x/menit dengan bantuan: simple mask 5 liter/menit. Ada bantuan otot-otot pernafasan tambahan saat bernafas. Analisa Gas Darah.\r\npH	7.367	N: 7.35 – 7.45\r\npCO2	40.8	N: 35.0 - 45-0\r\npO2	48.9	N: 80 – 105\r\nHCO3	23.6	N: 22 - 26\r\ntCO1	24.9	N: 23.05 – 27.35\r\nStandar BE-b	-1.1	N: (-2) – (+2)\r\nSaturasi O2	80.9	N: 95 – 100\r\n\r\nInterevensi keperawatan yang tepat berdasatkan kasus diatas  adalah….kecuali\r\n', 507, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 02:54:34', '2021-05-03 02:54:34'),
	(1118, 2, 1, 0, 'Seorang perempuan berusia 40 tahun didiagnosa HIV 1 tahun yang lalu. Saat ini pasien dirawat diruang isolasi dengan keluhan nyeri pada daerah mulut, demam, dan tidak nafsu makan. Keluarga pasien mengatakan takut untuk membersihkan daerah mulut yang kotor, berdarah, dan luka-luka.\r\n\r\nApa intervensi yang harus dilakukan agar tidak terjadi penularan virus HIV?\r\n', 508, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 02:56:18', '2021-05-03 02:56:18'),
	(1119, 2, 1, 0, 'Seorang pasien datang ke rumah sakit dengan keluhan demam, flu selama satu bulan tidak sembuh-sembuh, dan sakit kepala. TD= 140/80 mmHg, N=92 x / menit, S= 39° C, P= 28 x/menit. Teraba benjolan di leher pasien, nyeri panggul. Diagnosa HIV oleh dokter. \r\n\r\nApa diagnosa keperawatan yang dapat ditegakkan dari data di atas?\r\n', 509, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 02:57:53', '2021-05-03 02:57:53'),
	(1120, 2, 1, 0, 'Seorang pasien datang ke rumah sakit denan keluhan mudah lelah, pusing, dan mengalami kelemahan otot. Pasien tampak lesu dan tidak segar. TD: 110/70 mmHg, Suhu : 350 C, HR : 89x/mnt, P : 25x/mnt. Hb didapat ; Hb 9 g/dl, kadar zat besi 3mg,TB 158 cm, BB : 45 Kg.\r\n\r\nApa masalah keperawatan prioritas pada pasien tersebut?\r\n', 510, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 03:00:28', '2021-05-03 03:00:28'),
	(1121, 2, 1, 0, 'Seorang wanita berusia 45 tahun mengalami perdarahan haid yang banyak selama	3 minggu. Klien mengeluh lemas, letih, lesu dan keringat dimalam hari. TD=90/70 mmHg, N=80 x/mnt, P=28x/mnt, S=37.50 C. Hasil laboratorium didapatkan Hb 10 g/dl. \r\n	\r\nApa intervensi yang dilakukan untuk mengatasi masalah keperawatan yang muncul?\r\n', 511, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 03:03:24', '2021-05-03 03:03:24'),
	(1122, 2, 1, 0, 'Seorang pasien didiagnosa mengalami anemia hemolitik dan mengeluh sangat lemas dan lelah. Ketika bergerak sedikit saja kepala terasa berat dan berkuang-kunang. TD=80/70 mmHg. Hb 9.5 g/dl. \r\n	\r\nApa intervensi kolaborasi yang dilakukan untuk mengatasi tersebut?\r\n', 512, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 03:05:09', '2021-05-03 03:05:09'),
	(1123, 2, 1, 0, 'Prosedur persiapan terapi Electro Convulsi Therapy (ECT) telah dilakukan dengan baik. Pasien laki-laki berusia 25 tahun dinyatakan siap untuk ECT. Namun, saat memasuki ruang ECT, tampak wajah dan tangannya berkeringat serta tubuhnya gemetar. \r\nApakah tindakan keperawatan utama yang harus dilakukan\r\n\r\n', 513, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:07:14', '2021-05-03 16:07:14'),
	(1124, 2, 1, 0, 'Seorang laki-laki berusia 30 tahun dibawa ke UGD RSJ.  Pasien berbicara kasar dan menendang benda-benda di sekitarnya. Menurut keluarga, pasien dibawa ke RSJ karena telah merusak rumah tetangga  dan marah-marah tanpa sebab. Selain itu, pasien tampak sering tidur larut malam, melamun damenyendiri di rumah.\r\nApakah masalah keperawatan utama pada pasien?\r\n\r\n\r\n', 514, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:09:09', '2021-05-03 16:09:09'),
	(1125, 2, 1, 0, 'Seorang laki-laki berusia 45 tahun dirawat di RSJ. Saat pengkajian, pasien selalu mengatakan “Saya adalah orang kaya, saya pemilik saham di beberapa perusahaan ternama, saya sering menang bursa efek”. Pasien mengatakan merasa sedih karena isterinya selingkuh dan menikah dengan laki-laki lain.\r\nApakah hasil yang diharapkan setelah diberikannya intervensi keperawatan pada pasien?\r\n\r\n', 515, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:11:41', '2021-05-03 16:11:41'),
	(1126, 2, 1, 0, 'Seorang wanita berusia 35 tahun sudah menjalani perawatan selama  3 hari pasien di RSJ. Saat dilakukan pengkajian di ruang tenang, pasien baru saja mencakar muka  teman sekamarnya. Menurut pasien, temannya tersebut mirip dengan selingkuhan suaminya.\r\nApakah faktor presipitasi pada kasus di atas ?\r\n\r\n\r\n', 516, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:13:54', '2021-05-03 16:13:54'),
	(1127, 2, 1, 0, 'Seorang remaja laki-laki berusia 18 tahun dirawat di Rumah Sakit Jiwa. Pasien mengatakan bahwa dirinya jelek dan tidak berharga. Selama berinteraksi dengan perawat, pasien terlihat menunduk, kontak mata kurang.\r\nManakah tindakan keperawatan yang pertama kali dilakukan untuk pasien tersebut?\r\n', 517, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:18:14', '2021-05-03 16:18:14'),
	(1128, 2, 1, 0, 'Seorang laki-laki berusia 32 tahun dirawat diRSJ. Saat datang klien hanya berdiam diri dikamar tidak mau berinteraksi, badan bau dan kotor, pakaian tidak sesuai, klien cenderung diam.\r\nPerencanaan yang tepat pada kasus tersebut adalah.\r\n\r\n', 518, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:19:53', '2021-05-03 16:19:53'),
	(1129, 2, 1, 0, 'Seorang perempuan berusia 22 tahun datang ke RSJ karena sudah melakukan percobaan membunuh ibunya sebanyak 2 kali. Hasil pengkajian: klien mengatakan selalu ada yang membisikan untuk membunuh ibunya, bicara sendiri, afek datar, intonasi suasa tinggi, badannya kotor, mulut bau. \r\n Diagnosa utama pada kasus tersebut adalah…\r\n\r\n', 519, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:21:09', '2021-05-03 16:21:09'),
	(1130, 2, 1, 0, 'Seorang laki- laki berusia 36 tahun baru pertama kali dibawa ke RSJ. Sudah 2 minggu mengurung diri dikamar, begadang dan berbicara sendiri. Berdasarkan keterangan keluarga klien berencana melangsungkan pernikahan 1 minggu lagi namun digagalkan oleh pihak perempuan. Klien merasa malu, klien memiliki pengalaman masa lalu yang tidak menyenangkan yaitu ditolak cintanya sebanyak 3x. \r\nManakah data diatas yang menunjukan faktor Presipitasi..\r\n', 520, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:22:36', '2021-05-03 16:22:36'),
	(1131, 2, 1, 0, 'Seorang perempuan berusia 44 tahun di RSU. Hasil Swab PCR teridentifikasi positif Covid -19. Klien menyalahkan anaknya yg tidak pernah mengikuti protocol Kesehatan, karena klien merasa telah mengikuti protocol kesehatan secara ketat, di keluarganyapun semua dinyatakan positif, klien harus menjalani isolasi di RS. \r\nMekanisme koping yang digunakan oleh klien adalah…\r\n\r\n\r\n', 521, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:24:33', '2021-05-03 16:24:33'),
	(1132, 2, 1, 0, 'Seorang perempuan berusia 23 tahun kehialngan suami dan anaknya pada bencana longsor. Saat ini korban belum ditemukan dan belum tau kondisinya  Kondisi klien sering menangis histeris, menyalahkan diri sendiri, panik, gelisah.. \r\nTindakan yang tepat pada kasus tersebut..\r\n\r\n', 522, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:31:37', '2021-05-03 16:31:37'),
	(1133, 2, 1, 0, 'Seorang  laki-laki berusia 15 tahun dirawat di Rs Jiwa selama 7 hari. Pasien terlihat menyendiri tidak bergabung dengan pasien lain, tampak lusuh dan berbau, terdapat luka pada tangannya. Ketika dikaji pasien sesekali menatap perawat dan selalu menunduk, mengungkapkan malu karena tidak naik kelas, dan keluarga menganggap pasien sebagai anak yang nakal, tidak memiliki prestasi di sekolah dan berbeda dengan kakaknya yang selalu juara kelas.\r\nApakah diagnose  pada kasus diatas?\r\n   \r\n\r\n', 523, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:33:26', '2021-05-03 16:33:26'),
	(1134, 2, 1, 0, 'Seorang laki-laki  usia 38 tahun, sudah  1 minggu di Rumah Sakit Jiwa. Hasil  Pasien tidak mau makan dan selalu mencium bau amis dan bau kotoran, pasien selalu membuang ludah  dan menutup hidungnya.  Pasien mengatakan ada orang yang mencampuri makanannya dengan kotoran dan darah karena aka nada orang yang merebut hartanya karena keturunan raja majapahit yang memiliki peta harta karun sehingga banyak orang yang akan memburunya\r\nApakah jenis waham pada kasus tersebut?\r\n\r\n', 524, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:35:19', '2021-05-03 16:35:19'),
	(1135, 2, 1, 0, 'Seorang laki-laki berusia 45 tahun. Di rawat di ruang tenang selama 5 hari. Klien terlihat sedih dan tidak bergabung dengan teman lainnya. Saat dikaji klien mengatakan rindu pada keluarganya dan menayakan kapan bisa pulang. Perawat menjawab belum tahu kapan klien pulang dan akan ditanyakan ke dokter saat visite kemudian perawat mengajak klien untuk bergabung dengan teman lainnya\r\nApakah prinsip etik yang dilakukan perawat?\r\n', 525, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:37:08', '2021-05-03 16:37:08'),
	(1136, 2, 1, 0, 'Laki-laki usia 25 tahun dirawat  di RSJ selama 3 hari mengatakan bahwa klien adalah lulusan universitas di Kairo, namun bersembuyi di RSJ karena sedang melakukan misi yang sebagai utusan dari malaikat. Klien tidak mau bergabung dengan pasien lain karena takut rahasianya terbongkar. \r\nApakah implementasi yang tepat dilakukan oleh perawat?\r\n', 526, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:38:44', '2021-05-03 16:38:44'),
	(1137, 2, 1, 0, 'Perempuan usia 28 tahun, sudah 1 minggu dirawat di Rumah Sakit Jiwa, sebelum masuk RS pasien menyayat nadinya dengan pisau. Pada saat pengkajian pasien mengatkan dia akan bahagia jika di surga tidak akan mengecewakan keluarga lagi dan menitipkan keluarganya pada perawat, pasien juga mengatakan sering didatangi oleh kakeknya dan mengajak dia bersamanya. Menurut keterangan keluarga kakenya sudah meninggal 5 tahun yang lalu\r\nApakah kriteria evaluasi yang prioritas pada kasus diatas?\r\n', 527, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:40:11', '2021-05-03 16:40:11'),
	(1138, 2, 1, 0, 'Seorang perempuan usia 30 tahun dengan di diagnose kanker rahim 1 tahun yang lalu, klien sudah merasa cepat lelah dan mengeluh penyakitkanya tidak kunjung membaik, klien merasa sedih karena selalu tergantung pada keluarganya. Sejak sakit klien tidak memiliki pekerjaan dan juga diceraikan oleh suaminya.\r\nApakah diagnose pada kasus diatas?\r\n', 528, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:48:21', '2021-05-03 16:48:21'),
	(1139, 2, 1, 0, 'Seorang perempuan usia 16 tahun BB : 67 kg, TB = 145cm, tidak mau bermain dengan teman-temannya klien selalu dibully karena bentuk tubuhnya, klien mengkonsumsi obat penglangsing berlebihan yang menyebabkan klien harus ditarawat di RS.\r\nApakah intervensi yang dilakukan perawat?\r\n', 529, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:49:52', '2021-05-03 16:49:52'),
	(1140, 2, 1, 0, 'Seorang perempuan usia 15 tahun  sudah 1 bulan tidak mau keluar rumah dan selalu menolak jika ada temannya mengajak main ataupun berkunjung, bahkan menolak untuk pergi sekolah. Hal ini terjadi sejak klien tidak naik kelas\r\nApakah masalah psikososial yang tepat pada kasus di atas?\r\n', 530, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:52:05', '2021-05-03 16:52:05'),
	(1141, 2, 1, 0, 'Seorang laki-laki usia 35 tahun sudah menikah, tidak memiliki pekerjaan sehingga istinya yang menjadi tulang punggung keluarga. Klien sering marah-marah tidak jelas dan mudah tersinggung jika ditanyakan mengenai kondisi keluarganya.\r\nApakah komponen yang paling terganggu pada konsep diri kasus diatas?\r\n', 531, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:53:23', '2021-05-03 16:53:23'),
	(1142, 2, 1, 0, 'Seorang perempuan usia 28 tahun dirawat di RSJ. Kondisi klien pandangan mata tajam. Suara keras, bicara kasar. Klien sering menyanyi dan teriak teriak kemuan menagis sambil menyebut namanya \r\nApakah tanda dan gejala apakah yang di tujukan oleh klien ?\r\n', 532, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-03 16:55:08', '2021-05-03 16:55:08'),
	(1143, 2, 1, 0, 'Seorang anak perempuan berusia 15 bulan dibawa ke IGD dengan keluhan sesak dan tampak kebiruan. Hasil pemeriksaan didapatkan pertumbuhan terhambat, anak terlihat pucat, banyak keringat bercucuran, ujung-ujung jari hiperemik. \r\nApakah tindakan prioritas yang dapat dilakukan perawat pada kasus?', 533, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:16:45', '2021-05-05 00:16:45'),
	(1144, 2, 1, 0, 'Seorang anak perempuan berusia 12 tahun dibawa ke UGD  mengeluhkan demam mendadak dengan suhu 39° C sejak 3 hari yang lalu disertai nyeri kepala, nyeri otot dan sendi, dan penurunan nafsu makan. Tidak ditemukan tanda-tanda perdarahan. Hasil lab ditemukan hasil NS1+ disertai hasil trombosit 90.000/mm3, Hematokrit 52% dan Leukosit 2500/mm3. Apakah diagnosa penyakit pada kasus?\r\nApakah masalah keperawatan utama pada kasus?', 534, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:18:40', '2021-05-05 00:18:40'),
	(1145, 2, 1, 0, '\r\nSeorang anak laki-laki berusia 10 tahun, dibawa ke poliklinik anak, mengeluhkan demam mendadak, Hasil pengkajian Suhu 38.7° C sejak 4 hari yang lalu disertai nyeri kepala, nyeri otot dan sendi, penurunan nafsu makan, dan epitaksis. hasil NS1+ disertai hasil lab didapatkan trombosit 70.000/mm3, Hematokrit 54% dan Leukosit 2000/mm3. \r\nApakah Masalah  keperawatan yang tepat pada kasus?\r\n', 535, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:20:40', '2021-05-05 00:20:40'),
	(1146, 2, 1, 0, 'Seorang balita laki-laki dibawa ke IGD dengan keluhan kesulitan bernafas. Hasil pemeriksaan didapatkan tampak lemah, sianosis, frekuensi nadi 180x/menit, frekuensi nafas 58x/menit, tampak clubbing of finger, \r\nApakah kriteria hasil yang tepat pada kasus?', 536, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:23:19', '2021-05-05 00:23:19'),
	(1147, 2, 1, 0, 'Seorang anak perempuan berusia 11 tahun  dibawa ke poliklinik anak karena mengalami demam selama 3 hari. Hasil pengkajian didapatkan mengeluh sakit kepala,nyeri pada sendi , suhu 38,9 °C, dan terdapat ptechiae, uji tourniquet positif.  \r\nApakah data penunjang yang harus dipantau selanjutnya pada kasus?', 537, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:24:51', '2021-05-05 00:24:51'),
	(1148, 2, 1, 0, 'Seorang bayi perempuan dibawa ke UGD  dengan keadaan  sesak nafas, saat dikaji frekwensi nafas 53x/menit, terdapat  retraksi dada, bunyi jantung tambahan (machinery mur-mur), cedera tungkai dan  hepatomegali\r\n\r\nApakah fungsi observasi yang perawat lakuakan dengan data  pada kasus?\r\n', 538, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:26:46', '2021-05-05 00:26:46'),
	(1149, 2, 1, 0, 'Seorang anak perempuan, berusia 10 tahun, penyandang Thalasemia Mayor,  dibawa ke poli klinik  untuk dilakukan  Tranfusi darah PRC, saat tranfusi perawat melakukan observasi , klien mengeluh gatal-gatal dikulit, hasil pengkajian :  suhu  38,7 °C, kulit tampak kemerahan, menggigil dan gelisah.\r\nApakah intervensi  prioritas yang dapat perawat lakukan pada kasus?', 539, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:28:39', '2021-05-05 00:28:39'),
	(1150, 2, 1, 0, 'Seorang anak laki-laki berusia 4 tahun. Mengeluh mengalami nyeri didaerah gusi , hasil pengkajian didapatkan gusi berdarah, keadaan mukosa mulut kotor. Perawat melakukan oral hygiene dan  menjelaskan prosedur dan meminta persetujuan ibunya, mencuci tangan, menggunakan sarung tangan ,posisikan pasien,  memasang alas handuk,  melarutkan cairan antiseptic pada Kom kassa. \r\nApakah tindakan selanjutnya yang harus dilakuakan  pada kasus?', 540, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:31:57', '2021-05-05 00:31:57'),
	(1151, 2, 1, 0, 'Seorang anak perempuan berusia 6 tahun. Mengalami thalassemia Mayor,  datang untuk mendapatkan tranfusi darah rutin. Klien mengeluh sesak dan lemas. Hasil pengkajian didapatkan Hb 6 mg/DL, konjungtiva pucat dan berwarna keabuan, tampak hepatomegali. \r\nApakah Intervensi prioritas yang harus dilakuakan  pada kasus?', 541, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:33:54', '2021-05-05 00:33:54'),
	(1152, 2, 1, 0, 'Seoarang anak perempuan berusia 11 tahun mengalami thalassemia mayor, datang ke poli thalasemia mengeluh lemas, menghindar saat akan diobservasinya dan tampak malu-malu, hasil pengkajian : cooley face sudah tampak jelas, kulit tampak keabuan,  Hb : 6 mg/dl, frekuensi nafas 35x/menit.\r\nApakah masalah keperawatan prioritas pada kasus?', 542, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:35:33', '2021-05-05 00:35:33'),
	(1153, 2, 1, 0, 'Seorang anak laki-laki berusia 4 tahun,  terdiagnosa medis CKD, hasil pengkajian didapatkan mengalami edema anasarka, hasil lab menunjukkan hiperkalsemi, hipernatremi, kreatinin dan ureum meningkat, Berat badan klien meningkat.  \r\n\r\nApakah fokus pengkajian untuk mengidentifikasi status hidrasi pada kasus?\r\n', 543, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:37:11', '2021-05-05 00:37:11'),
	(1154, 2, 1, 0, 'Seorang anak laki-laki, berusia 7 tahun, hasil pengkajian didapatkan tampak lemah, aktifitas sehari-hari sangat terbatas, akral dingin, tampak edema seluruh tubuh, lingkar abdomen meningkat, pola nafas tidak efektif (takhipneu). \r\nApakah prioritas masalah keperawatan pada kasus di atas', 544, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:38:39', '2021-05-05 00:38:39'),
	(1155, 2, 1, 0, 'Seorang anak laki-laki, berusia 7 tahun, hasil pengkajian didapatkan tampak lemah, aktifitas sehari-hari sangat terbatas, lingkar abdomen meningkat, pola nafas takhipneu, RR : 35x/mnt\r\nApakah masalah keperawatan utama pada kasus ?', 545, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:40:05', '2021-05-05 00:40:05'),
	(1156, 2, 1, 0, 'Seorang anak laki-laki, berusia 10 tahun, hasil pengkajian didapatkan tampak lemah, aktifitas sehari-hari sangat terbatas, akral dingin, trombosit 135 ribu sel/mm3 (150-450 ribu sel/mm3), Hb 10 g/dL (10,7-14,7 g/dL)\r\nApakah tindakan keperawatan untuk mengatasi resiko perdarahan pada kasus tersebut ?', 546, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:41:35', '2021-05-05 00:41:35'),
	(1157, 2, 1, 0, 'Seorang anak laki-laki berusia 3 tahun mengalami BAB > 5x/ hari dengan konsistensi cair. bibir kering, turgor menurun, tampak rewel, hematokrit menurun, kelemahan, T: 38,5 0C, BB menurun.  \r\nApakah tindakan utama pada kasus tersebut?', 547, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:43:07', '2021-05-05 00:43:07'),
	(1158, 2, 1, 0, 'Seorang balita perempuan sedang dirawat di ruang anak, hasil pengkajian didapatkan merasakan nyeri setiap kali duduk, skala nyeri 5 dan terasa sesak setiap turun dari tempat tidur. Bermain dilakukan di tempat tidur. \r\nApakah masalah keperawatan utama pada kasus ? \r\n', 548, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:44:49', '2021-05-05 00:44:49'),
	(1159, 2, 1, 0, 'Seorang anak perempuan, berusia 6 tahun dengan diagnosa medis ALL, hasil managemen cairan didapatkan membutuhkan cairan NaCl 60 cc/jam, terpasang infus makrodrip. \r\nBerapakah jumlah tetesan infus per menit? ', 549, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:46:30', '2021-05-05 00:46:30'),
	(1160, 2, 1, 0, 'Seorang anak laki-laki berusia 11 tahun dirawat di ruang rawat anak, hasil pengkajian didapatkan IMT  -3 SD, nafsu makan menurun, Hb 10 gr/dl, lemah, porsi makan tidak habis\r\nApakah Tindakan kolaborasi  untuk mengatasi kasus tersebut ?', 550, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:48:37', '2021-05-05 00:48:37'),
	(1161, 2, 1, 0, 'Seorang anak laki-laki, berusia 10 tahun. Hasil pengkajian didapatkan  mengalami kemerahan dan gatal saat diberikan obat. Hal ini membuat orang tua anak T cemas dan sering menanyakan kondisi anaknya. Perawat tidak menjelaskan kondisi anak tersebut kepada orang tuanya dikarenakan takut disalahkan. \r\nApakah pelanggaran Etika keperawatan yang dilakukan oleh perawat tersebut pada kasus tersebut?  ', 551, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:50:35', '2021-05-05 00:50:35'),
	(1162, 2, 1, 0, 'Seorang anak perempuan , berusia  8 tahun , telah menjalani kemoterapi, hasil pengkajian didapatkan  tampak bibir pecah dan area mulut stomatitis, nafsu makan menurun, klien tampak lemah. Didapatkan hasil Lab trombosit 105.000 sel/mm3, Hb 9,8 gr/dl\r\nApakah tindakan keperawatan prioritas untuk mengatasi masalah tersebut ', 552, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 00:52:28', '2021-05-05 00:52:28'),
	(1163, 2, 1, 0, 'Seorang laki-laki 65 tahun memiliki riwayat serangan stroke dua bulan yang lalu. Berdasarkan hasil anamnesis saat kunjungan rumah didapatkan riwayat hipertensi sejak sepuluh tahun yang lalu. Pasien sering mengeluh pusing bila mendengar suara-suara yang keras. Hasil pemeriksaan fisik diperoleh data bahwa pasien mengalami hemiplegia ekstremitas sebelah kiri. \r\nPertanyaan soal\r\nApakah intervensi keperawatan yang merupakan prioritas untuk menyelesaikan kasus tersebut?\r\n', 553, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:30:43', '2021-05-05 01:30:43'),
	(1164, 2, 1, 0, 'Seorang laki-laki berusia 65 tahun tinggal bersama keluarga, memiliki keluhan tidak bisa menahan kencing segera saat merasa ada rangsangan berkemih. Pasien tersebut merasa sangat terganggu dengan keluhannya itu. \r\nPertanyaan soal:\r\nSebagai perawat gerontik, apa intervensi keperawatan yang dapat dilakukan pada pasien tersebut?\r\n', 554, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:31:32', '2021-05-05 01:31:32'),
	(1165, 2, 1, 0, 'Oma J, usia 84 thaun beragama Islam dengan tanggal masuk ke panti pada 22 Januari 2019. Klien mengeluh sering lupa, namun tidak tahu apa yang klien lupa.  Awal masuk panti Klien hanya menunjukan sering lupa, namun seiring berjalannya waktu ingatan klien menurun semakin berat, sampai berdampak pada aktivitas sehari-hari dan kemampuan social klien. Saat dikaji klien mengalami disorientasi orang dan waktu. Klien tidak bisa mengenal petugas panti yang setiap hari berinteraksi, klien harus diingatkan untuk nama teman nya satu kamar. Klien tidak tahu hari, tanggal dan jam, klien lebih banyak diam dan komunikasi inkoheren.\r\nPertanyaan soal:\r\nPengkajian lanjutan apa yang harus dilakukan oleh perawat\r\n', 555, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:32:09', '2021-05-05 01:32:09'),
	(1166, 2, 1, 0, 'Seorang laki-laki berusia 70 tahun di sebuah UPT PSLU mengeluh sering ke toilet untuk berkemih, selalu merasa lega setelah berkemih, tapi tidak jarang urine sudah keluar sebelum mencapai toilet. Dia tidak dapat berjalan cepat karena pengelihatannya menurun dan nyeri panggul. \r\nPertanyaan soal\r\nApakah diagnosa keperawatan individu yang utama dari kasus di atas ?\r\n', 556, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:32:48', '2021-05-05 01:32:48'),
	(1167, 2, 1, 0, 'Seorang perempuan usia 80  tahun, dibawa ke UGD Puskesmas dengan keluhan utama sesak nafas. Keluarga mengatakan klien tiba-tiba sesak nafas setelah  terpapar udara dingin. Keadaan umum lemah dan pada pemeriksaan fisik didapatkan wheezing, frekuensi napas 29x/menit, akral dingin, batuk produktif, frekuensi nadi 90x/menit, TD 120/80 mmHg, suhu 37.6 0C, ronkhi pada semua lapang paru.\r\nApakah masalah keperawatan pada kasus diatas ?\r\n', 557, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:33:40', '2021-05-05 01:33:40'),
	(1168, 2, 1, 0, 'Seorang bapak berusia 79  tahun tinggal di sebuah keluarga dengan riwayat: selama 6 bulan terakhir mengeluh kesulitan menahan kencing dan sering ngompol. Dalam satu hari frekwensi kencing lebih dari 10 kali dengan jumlah urine + 1500cc. Keadaan umum: baik, TD 140/70 mmHg, nadi 70x/menit, RR 18 x/menit. BB 50 kg, warna urine kuning jernih. Apa tindakan yang tepat sesuai dengan permasalahan diatas ?', 558, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:34:15', '2021-05-05 01:34:15'),
	(1169, 2, 1, 0, 'Pada sebuah komunitas lansia di RW 01 didapatkan data: jumlah lansia 100 orang, 60% wanita dan 40% laki-laki. Masalah kesehatan yang paling banyak dijumpai adalah : Hipertensi 60%, kencing manis 20% dan sisanya sehat. Pola perilaku kesehatan: 75% minum kopi 2 gelas/hari, 65% suka makan asin, 45% mengalami sulit tidur dan 75% kurang beraktifitas olah raga. Fasilitas posyandu lansia ada sejak 2 tahun yang lalu. Rata—rata jumlah kunjungan ke posyandu tiap bulan 21 orang. Kegiatan senam lansia belum ada.\r\nApakah diagnosa keperawatan kelompok lansia diatas?\r\n', 559, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:35:04', '2021-05-05 01:35:04'),
	(1170, 2, 1, 0, 'Seorang perempuan berusia 75 th datang ke puskesmas dengan keluhan nyeri pada kaki. Keluhan sudah berlangsung sejak 1 tahun. Nyeri dirasakan berdenyut dan sendi terasa kaku, nyeri mulai pinggang hingga kedua kaki, skala nyeri 5, nyeri muncul pada saat bangun tidur pagi hari dan sore hari setelah mandi. Pasien tidur + 4 jam sehari.\r\nApakah masalah keperawatan yang muncul pada pasien di atas?\r\n', 560, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:35:43', '2021-05-05 01:35:43'),
	(1171, 2, 1, 0, 'Seorang perempuan, usia 75 th, tinggal di panti werda. Mengeluh nyeri sejak 1 tahun yang lalu. Selama ini klien tidak pernah melakukan latihan pergerakan untuk otot dan sendi. Rasa sakit yang dirasakan saat ini bersifat  nyeri berdenyut dan sendi terasa kaku, nyeri mulai pinggang hingga kedua kaki, skala nyeri 5, nyeri muncul pada saat bangun tidur pagi hari dan sore hari setelah mandi.\r\nApa tindakan keperawatan yang perlu dilakukan pada klien lansia tersebut ?\r\n', 561, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:36:21', '2021-05-05 01:36:21'),
	(1172, 2, 1, 0, 'Didalam sebuah keluarga terdapat seorang lansia berusia 90 tahun. rumah keluarga tersebut tidak rapi, barang-barang berserakan dilantai. Terlihat terdapat genangan air dilantai. Lansia tersebut berjalan menggunakan tongkat. \r\nApa intervensi pada kasus diatas?\r\n', 562, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:36:57', '2021-05-05 01:36:57'),
	(1173, 2, 1, 0, 'Seorang perempuan berusia 83 tahun menderita hipertensi sejak 30 tahun yang lalu. pasien tersebut jarang minum obat serta tidak mau control. Pasien mengatakan hanya minum obat saat ada keluhan. \r\nApakah tujuan dari masalah keperawatan pada kasus diatas?\r\n', 563, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:37:33', '2021-05-05 01:37:33'),
	(1174, 2, 1, 0, 'Bapak A usia 62th tinggal disuatu pemukiman padat di Bandung bersama istri dan anak yang berusia 7 tahun, istri Bapak A bernama Ibu S sudah lama batuk dan dinyatakan menderita TB paru. Dari pengkajian didapatkan data berat badan 40 Kg (Tb 155 Cm), Ibu S mendapatkan obat Tb paru dari RS, keluarga tidak memiliki tempat penampungan dahak, tidak memisahkan alat-alat makan, dan ruangan rumah lembab dan gelap. Apakah masalah keperawatan pada kasus diatas?', 564, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:38:11', '2021-05-05 01:38:11'),
	(1175, 2, 1, 0, 'Seorang perempuan 70 tahun di bawa keluarganya ke puskesmas dengan keluhan varises di kakinya yang membesar dan terasa nyeri. Hasil pengkajian didapatkan data: TD 170/80 mmHg, Frekuensi nadi 76 kali per menit, dan terlihat ada varises di daerah otot gastrocnemius.\r\nPertanyaan soal\r\nApakah jenis perubahan fisiologis pada kondisi kasus diatas?\r\n', 565, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:38:49', '2021-05-05 01:38:49'),
	(1176, 2, 1, 0, 'Seorang perempuan dengan usia 55 tahun data ke puskesmas dengan hipertensi. Hasil pemeriksaan antropometri menunjukan BB 80 Kg dan TB 160 cm. Dari hasil pengkajian klien mengatakan tidak menyukai masakan yang bersantan dan asin, ia juga tidak merokok, tidak suka begadang, tidak meminum alcohol dan tidak minum kopi.\r\nPertanyaan soal\r\nApakah faktor resiko hipertensi yang tidak dapat diubah pada kasus diatas?\r\n', 566, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:39:33', '2021-05-05 01:39:33'),
	(1177, 2, 1, 0, 'Seorang perempuan berusian 70 tahun tinggal di panti werdha: mengeluh tidak nafsu makan karena sariawan dimulutnya. Dari hasil pengkajian pasien didapatkan data: gigi terlihat kotor serta banyak sisa makanan, mulut bau, bibir kering, bibir pecah-pecah dan tampak stomatitis pada mukosa mulut dengan diameter 0.5 cm dan berwarna merah.\r\nPertanyaan soal\r\nApakah intervensi keperawatan prioritas pada pasien tersebut?\r\n', 567, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:40:22', '2021-05-05 01:40:22'),
	(1178, 2, 1, 0, 'Wanita 60 Tahun penghuni PSTW memiliki riwayat hipertensi semenjak 10 tahun yang lalu, hasil pemeriksaan tekanan darah 160/100 mmHg, klien menyatakan sakit kepala berat, tengkuk/ leher bagian bawah, mata kunang-kunang/pandangan gelap/kabur, dan telinga berdengung.\r\nPertanyaan Soal\r\nApa intervensi keperawatan mandiri utama yang dilakukan?\r\n', 568, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:41:00', '2021-05-05 01:41:00'),
	(1179, 2, 1, 0, 'Perempuan, 60 tahun datang ke klinik geriatri dengan keluhan susah tidur karena sering merasa panas dan gatal di malam hari, klien mengatakan sudah dua bulan tidak mensturasi. Tekanan darah 150/100 mmhg. klien merasa cemas dengan kondisinya saat ini.\r\nPertanyaan Soal\r\nApa masalah keperawatan utama yang dilakukan?\r\n', 569, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:41:51', '2021-05-05 01:41:51'),
	(1180, 2, 1, 0, 'Seorang perempuan berusia 70 tahun dating ke posyandu lansia dengan keluhan nyeri pada sendi, hasil pemeriksaan fisik: ditemukan area persendian lutut memerah, bengkak dan susah digerakkan.\r\nPertanyaan Soal\r\nApakah intervensi keperawatan yang ditemukan pada kasus tersebut?\r\n', 570, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:42:29', '2021-05-05 01:42:29'),
	(1181, 2, 1, 0, 'Seorang perempuan berusia 73 tahun saat kunjungan rumah, klien mengeluh tidak mampu melakukan aktivitas terutama mengerjakan pekerjaan rumah. Hasil pengkajian rentang pergerakan terbatas, kekuatan otot lemah, pasien kurang mendapatkan perhatian keluarga.\r\nPertanyaan Soal\r\nApakah masalah utama keperawatan yang dilakukan?\r\n', 571, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:43:09', '2021-05-05 01:43:09'),
	(1182, 2, 1, 0, 'Seorang perempuan usia 56 Tahun mengeluh sering pusing, haid tidak teratur, kadang kadang banyak, sudah dialami ± 2bulan, setelah dilakukan pemeriksaan fisik: tampak pucat, konjungtiva anemis TD: 90/70mmHg, nadi 68 kali/menit, frekwensi nafas 20 kali/menit.\r\nPertanyaan Soal\r\nApakah tindakan perawat pada kasus tersebut?\r\n', 572, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 01:44:35', '2021-05-05 01:44:35'),
	(1183, 2, 1, 0, 'Sebelum melakukan Electro Convulsive Therapy (ECT), perawat bertugas untuk menjelaskan prosedur tindakan yang akan dilakukan, apa saja keuntungan dan kerugian yang akan diperoleh terkait tindakan yang akan diterimanya. Hal ini guna mencegah bahaya yang nantinya akan didapatkan klien. Apakah prinsip moral yang digunakan dalam proses keperawatan di atas?\r\n\r\n', 573, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 19:36:58', '2021-05-05 19:36:58'),
	(1184, 2, 1, 0, 'Seorang perawat baru, melakukan orientasi kerja di ruang rawat inap dalam. Tampak ragu, takut salah, dan cenderung mengerjakan tugas secara berulang-ulang  dalam memberikan asuhan keperawatan pada pasien. Apa yang harus dilakukan perawat baru tersebut untuk mencegah kondisi di atas\r\n', 574, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 19:38:03', '2021-05-05 19:38:03'),
	(1185, 2, 1, 0, 'Di ruang rawat inap, dibutuhkan peraturan tentang pembatasan jumlah pengunjung, adanya jadwal kunjungan, dibuat pembatasan usia yang boleh berkunjung, dan pembatasan jumlah penunggu pasien. Apakah Tujuan dari upaya tersebut?\r\n', 575, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 19:39:27', '2021-05-05 19:39:27'),
	(1186, 2, 1, 0, 'Pasien dan keluarga diberitahukan tempat tidur yang akan ditempati, tetapi lingkungan seperti WC, ruang perawat, fasilitas, peraturan ruangan, perawat dan dokter yang merawat belum diorientasikan secara optimal. Dalam manajemen asuhan keperawatan, pengelolaan apa yang harus dilakukan oleh katim ?\r\n', 576, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 19:40:54', '2021-05-05 19:40:54'),
	(1187, 2, 1, 0, 'Pasien berusia 56 th, 2 jam paska apendictomy, nampak kesakitan, belum bisa mobilisasi sendiri,  terpasang infus. Apakah klasifikasi tingkat ketergantungan pasien di atas? (berdasarkan teori douglas, 1984)\r\n', 577, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 19:42:27', '2021-05-05 19:42:27'),
	(1188, 2, 1, 0, 'Pada saat Anda dan perawat lain melaksanakan  proses operan dinas (hand over) pagi hari, ditemukan hal-hal yang harus ditindaklanjuti pada pagi hari tersebut, diantaranya harus rontgen, pasien Tn. A mengalami aritmia, pasien Tn. O, BAB di tempat tidur, pasien Ny. C mengalami gejala hipoglikemia, pasien Tn. E kehabisan persediaan obat. Tindakan keperawatan apakah yang harus ditindaklanjuti terlebih dahulu?\r\n\r\n', 578, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 19:43:27', '2021-05-05 19:43:27'),
	(1189, 2, 1, 0, 'Anda ditunjuk oleh Karu untuk merawat 5 pasien dan bertanggung jawab penuh selama 24 jam sampai dengan pasien pulang, anda diberikan kewenangan oleh Karu untuk melakukan proses asuhan keperawatan lengkap untuk ke empat pasien tersebut. Dalam melaksanakan implementasi anda juga dibantu oleh 3 orang perawat pelaksana. Apakah jenis metode penugasan asuhan keperawatan di atas?\r\n', 579, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 19:44:49', '2021-05-05 19:44:49'),
	(1190, 2, 1, 0, 'Kepala ruangan menjadwalkan anda satu shif dengan salah seorang perawat yang sedang bermasalah dengan anda, dimana konflik tersebut sudah berlangsung lama dan belum terselesaikan. Jika ada dalam satu tim, dikhawatirkan akan mengganggu terhadap kerjasama tim dan kinerja dari masing-masing. Strategi yang paling tepat untuk menyelesaikan konflik tersebut adalah\r\n', 581, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 19:45:50', '2021-05-05 19:46:08'),
	(1191, 2, 1, 0, 'Anda melihat teman sejawat anda dimarahi oleh dokter di depan pasien karena kesalahan dalam memberikan obat.  Terlihat perawat tersebut balik memarahi dokter karena kesalahannya tersebut akibat dokter salah memberikan resep obatnya. Apa yang pertama kali harus anda lakukan menghadapi situasi tersebut?\r\n\r\n', 581, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 19:46:53', '2021-05-05 19:46:53'),
	(1192, 2, 1, 0, 'Seorang laki-laki 43 tahun menderita laserasi kecelakaan pada lengan bawah dibawa ke bagian gawat darurat oleh keluarga. Hasil pemeriksaan menunjukkan laserasi membutuhkan perbaikan dengan jahitan, tetapi pasien menolak pengobatan. Tindakan apa yang harus diambil oleh perawat?\r\n\r\n', 582, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 19:49:45', '2021-05-05 19:49:45'),
	(1193, 2, 1, 0, 'Dalam metode penugasan tim, rekan satu tim anda mendelegasikan pasien dengan memberikan laporan tertulis mengenai kondisi pasien. Pasien mengeluh perawat terus menerus menanyakan hal yang sama dengan yang ditanyakan perawat sebelumnya, tanpa ada tindakan selanjutnya, sehingga masalah pasien belum teratasi.  Tindakan yang  dibutuhkan dalam metode tim untuk mengatasi hal tersebut adalah \r\n\r\n', 583, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 19:52:20', '2021-05-05 19:52:20'),
	(1194, 2, 1, 0, 'Seorang perawat mendapatkan tugas mengelola pasien sejumlah 10 orang. Perawat melakukan pekerjaannya tidak sistematis dan tidak efektif. Semua pasien mendapatkan jenis pelayanan yang sama. Hal ini sangat membingungkan dan memberatkan tugasnya sebagai perawat. Apa tindakan pertama yang harus dilakukan perawat agar asuhan keperawatan diberikan dengan efektif dan efisien sesuai dengan kondisi pasien?\r\n\r\n', 584, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 19:53:58', '2021-05-05 19:53:58'),
	(1195, 2, 1, 0, 'Pada saat shif sore anda ditugaskan sebagai perawat asociet pada metode Tim,  Anda diberikan tugas merawat pasien Tn. A umur 55 tahun dengan diagnosa medis sirosis hepatis, pada saat anda mengkaji lanjutan, didapatkan data bahwa Tn. A mengalami perburukan kondisi, pada renpra tidak ada tindakan untuk menangani masalah tersebut yang dibuat oleh ka Tim. Tindakan apakah yang harus dilakukan dalam kerangka metode penugasan Tim?\r\n\r\n', 585, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 19:54:57', '2021-05-05 19:54:57'),
	(1196, 2, 1, 0, 'Anda ditunjuk oleh Karu untuk merawat 5 pasien dan bertanggung jawab penuh selama 24 jam sampai dengan pasien pulang, anda diberikan kewenangan oleh Karu untuk melakukan proses asuhan keperawatan lengkap untuk ke empat pasien tersebut. Dalam melaksanakan implementasi anda juga dibantu oleh 3 orang perawat pelaksana. Apakah jenis metode penugasan asuhan keperawatan di atas?\r\n', 586, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 19:56:10', '2021-05-05 19:56:10'),
	(1197, 2, 1, 0, 'Anda ditempatkan bekerja di ruang A. Menurut anda banyak hal yang harus dirubah dan diperbaiki dari kondisi pelayanan asuhan keperawatan di ruang tersebut. Misalnya catatan keperawatan tidak diisi dengan lengkap, format dokumentasi belum lengkap,  format sulit diisi, data terpisah-pisah. Apakah tidakan yang harus anda lakukan dalam mengatasi masalah dokumentasi tersebut ?\r\n\r\n', 587, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 19:57:42', '2021-05-05 19:57:42'),
	(1198, 2, 1, 0, 'Anda ditugaskan sebagai Katim, sekitar jam 09.00, datang pasien baru dengan diagnosa Stroke, sebagai Ka. tim apa yang harus anda lakukan: \r\n\r\n', 588, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 19:58:34', '2021-05-05 19:58:34'),
	(1199, 2, 1, 0, 'Perawat dan kepala ruangan di ruangan penyakit dalam  melakukan diskusi pada pasien x dengan diagnosa medis efusi pleura kemudian perawat mendiskusikan hasil temuan pemeriksaan fisik serta data penunjang yang berhubungan dengan klien mengenai masalah keperawatan dan perawat menetapkan tindakan yang akan dilakukan. Sebelumnya pasien dilibatkan dalam diskusi bersama perawat ruangan dan kepala ruangan. Kegiatan yang dilakukan perawat di atas berada pada tahapan?\r\n\r\n', 589, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 19:59:50', '2021-05-05 19:59:50'),
	(1200, 2, 1, 0, 'Seorang perawat ditunjuk maenjadi manajer kasus, yang memilki tanggung jawab dari mulai perencanaan, pelaksanaan, koordinasi dan evaluasi pasien yang dibantu oleh tim perawatan. Metode pelayanan asuhan keperawatan tersebut adalah:\r\n\r\n', 590, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 20:00:41', '2021-05-05 20:00:41'),
	(1201, 2, 1, 0, 'Seorang Ners ditugaskan untuk mengelola pasien satu ruangan oleh ketua tim. Pada saat post conference,  ners tersebut melaporkan kondisi pasiennya mengalami perbaikan setelah tiga hari perawatan.  Ketua tim melihat dokumentasi yang dibuat dan melakukan supervisi langsung untuk mengevaluasi kondisi pasien yang dikelola oleh ners. Apakah fungsi manajemen yang dilakukan oleh ketua tim di ruang rawat inap tersebut? \r\n', 591, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 20:02:49', '2021-05-05 20:02:49'),
	(1202, 2, 1, 0, 'Terdapat seorang pasien yang mengalami penurunan kondisi umumnya sehingga perawat harus menginfromasikan pada dokter. Perawat menelpon dokter  dengan berdasarkan SOP, perawat menyampaikan latar belakang atau masalah pasien sebelumnya. Apakah tindakan selanjutnya yang dilakukan oleh perawat tersebut?\r\n\r\n', 592, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 20:05:43', '2021-05-05 20:05:43'),
	(1203, 2, 1, 0, 'Seorang perempuan berusia 25 tahun, di rawat di ruang nifas RS A setelah melahirkan bayi laki-laki dengan BBL 2800 gr, sehat. Setelah diobservasi terjadi perubahan fisik pada pasien tersebut. Tensi 110/70 mmHg, Nadi 78x/menit. TFU setinggi pusat, kontraksi uterus tidak baik (lembek).\r\nApakah yang terjadi pada uterus ibu tersebut?', 593, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 20:45:09', '2021-05-05 20:45:09'),
	(1204, 2, 1, 0, 'Seorang perempuan usia 22 tahun datang ke poliklinik kandungan dengan keluhan terlambat haid sudah 1 bulan, mual dan muntah, hasil tespack positif.\r\nManakah yang benar mengenai pernyataan diatas?', 594, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 20:46:54', '2021-05-05 20:46:54'),
	(1205, 2, 1, 0, 'Seorang perempuan usia 55 tahun kunjungan ke Poliklinik Kebidanan dengan keluhan keluar cairan dari vagina, cairan berwarna kehijauan berbau busuk, diagnose medis dikatakan kanker servik. \r\nApakah data yang perlu dikaji pada kasus diatas untuk memperkuat diagnose kanker serviks?', 595, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 20:48:47', '2021-05-05 20:48:47'),
	(1206, 2, 1, 0, 'Seorang perempuan usia 45 tahun kunjungan ke Poliklinik Kebidanan R.S.C dengan keluhan keluar darah dari vagina, darah berbau busuk, diagnose medis dikatakan kanker servik. \r\nApakah data yang perlu dikaji pada kasus diatas untuk memperkuat diagnose kanker serviks?', 596, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 20:50:24', '2021-05-05 20:50:24'),
	(1207, 2, 1, 0, 'Seorang perempuan berusia 22 Tahun, P1A0 post SC atas indikasi plasenta previa. Hasil pemeriksaan fisik didapatkan: TD: 120/80, RR: 28x/menit, Nadi: 98x/menit, S: 37,5C. TFU setinggi pusat. \r\nManakah resiko yang mungkin muncul terkait plasenta previa yang perlu diperhatikan perawat ketika akan merencanakan asuhan keperawatan dan melakukan pengawasan pada pasien? ', 597, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 20:51:49', '2021-05-05 20:51:49'),
	(1208, 2, 1, 0, 'Seorang perempuan berusia 23 tahun mengeluh perdarahan setelah 2 jam post partum, ketika dilakukan pemeriksaan TFU didapatkan TFU 1 jari diatas pusat, teraba kandung kemih penuh serta kontraksi uterus baik.\r\nSetelah dilakukan pemeriksaan pada pasien, intervensi apa yang harus dilakukan perawat?', 598, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 20:52:58', '2021-05-05 20:52:58'),
	(1209, 2, 1, 0, 'Seorang pasien perempuan usia 35 tahun datang ke Puskesmas untuk melakukan pemeriksaan ulang kehamilannya yang ke-5. Pasien mengatakan belakangan ini sering merasakan pusing, pengelihatan kadang-kadang kabur, disertai nyeri pada ulu hati. Hasil pemeriksaan fisik tekanan darah 140/90 mmHg, kedua kaki edema, BB bertambah drastis dalam dua minggu belakangan ini.Usia kehamilan 34 minggu, DJJ dalam batas normal, hasil pemeriksaan urun didapatkan protein urine (+).\r\nApakah komplikasi yang dapat terjadi pada pesien tersebut?', 599, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 20:53:52', '2021-05-05 20:53:52'),
	(1210, 2, 1, 0, 'Seorang pasien perempuan usia 35 tahun datang ke Puskesmas untuk melakukan pemeriksaan ulang kehamilannya yang ke-5. Pasien mengatakan belakangan ini sering merasakan pusing, pengelihatan kadang-kadang kabur, disertai nyeri pada ulu hati. Hasil pemeriksaan fisik tekanan darah 140/90 mmHg, kedua kaki edema, BB bertambah drastis dalam dua minggu belakangan ini.Usia kehamilan 34 minggu, DJJ dalam batas normal, hasil pemeriksaan urun didapatkan protein urine (+).\r\nApakah komplikasi yang dapat terjadi pada pesien tersebut?', 600, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 20:57:05', '2021-05-05 20:57:05'),
	(1211, 2, 1, 0, 'Seorang perempuan usia 40 tahun datang ke poli ginekologi dengan keluhan keluar cairan dari alat kelaminnya sejak 4 hari yang lalu disertai rasa sakit pada waktu BAK. Dari hasil pemeriksaan didapatkan pus yang keluar jumlahnya banyak hingga membasahi celana dalam pasien. Pus berwarna hijau kemerahan yang kental. Pasien mengatakan ia bekerja sebagai PSK.\r\nMasalah apa yang dialami oleh pasien?', 601, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 20:58:16', '2021-05-05 20:58:16'),
	(1212, 2, 1, 0, 'Seorang perempuan berusia 50 tahun, datang ke poli ginekologi dengan keluhan nyeri perut bagian bawah sejak 2 minggu yang lalu. Pasienmerasakan keluhan nyeri di perut bagian bawah bertambah berat dari hari ke hari. Sebelumnya pasien mengalami perdarahan dari liang vagina sudah sejak 1 tahun. Darah keluar dari liang vagina terus-menerus setiap hari, darah yang keluar berwarna merah segar, kadang-kadang disertai dengan lendir, dan tidak berbau. Selama mengalami perdarahan pasien tidak mau berobat karena pasien merasa takut. Pasien merasa sakit di perut bagian bawah yang semakin lama semakin bertambah berat, nyeri dirasakan muncul tiba-tiba saja dan dirasakan terus menerus.\r\nMasalah apa yang dialami oleh pasien?', 602, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 20:59:25', '2021-05-05 20:59:25'),
	(1213, 2, 1, 0, 'Seorang perempuan berusia 27 Tahun, G2P0A1, ke UGD jam 01.00 WIB dengan keluhan mulas sejak 18.00 WIB. Dari pengkajian didapatkan tekanan darah 120/80 mmHg, frekuensi napas 22x/menit, denyut nadi 80 x/menit, suhu 36,50c, his teratur sebanyak 2-3x dalam 10 menit dengan durasi 30 detik dan pembukaan 3 cm.\r\nPada pukul berapakah pasien diperkirakan melahirkan bayinya?', 603, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 21:00:30', '2021-05-05 21:00:30'),
	(1214, 2, 1, 0, 'Seorang perempuan usia 28 tahun, G2P1A0 datang ke klinik bersalin dengan keluhan mules yang semakin kuat dan sering serta keluar cairan bening dan lendir darah. Hasil pengkajian: DJJ 160x/menit, gerakan janin lemah, skala nyeri 8 saat his datang, his 2 kali dalam 10 menit dengan durasi 30-40 detik, pembukaan 4 cm.\r\nApakah masalah kesehatan yang menjadi prioritas?', 604, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 21:01:37', '2021-05-05 21:01:37'),
	(1215, 2, 1, 0, 'Seorang perempuan berusia 25 Tahun, G1P0 di rawat di kamar bersalin telah melahirkan bayi laki-laki secara normal dengan berat badan 2400 gram. Dari hasil pengkajian, bayi sesekali hanya menggerakkan kaki, bayi tidak langsung menangis kuat, ektremitas tampak pucat, denyut nadi 80 x/menit, dan grimace muncul setelah diberi rangsangan. \r\nBerapakah  penilaian skor APGAR pada bayi tersebut? ', 605, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 21:02:44', '2021-05-05 21:02:44'),
	(1216, 2, 1, 0, 'Seorang perempuan berusia 15 tahun, G1P0, dibawa ke UGD bersama ibunya dengan keluhan perdarahan. Dari hasil pengkajian: Tekanan darah 110/70 mmHg, frekuensi nadi 22 x/menit, frekuensi napas 80 x/menit, usia kehamilan 20 minggu, kontraksi lemah, tidak teraba gerakan janin dan tidak terdengar bunyi jantung janin.  Diagnosa medis IUFD.\r\nApakah tindakan yang utama dilakukan pada pasien tersebut?', 606, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 21:04:28', '2021-05-05 21:04:28'),
	(1217, 2, 1, 0, 'Seorang perempuan berusia 20 tahun, G1P0 ke UGD dengan keluhan nyeri perut dan perdarahan. Tekanan darah 100/70 mmHg, denyut nadi 24 x/menit, frekuensi napas 80 x/menit, usia kehamilan <37 minggu, ada kontraksi, dan terdiagnosa intrauterine fetal distress. Dokter telah menjelaskan kondisi janin dan penatalaksanaannya namun pasien meminta untuk tetap di section caesaria atas permintaan pasien karena tidak kuat nyeri kontraksi.\r\nApakah dilema etik yang terjadi jika terjadi pada kasus tersebut?', 607, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 21:05:37', '2021-05-05 21:05:37'),
	(1218, 2, 1, 0, 'Seorang perempuan berusia 24 tahun di ruang bersalin, G1P0A0 usia kehamilan 37 minggu.saa ini mengeluh perutnya mulas yang semakin sering dan disertai lendir darah, dan pasien tampak cemas. TFU 32 cm, DJJ 120x/menit, his 3 kali dalam 10 menit dengan durasi 30 detik, hasil pemeriksaan dalam : portio teraba lunak, pembukaan serviks 10 cm, selaput ketuban utuh.\r\nApakah tindakan selanjutnya yang harus dilakukan?', 608, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 21:07:25', '2021-05-05 21:07:25'),
	(1219, 2, 1, 0, 'Seorang perempuan usia 28 tahun, G2P1A0 di kamar bersalin, mules-mules sejak 8 jam yang lalu dan bertambah sering dan kuat. Hasil pemeriksaan: kontraksi uterus setiap 10 menit sekali dengan durasi 30 detik dan pembukaan 5 cm dengan selaput ketuban masih utuh.\r\nApakah evaluasi selanjutnya yang diharapkan? ', 609, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 21:08:21', '2021-05-05 21:08:21'),
	(1220, 2, 1, 0, 'Seorang perempuan usia 25 tahun, G1P0A0 di kamar bersalin, mules-mules sejak 5 jam yang lalu dan bertambah sering dan kuat. Hasil pemeriksaan: pembukaan 3 cm, his setiap 10 menit sekali dengan durasi 20 detik, DJJ 120 kali/menit.\r\nPada tahap manakah fase persalinan pasien?', 610, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 21:09:12', '2021-05-05 21:09:12'),
	(1221, 2, 1, 0, 'Seorang perempuan usia 34 tahun, P1A0 di kamar bersalin, tampak lemas setelah lahir plasenta, uterus teraba lembek, tidak ada kontraksi uterus, dan  perdarahan pervaginam lebih dari 300 cc.\r\nApakah tindakan yang harus dilakukan selanjutnya?', 611, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 21:10:11', '2021-05-05 21:10:11'),
	(1222, 2, 1, 0, 'Seorang perempuan berusia 30 Tahun, P4A0 di ruang bersalin. Satu jam setelah melahirkan, perawat melakukan observasi  kala 4 dan didapati kandung kemih teraba keras, fundus uteri lembek, kontraksi lemah dan lokhea sangat banyak. Apakah tindakan yang paling tepat dilakukan oleh perawat?', 612, 1, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-05 21:11:10', '2021-05-05 21:11:10'),
	(1223, 2, 1, 0, 'Pada saat melakukan proses pengkajian didapatkan data objektif bahwa Rumah yang dimiliki oleh sebagian besar warga berupa bangunan semi permanen dengan luas kurang lebih 30 m2 yang dihuni sekitar  4 orang, 80% jendela rumah di tutup secara permanen dengan ventilasi, pencahayaan dan sirkulasi cenderung tidak baik.\r\nApakah masalah kesehatan berisiko pada kelompok wilayah masyarakat tersebut?', 613, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:07:32', '2021-05-09 09:07:32'),
	(1224, 2, 1, 0, 'Perawat melakukan kegiatan pengkajian, tahapan ini di awali dengan mengisi form pengkajian. Teknik pengambilan data dilakukan dengan dating ke rumah warga secara langsung.\r\nApakah metode pengkajian yang dilakukan oleh perawat?', 614, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:10:15', '2021-05-09 09:10:15'),
	(1225, 2, 1, 0, 'Pengkajian seorang perawat dilakukan dengan mencari informasi terkait jumlah dokter, poskesdes, puskesmas serta cara masyarakat menjangkau tempat tersebut.\r\nApakah ranah pengkajian yang dilakukan oleh perawat?', 615, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:12:09', '2021-05-09 09:12:09'),
	(1226, 2, 1, 0, 'Pada saat pengkajian seorang perawat mendapati tiga keluarga yang memiliki balita dengan kondisi gizi yang kurang baik karena BB balita berada pada garis merah. Pada saat ditanya oleh perawat ditemukan data subjektif: kader mengatakan keluarga merasa malu dan takut disalahkan jika membawa anaknya ke Puskesmas.\r\nApakah  intervensi yang harus dilakukan oleh perawat ? ', 616, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:14:08', '2021-05-09 09:14:08'),
	(1227, 2, 1, 0, 'Data objektif setelah dilakukan pengkajian di Desa Mekarjaya didapatkan 80% balita mengalami keluhan diare. Hasil pengkajian di wilayah tersebut terlihat 90% rumah warga berdekatan, sampah menumpuk dan tidak jarang terdapat hewan tikus berkeliaran. Menurut kader, pihak puskesmas sudah melakukan penyuluhan terkait diare pada warga sebanyak 3 kali.\r\nApakah kriteria keberhasilan untuk kader ?', 617, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:16:02', '2021-05-09 09:16:02'),
	(1228, 2, 1, 0, 'Di dapatkan data objektif 70% warga Desa Mekarjaya mengalami gejala hipertensi. Puskesmas bekerjasama dengan BPJS mengadakan program prolanis sebagai upaya pengelolaan penyakit pada lansia agar terkontrol dan tidak bertambah parah. Hasil evaluasi menunjukan bahwa 80% menyatakan gejala hipertensi yang dilakukan berkurang setelah mengikuti kegiatan prolanis. \r\nApakah masalah keperawatan pada masyarakat tersebut?', 618, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:18:01', '2021-05-09 09:18:01'),
	(1229, 2, 1, 0, 'Hasil pengkajian yang dilakukan di Desa Jujur terdapat 50% balita mengalami gizi buruk, angka kunjungan ke posyandu rendah. Terdapat 3 orang kader aktif di masyarakat.\r\nApakah  intervensi utama yang dapat dilakukan perawat untuk kader ?', 619, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:19:30', '2021-05-09 09:19:30'),
	(1230, 2, 1, 0, 'Seorang perawat akan melakukan Pendidikan Kesehatan kepada warga dengan topik mengatasi diare dengan oralit. Perawat sudah menyampaikan tujuan dan kontrak waktu penyuluhan.\r\nApakah implementasi selanjutnya yang dapat dilakukan oleh perawat?', 620, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:21:13', '2021-05-09 09:21:13'),
	(1231, 2, 1, 0, 'Pada saat melakukan pengkajian didapatkan data subjektif 60% warga mengatakan bahwa diare pada balita wajar karena sebagai pertanda akan mengalami peningkatan kemampuan dalam perkembangan.  \r\nApakah data inti komunitas yang harus dikaji lebih lanjut oleh perawat?', 621, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:22:45', '2021-05-09 09:22:45'),
	(1232, 2, 1, 0, 'Data objektif didapatkan data terjadi 20 kasus TBC pada usia dewasa, 60% penderita mendapatkan pengobatan TBC selama 1 bulan, dan 40% sudah mendapatkan pengobatan TBC selama 5 bulan.\r\nApakah intervensi yang dapat dilakukan perawat?', 622, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:24:20', '2021-05-09 09:24:20'),
	(1233, 2, 1, 0, 'Perawat melakukan pengkajian komunitas di suatu wilayah pada musim hujan, didapatkan 50 % warga selalu menggatungkan baju di rumahnya, 20% jarang membersihkan bak mandi, 40% rumah warga terdapat kumbangan air, selokan banyak sampah, dan  20% warga tidak menutup dengan benar tempat penyimpanan air.\r\nApakah upaya preventif primer yang paling tepat untuk kasus tersebut?', 623, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:27:39', '2021-05-09 09:27:39'),
	(1234, 2, 1, 0, 'Seorang perawat komunitas  melakukan pengkajian di  RW dengan  jumlah warga sebanyak 150 orang. Didapatkan hasil 20 orang lansia, 15 orang balita , 7 orang ibu hamil. Balita yang mengalami diare 1 bulan terkahir 5 orang dan berat badan di garis bawah garis merah 3 orang. Ibu hami dengan hiperemesis 2 orang dan 5 orang mengalami anemia serta lansia dengan hipertensi 10 orang.\r\nApakah masalah kesehatan yang memiliki presentasi yang paling tinggi di wilayah tersebut?', 624, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:29:07', '2021-05-09 09:29:07'),
	(1235, 2, 1, 0, 'Perawat komunitas melakukan pengkajian secara lansung kepada kader kesehatan mengenai persepsi dan perilaku warga terhadap penyakit covid 19 yang menjadi pandemic saat ini.\r\nMetode pengkajian apakah yang digunakan oleh perawat komunitas tersebut?', 625, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:30:48', '2021-05-09 09:30:48'),
	(1236, 2, 1, 0, 'Seorang perawat komunitas melakukan pengkajian dengan cara mendatangi langsung serta bertanya kepada para tokoh masyarakat, tokoh agama, tokoh pemuda yang ada di sebuah RW untuk mendapatkan data mengenai budaya yang berkaitan dengan kesehatan  di wilayah tersebut.\r\nMetode pengkajian apakah yang digunakan oleh perawat komunitas tersebut?', 626, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:32:31', '2021-05-09 09:32:31'),
	(1237, 2, 1, 0, 'Perawat  berkeliling di wilayah komunitas,  mengobservasi lingkungan, dan perilaku masyarakat yang berkaitan dengan kesehatan sehingga perawat mendapatkan data yang dapat mendukung asuhan keperawatan yang akan dilakukan.\r\nMetode pengkajian apakah yang digunakan oleh perawat komunitas tersebut?', 627, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:34:02', '2021-05-09 09:34:02'),
	(1238, 2, 1, 0, 'Hasil survey mawas diri didapatkan warga di komunitas di sualtu wilayah belum konsisten dalam melakukan protocol kesehatan.Perawat puskesmas memberikan penyuluhan   tentang protocol kesehatan yang harus dilakukan saat pandemic covid 19 di gedung serbaguna RW.\r\nApakah evaluasi keberhasilan kegiatan perawat?', 628, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:44:39', '2021-05-09 09:44:39'),
	(1239, 2, 1, 0, 'Perawat puskesmas melatih kader tentang pengawas minum obat (PMO) pada penderita TBC.  Jumlah kader yang mengikuti pelatihan sebanyak 16 peserta yang berasal dari 8 RW. Pelatihan dilaksanakan karena masih tingginya angka kejadian TBC di RW tersebut.\r\nApakah evaluasi yang tepat untuk keberhasilan tindakan tersebut?', 629, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:46:13', '2021-05-09 09:46:13'),
	(1240, 2, 1, 0, 'Perawat puskesmas melakukan pengkajian pada masyarakat satu desa dan didapatkan masalah tingginya angka penyakit diabetes mellitus dan hipertensi pada lansia.  Perawat melakukan program senam sehat yang diikuti masyarakat. Dilakukan pengukuran tekanan darah setiap sebelum dan sesudah senam dan cek gula darah sebelum senam.\r\nApakah keberhasilan tindakan yang dilakukan perawat?', 630, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:47:50', '2021-05-09 09:47:50'),
	(1241, 2, 1, 0, 'Perawat melakukan pengkajian di sekolah SD didapatkan 30% siswa mengalami karies gigi dan 95% tidak pernah mengosok gigi pada malam hari, 70% siswa menyukai makanan yang manis.\r\nApakah intervensi yang tepat dilakukan ?', 631, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:49:07', '2021-05-09 09:49:07'),
	(1242, 2, 1, 0, 'Pearawat melakukan pengkajian di salah satu SMA, didapatkan pada siswa laki laki : 95% merokok dan 30% pernah mencoba minuman berakohol. Siswa melakukan hal tersebut karena dipicu oleh ajakan dari teman-temanya dan dalam bentuk solidaritas.\r\nApakah diagnosis yang sesuai dengan kondisi tersebut?', 632, 1, NULL, NULL, '-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-05-09 09:50:37', '2021-05-09 09:50:37');
